INSERT INTO `producto` (`id_producto`, `estatus`, `codigo`, `nombre`, `descripcion`, `cantidad`, `precio`, `foto_prin`, `fecha_registro`, `id_departamento1`, `id_departamento2`, `id_departamento3`) VALUES
(1, 'a', 'CO451', 'ABRELATAS ELECTRICO B+D', 'Favorece el trabajo manos libres, lo que otorga rapidez y comodidad para la realización de las labores, Es ligero, sencillo de ubicar y de trasladar el momento que decidas, Tiene base antideslizante para que apoyes con seguridad, sin riesgo de , Su apagado es automático, y podrás repetir la operación cada vez que lo requieras, Se manipula sin complejidad, evita la aplicación de esfuerzos y es recomendado para todo tipo de personas, Puedes disponerlo sobre la mesa para utilizarlo en el momento justo de comer, Contribuye a mantener la higiene del lugar, pues evita los derrames de comida al abrir las latas.', 0, 23, 'CO451-1', '2021-06-30', 1, 4, 10),
(2, 'nv', 'BL1650-04LA', 'JARRA B+D', 'FusionBlade ™ Jarra de Vidrio de 1,5 L con tapa, Jarra de vidrio de 1,5 L con boquilla perfect pour™, Tapa de doble abertura, Apto para lavaplatos', 0, 0, 'BL1650-04LA-1', '2021-04-14', 1, 4, 10),
(3, 'nv', 'BL1650-05LA', 'CUCHILLA B+D', 'Cuchilla QuadPro de FusionBlade ™, Diseño exclusivo de 4 aspas para un mejor desempeño, Apto para lavaplatos', 0, 0, 'BL1650-05LA-1', '2021-02-24', 1, 4, 10),
(4, 'a', 'BL1130-04LA', 'JARRA DE VIDRIO B+D', 'Jarra de vidrio de 1,5 L con boquilla perfect pour™, Taza para medir de 30 ml integrada en la tapa, Apto para lavaplatos', 0, 12, 'BL1130-04LA-1', '2021-03-03', 1, 4, 10),
(5, 'a', 'BL1130-05LA', 'CUCHILLA B+D', 'Cuchilla QuadPro de FusionBlade ™, diseño exclusivo de 4 aspas para un mejor desempeño, apto para lavaplatos', 0, 6, 'BL1130-05LA-1', '2021-02-10', 1, 4, 10),
(6, 'i', 'CM1010B-03LA', 'FILTRO PERMANENTE B+D', 'Filtro permanente, Apto para lavaplatos', 0, 2, 'CM1010B-03LA-1', '2020-09-29', 1, NULL, NULL),
(7, 'a', 'DCM1100B-03LA', 'JARRA 10 TZS CAFETERA', 'DCM1100B-03LA JARRA 10 TZS CAFETERA', 18, 11, 'DCM1100B-03LA-1', '2021-06-12', 1, 4, 10),
(8, 'a', 'GC3000B', 'JARRA 12 TZS CAFETERA B+D', 'La jarra de reemplazo BLACK + DECKER de 12 tazas * es conveniente y duradera. Para su comodidad, la jarra enumera las marcas de nivel de agua y de nivel de café preparado. Es una garrafa DuraLife con un mango resistente y un vidrio reforzado para extender la vida útil de su compra.', 7, 11, 'GC3000B-1', '2021-06-01', 1, 4, 10),
(9, 'a', 'BL2010WP-07LA', 'CUCHILLA LIC VIDRIO/P', 'Cuchilla DuraPro /TurboPro para Licuadora Jarra de Vidrio o Plástico\n\nMulti-nivel de acero inoxidable\n\nCompatibles con modelos:\nBLBD210GT, BLBD210GR\nBLBD210GG, BLBD210GP\nBLBD210PW, BLBD210PB\nBLBD210PV, BLBD210PR\nBLBD210PP, BLBD210PG\nBLBD210GPW, BL2010BP\nBL2010WG, BLBD202GW\nBLBD202PW, BLBD210GB\nBLBD210GPW, BLBD210GW\nBLBD210PB, BLBD210PW\nBLBD210PG, BLBD210PP\nBLBD210PR, BLBD210PV\nBLBD210GSS, BLBD10GSS\nBLBD10GW1, BL2010BP\nBL2010RP, BL2010WP\nBLBD10PW, BLBD10PR\nBLBD10PG, BLBD10PV\nBLBD10PO, BLBD10GW\nBL2352GW, BL2352P\n', 0, 6, 'BL2010WP-07LA-1', '2021-02-25', 1, 4, 10),
(10, 'a', 'BL2010WP-03LA', 'JARRA LIC PLASTICO B+D', 'Jarra de plástico de 1,5 DuraPro /TurboPro con pico vertedor, asa con diseño ergonómico\n\nCompatibles con modelos:\nBL2010BP, BL2010BPA\nBL2010RP, BL2010WP\nBLBD10GW, BLBD10PW\nBLBD10PG, BLBD10PO\nBLBD10PR, BLBD10PV\nBL2352P, BLBD210PB\nBLBD210PW, BLBD210PG\nBLBD210PP, BLBD210PR\nBLBD210PV, BLBD202PW\nBLBD210GPW', 1, 7, 'BL2010WP-03LA-1', '2021-02-25', 1, 4, 10),
(11, 'a', 'GD2011B', 'ASADOR ELECTRICO B+D', '1500 watts, Capacidad de 8 Porciones, Superficie Antiadherente, Superficie de cocción, 19 x 75 x 10.25\", Canal para eliminar el exceso de grasa, Bandeja de goteo removable, Control de temperatura removible con cierre a presión', 0, 32, 'GD2011B-1', '2021-02-26', 1, 4, 21),
(12, 'a', 'GD2051B', 'ASADOR ELECTRICO B+D', 'El Asador Eléctrico GD2051B combina la rápida e incluso calefacción con temperatura variable de los controles, por lo que es fácil crear todos los favoritos de su desayuno—de tocino y huevos para los panqueques y hash browns. Esta versión actualizada de la plancha viene con un built-en el calentamiento de la bandeja que permite almacenar los alimentos cocinados, mientras que completar la comida. Todo lo que sale junto a la temperatura perfecta. Además, la gran superficie antiadherente y se desliza la bandeja de goteo hacer la limpieza de una brisa.', 0, 48, 'GD2051B-1', '2021-02-26', 1, 4, 21),
(13, 'a', 'MX900', 'BATIDORA CON PEDESTAL B+D', 'Disfrute de la potencia para mezclar con facilidad. Esta práctica batidora cuenta con 5 velocidades. El potente motor de 250 watts brinda una variedad de funciones de mezclado. El conveniente talón y descanso para recipiente facilitan colocar la batidora en posición de descanso entre las tareas. Características: 250 watts, 5 velocidades, Botón de expulsión, Soporte en pedestal, Mango ergonómico, Recipiente de vidrio, Recipiente de plástico, 2 Batidores de alambre, 2 Ganchos para masa', 12, 44, 'MX900-1', '2021-02-26', 1, 4, 12),
(14, 'a', 'MX1500W', 'BATIDORA D/MANO B+D', 'Disfrute de la potencia para mezclar con facilidad. Esta práctica batidora cuenta con 5 velocidades. El potente motor de 175 watts brinda una variedad de funciones de mezclado. El conveniente talón y descanso para recipiente facilitan colocar la batidora en posición de descanso entre las tareas. Características: 175 watts, 5 velocidades, Botón expulsor de batidores, Función Turbo, Mango, ergonómico, Talón de descanso, Apto para lavaplatos, 2 Batidores', 14, 19, 'MX1500W-1', '2021-02-27', 1, 4, 12),
(15, 'nv', 'MX3200B', 'BATIDORA D/MANO B+D', 'Características: 250 watts, 6 velocidades, Función turbo, Mango ergonómico, Talón de descanso, Botón expulsor de batidores, Apto para lavaplatos, Estuche de almacenamiento, 2 Batidores de alambre, 2 ganchos de masa, 1 Batidor de huevos', 1, 32, 'MX3200B-1', '2021-03-01', 1, 4, 12),
(16, 'a', 'MX3000W', 'BATIDORA D/MANO B+D', 'Características: Menos esfuerzo, 20% más lento de primera velocidad, 250 W de potencia con 6 velocidades, Accesorios profesionales: 2 varillas de alambre y 2 batidos, tazón y reposacabezas, Apto para lavaplatos.', 0, 0, 'MX3000W-1', '2021-02-26', 1, 4, 12),
(17, 'a', 'MX1200', 'BATIDORA DE PEDESTAL B+D', 'Disfrute de la potencia para mezclar con facilidad con la batidora de pedestal y manual de Black+Decker. La batidora tiene 5 velocidades además de la función de turbo y un potente motor de 250 watts para brindar una variedad de funciones de mezclado. Adicionalmente, cuenta con la versatilidad necesaria para cambiar de batidora de pedestal a batidora de mano. 2 batidores de alambre, 2 ganchos para masa, tazón de acero inoxidable (3.5L) con diseño giratorio, son los accesorios que complementan esta versátil batidora. Características: 250 Watts de potencia, 5 Velocidades + Función de Turbo, Tazón de acero inoxidable (3.5L) con diseño giratorio, 2 Batidores de alambre, 2 Ganchos para masa, Cabezal inclinable, Diseño multiuso fácil de convertir de batidora con base a batidora manual, Botón de expulsión, Talón de descanso, Accesorios aptos para lavaplatos', 0, 64, 'MX1200-1', '2021-02-26', 1, 4, 12),
(18, 'a', 'HB2800B', 'BATIDORA DE INMERSION 3 EN', 'Características: 200 watts, 2 Velocidades, Controles de un toque, Taza de medir/mezclar con boquilla fácil de verter (700ml), Cuchillas de acero inoxidable, Batidor de huevos de acero inoxidable, Cuchillas de acero inoxidable para cortar, Cuchillas de acero inoxidable para licuar, Recipiente para picar (500ml) con cuchillas de acero inoxidable', 0, 28, 'HB2800B-1', '2021-02-26', 1, 4, 12),
