(51, 'a', 'TO1332SBD', 'HORNO TOSTADOR B+D', 'Características: 1500 watts, Capacidad de 4 rebanadas, Tecnología EvenToast™, Selector de temperatura, Selector Multi-Función, Cronómetro a 30 minutos, Puerta de vidrio con asa fría al tacto, Luz indicadora de funcionamiento, Bandeja para hornear, Bandeja para asar.', 1, 47, 'TO1332SBD-1', '2021-02-26', 1, 4, 15),
(52, 'a', 'TO1700SG', 'HORNO TOSTADOR B+D', '¡Excelente para cocinar bocadillos y preparar rápidamente aperitivos! Este horno tostador se adapta a una pizza de 9 \"o cuatro rebanadas de pan, y los controles simplificados de dial le permiten programar el cronómetro de 30 minutos y optar por hornear, asar, tostar o mantener caliente. Además, nuestra exclusiva tecnología EvenToast Technology ™ ofrece deliciosos y tostadas uniformemente hechas. Características: 4 funciones: hornear, asar, tostar, mantener caliente, Se adapta a 4 rebanadas de pan o una pizza de 9 \", Temporizador de 30 minutos con encendido, Bandeja de hornear y estante incluidos.', 0, 48, 'TO1700SG-1', '2021-02-26', 1, 4, 15),
(53, 'a', 'TO1342B', 'HORNO TOSTADOR B+D', 'El horno tostador de 4 rebanadas BLACK + DECKER es ideal para tareas de horneado más pequeñas. Su interior expandido se adapta a una pizza de 9 ” o cuatro rebanadas de pan, y los controles de dial simplificados le permiten elegir hornear, asar, tostar o mantener caliente. Además, nuestra exclusiva tecnología EvenToast Technology ™ brinda hasta un 30% más de manera uniforme. Características: Cuatro funciones: elija hornear, asar, tostar y mantener caliente. Controles simplificados: los diales fáciles de usar le permiten controlar el tiempo y la temperatura de cocción. Interior curvado: el interior expandido se adapta a una pizza de 9 \"o cuatro rebanadas de pan. Temporizador de 30 minutos: el temporizador de precisión incluye una función de encendido para tareas de cocción más prolongadas. Puerta de vidrio de visión clara: preste atención a los alimentos mientras se hornea sin abrir la puerta del horno. Estante y bandeja incluidos: el estante y la bandeja para hornear incluidos encajan perfectamente en el horno tostador. Bandeja de migas extraíble: retire fácilmente las migajas de alimentos antes de que se quemen en el fondo del horno.', 9, 43, 'TO1342B-1', '2021-02-26', 1, 4, 15),
(54, 'a', 'TO1303SB', 'HORNO TOSTADOR B+D', 'El horno tostador de cuatro rebanadas BLACK + DECKER es un clásico de mostrador de cocina. No es necesario calentar el horno convencional, este modelo (modelo TO1303SB) le permite cocinar rápidamente. La ventana grande y el temporizador de cocción, con función de encendido, le permiten cocinar exactamente según sus especificaciones. Y, el tamaño eficiente aún permite hasta cuatro rebanadas de pan o una pizza de 9 \". Características: Exclusiva tecnología Even Toast, Bandeja de hornear y asar a la parrilla incluidos, Se adapta a una pizza de 9 \", Temporizador de 30 minutos con función de encendido, Bandeja extraíble para migas.', 0, 39, 'TO1303SB-1', '2021-02-26', 1, 4, 15),
(55, 'a', 'TO1373SSD', 'TOSTA HORNO B+D', 'Características: 1500 watts, Capacidad de 4 rebanadas, Tecnología EvenToast™, Selector de temperatura, Selector Multi-Función, Cronómetro a 30 minutos, Puerta de vidrio con asa fría al tacto, Luz indicadora de funcionamiento, Bandeja para hornear, Bandeja para asar.', 0, 44, 'TO1373SSD-1', '2021-04-14', 1, 4, 15),
(56, 'a', 'TO1675W', 'TOSTA HORNO B+D', 'Comience a cocinar de manera rápida y uniforme con el horno tostador de convección BLACK + DECKER. Este horno tostador de convección grande tiene la capacidad de cocinar pizzas enteras de 9 pulgadas con facilidad. Con la ayuda de su temporizador de 60 minutos, puede hornear, asar, tostar y mantener las funciones calientes en el horno tostador. El juego incluye una rejilla del horno, una bandeja para hornear y una bandeja para asar para cocinar varios platos simultáneamente. También cuenta con una puerta de vidrio de fácil visualización para revisar sus platos de vez en cuando. El mantenimiento es fácil. Características: Horno de mostrador de 6 rebanadas con ajuste para pizza de 9 \", Convección, hornear, asar, tostar y mantener las funciones calientes. Temporizador de 60 minutos, Rejilla del horno, Hornear Pan, Sartén para asar, Puerta de cristal de fácil vista.', 0, 68, 'TO1675W-1', '2021-02-26', 1, 4, 15),
(57, 'a', 'TO1940BD', 'TOSTA HORNO B+D', 'El horno de seis rebanadas de pan BLACK+DECKER tiene tecnología de convección que circula aire caliente para cocinar pizzas y congelados favoritos por mínimo tiempo. El interior está diseñado para el enfoque hacia la comida rápida e incluso cocinar. Las funciones de cocción son hornear, asar, tostar y mantener caliente. Tiene una capacidad para una pizza de 9\" o seis rebanadas de pan. Características: 1350 watts, Capacidad de 4 Rebanadas, Selector de Temperatura, Selector Multi-Función, Cronometro a 30 minutos, Puerta de Vidrio con asa fría al tacto, Luz Indicadora de funcionamiento, Bandeja para Hornear y bandeja para Azar.', 0, 54, 'TO1940BD-1', '2021-04-13', 1, 4, 15),
(58, 'a', 'TO1332BD', 'TOSTA HORNO B+D', 'Características: 4 Rebanadas de pan o pizza de 9 pulgadas. bandeja de miga extraible. Flujo de aire de 650 litros / minuto. Potencia 1500 Watts; Tecnología Exclusiva Even Toast. Color: Negro- Plata. Peso aproximado: 3,63 Kg. Dimensiones: 43 x 31 x 26 cm.', 0, 48, 'TO1332BD-1', '2021-04-14', 1, 4, 15),
(59, 'a', 'TO1420B', 'TOSTA HORNO B+D', 'Características: 1200 Watts, Capacidad de 4 rebanadas, Selector de temperatura, Selector Multi-Función, Cronómetro a 30 minutos, Puerta de vidrio con asa fría al tacto, Luz indicadora de funcionamiento, Bandeja para hornear, Bandeja para asar.', 0, 48, 'TO1420B-1', '2021-04-14', 1, 4, 15),
(60, 'a', 'TO1303RB', 'HORNO TOSTADOR B+D', 'Prepare un bocadillo o una comida completa rápida y fácilmente con este horno tostador de acero inoxidable, bellamente diseñado para verse atractivo en el mostrador de su cocina. Disfrute de la versatilidad de la cocina para encimeras con el horno tostador de 4 rebanadas Black and Decker. Los controles fáciles de usar ofrecen funciones de cocción para hornear, asar, tostar y mantenerse caliente, con un temporizador de 30 minutos con función de permanecer encendido. El interior curvo extra profundo se adapta a cuatro rebanadas de pan tostado o una cazuela e incluso puede sostener una pizza de nueve pulgadas con facilidad. El horno tostador Black and Decker viene con una bandeja de migas extraíble y accesorios aptos para lavavajillas, lo que permite una limpieza fácil y rápida. El horno también incluye una bandeja para hornear y una rejilla para asar para acomodar todo tipo de recetas en cualquier comida.\n\nTecnología exclusiva -Even Toast Technology\nCapacidad de cocción - 4 rebanadas o Pizza de 9”\nTimer de 30 minutos - Tuesta, hornea, asa y mantiene calientes los alimentos\nLuz indicadora de encendido - Incluye charola de horneado y parrilla de asado\nAcentos en acero inoxidable - Charola de migajas\n\nDimensiones: 44 x 30.4 x 24 cm; 3.8 kg', 0, 39, 'TO1303RB-1', '2021-02-27', 1, 4, 15),
(61, 'a', 'CTO650', 'HORNO PARA PIZZA B+D', 'Características: 1500 watts, Capacidad de 6 rebanadas, Selector de temperatura, Selector Multi-Función, Cronómetro a 60 minutos, Interior curvo, Luz indicadora de funcionamiento, Bandeja para hornear, Bandeja para asar.', 0, 98, 'CTO650-1', '2021-04-14', 1, 4, 15),
(62, 'a', 'TO3260XSBD', 'HORNO TOSTADOR B+D', '¡Conozca a nuestro horno tostador con la capacidad más grande! El Horno Tostador Extra Ancho de BLACK+DECKER simplificará las tareas de horneados grandes. Su interior extendido acomoda una bandeja completa de 29,9 cm x 33 cm (9” x 13”) para que pueda hornear lasaña, biscochos de chocolate y hasta pizzas congeladas de 30 cm (12”) en poco tiempo. Ya no tendrá que esperar a que su horno se precaliente, solo fije la temperatura correcta y el tiempo de cocción y estará cocinando en solo minutos con cuatro funciones diferentes: hornear, asar, tostar y mantener caliente. La avanzada tecnología de convección circula el aire dentro del horno para obtener resultados rápidos y uniformes. Además, la bandeja para migas exterior es fácil de deslizar hacia adentro y hacia afuera, haciendo la limpieza súper fácil. Características: 1500 watts, Interior extra ancho.', 0, 106, 'TO3260XSBD-1', '2021-04-13', 1, 4, 15),
(63, 'a', 'TO1760SS-LA', 'HORNO TOSTADOR B+D', 'Experimente la diferencia que puede hacer el calentamiento uniforme con el Horno Tostador de Convección Natural BLACK+DECKER™. Su interior fue diseñado basado en los principios de termodinámica, circulando el flujo de aire eficazmente para proporcionar más calor de manera uniforme* y resultados rápidos. La cocción en el mostrador es simple con un reloj contador de 30 minutos y cuatro funciones de cocción: hornear, asar, tostar y mantener caliente. Además, el horno tostador es perfecto para preparar sus alimentos de merienda congelados favoritos: presas de pollo rebosadas, palitos de mozzarella, rollitos primavera o cualquier otro tipo de merienda que le apetezca. ', 0, 42, 'TO1760SS-LA-1', '2021-04-14', 1, 4, 15),
(64, 'a', 'TO4314SSD', 'HORNO TOSTADOR B+D', 'Desde pizza a pollo, cocine todos sus favoritos en el Horno de Convección Rostizador para Mostrador de BLACK+DECKER. Con una parrilla para rostizar removible, dos bandejas para tostar y una bandeja para hornear incluidas, las opciones son infinitas. Seleccione entre las funciones de hornear, asar, tostar y mantener caliente para usar la mejor función para cada alimento. Una bandeja para migas removible y piezas aptas para lavavajilla facilitan la limpieza. Características: 1500 watts, Capacidad de 9 rebanadas, Rotisserie, Selector de temperatura, Selector Multi-Función, Cronómetro a 30 minutos, Interior Curvo, Acentos de acero inoxidable, Puerta de vidrio con asa fría al tacto, Luz indicadora de funcionamiento, Bandeja para hornear, Bandeja para asar.', 0, 90, 'TO4314SSD-1', '2021-02-26', 1, 4, 15),
(65, 'a', 'TO3290XG', 'TOSTA HORNO B+D', 'El horno de convección extra ancho digital tiene espacio para una bandeja de nueve pulgadas por 13 pulgadas, ¡para que pueda preparar una comida adecuada para toda la familia en su encimera! ¡El ventilador de convección asegura una calefacción rápida y uniforme para todas sus tareas de horneado, y siete funciones de cocción separadas proporcionan el calor ideal para asar, tostar y más! Además, los controles digitales facilitan la selección de la hora, la temperatura y la función de cocción, con un temporizador de tostado y un temporizador de precisión de 120 minutos con apagado automático. 7 funciones: funciones de cocción dedicadas incluyen: convección hornear, asar, tostar, bagel, recalentar, pizza y aperitivos congelados. Controles digitales: botones fáciles de usar que proporcionan un control preciso sobre el tiempo, la temperatura y la función. La pantalla digital muestra claramente la información de cocción. Temporizador de precisión: el temporizador de 120 minutos incluye la funcionalidad de permanencia y apagado automático y un temporizador de tono de tostado de precisión. Tecnología de convección: el ventilador de convección especial optimiza la circulación de calor para asegurar un calentamiento rápido e uniforme durante la cocción. Hornee un pollo entero o termine los filetes justo debajo del asador. La bandeja de migas extraíble se desliza hacia dentro y hacia fuera para quitar fácilmente las migas antes de que se quemen en la parte inferior del horno.', 0, 120, 'TO3290XG-1', '2020-09-29', 1, NULL, NULL),
(66, 'a', 'TOD3300SS', 'TOSTA HORNO B+D', 'Los controles digitales eliminan las conjeturas de los tiempos de cocción con este horno de encimera premium. Configure el temporizador hasta 90 minutos y elija entre siete selecciones de tonos tostados. La pantalla digital ayuda a lograr resultados precisos en todo momento. Este horno de mostrador está diseñado para cocinar 20% más rápido * gracias a la tecnología de calentamiento por convección mejorada que garantiza una cocción rápida y uniforme con las cuatro funciones: hornear, asar, tostar y mantener caliente. El interior es lo suficientemente grande como para caber hasta seis rebanadas de pan o una pizza de 12 \", y las tres posiciones de las rejillas proporcionan la flexibilidad para cocinar todo tipo y tamaño de alimentos. Además, la bandeja externa para migas facilita la limpieza del horno tostador y la encimera. Características: Temporizador digital y selector de sombra de pan tostado, 20% de cocción más rápida * - Tecnología de convección, 4 funciones: horneado por convección, asar, tostar, mantenerse caliente, Se adapta a 6 rebanadas de pan o una pizza de 12 \", Tres posiciones de rack, Bandeja externa para migas - Limpieza fácil.', 0, 98, 'TOD3300SS-1', '2020-09-29', 1, NULL, NULL),
(67, 'a', 'TO3265XSSD', 'TOSTA HORNO FREIDOR B', 'Presentamos la Tecnología para Freír con Aire, una tecnología nueva en el Horno Extra Ancho con Función para Freír con Aire de BLACK+DECKER. ¡Disfrute del sabor de alimentos fritos en aceite abundante sin la grasa! La tecnología para freír con aire usa aire caliente de alta intensidad para hornear, dorar y crujir sus alimentos fritos favoritos con poco o ningún aceite. Pruebe las papas fritas, papitas fritas de vegetales, filetes de pescado empanizados, meriendas congeladas y ¡mucho más! El diseño de gran capacidad acomoda alimentos para toda la familia. El horno contiene suficiente espacio para hasta ocho rebanadas de pan o una pizza de 30 cm (12”) y ¡hasta puede usar las bandejas que ya tiene! Con espacio suficiente para una bandeja de 23 cm x 33 cm (9” x 13”) con asas, puede servir sus alimentos directamente del horno a la mesa. Tres perillas de control hacen fácil ajustar el reloj automático de la función de tostar y el reloj automático de 60 minutos, y seleccionar entre cinco funciones de cocción: hornear, asar, tostar, mantener caliente y freír con aire. La tecnología de cocción por convección circula el aire dentro del horno para resultados rápidos y uniformes al freír con aire. Además, este horno tostador incluye una cesta diseñada para freír con aire, una bandeja y parrilla para hornear/asar y una bandeja para migas externa que se desliza hacia adentro y hacia afuera del horno para una limpieza fácil. Características: 1500 Watts, Tecnología de convención: Aumenta la velocidad y la uniformidad, Tecnología para freír saludable: Aire caliente de gran intensidad hornea, dora, y concina crujiente con poco o nada de aceite, Reloj automático de 60 minutos con opción de funcionamiento continúo, 5 Funciones: Freír con Aire, Hornea, Tuesta, Asa, Mantiene Caliente, Acomoda una pizza de 12” o una bandeja con asas para hornear de 9\" x 13\", Incluye cesta de freír con aire, bandeja para hornera, y parrilla de asar, Bandeja de residuos removible.', 0, 293, 'TO3265XSSD-1', '2020-09-29', 1, NULL, NULL),
(68, 'a', 'TO3210SSD', 'TOSTA HORNO B+D', 'El Horno de BLACK+DECKER está construido para complacer. Con espacio interior extenso, puede cocinar fácilmente una pizza de 30 cm (12”) o hasta acomodar seis rebanadas de pan. El reloj automático para la función de tostar con ajustes de niveles de tostado desde claro a oscuro, permite variedad dependiendo de lo que vaya a tostar. Además, las funciones de tostar, hornear y asar son todas disponibles como funciones de cocción. Características: 1500 Watts, Capacidad de 6 rebanadas, Puerta de vidrio con asa fría al tacto, Bandeja para hornear, Bandeja para parrilla.', 0, 88, 'TO3210SSD-1', '2020-09-29', 1, NULL, NULL),
(69, 'a', 'TO1322SBD', 'TOSTA HORNO B+D', 'Características: 1500 watts, Capacidad de 4 rebanadas, Tecnología EvenToast™, Selector de temperatura, Selector Multi-Función, Cronómetro a 30 minutos, Puerta de vidrio con asa fría al tacto, Luz indicadora de funcionamiento, Bandeja para hornear, Bandeja para asar.', 0, 46, 'TO1322SBD-1', '2021-04-13', 1, 4, 15),
(70, 'a', 'TO1755SRG-LA', 'TOSTA HORNO B+D', 'Experimente la diferencia que puede hacer el calentamiento uniforme con el Horno Tostador de Convección Natural BLACK+DECKER™. Su interior fue diseñado basado en los principios de termodinámica, circulando el flujo de aire eficazmente para proporcionar más calor de manera uniforme* y resultados rápidos. La cocción en el mostrador es simple con un reloj contador de 30 minutos y cuatro funciones de cocción: hornear, asar, tostar y mantener caliente. Además, el horno tostador es perfecto para preparar sus alimentos de merienda congelados favoritos: presas de pollo rebosadas, palitos de mozzarella, rollitos primavera o cualquier otro tipo de merienda que le apetezca. Características: 1150 Watts, Capacidad de 4 rebanadas/Acomoda una pizza de 23 cm, Selector de temperatura, Cronómetro a 30 minutos, La convección natural proporciona resultados de cocción deliciosos. Este horno tostador fue diseñado para controlar con precisión la circulación de aire, basado en los principios de termodinámica, Puerta de vidrio con asa fría al tacto, Luz indicadora de funcionamiento, Incluye bandeja para hornear y parrilla de asar.', 0, 38, 'TO1755SRG-LA-1', '2021-02-27', 1, 4, 15),
(71, 'a', 'BL1830SGM', 'LICUADORA B+D', 'Características: 700 Watts de Potencia, 4 Velocidades, Sistema Inteli-Fuse™, Jarra de Vidrio de 1,5 lt. Cuchillas QuadPro FusionBlade™, Taza medidora en la tapa, Apto para lavavajillas, Guarda cable, Soportes de goma antideslizantes.', 0, 70, 'BL1830SGM-1', '2021-04-14', 1, 4, 16),
(72, 'a', 'BL1820SGM', 'LICUADORA B+D', 'La Licuadora digital FusionBlade ™ de BLACK + DECKER es un cambiador de juegos para cualquier cocina. Las bebidas heladas artesanales y las creaciones mezcladas se preparan de forma instantánea con la forma única de las cuchillas y el diseño del tarro que se combinan para entregar la potencia de mezcla máxima. Un botón de pulso se une a 4 opciones de velocidad para darle control total sobre los 700 volts de potencia máxima, triturando fácilmente el hielo y mezclando frutas. Además, un ajuste de licuado pre programado preparará un sabroso plato combinado en sólo 30 segundos. Las infinitas posibilidades esperan con esta licuadora atractiva, cromo-acentuada que puede transformar la manera en que cocinas y comes. Características: Control digital automático de 4 funciones + pulso, Cuchilla de acero inoxidable FusionBlade ™ de 4 puntas, 700 volts de potencia, Tarro de vidrio de 6 tazas (48 onzas), Tapa de inserción de 1 oz, Partes Desprendibles Aptas para Lavavajillas.', 0, 70, 'BL1820SGM-1', '2020-09-29', 1, NULL, NULL),
(73, 'a', 'BL2352P', 'LICUADORA  B+D', 'Características: 550 watts de potencia, 2 velocidades, Jarra de plástico de 1,5 lt. Cuchillas de 4 niveles de acero inoxidable, Taza medidora en la tapa, Apta para lavavajillas, Guardacable.', 2, 31, 'BL2352P-1', '2021-04-13', 1, 4, 16),
(74, 'a', 'BL2010BP', 'LICUADORA B+D', 'Características: 10 velocidad con pulso, encuentra la consistencia correcta para todo lo que hace con una gama de velocidades de mezcla. Frasco ligero de 5 tazas (1.5 Lt.) es fácil de manejar con un pico PerfectPour ™ que elimina goteos y derrames. Cuchilla de 4 puntos - La cuchilla de acero inoxidable de varios niveles se mezcla a varios niveles para mejorar la eficiencia y el poder de la mezcla. Inserción de la tapa de medición: La tapa transparente de la tapa sirve como una taza de medir de 1 onza, ideal para preparar bebidas heladas. Lavado en el lavavajillas de piezas de limpieza es una brisa con el lavavajillas caja de seguridad, la tapa y la cuchilla.', 0, 34, 'BL2010BP-1', '2020-09-29', 1, NULL, NULL),
(75, 'a', 'BLC12650HB', 'LICUADORA B+D', 'Características: 650 Watts, 12 velocidades, Jarra de Vidrio de 1,25 lt. Candado de Seguridad entre Jarra y base, Soportes de goma antideslizantes, Botón para triturar hielo, Cuchillas de 4 niveles de acero inoxidable, Taza medidora en la tapa, Apto para lavaplatos, Guardacable.', 0, 50, 'BLC12650HB-1', '2020-09-29', 1, NULL, NULL),
(76, 'a', 'BLBD10GW', 'LICUADORA B+D', 'Características: 550 watts, 10 velocidades, Jarra de vidrio de 1,25 lt. Cuchillas de 4 niveles de acero inoxidable, Taza medidora en la tapa, Apto para lavaplatos, Guardacable, Incluye: Jarra de plástico adicional de 1,5 lt.', 0, 36, 'BLBD10GW-1', '2020-09-29', 1, NULL, NULL),
(77, 'nv', 'BL10451', 'LICUADORA B+D', 'Características: 10 Potentes velocidades y control de pulso para toda función de licuado, Eje de cuchillas metálicas en acero inoxidable brinda un rendimiento superior al licuar y picar, Potente motor de 475 Watts, Tapa con medidor, Jarra de Vidrio de 1.4L, Base grande con sistema de entrecierre, Pies con soporte de goma.', 0, 0, 'BL10451-1', '2021-03-02', 1, NULL, NULL),
(78, 'a', 'BLBD10GSS', 'LICUADORA  B+D', 'La Licuadora de Turbo Pro de 10 Velocidades de BLACK+DECKER es esencial en la cocina. Con 10 velocidades y una función de pulso, su funcionamiento es simple y eficiente. La jarra de 1.25 Lt. de vidrio está diseñada para verter fácilmente y tiene la capacidad suficiente para acomodar varias porciones de batidos favoritos y ¡más! Además, la limpieza es muy fácil gracias a las piezas removibles aptas para lavavajillas. Características: 550 Watts, 10 velocidades, Jarra de Vidrio de 1,25 lt. Cuchillas de 4 niveles de acero inoxidable, Taza medidora en la tapa, Guardacable, Apto para lavaplatos.', 1, 46, 'BLBD10GSS-1', '2020-09-29', 1, NULL, NULL),
(79, 'a', 'BLBD10PV', 'LICUADORA MORADA B+D', 'Características: 550 Watts, 10 velocidades, Jarra de plástico de 1,5 lt. Cuchillas de 4 niveles de acero inoxidable, Taza medidora en la tapa, Apto para lavaplatos, Guardacable.', 0, 30, 'BLBD10PV-1', '2021-04-13', 1, 4, 16),
(80, 'a', 'BL1130SGM', 'LICUADORA B+D', 'La Licuadora FusionBlade™ de 12 velocidades de BLACK + DECKER es un cambio de juego para cualquier cocina. Las bebidas heladas artesanales y las creaciones mezcladas se hacen instantáneamente con la forma única de las cuchillas y el diseño del tarro que se combinan para entregar la potencia de mezcla máxima. Un botón de pulso se une a 12 opciones de velocidad para darle un control total sobre los 650 watts de potencia máxima, aplastando fácilmente el hielo y mezclando frutas. Infinitas posibilidades esperan con esta confiable Licuadora que puede transformar la forma de cocinar y comer. Características: Cuchilla de acero inoxidable FusionBlade ™ de 4 puntas, 650 watts de potencia, 12 Velocidades + Pulso, Tarro de vidrio de 6 tazas (48 onzas), Tapa de Inserción de la taza de medición de 1 oz, Partes Desprendibles Aptas para Lavavajillas.', 0, 54, 'BL1130SGM-1', '2021-04-14', 1, 4, 16),
(81, 'a', 'BLBD10PW', 'LICUADORA BLANCA B+D', 'Características: 350 Watts, 10 velocidades, Jarra de plástico de 1,5 lt. Cuchillas de 4 niveles de acero inoxidable, Taza medidora en la tapa, Apta para lavavajillas, Guardacable.', 0, 30, 'BLBD10PW-1', '2021-04-13', 1, 4, 16),
