(84, 'a', 'BLBD10PG', 'LICUADORA VERDE B+D', 'Características: 550 Watts, 10 velocidades, Jarra de plástico de 1,5 lt. Cuchillas de 4 niveles de acero inoxidable, Taza medidora en la tapa, Apta para lavavajillas, Guardacable.', 1, 29, 'BLBD10PG-1', '2021-04-14', 1, 4, 16),
(85, 'a', 'BL1111SG', 'LICUADORA B+D', 'La nueva licuadora FusionBlade ™ de BLACK + DECKER combina la tecnología avanzada de cuchillas con una geometría innovadora para ofrecer un sistema poderoso que es perfecto para todas sus necesidades de mezcla. Desde la mezcla y el picado hasta la mezcla y el puré, esta licuadora FusionBlade ™ puede hacer el trabajo de manera rápida y eficiente. Con 12 velocidades, una jarra grande de vidrio para seis tazas y un motor robusto, esta licuadora es lo suficientemente versátil para todos tus trabajos impares. ¡Es lo suficientemente fuerte como para crear un vórtice poderoso para obtener resultados perfectos cada vez! ', 0, 54, 'BL1111SG-1', '2021-04-14', 1, 4, 16),
(86, 'a', 'BL1110RG', 'LICUADORA B+D', 'La nueva licuadora FusionBlade ™ de BLACK + DECKER combina la tecnología avanzada de cuchillas con una geometría innovadora para ofrecer un sistema poderoso que es perfecto para todas sus necesidades de mezcla. Desde la mezcla y el picado hasta la mezcla y el puré, esta licuadora FusionBlade ™ puede hacer el trabajo de manera rápida y eficiente. Con 12 velocidades, una jarra grande de vidrio para seis tazas y un motor robusto, esta licuadora es lo suficientemente versátil para todos tus trabajos impares. ¡Es lo suficientemente fuerte como para crear un vórtice poderoso para obtener resultados perfectos cada vez! Características: FusionBlade: cuchillas de acero inoxidable de 2 puntas para triturar hielo en la nieve y hacer puré de alimentos rápidamente, 12 velocidades y pulso para todas las necesidades de mezcla, Jarra de vidrio de 6 tazas con marcas de nivel fáciles de leer, asa ergonómica y una tapa fácil de quitar, Tapa de taza de medición de 1 oz para bebidas mezcladas fáciles, Piezas aptas para lavavajillas', 8, 56, 'BL1110RG-1', '2021-02-26', 1, 4, 16),
(87, 'a', 'BL1210RG', 'LICUADORA BLACK+DECKER', 'La licuadora multifunción PowerCrush BLACK + DECKER ™ usa 700 vatios de potencia para pulverizar hielo y otros ingredientes duros para crear deliciosos batidos, batidos y más. El QuadPro Blade es lo suficientemente versátil como para hacer bebidas heladas, sopas, purés e incluso migas (pan, galletas o cereales) para usar en otras recetas. Utilice los cuatro botones de control de velocidad intuitivos para encontrar la consistencia perfecta. Luego disfrute de un vertido fácil y sin derrames con el caño de cierre con bisagras con cierre y el frasco de vidrio PerfectPour ™. Además, la limpieza es fácil con la función Easy Clean, que utiliza el movimiento de la cuchilla de mezcla para aflojar los alimentos apilados y todas las piezas son aptas para lavavajillas. Mezcla rápida y potente, servicio rápido y fácil de limpiar. ', 0, 54, 'BL1210RG-1', '2021-04-13', 1, 4, 16),
(88, 'a', 'BL1210BG', 'LICUADORA B+D', 'La licuadora multifunción PowerCrush BLACK + DECKER ™ usa 700 vatios de potencia para pulverizar hielo y otros ingredientes duros para crear deliciosos batidos, batidos y más. El QuadPro Blade es lo suficientemente versátil como para hacer bebidas heladas, sopas, purés e incluso migas (pan, galletas o cereales) para usar en otras recetas. Utilice los cuatro botones de control de velocidad intuitivos para encontrar la consistencia perfecta. Luego disfrute de un vertido fácil y sin derrames con el caño de cierre con bisagras con cierre y el frasco de vidrio PerfectPour ™. Además, la limpieza es fácil con la función Easy Clean, que utiliza el movimiento de la cuchilla de mezcla para aflojar los alimentos apilados y todas las piezas son aptas para lavavajillas. Mezcla rápida y potente, servicio rápido y fácil de limpiar. Características: Frasco de vidrio PerfectPour ™ de 6 tazas, Motor de 700 vatios, Tecnología QuadPro Blade de 4 puntas, Piezas aptas para lavavajillas, Batidos, batidos, bebidas heladas, purés, migas y más!', 0, 54, 'BL1210BG-1', '2020-09-29', 1, NULL, NULL),
(89, 'a', 'PB1002R', 'LICUADORA  PERSONAL ROJA B+D', 'La creación de bebidas mezcladas personalizadas nunca fue tan fácil gracias a la licuadora personal BLACK + DECKER FusionBlade ™. Perfecta para raciones individuales, la licuadora viene con un par de frascos de 20 oz que incluyen tapas de viaje para mantener tus bebidas en su lugar sin importar a dónde vayas. El poderoso acero inoxidable FusionBlade ™ está diseñado para triturar hielo y mezclar alimentos y líquidos de manera uniforme, por lo que es la herramienta ideal para crear bebidas mixtas y batidos. Mezcla algunas bebidas por una noche o crea un batido de proteínas para llevar al gimnasio, esta licuadora puede preparar bebidas personalizadas para todas las ocasiones. Características: Tecnología FusionBlade ™, 275 vatios de potencia, 2 tarros de mezcla, Boton de encendido / apagado.', 8, 41, 'PB1002R-1', '2021-06-07', 1, 4, 16),
(90, 'a', 'PB1002G', 'LICUADORA PERSONAL GRIS B+D', 'La creación de bebidas mezcladas personalizadas nunca fue tan fácil gracias a la licuadora personal BLACK + DECKER FusionBlade ™. Perfecta para raciones individuales, la licuadora viene con un par de frascos de 20 oz que incluyen tapas de viaje para mantener tus bebidas en su lugar sin importar a dónde vayas. El poderoso acero inoxidable FusionBlade ™ está diseñado para triturar hielo y mezclar alimentos y líquidos de manera uniforme, por lo que es la herramienta ideal para crear bebidas mixtas y batidos. Mezcla algunas bebidas por una noche o crea un batido de proteínas para llevar al gimnasio, esta licuadora puede preparar bebidas personalizadas para todas las ocasiones. Características: Tecnología FusionBlade ™, 275 vatios de potencia, 2 tarros de mezcla, Boton de encendido / apagado.', 0, 40, 'PB1002G-1', '2021-04-14', 1, 4, 16),
(91, 'a', 'BL4000T', 'LICUADORA DIGITAL CELESTE', '¡Comience la fiesta con la máquina de bebidas explosivas BLACK + DECKER XL! El extra grande de 72 onzas. el frasco de mezcla viene con una funda de enfriamiento aislada que mantiene las bebidas heladas frías durante horas. Los controles digitales incluyen cuatro funciones predeterminadas que crean la consistencia perfecta para margaritas, daiquiris, batidos y batidos. Además, la cuchilla está totalmente integrada con la jarra, y ambas son aptas para lavavajillas. Características: Capacidad XL 72 oz. Frasco ligero Eastman Tritan®, Diseño de mango abierto de agarre suave, Tapa transparente y de fácil cierre con caño de vertido que se puede volver a cerrar, Potente motor de 650 vatios, Incluye manga de aislamiento, Panel de control táctil digital de 4 velocidades, Las funciones preestablecidas incluyen: Margaritas, Daiquris, Batidos y Batidos, Piezas aptas para lavavajillas.', 0, 94, 'BL4000T-1', '2021-04-13', 1, 4, 16),
