(139, 'a', 'IR2011', 'PLANCHA ANTIADERENTE B+D', 'La marca #1 en Planchas BLACK+DECKER, está acelerando el cuidado de la ropa con la plancha de vapor avanzado de EvenSteam™. El diseño de suela TrueGlide™ de EVEN STEAM está diseñada para proveer un flujo de vapor más uniforme desde el talón de descanso hasta la punta, permitiéndole dominar las arrugas rápidamente en cualquier área de su prenda. La tecnología SmartSteam™ combina controles de vapor y temperatura en una sola perilla para el uso fácil. Además, esta plancha ofrece potente emisión de vapor para agresivamente sacar las arrugas y puede incluso utilizarse verticalmente para retocar rápidamente la ropa en la percha. Características: 2000-2400 watts, Tecnología EvenSteam™, Suela antiadherente TrueGlide™, Golpe de vapor, Emisión de vapor, Rocío fino, Sistema Anti-Goteo, Mango Comfort Grip™, Sistema Auto Clean®, Rocío fino, Guía de tejidos, Selector de tejidos, Talón antideslizante, Luz indicadora de funcionamiento.', 0, 32, 'IR2011-1', '2021-04-13', 1, 4, 18),
