(145, 'a', 'IR05X', 'PLANCHA B+D', 'La plancha de vapor Xpress proporciona vapor potente para eliminar fácilmente las arrugas y una suela antiadherente para un deslizamiento sin esfuerzo. Elimine las arrugas más fuertes con el aumento de vapor vertical y la niebla de pulverización, mientras que el sistema antigoteo evita las manchas de agua a bajas temperaturas. Características: 120 Watts, Cierre automático de 3 vías sensibles de movimiento, Explosión de vapor y aerosol de la niebla, Capacidad de vapor vertical antigoteo y sistema de auto limpieza, Empuñadura de confort, Cable giratorio de 360 grados, 2 años de garantía,', 0, 24, 'IR05X-1', '2021-04-13', 1, 4, 18);
