(146, 'a', 'IR09X', 'PLANCHA B+D', 'Olvídate de la tediosa tarea de planchar con la IR09X, con suela antiadherente perfecta para que se pueda deslizar fácilmente a través de los tejidos para mayor velocidad y mejor rendimiento. Combate las arrugas difíciles en un parpadeo gracias a su tecnología. Este sistema Smart Steam, regula automáticamente la cantidad de vapor de acuerdo al tipo de tela, gracias a su novedoso selector y guía de tejidos, para que se olvide de las dificultades de planchar. Cuenta con un diseño bonito y sumamente funcional, el cual cuenta con un rociador, orificio de llenado y tanque de agua, además de tener un talón de descanso y ser ultra-ligero. Con sistema de auto limpieza, selector guía de tejidos para brindarle un mejor cuidado a todas tus prendas, su cable es extra largo y pude girarse hasta 360° para que puedas mover más fácilmente la plancha. ', 0, 30, 'IR09X-1', '2021-04-13', 1, 4, 18),
(147, 'a', 'IR01P', 'PLANCHA B+D', 'Características: 1200 Watts, Suela antiadherente, Sistema de vapor Smart Steam®, Sistema Anti-Goteo, Mango Comfort Grip™, Botón de rocío, Selector y guía de tejidos, Cable giratorio de 360°, Talón de descanso.', 0, 20, 'IR01P-1', '2021-04-14', 1, 4, 18),
(148, 'a', 'AS385', 'PLANCHA B+D', 'Características: 1200 Watts, Suela antiadherente, Golpe de vapor vertical, Sistema de vapor Smart Steam®, Selector de vapor/seco, Mango abierto y suave, Botón de rocío, Selector y guía de tejidos, Cable giratorio de 360°, Talón de descanso, Luz indicadora de funcionamiento.', 0, 14, 'AS385-1', '2021-04-13', 1, 4, 18),
(149, 'a', 'F54', 'PLANCHA B+D', 'La plancha The Classic™ con un diseño clásico y una amplia gama de funciones prácticas trae simplicidad y estilo volver a planchar. Características: 1100 watts, Suela de aluminio, Canal de botones, Guía de tejidos, Cable giratorio de 180°, Temperatura variable.', 0, 24, 'F54-1', '2021-04-13', 1, 4, 18),
(150, 'a', 'IRBD100', 'PLANCHA B+D', 'Plancha de Vapor QUICK‘N EASY IRBD100 Es una de las mejores en el mercado, con esto podemos decir que la Plancha IRBD100 es un producto innovador que te ayuda a obtener excelentes resultados en tus prendas favoritas, lo cual te ayudará a lucir siempre bien e impecable. Características: 1100 watts, Suela antiadherente, Vapor variable, Rocío fino, Guía de tejidos, Selector de tejidos, Cable giratorio de 180°, Talón de descanso, Mango Comfort Grip™.', 10, 15, 'IRBD100-1', '2021-02-26', 1, 4, 18),
