(152, 'a', 'IR1811', 'PLANCHA B+D', 'Ligero y fácil de manejar, TrueGlide™ con suela antiadherente tiene características SmartSteam™ Tecnología propia, que automáticamente regula el nivel de vapor basado en tela para agilizar los controles y tomar las conjeturas de planchado. La plancha, está diseñada para evitar goteos y es conveniente con el clip integrado. Simplemente envuelva y coloque el enchufe en el cable para asegurar. Características: 1200 watts, Suela antiadherente TrueGlide™, Vapor variable, Sistema de Smart Steam™, Diseño ligero para un planchado fácil, Selector de tejidos, Sujetador de cable, Cable giratorio de 360°, Talón de descanso, Mango Comfort Grip™.', 14, 19, 'IR1811-1', '2021-02-26', 1, 4, 18),
(153, 'a', 'IR3001', 'PLANCHA IMPACT B+D', 'La Plancha de Vapor Avanzado IMPACT™ de BLACK+DECKER está diseñada para máxima durabilidad, proporcionando ambos, rendimiento y construcción duraderos. Segura de usar y completamente funcionable después de caerse de una tabla de planchar a 4 pies de altura, la plancha IMPACT™ está respaldada por una garantía limitada de 4 años. La suela de Ceramic Glide™ se desliza suavemente y el vapor de alto rendimiento ponen a prueba las arrugas. Controles separados de temperatura y vapor crean ajustes óptimos para todo tipo de tela y con la práctica función de vapor vertical, las prendas pueden ser vaporizadas justo en la percha. Alto rendimiento por dentro y por fuera, la Plancha de Vapor Avanzado IMPACT™ de BLACK+DECKER está lista para la batalla por largo tiempo. Características: 1500 watts, Máxima durabilidad, A prueba de caídas, 165g de vapor, Apagado automático en 3 posiciones, Vapor variable, Golpe de vapor, Rocío fino, Sistema Auto Clean®, Sistema Anti-Goteo, Mango suave Comfort Grip™, Cable giratorio de 360°, 4 años de garantía.', 0, 36, 'IR3001-1', '2021-02-26', 1, 4, 18),
(154, 'a', 'IRD03', 'PLANCHA SECA B+D', 'Características: Tecnología SmartTemp™, Suela antiadherente TrueGlide™, Planchado Seco, Selector de tejidos, Indicador de encendido, Talón de descanso,Mango Comfort Grip', 0, 14, 'IRD03-1', '2021-04-13', 1, 4, 18),
(155, 'a', 'IRBD200', 'PLANCHA B+D', 'La plancha de Black+Decker™ de TrueGlide™ Colors viene con golpe de vapor de 100g/minuto que elimina las arrugas más difíciles. Suela antiadherente TrueGlide™ Colors es 2 veces más durable para todos tipos de planchados. Tiene un tanque de agua transparente que es extra grande de 260ml y características Tecnología Auto-Clean™. Características: 1200 watts, Suela antiadherente TrueGlide™ Colors, Golpe de vapor, Función de AutoClean™, Rocío fino, Vapor variable, Selector de tejidos, Tanque de agua transparente extra grande de 260ml, Talón de descanso, Mango Comfort Grip™.', 10, 17, 'IRBD200-1', '2021-02-26', 1, 4, 18),
(156, 'a', 'IRBD202', 'PLANCHA B+D', 'La plancha de Black+Decker™ de TrueGlide™ Colors viene con golpe de vapor de 100g/minuto que elimina las arrugas más difíciles. Suela antiadherente TrueGlide™ Colors es 2 veces más durable para todos tipos de planchados. Tiene un tanque de agua transparente que es extra grande de 260ml y características Tecnología Auto-Clean™. Características: 1200 watts, Suela antiadherente TrueGlide™ Colors, Golpe de vapor, Función de AutoClean™, Rocío fino, Vapor variable, Selector de tejidos, Tanque de agua transparente extra grande de 260ml, Talón de descanso, Mango Comfort Grip™.', 10, 17, 'IRBD202-1', '2021-02-26', 1, 4, 18),
(157, 'a', 'HGS200', 'PLANCHA VERTICAL B+D', 'Refrescar los tejidos es fácil con el Vaporizador Avanzado de Mano de BLACK+DECKER. Con 1400 watts de potencia y precalentamiento en menos de un minuto, este vaporizador produce un rendimiento rápido y efectivo para combatir las arrugas. El gatillo de cierre le permite aplicar vapor continuamente o en pequeños golpes de vapor, también incluye 3 accesorios para remover la pelusa y vaporizar tejidos de tapicería y tejidos delicados. Es tan práctico, que es perfecto para desodorizar y refrescar la ropa de cama, las cortinas y los jugetes de felpa y limpiar con vapor toda superficie dura, resistente al calor. El Vaporizador de Vapor Avanzado de BLACK+DECKER pone la potencia del vapor en un dispositivo liviano, facilitando el mantener sus tejidos sin arrugas y el hogar con la frescura que brinda el vapor.\n\nVapor continuo de gran alcance con gatillo\nLuces indicadoras\nDiseño ligero y ergonómico\nTanque de agua removible de 220 ml\nApagado automático\nAccesorio para tapicerías Cepillo para pelusa\nAccesorio para telas delicadas', 0, 46, 'HGS200-1', '2021-02-26', 1, 4, 18),
