(161, 'a', 'IRBD203', 'PLANCHA B+D', 'La plancha de Black+Decker™ de TrueGlide™ Colors viene con golpe de vapor de 100g/minuto que elimina las arrugas más difíciles. Suela antiadherente TrueGlide™ Colors es 2 veces más durable para todos tipos de planchados. Tiene un tanque de agua transparente que es extra grande de 260ml y características Tecnología Auto-Clean™ . Características: 1200 watts, Suela antiadherente TrueGlide™ Colors, Golpe de vapor, Función de AutoClean™, Rocío fino, Vapor variable, Selector de tejidos, Tanque de agua transparente extra grande de 260ml, Talón de descanso, Mango Comfort Grip™.', 0, 16, 'IRBD203-1', '2021-04-14', 1, 4, 18),
(162, 'a', 'IRBD204', 'PLANCHA B+D', 'La plancha de Black+Decker™ de TrueGlide™ Colors viene con golpe de vapor de 100g/minuto que elimina las arrugas más difíciles. Suela antiadherente TrueGlide™ Colors es 2 veces más durable para todos tipos de planchados. Tiene un tanque de agua transparente que es extra grande de 260ml y características Tecnología Auto-Clean™ . Características: 1200 watts, Suela antiadherente TrueGlide™ Colors, Golpe de vapor, Función de AutoClean™, Rocío fino, Vapor variable, Selector de tejidos, Tanque de agua transparente extra grande de 260ml, Talón de descanso, Mango Comfort Grip™.', 10, 18, 'IRBD204-1', '2021-04-14', 1, 4, 18),
(163, 'a', 'HC306B', 'MINI PROCESADOR DE ALIMENTO', '¡Disfruta de picar o picar de forma rápida y fácil con solo tocar un botón con el interruptor de un solo toque BLACK + DECKER! Con una capacidad de 1.5 tazas, una cuchilla afilada y un control de pulso de un toque, obtendrás excelentes resultados con facilidad. Además, la tapa de la cerradura de seguridad ofrece mayor seguridad y mayor tranquilidad durante el uso. Características: Hoja Afilada, Tapa de bloqueo de seguridad, Control de botón de pulso de un toque, Capacidad de la taza de 1.5 tazas, Piezas desmontables aptas para lavavajillas, Diseño compacto, Almacenamiento de cable.', 0, 18, 'HC306B-1', '2021-04-13', 1, 4, 20),
(164, 'a', 'HC3000', 'MINI PROCESADOR DE ALIMENTO', 'La cocina casera no tiene que ser una molestia. El Picador One-Touch de BLACK + DECKER ™ FreshPrep le ahorra tiempo y energía en la cocina con el corte y la mezcla rápidos y fáciles. El motor de 175 vatios acciona la cuchilla de afilado permanente para crear rápidamente salsas, salsas, vinagretas, pan rallado y más. La cubierta del recipiente de trabajo tiene pequeños orificios para que pueda agregar aceite lentamente a las salsas y aderezos. Además, todas las piezas desmontables son aptas para lavavajillas para una limpieza simple. Características: Motor 175W, Hoja Afilada, Capacidad de 3 tazas, Agujeros de aceite, Control de pulso de un toque, Piezas desmontables aptas para lavavajillas, Diseño compacto.', 0, 0, 'HC3000-1', '2020-09-29', 1, NULL, NULL),
(165, 'a', 'FP1336', 'PROCESADOR DE ALIMENTOS B+D', 'El Procesador de Alimentos de 8 Tazas de BLACK+DECKER es un electrodoméstico útil para procesar los alimentos. Le brinda la flexibilidad de rebanar y picar así necesite mucha o poca cantidad. Las cuchillas para picar de acero inoxidable y el potente motor de 350 watts trabajan en combinación para procesar los alimentos rápidamente en el recipiente de procesamiento de 8 tazas. Características: 350 Watts de potencia, 2 velocidades + pulso, cierre de seguridad en la tapa, Guardacable, Recipiente de 8 tazas, Cuchilla para picar, Disco para Rallar/Rebanar.', 0, 50, 'FP1336-1', '2021-04-13', 1, 4, 20),
(166, 'a', 'FP1600B', 'PROCESADOR DE ALIMENTOS B+D', 'Impulsado por una potencia de 450 vatios, es ideal para cortar, picar, rebanar, etc. El tazón de trabajo con capacidad para 8 tazas de este procesador de alimentos BLACK + DECKER admite una gran cantidad de frutas y vegetales al mismo tiempo. Los botones de encendido y apagado / pulsos ubicados convenientemente en este procesador de alimentos de 8 tazas brindan una mejor comodidad operativa. Equipado con una cuchilla para picar de acero inoxidable y un disco reversible para rebanar / triturar, este procesador de alimentos BLACK + DECKER corta la verdura tan bien como desee. Construido con piezas aptas para lavavajillas, este procesador de alimentos de 8 tazas es extremadamente fácil de limpiar. Entonces, traiga a casa el BLACK + DECKER FP1600B y ahorre tiempo y esfuerzo. ', 0, 50, 'FP1600B-1', '2021-04-14', 1, 4, 20),
(167, 'a', 'HC150W', 'MINI PROCESADOR DE ALIMENTO', 'El Picador One-Touch de BLACK + DECKER ™ le da el poder de crear sus platillos favoritos y preparar fácilmente los ingredientes para recetas más grandes. El control de pulso de un toque opera la cuchilla de acero inoxidable de dos niveles para cortar y picar con facilidad. Además, todas las piezas desmontables son aptas para lavavajillas para una limpieza rápida y fácil. Características: Motor 70W, Hoja Afilada, Capacidad de 1.5 tazas, Agujeros de aceite, Control de pulso de un toque, Piezas desmontables aptas para lavavajillas, Diseño compacto.', 0, 16, 'HC150W-1', '2021-02-26', 1, 4, 20),
(168, 'a', 'FP2500', 'PROCESADOR DE ALIMENTOS B+D', '¿Qué tan poderoso es el procesador de alimentos de boca ancha Power Pro? Tan poderosos, que tuvimos que diseñar pies de ventosa especiales para trabajo pesado para mantenerlos en su lugar mientras rebana, corta, trocea, ralla y purés manzanas enteras, papas, pepinos, cebollas, bloques de queso o cualquier otro alimento integral con facilidad. Con un motor feroz de 500 vatios y toneladas de torsión que trabajan en concierto bajo su elegante y robusto exterior, esta es una maquinaria de servicio pesado que funciona tan bien como se ve. Características: Procesador de alimentos de 500 vatios, Capacidad de 10 tazas, Canaleta de alimentación de boca ancha, Botones Mylar suaves al tacto, 2 ajustes de velocidad, más pulso, Sistema de bloqueo de seguridad, Pies de ventosa de alta resistencia, Almacenamiento de cable, Piezas aptas para lavavajillas, Incluye una cuchilla para picar de acero inoxidable y un disco para cortar y triturar.', 0, 62, 'FP2500-1', '2021-02-26', 1, 4, 20),
(169, 'a', 'FP1700B', 'PROCESADOR DE ALIMENTOS B+D', 'El Procesador de Alimentos de 8 Tazas de BLACK+DECKER es un electrodoméstico útil para procesar los alimentos. Le brinda la flexibilidad de rebanar, picar, desmenuzar, rallar o hacer puré, así necesite mucha o poca cantidad. Las cuchillas para picar de acero inoxidable y el potente motor de 450 watts trabajan en combinación para procesar los alimentos rápidamente en el recipiente de procesamiento de 8 tazas. Un disco para rebanar y rallar de acero inoxidable hace aporte a su versatilidad y conveniencia. Este procesador de acero inoxidable cuenta con un tubo de alimentación con empujador que ayuda a guiar los alimentos a través del tubo con facilidad. Usted puede observar sus alimentos mientras se procesan ya que el recipiente es transparente. Con un sistema de entrecierre de seguridad, este procesador de alimentos negro tiene controles táctiles que ayudan a facilitar su funcionamiento. Su apariencia elegante realzará la decoración de su cocina. Características: 450 watts de potencia, Botón Encendido/Apagado, Botón de Pulso, Guardacable, INCLUYE: recipiente de 8 tazas; Cuchilla para picar; Disco para rallar/rebanar.', 0, 48, 'FP1700B-1', '2020-09-29', 1, NULL, NULL),
(170, 'a', 'FP4150B', 'PROCESADOR DE ALIMENTOS B+D', '¡Simplemente configúralo y ve a cortar, triturar, rebanar y más! El procesador de alimentos de 8 tazas BLACK + DECKER Easy Assembly está diseñado para su comodidad, simplemente coloque el recipiente de trabajo en la base y gire la tapa hasta que encaje en su lugar. La S-blade es perfecta para cortar y mezclar, y el disco de doble cara ofrece un fácil corte y trituración. Elija entre dos velocidades y un ajuste de pulso para alcanzar resultados óptimos para todos los tipos de alimentos. La cubeta de trabajo de 8 tazas tiene capacidad para grandes cantidades, y todas las piezas desmontables son aptas para lavavajillas, por lo que la limpieza es rápida y fácil. Características: Set & Go !Fácil montaje para resultados rápidos, Tazón de trabajo de 8 tazas, Picar, mezclar, triturar, rebanar y más!, Motor 450W, Piezas aptas para lavavajillas.', 0, 52, 'FP4150B-1', '2020-09-29', 1, NULL, NULL),
