(191, 'a', 'TR2200SBD', 'TOSTADORA DE PAN B+D', '¡Disfruta de la versatilidad de tostar con solo tocar un botón! Tueste todo tipo de panes, gofres y pasteles, directamente del congelador, con controles fáciles de usar. Seleccione el modo de panecillo o el modo congelado para trabajos especiales, y configure el selector de color entre 1-7 para obtener tostadas a su gusto. Características: Tres funciones: disfrute de resultados de tostado ideales con el toque de un botón para panecillos y productos congelados. Utilice el botón Cancelar para finalizar el tostado en cualquier momento. Selector de sombra: elija entre siete tonos tostados con un simple botón. Ranuras extra anchas: ajusta bagels y panes artesanales grandes con facilidad. Levantamiento adicional: la palanca de levantamiento alto pone la tostada al alcance de la mano para facilitar su extracción. Guías autocentrantes: las guías se ajustan a cualquier ancho, manteniendo el pan en la posición perfecta para tostar.', 0, 34, 'TR2200SBD-1', '2021-02-26', 1, 4, 15),
(192, 'a', 'G49TD', 'WAFLERA 3 EN 1 B+D', 'Cocinar el desayuno y almuerzo para su familia es conveniente con el diseño 3 en 1. Comience preparando waffles, luego invierta las placas de cocción y doble hacia atrás la parte superior con bisagra para abrirla en posición plana con 2 placas de plancha que le permiten cocinar huevos y tocino. Cocinar es fácil con las canales de grasa que drenan los residuos de grasa de los alimentos. Para el almuerzo, prepare sándwiches tostados para satisfacer cualquier apetito. Características: 2 Parrillas de Cocción reversibles, Superficie antiadherente, Control para ajustar la temperatura, Luz de encendido, Asa fría al contacto, 4 pies de soporte.', 0, 64, 'G49TD-1', '2021-02-26', 1, 4, 21),
(193, 'a', 'WMB505', 'WAFLERA B+D', 'El desayuno es mejor con esta máquina para hacer waffles estilo belga de acero inoxidable. Las rejillas antiadherentes y extra profundas hacen waffles esponjosos con espacio suficiente para todos sus ingredientes favoritos. Además, las placas antiadherentes son fáciles de limpiar y son perfectas para hacer una variedad de alimentos: ¡pruebe papitas fritas, sándwiches a la parrilla, brownies, roles de canela y más! El versátil fabricante de waffles belgas BLACK + DECKER ™ te permite crear nuevas golosinas y descubrir favoritos clásicos. \n\nCaracterísticas: Las rejillas de cocción antiadherentes se limpian rápidamente, Rejillas de waffle antiadherentes con rejillas extra profundas, Luz indicadora de listo, Base de almacenamiento vertical, Envoltura de cable conveniente.', 0, 36, 'WMB505-1', '2021-02-26', 1, 4, 21),
(194, 'a', 'WM1240MB', 'WAFLERA B+D', '¡Hacer el desayuno delicioso! Las rejillas extra profundas crean gofres belgas grandes y esponjosos que contienen un montón de almíbar y todos tus ingredientes favoritos. Las placas de waffle antiadherentes forman un waffle grande o el divisor divide los waffles en 4 secciones rectangulares para compartir de manera fácil y conveniente. Su soporte vertical y su envoltura de cable permiten un almacenamiento fácil y conveniente al guardar. Características: Hace 4 waffles belgas, Luz indicadora de listo, Luz indicadora de poder, Base de almacenamiento vertical, Asas frías al tacto, Garantía limitada de 2 años.', 0, 42, 'WM1240MB-1', '2021-02-26', 1, 4, 21),
(195, 'a', 'WM2000SD', 'WAFLERA B+D', '¡Haga todos los clásicos del desayuno con la estación de comidas matutinas 3 en 1 BLACK + DECKER! El diseño compacto incluye placas de cocina intercambiables para funcionar como Waffle Maker, Grill o Sandwich Maker. Todas las placas son antiadherentes y aptas para lavavajillas para una fácil limpieza, e incluyen canales de salida de grasa para una rápida eliminación de la grasa. El indicador de temperatura le permite saber cuándo están precalentadas las placas, y las asas frías al tacto facilitan la apertura y el cierre del aparato durante la cocción. Características: Diseño compacto 3 en 1, Placas intercambiables para Waffle Maker, Grill, y Sandwich Maker, Canales de salida de grasa, Placas antiadherentes + aptas para lavavajillas para una fácil limpieza, Acentos de acero inoxidable.', 0, 44, 'WM2000SD-1', '2021-02-26', 1, 4, 21),
(196, 'a', 'CJ631', 'EXPRIMIDOR DE JUGO B+D', '¡Dos conos giran en ambas direcciones para exprimir cada gota de jugo de la fruta! El cono pequeño exprime más jugo de frutas pequeñas como naranjas, limones y limas, mientras que el cono grande es perfecto para la toronja. El control de pulpa ajustable le permite obtener la cantidad de pulpa que desea y el almacenamiento de cable incorporado mantiene el cable limpio y fuera del camino. ¡Todas las piezas son aptas para lavavajillas para una limpieza rápida y fácil! Características: Recipiente de jugo de vista clara, Mediciones fáciles de leer, Caño de fácil vertido, Cubierta de almacenamiento, Almacenamiento de cable, 2 conos de auto-inversión, Control de pulpa ajustable.', 0, 22, 'CJ631-1', '2021-04-14', 1, 4, 14),
(197, 'a', 'CJ650W', 'EXPRIMIDOR DE JUGO B+D', '¡El jugo recién exprimido está a solo una vuelta! El BLACK + DECKER 32 onzas. Citrus Juicer cuenta con un cono de doble propósito y auto reversible que asegura la máxima extracción de jugo de cítricos grandes y pequeños. El jugo fluye hacia la jarra de fácil vertido, que incluye marcas de medición para un uso preciso en recetas y bebidas mixtas. Además, todas las piezas desmontables se pueden lavar en el lavavajillas para una fácil limpieza. Características: Exprimidor eléctrico activado por presión, 32 onzas Capacidad: la jarra de gran capacidad contiene hasta un cuarto de galón de jugo. Conos de zumos con inversión automática: el cono con inversión automática garantiza que usted obtenga la mayor cantidad de jugo al cambiar de dirección con cada pulsación. Control de pulpa ajustable: una simple palanca de pulpa te permite crear el estilo de jugo que prefieras. Piezas aptas para lavavajillas: todas las piezas desmontables son aptas para lavavajillas para una fácil limpieza.', 10, 19, 'CJ650W-1', '2021-02-26', 1, 4, 14),
(198, 'a', 'JE2400BD', 'EXPRIMIDOR  DE JUGO B+D', 'El extractor de jugos de 400 vatios BLACK + DECKER hace que sea fácil convertir todas sus frutas y verduras favoritas en un jugo delicioso y sin pulpa. El potente motor de 400 vatios funciona rápidamente a través de los productos, separando el jugo fresco de la pulpa, que se recoge en un recipiente separado. Con controles intuitivos y piezas aptas para el lavavajillas, ¡es la manera rápida y fácil de disfrutar de un jugo fresco y sabroso! Características: Potente motor de 400W, 28 oz grande Capacidad de contenedor de pulpa integrada, Hojas de acero inoxidable y colador, Mecanismo de bloqueo de doble seguridad, Elegante diseño vertical que ahorra espacio, Pies antideslizantes, Almacenamiento de cable, Piezas aptas para lavavajillas, Garantía limitada de 2 años.', 10, 41, 'JE2400BD-1', '2021-02-26', 1, 4, 14),
(199, 'a', 'JMBD3181', 'EXPRIMIDOR DE JUGO B+D', 'El extractor de jugos de 500 vatios BLACK + DECKER hace que sea fácil convertir todas sus frutas y verduras favoritas en un jugo delicioso y sin pulpa. El potente motor de 500 vatios funciona rápidamente a través de los productos, separando el jugo fresco de la pulpa, que se recoge en un recipiente separado. Con controles intuitivos y piezas aptas para el lavavajillas, ¡es la manera rápida y fácil de disfrutar de un jugo fresco y sabroso! Características: 500 watts, 2 velocidades, Jarra de jugo, Cuchilla de acero inoxidable, Filtro de pulpa de acero inoxidable, Separador para pulpa de capacidad extra grande, Cierre de seguridad, Guardacable.', 0, 59, 'JMBD3181-1', '2021-02-26', 1, 4, 14),
(200, 'a', 'DCM18S', 'CAFETERA PERSONAL GRIS B+D', '¡La cafetera profesional Brew n Go ™ BLACK + DECKER ™ es ideal para un estilo de vida activo y en movimiento! Su café se elabora directamente en 15 onzas. Taza térmica de acero inoxidable que se adapta a la mayoría de portavasos de automóviles. El filtro permanente de posos es compatible con posos de café y vainas blandas preenvasadas, y es fácil de enjuagar en el fregadero. La operación de un solo toque entrega rápidamente el café de la mañana que necesita, con un diseño compacto que es perfecto para cocinas pequeñas, apartamentos y dormitorios. Características: Cafetera Personal, 15 onzas Taza de viaje de acero inoxidable incluida, Filtro permanente, Apagado automático, Diseño de ahorro de espacio', 0, 26, 'DCM18S-1', '2021-04-13', 1, 4, 13),
(201, 'a', 'BL1350DPP', 'LICUADORA DE MEZCLA', 'Infunde tus sabores favoritos! El filtro de infusión se adhiere al interior del frasco mezclador de 6 tazas, lo que facilita agregar un impulso de sabor saludable y rico en nutrientes a su agua. El infusor es el complemento perfecto para esta licuadora 3 en 1 premium, que utiliza 900 W de potencia * para pulverizar hielo y otros ingredientes duros para crear deliciosos batidos, batidos y más. El QuadPro lámina trabaja con el 6-cup libre de BPA Tritan jarra de la licuadora y el 18-oz Tritan sin BPAlicuadora, y es lo suficientemente versátil como para crear bebidas heladas, sopas, purés e incluso migas (pan, galletas o cereales) para usar en otras recetas. Use los controles intuitivos para tres velocidades, tres programas y una función de pulso para encontrar la consistencia perfecta. Luego, disfrute de un vertido fácil y sin derrames con la boquilla de vertido con cierre y con bisagra en la tapa de doble apertura. Además, la limpieza es fácil con piezas aptas para lavavajillas.', 0, 0, 'BL1350DPP-1', '2020-09-29', 1, NULL, NULL),
(202, 'a', 'MX600W', 'BATIDORA HELIX PERFORMANCE', 'Novedad de BLACK + DECKER! El diseño avanzado de hélice mejora el rendimiento de mezcla al maximizar la superposición del batidor y mezclar ingredientes en múltiples direcciones. El mezclador de mano BLACK + DECKER Helix Performance Premium presenta batidores de nylon reforzado con 2 veces el área de superficie y 2 veces el rendimiento de mezcla. El motor de 250 vatios funciona a cinco velocidades, incluida una velocidad de arranque más controlada para ayudar a evitar salpicaduras. Además, un turbo boost especial agrega un aumento de potencia en cada velocidad de mezcla para combinar ingredientes espesos en poco tiempo. Este conjunto incluye dos batidores helicoidales, dos ganchos para masa y un batidor de alambre, lo que le permite crear rápidamente masas para pasteles y galletas, masas de pan, untables y salsas, crema batida casera, claras de huevo batidas para un sabroso merengue y muchas más recetas deliciosas. Todos los accesorios se almacenan convenientemente en el estuche de almacenamiento de diseño inteligente, que usa el mezclador en sí como la tapa a presión. La limpieza es muy sencilla con el botón de expulsión automática que desconecta rápidamente las herramientas de mezcla aptas para lavavajillas. Además, puede evitar aún más problemas con el talón y el tazón de descanso, lo que permite que la batidora se coloque verticalmente en el borde del tazón.', 0, 38, 'MX600W-1', '2021-02-26', 1, 4, 12),
(203, 'a', 'JE2200B', 'EXPRIMIDOR DE JUGO B+D', 'Consumidores preocupados por la salud y el presupuesto: ¡es hora de un nuevo comienzo! BLACK + DECKER presenta este potente extractor de jugos de 400 vatios que hará un trabajo rápido de sus frutas y verduras frescas favoritas, desde manzanas y naranjas hasta zanahorias y tomates, sin poner el apretón en su billetera. Con un colador de alta calidad y cuchillas de acero inoxidable, la pulpa se separa mientras que nada más que jugo natural y nutritivo se cuela sin esfuerzo en la jarra de 300 ml a continuación. ¡Las piezas aptas para lavavajillas hacen que la limpieza sea muy fácil! Más tiempo para disfrutar de los frutos de (muy) poco trabajo.', 0, 38, 'JE2200B-1', '2021-02-26', 1, 4, 14),
(204, 'a', 'TO3280SSD', 'HORNO DE CONVECCIÓN DIGITAL', 'La cocina casera se ha vuelto más fácil con el horno de encimera digital BLACK + DECKER Dining-In ™. Con un gran interior y tiempos de cocción un 20% más rápidos *, las siete funciones de cocción dedicadas perfeccionan rápidamente todo, desde pizzas de 12 \"hasta restos recalentados. Los controles digitales intuitivos facilitan la configuración de la hora, la temperatura y la función de cocción, y el temporizador de 120 minutos cuenta con la función de encendido y apagado automático. Además, la puerta de vidrio de fácil vista le permite controlar sus alimentos durante todo el proceso de cocción.', 0, 112, 'TO3280SSD-1', '2020-09-29', 1, NULL, NULL),
(205, 'a', 'PBJ2000', 'JARRA LICUADORA PERSONAL', 'Este conjunto de jarras de licuadora de 20 oz es compatible con las bases de mezcla FusionBlade ™ personales y de tamaño completo. También se incluye la base FusionBlade ™ que tritura fácilmente el hielo en la nieve y hace puré los alimentos de manera rápida y uniforme. Los frascos vienen con tapas de viaje que son perfectas para llevar, lo que lo convierte en una excelente adición para crear bebidas personalizadas.', 0, 14, 'PBJ2000-1', '2021-04-13', 1, 4, 10),
(206, 'a', 'TO1745SSG', 'HORNO DE CONVENCCIÓN NATURAL', 'Pruebe la diferencia que incluso la calefacción puede hacer con el horno tostador de convección natural BLACK + DECKER ™. El interior fue diseñado utilizando los principios de la termodinámica, haciendo circular el flujo de aire de manera eficiente para proporcionar un calentamiento más uniforme * y resultados rápidos. La cocción en la encimera es simple usando el temporizador de 30 minutos y cuatro funciones de cocción: hornear, asar, tostar y mantener caliente. Además, el horno tostador es perfecto para preparar sus refrigerios congelados favoritos: nuggets de pollo, palitos de mozzarella, rollitos de huevo o cualquier otra cosa que desee.', 0, 48, 'TO1745SSG-1', '2020-09-29', 1, NULL, NULL);
INSERT INTO `producto` (`id_producto`, `estatus`, `codigo`, `nombre`, `descripcion`, `cantidad`, `precio`, `foto_prin`, `fecha_registro`, `id_departamento1`, `id_departamento2`, `id_departamento3`) VALUES
(207, 'a', 'SCD4007', 'OLLA DE COCCIÒN LENTA DIGITAL', 'Cree deliciosas comidas que se ajusten a su horario con la olla de cocción lenta portátil BLACK + DECKER ™ con envoltura de pizarra completa. Simplemente reúna los ingredientes en la olla de gres de 7 cuartos, luego use los controles digitales para establecer el tiempo y el calor perfectos (bajo, alto, cálido). La unidad cambia automáticamente al modo \"Cálido\" cuando se completa la cocción, por lo que tendrá una comida deliciosa justo cuando la necesite. ¡Y puedes llevarlo a cualquier parte! La tapa con seguro y las manijas grandes aseguran un transporte sin problemas desde el hogar a la oficina, el portón trasero o la reunión familiar. La limpieza es fácil con la olla de gres apta para lavavajillas y la tapa de vidrio templado. Además, el exterior es una superficie de pizarra que le permite ser creativo: etiquételo para cenas compartidas con información sobre alergias, escriba recetas para preparar comidas fácilmente o dibuje un diseño divertido para animar su cocina.', 0, 76, 'SCD4007-1', '2021-04-13', 1, 4, 17),
(208, 'a', 'TO1313SBD', 'HORNO TOSTADOR', 'Tecnología EvenToast: El interior del horno tostador está especialmente diseñado para tostar hasta 4 rebanadas de pan a la vez.\r\nPorciones de pizza de 9 pulgadas, 4 rebanadas de pan. El horno tostador compacto encaja perfectamente en el mostrador, mientras que el interior curvado permite espacio para porciones de pizza de 9 pulgadas y 4 rebanadas de pan.\r\nCuatro funciones: Las funciones de cocción del horno tostador de acero inoxidable incluyen: hornear, asar, tostar y mantener la comida caliente.\r\nTemporizador de 30 minutos: El temporizador cuenta con ajustes de tostado precisos y la función de mantenimiento de temperatura.\r\nBandeja para migas desmontable: Se puede mantener el horno tostador limpio con la práctica bandeja para migas desmontable.', 0, 46, 'TO1313SBD-1', '2020-09-29', 1, NULL, NULL),
(209, 'a', 'CM2020B', 'CAFETERA PROGRAMABLE', 'Tome el control de su mañana con la cafetera programable BLACK + DECKER de 12 tazas * y personalice su preparación! Elija café regular o fuerte con el selector de potencia de preparación, y use la opción de preparación de 1-4 tazas * para preparar una preparación de café más pequeña sin renunciar al sabor de llenar toda la jarra. ¡Viva las mañanas ocupadas con la programación Quick Touch ™ y mantenga su café fresco y caliente durante todo el día con la pantalla Time Since Brewed y Keep Hot Garrafe Plate', 0, 46, 'CM2020B-1', '2021-04-14', 1, 4, 13),
(210, 'a', 'CM0755BZ', 'CAFETERA 4 EN 1', 'Elige tu cerveza! Esta cafetera 4 en 1 se prepara en una taza estándar, una taza de viaje alta, una jarra para servir de 5 tazas *, y funciona para verter sobre el café. El soporte ajustable permite la versatilidad de preparación, y la exclusiva canasta extraíble le permite controlar la fuerza de su café al verterlo en una taza o jarra. La jarra mejorada está diseñada para un manejo cómodo y un vertido sin goteo, y la tapa es extraíble para facilitar la limpieza. Además, obtienes una taza de café Tritan ™ de doble pared que mantiene el café a la temperatura perfecta para beber.', 0, 32, 'CM0755BZ-1', '2021-04-13', 1, 4, 13),
(211, 'a', 'TO1675B', 'HORNO TOSTADOR', 'Comience a cocinar de manera rápida y uniforme con el horno tostador de convección BLACK + DECKER. Este gran horno tostador de convección tiene la capacidad de cocinar pizzas enteras de 9 pulgadas con facilidad. Con la ayuda de su temporizador de 60 minutos, puede hornear, asar, tostar y mantener las funciones calientes en el horno tostador. El conjunto incluye una rejilla del horno, una bandeja para hornear y una asadera para cocinar varios platos simultáneamente. También cuenta con una puerta de vidrio de fácil visualización para revisar sus platos de vez en cuando. El mantenimiento es fácil.\r\nHorno de encimera de 6 rebanadas con ajuste de pizza de 9 \"\r\nConvección, hornear, asar, tostar y mantener calientes las funciones\r\nTemporizador de 60 minutos\r\nRejilla del horno\r\nHornear pan\r\nAsadera\r\nPuerta de vidrio de fácil vista.\r\n', 0, 68, 'TO1675B-1', '2021-02-26', 1, 4, 15),
(212, 'a', 'TO4315SSQ', 'HORNO TOSTADOR', 'Presentamos la tecnología Air Fry, nueva en el horno tostador Crisp \'N Bake Air Fry con asador BLACK + DECKER. ¡Este es un sabor frito sin grasa! La tecnología Air Fry utiliza aire caliente de alta intensidad para hornear, dorar y hacer crujientes sus comidas fritas favoritas con poco o ningún aceite. ¡Pruebe papas fritas, papas fritas vegetarianas, filetes de pescado empanados, refrigerios congelados y mucho más! Además, ¡este horno tostador tiene una función de asador! Simplemente ensarte la comida en el asador y ajuste el dial a Rotisserie para obtener resultados de cocción uniformes y jugosos en pollo y otros cortes de carne. Hay espacio para hasta seis rebanadas de pan o una pizza de 12 \". Cuatro perillas de control hacen que sea fácil configurar el temporizador de tostadas y el temporizador de 60 minutos, y elegir entre seis funciones de cocción: hornear, asar, tostar, mantener caliente, asador y alevines de aire. La tecnología de convección hace circular el aire dentro del horno para obtener resultados rápidos e incluso cuando se fríe con aire. Además, este horno tostador incluye una canasta de freír con aire, una bandeja para hornear / asar y una rejilla, y una bandeja de migas externa que se desliza hacia adentro y hacia afuera para facilitar la limpieza.', 0, 120, 'TO4315SSQ-1', '2020-09-29', 1, NULL, NULL),
(213, 'a', 'CM0941B', 'CAFETERA B+D', 'La forma más fácil de calentar café, Esta cafetera de 12 tazas* prepara rápidamente tu café favorito con sólo tocar un botón. También cuenta con otras funciones muy útiles como tecnología Sneak-A-Cup, jarra de virio Duralife de 12 tazas y filtro permanente lavable.\r\n\r\nLuz indicadora de encendido y apagado\r\nJarra de vidrio Duralife™\r\nCapacidad de 12 tazas\r\nTecnología Sneak-a-Cup™\r\nPlaca calefactora antiadherente\r\nApto para lavaplatos\r\nGuardacable', 5, 26, 'CM0941B-1', '2021-04-13', 1, 4, 13),
(214, 'a', 'CM0941W', 'CAFETERA 12 TAZAS', 'La forma más fácil de calentar café, Esta cafetera de 12 tazas* prepara rápidamente tu café favorito con sólo tocar un botón. También cuenta con otras funciones muy útiles como tecnología Sneak-A-Cup, jarra de virio Duralife de 12 tazas y filtro permanente lavable.\r\n\r\nLuz indicadora de encendido y apagado\r\nJarra de vidrio Duralife™\r\nCapacidad de 12 tazas\r\nTecnología Sneak-a-Cup™\r\nPlaca calefactora antiadherente\r\nApto para lavaplatos\r\nGuardacable', 0, 25, 'CM0941W-1', '2021-02-25', 1, 4, 13),
(215, 'a', 'CMU4010', 'PRECOLADORA DE CAFE', 'Prepare su café para sus compañeros o visitantes diario rápidamente con la Percoladora de Café de 40 Tazas de BLACK+DECKER. Mantiene el café caliente automáticamente y cuela el café a la velocidad de 1 taza por minuto.\r\n\r\nCuela el café a la velocidad de 1 taza por minuto\r\nMantiene el café caliente automáticamente\r\nFiltro de café\r\nAsas frías al tacto\r\nMarcas del nivel de agua\r\nLlave\r\nLuz indicadora', 0, 50, 'CMU4010-1', '2021-04-13', 1, 4, 13),
(216, 'a', 'HC300B', 'PROCESADOR DE ALIMENTOS', 'El Picador de Un Toque de BLACK+DECKER le brinda el poder de crear sus platos acompañantes y preparar los ingredientes fácilmente para recetas más grandes. El control de pulso de un toque opera la cuchilla de dos niveles de acero inoxidable para picar con facilidad. Además, todas las piezas removibles son aptas para lavavajillas para una limpieza rápida y fácil.\r\n\r\nCapacidad de 3 tazas\r\n175 watts de potencia\r\nControl de pulso de un solo toque\r\nOrificios de aceite\r\nCuchilla para picar de acero inoxidable\r\nPartes aptas para lavavajillas', 10, 28, 'HC300B-1', '2021-04-13', 1, 4, 20),
(217, 'a', 'CMU6000', 'PRECOLADORA DE CAFÉ', 'Prepare su café para sus compañeros o visitantes diario rápidamente con la Percoladora de Café de 60 Tazas de BLACK+DECKER. Mantiene el café caliente automáticamente y cuela el café a la velocidad de 1 taza por minuto.\r\n\r\nCuela el café a la velocidad de 1 taza por minuto\r\nMantiene el café caliente automáticamente\r\nFiltro de café\r\nAsas frías al tacto\r\nMarcas del nivel de agua\r\nLlave\r\nLuz indicadora', 0, 92, 'CMU6000-1', '2021-04-13', 1, 4, 13),
(218, 'a', 'CMU1000', 'PRECOLADORA DE CAFÉ 100 TASAS', 'Prepare su café para sus compañeros o visitantes diario rápidamente con la Percoladora de Café de 100 Tazas de BLACK+DECKER. Mantiene el café caliente automáticamente y cuela el café a la velocidad de 1 taza por minuto.', 0, 94, 'CMU1000-1', '2021-04-13', 1, 4, 13),
(219, 'a', 'FP4200B', 'PROCESADORA DE ALIMENTOS', 'Motor potente de 450 watts\r\n2 velocidades más funciones de pulso\r\nRecipiente con capacidad de 8 tazas\r\nSistema de entrecierre de seguridad mejorado\r\nControles táctiles fáciles de limpiar\r\nPies de succión antideslizantes\r\nPiezas aptas para máquina lavaplatos\r\nACCESSORIES:Disco para desmenuzar y rebanar reversible y Cuchilla S de acero inoxidable', 0, 0, 'FP4200B-1', '2020-09-29', 1, NULL, NULL),
(220, 'a', 'CM0755WG', 'ESTACIÓN DE CAFÉ 4 EN 1', 'Escoja su forma de preparar café! Esta cafetera 4 en 1 cuela dentro de una taza normal, una taza de viaje, una jarra de 5 tazas* y funciona para preparar café filtrado a mano. El soporte ajustable brinda versatilidad en la preparación y la cesta de preparación removible, única, le permite controlar la intensidad de su café cuando prepara café filtrado a mano dentro de una taza o jarra. La jarra mejorada es diseñada para ser manejada comódamente y verter sin goteo, y la tapa es removible para facilitar la limpieza. Además, cuenta con una taza de viaje de 14 onzas para llevar su café en el camino.', 0, 34, 'CM0755WG-1', '2021-04-13', 1, 4, 13),
(221, 'a', 'D2400', 'SECADOR DE CABELLO', 'Este pequeño secador de viaje es el compañero ideal para lucir un cabello estupendo allá donde vayas. Su manejo es sencillo, cuenta con dos velocidades y gracias a su ingenioso mango plegable lo podrás guardar fácilmente cuando hayas acabado.', 10, 20, 'D2400-1', '2021-05-13', 65, 66, 69),
(222, 'a', 'D3190', 'SECADOR DE CABELLO IONICO', 'El secador de pelo morado de Remington Damage Control 1875 W, tiene tres posiciones de calor, dos ajustes de velocidad y una aire frío. Los micro acondicionadores ayudan a prevenir daños por calor y a aumentar el brillo de tu cabello. La tecnología Iónica ayuda a curar el cabello dañado mientras que reduce la estática y el encrespamiento. La tecnología de cerámica evita daños en el cabello mientras que permite un tiempo de secado rápido.\r\nLos micro acondicionadores ayudan a prevenir daños por calor y a aumentar el brillo de su cabello C\r\nTecnología de cerámica para prevenir daños en el cabello mientras que permite un tiempo de secado más rápido C\r\n1875 vatios C\r\n3 posiciones de calor C\r\n2 ajustes de velocidad C\r\nAire frío C', 0, 34, 'D3190-1', '2021-04-07', 65, 66, 69),
(223, 'a', 'S4A500', 'ALISADORA DE CABELLO', 'Sus placas recubiertas de cerámica con microacondicionadres de coco logran un cabello estilizado, protegido y brillante. Sus 8 diferentes ajustes de termperatura permiten seleccionar la que más se adecúa a tu tipo de cabello evitando causar daños en él.', 0, 0, 'S4A500-1', '2021-04-07', 65, 66, 68),
(224, 'a', 'S5505', 'ALISADORA DE CABELLO ULTRA', 'Cerámica avanzada Revestimiento ultra: ahora un 75% más suave. Visor digital de 150º C a 230º C. Función de bloqueo de temperatura. Función de temperatura turbo. Calentamiento rápido en 15 segundos. Placas estrechas extralargas de 110 mm. Placa flotante que presiona uniformemente al alisar. Dispositivo de cierre para guardar. Voltaje universal. Apagado automático de seguridad después de 60 minutos. Cable giratorio. Bolsa resistente al calor.', 0, 52, 'S5505-1', '2020-09-29', 1, NULL, NULL),
(225, 'a', 'S12A', 'PLANCHA DE CABELLO', 'Consiente tu cabello con esta plancha alisadora Remington. Sus placas de cerámica avanzada con micro acondicionadores de aguacate y macadamia son la combinación perfecta para lucir un cabello con brillo y sin frizz, 88% más suave* y 94% más sedoso*. Cuenta con placas flotantes de 110mm para un contacto permanente con el cabello, lista para usarcé en 30 segundos, cable giratorio de 2 metros, temperatura máxima de 230°C (450 °F), control de temperatura digital, bloqueo de placas para mejor almacenamiento, apagado automático. Ideal para cabello seco y sin brillo.\r\n\r\nPlacas de ceramica recubiertas con aguacate y macadamia\r\nPlacas flotantes para un contacto permanente\r\nControl de temperatura digital\r\nPlancas extralargas de 110mm\r\nTemperatura profesional de 230°C', 2, 43, 'S12A-1', '2021-04-07', 65, 66, 68),
(226, 'a', 'S7901P', 'PLANCHA DE CABELLO', 'Plancha Alisadora REMINGTON REM-S7901P Control Digital Morada\r\n\r\nAlisador que alisa tanto en cabellos secos o mojados evaporando los excesos de agua y dejando el cabello hidratado y con mas brillo.\r\n\r\nControl Digital LCD con regulador de temperatura y selector para pelo mojado o seco.\r\n\r\nCerámica: Genera uniformidad.\r\n\r\nSMOOTH TECHNOLOGY: Antiadherente.\r\n\r\nNiveles de temperatura: ( 1 a 30 ) 230°C.', 10, 45, 'S7901P-1', '2021-05-05', 65, 66, 68),
(227, 'a', 'S8599', 'ALISADORA DE CABELLO', 'Alisadora de Keratina y Aceite de Argán\r\n \r\nDónde Comprar\r\n\r\n¡Es hora de que tu cabello se vea mejor que nunca!\r\nRemington introduce la nueva línea Keratin Therapy con infusion de aceite de Argán Marroquí y elementeos esenciales que deben estar presentes en el cuidado de tu cabello. \r\n\r\n¿Qué es la tecnología de Keratina y Aceite de Argán?\r\n\r\nLa Keratina es una proteína natural vital para un cabello fuerte y saludable. El Aceite de Argán es conocido por nutrir el cabello desde el interior, dándole instantáneamente un brillo notorio. juntos, los resultados son un cabello fuerte, hidratado más protegido y sin ningún residuo graso. ', 0, 42, 'S8599-1', '2021-04-07', 65, 66, 68),
(228, 'a', 'NE3250', 'CORTADOR DE DETALLES', 'Mantén todos los detalles bajo control con la recortadora de vello facial, ideal para nariz, orejas y detalles de Remington.\n\nLa recortadora de vello de nariz y oídos de Remington es uno de los juegos de peluquería con los que lograrás el aseo que quieres en menos tiempo.\n\nEs resistente al agua y cuenta con batería, por lo que puedes usarla dentro y fuera de la ducha. Opera con tecnología ComfortTrim que utiliza navajas bidireccionales que remueven el vello indeseable sin tirones, y además cuenta con cubierta hipoalergénica antibacterial que se puede lavar fácilmente bajo la ducha.\n\nDispone de un cortador vertical con el que podrás acceder más fácilmente a los vellos de la nariz y las orejas y recortar con precisión la barba corta o las cejas para darles forma. El cortador de precisión es un accesorio que te permite retocar las patillas y la barba para perfilarlas mejor.\n\nAdemás, cuenta con un cabezal rotativo que remueve los vellos de la nariz y oídos.\n\nNano Silver: revestimiento antibacterial, corte mas higiénico.\nCuchillas Autoafilables.\nTecnología ComfortTrim sin rasguños y cortes.', 9, 14, 'NE3250-1', '2021-06-15', 65, 66, 67),
(229, 'a', 'TLG100', 'KIT DE VIAJE', 'Cuida de tu estilo donde quiera que vayas con el Travel Grooming Kit de Remington. Es uno de los juegos de peluquería más práctico ya que cuenta con todas las herramientas necesarias para responder a todas tus necesidades de cuidado personal en cualquier momento y en cualquier lugar.\n\nEste kit de 12 piezas es un completo juego de peluquería perfecto para viajar que cubre todas sus necesidades de corte: Pinzas, Tijeras, Cortauñas, Cortador para detalles, Mango del cortador, Cortador para nariz y oídos, Peines pequeños 4 longitudes, Cepillo de dientes, Lima, Botella de aceite, Cepillo para limpiar, Peine para bigote, Peine para el cabello.\n\nOperado por Baterías\nAcero Quirúrgico autoafilables\nIncluye 12 piezas: Guía de Peine ajustable, Cortadora de barba, Recortadora de hoja, Detalladora para Nariz y oidos, Peine, Tijeras, Pinzas, Cortador de uñas, Aceite lubricante\nCaja de almacenamiento\nPeines intercambiables Lavables\nPeine para barba', 10, 21, 'TLG100-1', '2021-06-09', 65, 66, 67),
(230, 'a', 'PG181', 'KIT DE CORTE 5 EN 1', 'Para recortar, detallar y rasurar. Crea tu propio look de forma fácil y rápida. Este compacto modelo, con cuchillas de acero avanzado y que funciona con pilas, consta de 5 cabezales versátiles para conseguir el mejor look y cubrir todas tus necesidades de afeitado y corte en la zona facial. Además sus accesorios son lavables y utiliza baterías 2AA.', 0, 16, 'PG181-1', '2021-04-07', 65, 66, 67),
(231, 'a', 'R95', 'AFEITADORA DUAL', 'Tanto si te desplazas por todo el mundo como si preparas la bolsa para el gimnasio, la afeitadora de viaje R95 será tu acompañante ideal. Tarda la mitad de tiempo en cargar* y tiene un diseño ligero y compacto que quedará tan bien en el neceser como en la estantería del baño.\r\n\r\nLa afeitadora de viaje R95 incorpora tecnología puntera y resulta agradable tanto a la vista como en la piel. Gracias a sus dos cabezales flotantes independientes y al diseño ergonómico llega fácilmente a todas las zonas del rostro de forma fácil y precisa.\r\n\r\nLa afeitadora R95 es un aparato de viaje de alto rendimiento que puede usarse en redes eléctricas de todo el mundo y tiene una autonomía de 30 minutos (suficiente para diez afeitados), por lo que es el compañero de viaje ideal de quienes necesitan mantener un aspecto bien aseado allí donde vayan.', 10, 25, 'R95-1', '2021-04-07', 65, 66, 67),
(232, 'a', 'PR1335', 'AFEITADORA REMINTONG', 'Descubra lo que hace un afeitado excelente con la afeitadora rotativa serie REMINGTON R3000. Los cabezales PrecisionPlus capturan pelos largos y rastrojos cortos, y las cuchillas Twintrack permanecen en contacto cercano con la piel para ayudar a prevenir la irritación y brindar una experiencia de afeitado rápida. Obtiene dos excelentes estilos de una afeitadora con el accesorio de rastrojo incluido. Se ajusta al cabezal de la afeitadora y crea un rastrojo que mejorará su aspecto. El aditivo antimicrobiano especial ayuda a inhibir el crecimiento de bacterias para un afeitado limpio. Y obtienes la conveniencia de la tecnología inalámbrica con la batería recargable, válida hasta 40 minutos de tiempo de ejecución con cada carga completa. * vs. Norelco Series 1000 ** Más que el modelo anterior de Remington', 12, 56, 'PR1335-1', '2021-06-07', 65, 66, 67),
(233, 'a', 'HC1080', 'CORTADORA DE CABELLO', 'Cortadora de Cabello Cromada, corte 100% lineal- las hojas tienen un movimiento perfectamente lineal para cortes precisos. Potente motor corta todo tipo de cabello. Cuchillas de acero inoxidable de alta calidad para conseguir un corte perfecto. Cuchillas autoafilables se mantienen siempre con el filo necesario, no necesitan mantenimiento. 6 ´peines de corte-longitudes de 3mm a 12mm. Palanca de ajuste. Agarre antideslizante. Uso con cable. Incluye caja de almacenamiento. (110) F.', 11, 16, 'HC1080-1', '2021-04-17', 65, 66, 67),
(268, 'a', 'AC9140', 'SECADOR PROLUXE', 'Consigue un secado digno de la mejor peluquería durante las 24 horas con el secador PROluxe y disfruta de una libertad sin encrespamientos y de resultados increí­blemente suaves.\n\nCon la tecnologí­a inteligente OPTIHeat y la exclusiva ráfaga de peinado perfecto el secador PROluxe puede moldear, dar forma y fijar el peinado. El concentrador tiene una forma especialmente diseñada que potencia el caudal de aire y mejora la distribución del calor, para que consigas resultados de peluquería.\n\n\n\n*Potente secador de 2400 W, con un resistente motor de corriente alterna (AC) de calidad profesional.\n\n*Un 90 % más de iones para un cabello brillante y sin encrespamiento.\n\n*La tecnologí­a inteligente OPTIHeat aporta calor allá donde se necesita.\n\n*El modo de ráfaga de peinado perfecto Pro+ fija el peinado durante 24 horas.\n\n\n\n', 0, 50, 'AC9140-1', '2021-04-07', 65, 66, 69),
(269, 'a', 'BCM1410-FD', 'CAFETERA B+D', 'Cafetera 12 tazas con duralife jarra de vidrio\nBotones de control; visualización LCD; Reloj y temporizador programable\nPreparación automática; Función de pausa y apagado automático para mantener caliente\nCesta de filtro extraíble\nVentana de fácil vista que indica niveles de agua \nMide aproximadamente 11x9x13.5 pulgadas', 1, 39, 'BCM1410-FD-1', '2021-04-13', 1, 4, 13),
