(276, 'a', 'BFBO9W', 'VENTILADOR DE MESA B+D', 'Este ventilador de caja sin marco BLACK + DECKER es el complemento perfecto en cualquier lugar de la casa donde sea necesario aumentar el flujo de aire. Tiene tres velocidades para controlar el giro de la duradera hoja de 9 \", todo alojado en un atractivo diseño autónomo sin marco. Operando desde la propia unidad, tendrá el alivio que tanto necesita en segundos.\n\nPerfecto para cualquier lugar del hogar, garaje u oficina.\n3 configuraciones de velocidad para obtener la cantidad correcta de circulación de aire\nControl del panel frontal fácil de usar y de fácil acceso\nHoja duradera de 9 pulg.\nDiseño único y autónomo sin marco', 0, 16, 'BFBO9W-1', '2021-02-25', 1, 4, 24),
(277, 'a', 'BFSR16W', 'VENTILADOR DE PEDESTAL B+D', 'Este ventilador de pie BLACK + DECKER es el complemento perfecto en cualquier lugar de la casa donde sea necesario aumentar el flujo de aire. Tiene tres velocidades para controlar el giro de la duradera hoja de 16 pulgadas y abunda la flexibilidad con la capacidad de ajustar la altura y la inclinación, además de la capacidad de oscilar. Los controles simples del panel frontal proporcionarán el alivio que tanto necesita en segundos. .\n\nPerfecto para cualquier lugar del hogar, garaje u oficina.\n3 configuraciones de velocidad para obtener la cantidad correcta de circulación de aire\nControl a distancia fácil de usar con almacenamiento a bordo (pilas no incluidas)\nHoja duradera de 16 pulg.\nÁngulo de inclinación y altura ajustable\nFunción de oscilación para cubrir un área más grande\nConveniente temporizador de apagado', 10, 31, 'BFSR16W-1', '2021-02-25', 1, 4, 24),
(278, 'a', 'BFSR18B', 'VENTILADOR DE PEDESTAL B+D', 'Este ventilador de pie BLACK + DECKER es el complemento perfecto en casi cualquier lugar de la casa donde sea necesario un mayor flujo de aire. Tiene tres velocidades para controlar el giro de la cuchilla duradera de 18 \"y la flexibilidad abunda en la capacidad de ajustar también la altura y la inclinación, además de la capacidad de oscilar. Los controles simples del panel frontal proporcionarán el alivio que tanto necesita en segundos .', 9, 37, 'BFSR18B-1', '2021-02-25', 1, 4, 24),
(279, 'a', 'BFSR18W', 'VENTILADOR DE PEDESTAL B+D', 'Este ventilador de pie BLACK + DECKER es el complemento perfecto en casi cualquier lugar de la casa donde sea necesario un mayor flujo de aire. Tiene tres velocidades para controlar el giro de la cuchilla duradera de 18 \"y la flexibilidad abunda en la capacidad de ajustar también la altura y la inclinación, además de la capacidad de oscilar. Los controles simples del panel frontal proporcionarán el alivio que tanto necesita en segundos.', 10, 37, 'BFSR18W-1', '2021-02-25', 1, 4, 24),
(280, 'a', 'BFT114', 'VENTILADOR DE TORRE B+D', 'Función de oscilación de 90° para cubrir un área grande. 3 ajustes de velocidad para obtener la cantidad correcta de circulación de aire. Longitud del cable de alimentación: 5 pies. Certificado de seguridad ETL. Incluye manual de instrucciones', 0, 22, 'BFT114-1', '2021-02-25', 1, 4, 24),
(281, 'a', 'BFTU107', 'VENTILADOR TURBO B+D', 'Portátil y fácil de transportar:\r\n¿Cansado de llevar a los grandes y pesados fans de una habitación a otra? Ya no tendrás que preocuparte cuando tengas este ventilador turbo de 7 pulgadas.\r\n\r\nFlotador de aire ajustable: ajusta fácilmente el ángulo del ventilador e inclina a 90 grados.\r\n\r\nAjuste de aire de 3 velocidades: este mini ventilador viene con 3 ajustes de velocidad baja, media y alta para que puedas obtener la cantidad adecuada de circulación de aire cuando lo necesites. Siéntase como usted sólo necesita un aire extra para su habitación, a continuación, elija el ajuste LOW pero si se siente como la habitación es muy húmeda y caliente, entonces elija el ajuste HIGH.\r\n\r\nCable de alimentación extralargo, no te conformes con ventiladores turbo que tienen longitud corta y limitada de cable. Obtén uno que tenga un cable de alimentación extra largo para que puedas moverlos fácilmente a diferentes zonas de la habitación sin preocuparte por dónde conectarlos.\r\n\r\nCertificado y aprobado por ETL SAFETY - Con una marca ETL Listed, este producto garantiza que el ventilador eléctrico que usted está comprando es de alta calidad y duradero al mismo tiempo. Este producto certificado ETL ha cumplido con los estándares especí­ficos de innovación, seguridad y calidad, y ha sido probado y probado para proporcionar un excelente rendimiento de calidad para los compradores.', 0, 20, 'BFTU107-1', '2021-02-25', 1, 4, 24),
(282, 'a', 'BL0002PW', 'LICUADORA WINDMERE', '', 0, 26, 'BL0002PW-1', '2020-09-29', 1, NULL, NULL),
(283, 'a', 'BL1120SG', 'LICUADORA B+D', 'La licuadora 12 velocidades FusionBlade™ BLACK + DECKER de 550 vatios agrega un poderoso golpe a cualquier cocina. El acero inoxidable FusionBlade™ funciona con la forma de 48oz. jarra de vidrio para mezclar eficientemente cualquier combinación. Use las 12 opciones de velocidad y el botón de pulso para un control total sobre el motor de servicio pesado, triturando fácilmente el hielo y encontrando la consistencia perfecta para sopas, salsas y salsas. Además, la limpieza es muy sencilla gracias a las piezas extraí­bles aptas para lavavajillas.', 0, 54, 'BL1120SG-1', '2021-02-26', 1, 4, 16),
(284, 'a', 'BL1140MS', 'LICUADORA B+D', 'Flexibilidad, Eficacia y Durabilidad son características destacadas de la Licuadora Pulverix™ BLACK+DECKER™ para preparar sus alimentos favoritos con toda confianza. Un motor de 700 watts de potencia máxima* trabaja eficazmente con cuchillas poderosas de 6 puntas en acero inoxidable, más 12 velocidades con pulso que ayudan a pulverizar hielo a nieve y triturar los ingredientes más duros, convirtiéndolos en deliciosas sopas y purés, refrescantes batidos de frutas o granizados y hasta migas de pan o galletas con la consistencia perfecta. Además de todo esto, brinda la flexibilidad de preparar sus favoritos en la jarra de vidrio con boquilla PerfectPourix™ y servir sin goteos en el vaso personal para llevar dondequiera que vaya. Diseñada con un sensor IntelliFuse™ para proteger el motor contra recalentamiento y un poderoso acople de metal, esta licuadora será su mejor aliado en la cocina por largo tiempo.', 0, 72, 'BL1140MS-1', '2021-02-26', 1, 4, 16),
(285, 'a', 'BL1220GG', 'LICUADORA B+D', 'Todo está en el nombre con la licuadora multifunción BLACK + DECKER ™ PowerCrush. Esta licuadora premium utiliza 700W de potencia * para pulverizar hielo y otros ingredientes duros para crear deliciosos batidos, batidos y más. QuadPro Blade es lo suficientemente versátil como para hacer bebidas heladas, sopas, purés e incluso migas (pan, galletas o cereales) para usar en otras recetas. Use los botones intuitivos de control de cuatro velocidades para encontrar la consistencia perfecta. Luego disfrute de un vertido fácil y sin derrames con la boquilla de vertido con bisagras que se puede volver a cerrar y el frasco de vidrio PerfectPour™. Además, la limpieza es fácil con la función Easy Clean que utiliza el movimiento de la cuchilla mezcladora para aflojar los alimentos apelmazados y todas las piezas son aptas para lavavajillas. Mezcla rápida y potente, servicio sin desorden y limpieza fácil: BLACK + DECKER™ PowerCrush es la iónica licuadora que necesita.', 0, 56, 'BL1220GG-1', '2021-02-26', 1, 4, 16),
(286, 'a', 'BL1350DP-P', 'LICUADORA B+D', '¡Menos ruido. Más potencia*! La Licuadora Digital con Tecnología Silenciosa PowerCrush BLACK+DECKER™ está diseñada para conveniencia máxima. La tecnología de la cuchilla QuadPro crea un vórtice potente para licuar eficazmente todo tipo de ingrediente y el motor de 900W tritura rápidamente el hielo y las frutas congeladas. La gama de ajustes de velocidad incluye 3 funciones preprogramadas que proporcionan resultados ideales para bebidas con hielo, sopas, purés, migas de pan y mucho más. Usted amará el vaso personal de 18 onzas fabricado de plástico resistente Tritan™. Éste es ideal para llevar consigo batidos de proteínas y otras bebidas.\n\n3 velocidades digitales + función de pulso\n3 funciones programadas: batido, infusión, licuado\nJarra PerfectPour™ Tritan® de 6 tazas (48 oz.),duradera\nFiltro del infusor permite la infusión de agua instantánea\nEmpujador de ingredientes produce gran rendimiento al licuar\nBoquilla vertedora intergrade y ranura con bisagra para empujador/ingredientes', 1, 79, 'BL1350DP-P-1', '2021-04-14', 1, 4, 16),
(287, 'a', 'BL1550SG', 'LICUADORA B+D', '¡Nueva y mejorada! ¡Esta licuadora digital de 3 velocidades cuenta con una base de metal resistente que se mantiene en su lugar para triturar hielo, mezclar sopas y mucho más! Los controles digitales sencillos y la función de pulso controlan el motor de 700 vatios y el FusionBlade™ de acero inoxidable de 4 puntas. Además, todas las piezas extraíbles son aptas para lavavajillas para una fácil limpieza.\r\n\r\nBase de metal fundido de alta resistencia.\r\nHoja de acero inoxidable de 4 puntas, tecnología de hoja QuadPro.\r\n3 velocidades + pulso.\r\nMotor de 700 vatios.\r\nTarro de vidrio de vertido perfecto de 6 tazas (48 onzas).', 5, 76, 'BL1550SG-1', '2021-02-26', 1, 4, 16),
