(289, 'a', 'BL2010WG-03LA', 'JARRA DE VIDRIO B+D', 'Jarra de Vidrio de 1,25 DuraPro /Turbo Pro con pico vertedor\n\nCompatibles con modelos:\nBLBD10GSS, BLBD10GW1\nBLBD10GW, BLBD202GW\nBLBD202GW, BLBD210GB\nBDBD210GW, BLBD210GSS\nBLBD210GPW, BL2352GW\nBL210BGC, BL210WG\nBL2010WGC, BL2020R\nBL2020S', 0, 8, 'BL2010WG-03LA-1', '2021-02-25', 1, 4, 10),
