(291, 'a', 'BLBD202GW', 'LICUADORA B+D', 'La Licuadora DURAPRO de 2 Velocidades de BLACK+DECKER con 4 Cuchillas de acero inoxidable 2 veces más duraderas**. Jarra de vidrio de 1.25 Lt. con tapa de doble abertura incluye un dispositivo de bisagra para añadir ingredientes y boquilla vertedora integrada que está diseñada para acomodar varias porciones de sus batidos favoritos y ¡más! Además, la limpieza es muy fácil gracias a las piezas removibles aptas para lavavajillas.', 10, 35, 'BLBD202GW-1', '2021-02-26', 1, 4, 16),
(292, 'a', 'BLBD210GSR', 'LICUADORA B+D', 'La Licuadora de DURAPRO de 10 Velocidades de BLACK+DECKER es un clásico en la cocina. Con mayor función de pulso y 4 cuchillas de acero inoxidable, 2 veces más duraderas ** para eficiencia y funcionamiento. La jarra de 1.25 Lt de vidrio y tapa de doble abertura está diseñada para verter fácilmente y tiene capacidad suficiente para acomodar varias porciones de sus batidos favoritos y ¡más! Además, la limpieza es muy fácil gracias a las piezas removibles aptas para lavavajillas.\n\n550 Watts\n10 velocidades + función de pulso\nJarra de vidrio de 1.25 Lt con tapa de doble abertura\n4 Cuchillas de acero inoxidable son 2 veces más duraderas**\nDispositivo de bisagra para añadir ingredientes\nBoquilla vertedora integrada\nPies antideslizantes\nApto para lavaplatos\nGuardacable', 0, 52, 'BLBD210GSR-1', '2021-02-26', 1, 4, 16),
(293, 'a', 'CBBD1725', 'CBBD1725 DCM1100B-BLBD210PB-IRBD202', 'Cafetera DCM1100B:\n10 tazas\nTemperatura óptima de colado\nVentanilla del tanque para ver el agua con facilidad\nMarcas de jarra de café y agua\nIndicador de encendido/apagado\nPlaca calefactora antiadherente\nGuardacable\n\nLicuadora BLBD210PB:\nDispositivo de bisagra para añadir ingredientes\nBoquilla vertedora integrada\n4 Cuchillas de acero inoxidable son 2 veces más duraderas***\nJarra plástica de 1.65 L\n10 velocidades + función de pulso\nPotencia de 550 watts**\nGuardacable\nPiezas lavables en máquina lavaplatos\nPies antideslizantes\n\nPlancha IRBD202:\nSuela antiadherente TrueGlide™ Colors\nRocío fino\nFunción de AutoClean™\nTanque de agua transparente extra grande de 260ml\nGolpe de vapor\nSelector de tejidos\nVapor variable\nMango Confort Grip™', 0, 78, 'CBBD1725-1', '2021-02-27', 1, 4, 64),
(294, 'a', 'CBBD1726', 'CBBD1726 CM0941B-BLBD210GB-IRBD200', 'La Licuadora de DURAPRO de 10 Velocidades es un clásico en la cocina, con su motor de 550W, Jarra de Vidrio de 1.25lts y sus 4 Cuchillas de acero inoxidable son 2 veces más duraderas\n\nLa cafetera de 12 tazas CM0941B, esta cafetera de 12 tazas prepara rápidamente tu café favorito con sólo tocar un botón. También cuenta con otras funciones muy útiles como tecnología Sneak-A-Cup, jarra de virio Duralife de 12 tazas y filtro permanente lavable.\n\nLa plancha de TrueGlide Colors viene con golpe de vapor de 100g/minuto que elimina las arrugas más difíciles. Suela antiadherente 2 veces más dura para todos tipos de planchados. Tiene un tanque de agua transparente que es extra grande de 260ml y características Tecnología Auto-Clean.', 0, 78, 'CBBD1726-1', '2021-02-27', 1, 4, 64),
(295, 'a', 'CBBD1727', 'CBBD1727 CM0941R-BLBD210GR-IR1830', 'La Licuadora de DURAPRO de 10 Velocidades es un clásico en la cocina, con su motor de 550W, Jarra de Vidrio de 1.25lts y sus 4 Cuchillas de acero inoxidable son 2 veces más duraderas\n\nLa cafetera de 12 tazas CM0941R, esta cafetera de 12 tazas prepara rápidamente tu café favorito con sólo tocar un botón. También cuenta con otras funciones muy útiles como tecnología Sneak-A-Cup, jarra de virio Duralife de 12 tazas y filtro permanente lavable.\n\nLa plancha de TrueGlide Colors viene con golpe de vapor de 100g/minuto que elimina las arrugas más difíciles. Suela antiadherente 2 veces más dura para todos tipos de planchados. Tiene un tanque de agua transparente que es extra grande de 260ml y características Tecnología Auto-Clean.', 0, 82, 'CBBD1727-1', '2021-02-27', 1, 4, 64),
(296, 'a', 'CBBD1728', 'CBBD1728 (RC5200-HC150W)', 'Olla Arrocera de 10 Tz modelo RC5200\n\nCapacidad de 10 Tazas /4.7L\nFunción para mantener caliente\nTapa de vidrio templado con soporte\nAsas frías al tacto\nLuces indicadoras de ciclos de cocción\n1000 Watts\n\nPicatodo de un toque modelo HC150W\n\n70 watts de potencia\nCapacidad de 1,5 tazas\nCuchilla para picar de acero inoxidable\nControl de pulso de un toque\nOrificios de Aceite', 0, 60, 'CBBD1728-1', '2021-02-27', 1, 4, 64),
(297, 'a', 'CBBD1729', 'CBBD1729 (BLBD210PB-IRBD202)', 'Plancha TrueGlide™ Colors modelo IRBD202 viene con golpe de vapor de 100g/minuto que elimina las arrugas más difíciles. Suela antiadherente TrueGlide™ Colors es 2 veces más durable para todos tipos de planchados. Tiene un tanque de agua transparente que es extra grande de 260ml y características Tecnología Auto-Clean™ .\n\nLicuadora de 10 Velocidades DURAPRO modelo BLBD210PB es un clásico en la cocina. Con mayor función de pulso y 4 cuchillas de acero inoxidable, 2 veces más duraderas, para eficiencia y funcionamiento. La jarra ergonómica de 1.5 Lt de plástico y tapa de doble abertura está diseñada para verter fácilmente.', 0, 50, 'CBBD1729-1', '2021-02-27', 1, 4, 64),
(298, 'a', 'CBBD1730', 'CBBD1730 (BLBD210GW-IRBD200)', 'La plancha de Black+Decker™ de TrueGlide™ Colors viene con golpe de vapor de 100g/minuto que elimina las arrugas más difíciles. Suela antiadherente TrueGlide™ Colors es 2 veces más durable para todos tipos de planchados. Tiene un tanque de agua transparente que es extra grande de 260ml y características Tecnología Auto-Clean™.\n\nLa Licuadora de DURAPRO de 10 Velocidades de BLACK+DECKER es un clásico en la cocina. Con mayor función de pulso y 4 cuchillas de acero inoxidable, 2 veces más duraderas ** para eficiencia y funcionamiento. La jarra de 1.25 Lt de vidrio y tapa de doble abertura está diseñada para verter fácilmente y tiene capacidad suficiente para acomodar varias porciones de sus batidos favoritos y ¡más! Además, la limpieza es muy fácil gracias a las piezas removibles aptas para lavavajillas.', 2, 57, 'CBBD1730-1', '2021-02-27', 1, 4, 64),
(299, 'a', 'CBM205', 'MOLINO B+D', '', 0, 40, NULL, '2020-09-29', 1, NULL, NULL),
(300, 'a', 'CI11AF', 'ONDULADOR DE CABELLO', 'DESCRIPCIÓN\nRizador Remington Cl11af Shine Therapy Aguacate\n\nRizador de cerámica con micro acondicionadores de aguacate.\nRemington es una herramienta que tienen que tener las mujeres que les gustan los rizos. Es muy fácil de usar para crear rizos sueltos o más definidos completamente sin esfuerzo gracias a su guía de espiral. Combinación perfecta para rizos definidos y con brillo. Contiene aguacate, ideal para cabello seco, dañado, maltratado y procesado.\n\nEspecificaciones:\n• Barril de 25mm\n• Barril con revestimiento de cerámica avanzada\n• Temperatura: 210°C / 410°F Máx.\n• Interruptor de encendido y apagado\n• Piloto indicador de encendido\n• 8 configuraciones de temperatura\n• Calentamiento rápido de 30 segundos\n• Punta fría de seguridad\n• Cable giratorio\n• Apagado automático\n', 0, 30, 'CI11AF-1', '2021-04-07', 65, 66, 68),
(301, 'a', 'CI5225CL', 'ONDULADOR DE CABELLO', 'Variedad de estilos para el cuidado del cabello. El rizador de cabello 2 en 1 te permite crear rizos suaves y uniformes o rizos definidos con una fijación duradera. Úsalo como una tenaza de rizador tradicional o quítale la pinza para usarlo como varita. El barril de cerámica está impregnado de titanio para calentarse rápidamente y mantenerse caliente. Su calor de salón de 205°C crea resultados profesionales duraderos sin dañar el cabello.\r\n\r\nTamaño de la Barra: 25mm.\r\n30 Ajustes de Temperatura.\r\nTemperatura máxima: 205°C (400°F).\r\nCalentamiento en 30 segundos.\r\nRizador 2 en 1.\r\nBarra Con Clip/ Sin Clip.\r\nUso con cable.\r\nBotón de Encendido y Apagado.\r\nIndicador LED de encendido.\r\nBarra Recubierta de Cerámica y Titanio.', 10, 23, 'CI5225CL-1', '2021-04-07', 65, 66, 68),
(302, 'a', 'CI63N1', 'ONDULADOR DE CABELLO', '  Rizador 2 en 1.\n·         Temperatura máxima de 170°C.\n·         3 niveles de temperatura disponibles.\n·         Calentamiento rápido en 30 segundos.\n·         Cuenta con guías en espiral que facilitan el rizado.\n·         Barril con revestimiento de cerámica avanzada.\n·         Interruptor de encendido y apagado.\n·         Piloto de encendido.\n·         Punta fría de seguridad incorporada.\n·         Cable giratorio.', 10, 34, 'CI63N1-1', '2021-04-07', 65, 66, 68),
(303, 'a', 'CJ4000S', 'EXPRIMIDOR B+D', '¡Disfrutar de jugos de cítricos recien exprimidos... justo cuando lo desee! Sacarle todo el jugo que necesita sin las semillas desde el cono autor reversible y el colador.\r\n\r\n40 Watts.\r\nGirado auto-reversible.\r\n2 posiciones de salida.\r\nGuardacable.\r\n2 conos intercambiables.\r\nTapa transparente de plástico.', 0, 29, 'CJ4000S-1', '2021-02-26', 1, 4, 14),
(304, 'a', 'CM0555B', 'CAFETERA B+D', 'Delicioso café, ¡fácil! La cafetera BLACK + DECKER ™ de 5 tazas * se pone en marcha con solo presionar un interruptor, calentando el agua a la temperatura óptima para una extracción completa del sabor. El café se prepara en la jarra de vidrio Duralife ™ mejorada, diseñada para un manejo cómodo y un vertido sin goteo. Además, la canasta del filtro extraíble y apta para lavavajillas facilita la limpieza.\r\n\r\nJarra ergonómica - Sin goteo.\r\nFunción Sneak-a-Cup ™.\r\nDiseño compacto que ahorra espacio.\r\nInterruptor de encendido / apagado iluminado.', 0, 28, 'CM0555B-1', '2021-02-26', 1, 4, 13),
(305, 'a', 'CM0750S', 'CAFETERA B+D', 'Esta cafetera 4 en 1 se prepara en una taza estándar, una taza de viaje alta, una jarra de 5 tazas *, y funciona para verter sobre el café. El soporte ajustable permite la versatilidad de preparación, y la exclusiva cesta extraíble le permite controlar la fuerza de su café al verterlo en una taza o jarra. La jarra mejorada está diseñada para un manejo cómodo y un vertido sin goteo, y la tapa es extraíble para facilitar la limpieza.\r\n\r\n4 formas de preparar.\r\nVierta la canasta de preparación compatible.\r\nJarra ergonómica de 5 tazas.\r\nDiseño compacto que ahorra espacio.\r\nFiltro de suelo permanente incluido.', 1, 29, 'CM0750S-1', '2021-04-14', 1, 4, 13),
(306, 'a', 'CM0940BD', 'CAFETERA B+D', 'La forma más fácil de tomar café caliente. Esta cafetera de 12 tazas * prepara rápidamente su café favorito con solo tocar un botón. Otras características útiles incluyen la tecnología Sneak-A-Cup ™, una jarra de vidrio Duralife® de 12 tazas * y una canasta de preparación lavable.\n\nCapacidad de 12 tazas\nFunción Sneak-a-Cup ™\nVentana de agua de fácil visualización\nInterruptor de encendido / apagado iluminado', 0, 26, 'CM0940BD-1', '2021-02-27', 1, 4, 13),
(307, 'a', 'CM0941R', 'CAFETERA B+D', 'La forma más fácil de calentar café, Esta cafetera de 12 tazas* prepara rápidamente tu café favorito con sólo tocar un botón. También cuenta con otras funciones muy útiles como tecnología Sneak-A-Cup, jarra de virio Duralife de 12 tazas y filtro permanente lavable.\r\n\r\nLuz indicadora de encendido y apagado.\r\nJarra de vidrio Duralife™.\r\nCapacidad de 12 tazas.\r\nTecnología Sneak-a-Cup™.\r\nPlaca calefactora antiadherente.\r\nApto para lavaplatos.\r\nGuardacable.', 0, 26, 'CM0941R-1', '2021-02-25', 1, 4, 13),
(308, 'a', 'CM1105B', 'CAFETERA B+D', 'La cafetera 12 tazas CM1105B de Black+Decker, elimina tiempo de su rutina en la mañana con funciones útiles de tecnología Sneak-A-Cup™. Panel de control digital programable Jarra de Vidrio Duralife.\r\n\r\nPanel de control digital programable.\r\nJarra de Vidrio Duralife™.\r\nTecnología Sneak-A-Cup™.\r\nFiltro permanente.\r\nPlaca calefactora con antiadherente.\r\nVentana para ver el nivel de agua.\r\nAuto-apagado.\r\nLas piezas pueden lavarse en lavavajillas.\r\nGuardacable.', 0, 34, 'CM1105B-1', '2021-04-13', 1, 4, 13),
(309, 'a', 'CM1410W', 'CAFETERA B+D', '', 0, 0, NULL, '2020-09-29', 1, NULL, NULL),
(310, 'a', 'CM410', 'CAFETERA WINDMERE', '', 0, 16, NULL, '2020-09-29', 1, NULL, NULL),
(311, 'a', 'CMU3000', 'PERCOLADORADORA B+D', 'Características: \r\n\r\nCuela el café a la velocidad de 1 taza por minuto. Mantiene el café caliente automáticamente.\r\nFiltro de café.\r\nAsas frías al tacto.\r\nMarcas del nivel de agua.\r\nEspita.\r\nLuz indicadora.', 0, 42, 'CMU3000-1', '2021-02-25', 1, 4, 13),
(312, 'a', 'D13A', 'SECADOR DE CABELLO', 'Logra resultados rápidos con mayor protección gracias a la tecnología iónica de Remington. Este secador emite un 90% más de iones y cuenta con una rejilla infundida con microacondicionadores de aguacate y macadamia permitiendo obtener un cabello brillante y libre de frizz.\n\nRendimiento de 2300W* / 80km/h velocidad del aire**\nMotor DC\nRejilla recubierta de cerámica con aguacate y macadamia\n3 niveles de temperatura\n2 ajustes de velocidad\nBotón de aire frio para fijar peinado\nConcentrador\nCable de 1.8m\nRejilla removible para una mejor limpieza.', 10, 39, 'D13A-1', '2021-05-05', 65, 66, 69),
(313, 'a', 'D3015', 'SECADOR DIFUSOR', 'Consigue un cabello increíblemente suave y sin encrespamiento con el secador Power Volume 2000. Con una potencia de 2000 W, rejilla de cerámica iónica, concentrador y un difusor, este práctico secador te permitirá lucir un cabello bonito cada día, sea cual sea el peinado que se te antoje crear. Y ahora, además de tu cabello, también puedes tratar bien al medio ambiente. Hemos introducido una función Eco adicional para que puedas ahorrar energía durante el secado.', 7, 25, 'D3015-1', '2021-05-05', 65, 66, 69),
(314, 'a', 'D3035', 'PLANCHA TITANIUMB+D', 'Descubra como la plancha Titanio de BLACK+DECKER puede transformar el cuidado de su ropa. Nuestra suela es más resistente y 6 veces más durable, con aditivos de turmalina para resultados antiestáticos. La suela Titanio tiene agentes acondicionadores que ayudan a prevenir arrugas, así como, deslizamiento mejorado un 60% para un planchado más fácil. Hasta puede dejar sus prendas colgadas en la percha mientras elimina las arrugas con la función de vapor vertical.\r\n\r\nSuela de Titanio.\r\nPotencia de 1600 Watts.\r\nApagado automático de 3 posiciones.\r\nGolpe de vapor.\r\nVapor vertical.\r\nVapor variable.\r\nRocío fino.\r\nAnti goteo.\r\nMango Comfort Grip™.\r\nTalón de descanso.\r\nTanque de agua fácil de llenar de 400ML.\r\nCable eléctrico de 2,5 m y 360°de giro.\r\nSistema de limpieza automático Auto-Clean™.', 0, 56, 'D3035-1', '2021-02-26', 1, 4, 18),
(315, 'a', 'D5000', 'SECADOR DE CABELLO', 'Realmente es un secador pequeñito, perfecto para guardar en algún cajón del baño sin que ocupe mucho espacio pero también para llevar de viaje cuando tienes algo limitado tu equipaje. Eso sí, que su tamaño no te engañe porque tiene una potencia de 1800 W gracias a los cuales no tendrá nada que envidiar, 3 niveles de temperatura y 2 velocidades para que consigas siempre la combinación deseada. De hecho hasta podemos considerarlo ecológico porque en el modo medio te ayudará a ahorrar energía. Viene con un concentrador para facilitar su uso, una rejilla trasera muy fácil de quitar para que puedas limpiarla y un gancho por si prefieres colgarlo en el cuarto de baño.\r\n \r\nSecador Eco: Además de proporcionarte un cabello de aspecto perfecto, este secador es respetuoso con el medio ambiente. Seleccionando la opción «eco», ahorrarás una cantidad considerable de energía. ', 1, 21, 'D5000-1', '2021-04-07', 65, 66, 69),
(316, 'a', 'DE711', 'CAFETERA B+D', '', 0, 0, 'DE711-1', '2020-09-29', 1, NULL, NULL),
(317, 'a', 'EK500W-T', 'CUCHILLO ELECTRICO B+D', 'Cortar es simple con el cuchillo eléctrico BLACK + DECKER ™ Comfort Grip ™ de 9 ”. Desde trinchar carne, rebanar pan o cortar espuma para proyectos de manualidades, este cuchillo hace que todo funcione rápidamente. Las hojas de acero inoxidable de 9 \"encajan de forma segura en su lugar y un gatillo intuitivo enciende y apaga el cuchillo. La fatiga de la muñeca se minimiza gracias al mango Comfort Grip ™, que cuenta con un diseño cómodo y ergonómico. Además, la limpieza es muy sencilla: solo golpe el botón de liberación de las cuchillas y coloque las cuchillas planas sobre la rejilla superior de su lavavajillas. Estarán listas para su próximo proyecto.\n\nMango Comfort Grip ™\nBotones de liberación de la cuchilla\nCerradura de seguridad\nHoja de acero inoxidable\nLengüetas antideslizantes\nSoporte de cuchillo', 0, 22, 'EK500W-T-1', '2021-04-14', 1, 4, 11),
(318, 'a', 'FP1337', 'PROCESADOR DE ALIMENTOS B+D', 'El Procesador de Alimentos de 8 Tazas de BLACK+DECKER es un electrodoméstico útil para procesar los alimentos. Le brinda la flexibilidad de rebanar, picar, desmenuzar, rallar o hacer puré, así necesite mucha o poca cantidad. Las cuchillas para picar de acero inoxidable y el potente motor de 450 watts trabajan en combinación para procesar los alimentos rápidamente en el recipiente de procesamiento de 8 tazas. Un disco para rebanar y rallar de acero inoxidable hace aporte a su versatilidad y conveniencia. Este procesador de acero inoxidable cuenta con un tubo de alimentación con empujador que ayuda a guiar los alimentos a través del tubo con facilidad. Usted puede observar sus alimentos mientras se procesan ya que el recipiente es transparente. Con un sistema de entrecierre de seguridad, este procesador de alimentos negro tiene controles táctiles que ayudan a facilitar su funcionamiento. Su apariencia elegante realzará la decoración de su cocina.', 2, 50, 'FP1337-1', '2021-02-26', 1, 4, 20),
(319, 'a', 'FP2500S', 'PROCESADOR DE ALIMENTOS', '¿Qué tan potente es el Procesador de Alimentos de Boca Ancha Power Pro de BLACK+DECKER? Es tan potente que tuvimos que diseñar pies de succión reforzados para mantenerlo en su lugar mientras rebana, pica, desmenuza, ralla y hace puré de manzanas enteras, papas, pepinos, cebollas, bloques de queso u otros alimentos enteros con facilidad. Con un motor feroz de 500 watts y toneladas de torsión trabajando en conjunto bajo su exterior elegante y estable, esta es una pieza de maquinaria resistente que desempeña de una forma tan excelente como luce.\n\n500 watts de Potencia\n2 velocidades\nFunción de pulso\nEnrollado de cable\nCierre de seguridad en la tapa\nCierre de seguridad entre la base y el tazón\nTubo de boca ancha\nINCLUYE: Recipiente de 10 tazas; Cuchilla para picar; Disco para rallar/rebanar', 0, 74, 'FP2500S-1', '2021-02-26', 1, 4, 20);
INSERT INTO `producto` (`id_producto`, `estatus`, `codigo`, `nombre`, `descripcion`, `cantidad`, `precio`, `foto_prin`, `fecha_registro`, `id_departamento1`, `id_departamento2`, `id_departamento3`) VALUES
(320, 'a', 'FP4200B-LA', 'PROCESADOR DE ALIMENTOS', 'Impulsado por 450 watts de potencia, el Procesador de Alimentos de 8 Tazas Fácil de Armar BLACK+DECKER™ es ideal para picar, rallar, rebanar ¡ y más! El tazón de procesamiento de 8 tazas acomoda cantidades grandes de cualquier plato delicioso que desee crear y todas las piezas removibles son aptas para el lavavajillas, haciendo la limpieza fácil y rápida.\n\nMotor potente de 450 watts\n2 velocidades más funciones de pulso\nRecipiente con capacidad de 8 tazas\nSistema de entrecierre de seguridad mejorado\nControles táctiles fáciles de limpiar\nPies de succión antideslizantes\nPiezas aptas para máquina lavaplatos\nACCESSORIES:Disco para desmenuzar y rebanar reversible y Cuchilla de acero inoxidable', 0, 53, 'FP4200B-LA-1', '2021-04-13', 1, 4, 20),
(321, 'a', 'G605W', 'SANDWICHERA B+D', 'Con la Sandwichera Black+Decker puede tostar, sellar y cortar dos sándwiches a la vez con placas antiadherentes y de fácil limpieza. Posibilidad de almacenamiento compacto en vertical con recogecable para ahorrar el máximo espacio.\n\n700 watts de potencia\nCapacidad 2 piezas\nSuperficie de cocción antiadherente\nCorta y sella los sandwiches\nAsas frías al tacto\nCierre de seguridad\nLuz de encendido\nLuz de temperatura de cocción\nAlmacenamiento vertical\nGuardacable', 0, 24, 'G605W-1', '2021-04-14', 1, 4, 21),
(322, 'a', 'HC06A', 'CORTE REMINTONG', 'La máquina de cortar pelo HC4050 de Remington es el kit perfecto para cortarse el cabello en casa con estilo y sin complicaciones. Es ideal para familias porque incluye 22 piezas y accesorios con los que conseguir cualquier tipo de corte de cabello. El cepillo limpiador ayuda a eliminar cualquier resto adherido antes del próximo uso, mientras que las tijeras y el peine que completan el kit te permitirán rebajar el cabello más largo antes de cortarlo o escalarlo.\n\nUso con cable\nAcero Quirúrgico autoafilables\nIncluye 23 piezas: 7 Peines de guía, Aceite lubricante, Peine, Tijeras, 1 clip, Capa y Caja de almacenamiento\nCuchillas Lavables\nPalanca de ajuste\nProtector de Hojilla\nPoderoso motor de corte lineal\nBlanco', 10, 31, 'HC06A-1', '2021-04-07', 65, 66, 67),
(323, 'a', 'HC150B', 'PROCESADOR DE ALIMENTOS B+D', 'El Picador de Un Toque de BLACK+DECKER le brinda el poder de crear sus platos acompañantes y preparar los ingredientes fácilmente para recetas más grandes. El control de pulso de un toque opera la cuchilla de dos niveles de acero inoxidable para picar con facilidad. Además, todas las piezas removibles son aptas para lavavajillas para una limpieza rápida y fácil.\r\n\r\n70 watts de potencia.\r\nCapacidad de 1,5 tazas.\r\nCuchilla para picar de acero inoxidable.\r\nControl de pulso de un toque.\r\nOrificios de Aceite.', 0, 16, 'HC150B-1', '2021-02-26', 1, 4, 20),
