(332, 'a', 'KE1550B', 'TETERA B+D', 'Con tecnología de hervor rápido, utiliza 1500W de potencia para hervir rápidamente a siete tazas de agua en menos tiempo en comparación a un microondas o estufa. La tetera viene con un filtro extraíble antical que evita que la acumulación de minerales paso través del pico por lo que obtienes agua fresca y caliente para té chocolate caliente comidas instantáneas harina de avena café de prensa francés y más.\r\n\r\n1.7L de capacidad.\r\nTecnología de hervor rápido.\r\nFiltro antical extraíble.\r\nProtección para hervir / secar.\r\nBase giratoria de 360 °.\r\nTapa con cierre Saety.\r\nEnvoltura de cordón.', 0, 34, 'KE1550B-1', '2021-02-25', 1, 4, 13),
