(334, 'a', 'MX217', 'BATIDORA DE MANO B+D', 'Disfrute de la potencia para mezclar con facilidad. Esta práctica batidora cuenta con 6 velocidades. El potente motor de 250 watts brinda una variedad de funciones de mezclado. El conveniente talón y descanso para recipiente facilitan colocar la batidora en posición de descanso entre las tareas.\n\n250 watts\n6 velocidades\nMango ergonómico\nTalón de descanso\nBotón expulsor de batidores\nFunción Turbo\n2 Batidores de alambre\n2 Batidor de huevos\nApto para lavaplatos', 0, 0, 'MX217-1', '2021-02-26', 1, 4, 12),
(335, 'a', 'MX300', 'BATIDORA D/MANO B+D', 'Disfrute de la potencia para mezclar con facilidad. Esta práctica batidora cuenta con 6 velocidades. El potente motor de 250 watts brinda una variedad de funciones de mezclado. El conveniente talón y descanso para recipiente facilitan colocar la batidora en posición de descanso entre las tareas.\n\n250 watts\n6 velocidades\nMango ergonómico\nTalón de descanso\nBotón expulsor de batidores\nFunción Turbo\n2 Batidores de alambre\n2 Batidor de huevos\nApto para lavaplatos', 0, 0, 'MX300-1', '2021-02-26', 1, 4, 12),
(336, 'a', 'MX600G', 'BATIDORA B+D', 'Novedad de BLACK + DECKER! El diseño avanzado de hélice mejora el rendimiento de mezcla al maximizar la superposición del batidor y mezclar ingredientes en múltiples direcciones. El mezclador de mano BLACK + DECKER Helix Performance Premium presenta batidores de nylon reforzado con 2 veces el área de superficie y 2 veces el rendimiento de mezcla. El motor de 250 vatios funciona a cinco velocidades, incluida una velocidad de arranque más controlada para ayudar a evitar salpicaduras. Además, un turbo boost especial agrega un aumento de potencia en cada velocidad de mezcla para combinar ingredientes espesos en poco tiempo. Este conjunto incluye dos batidores helicoidales, dos ganchos para masa y un batidor de alambre, lo que le permite crear rápidamente masas para pasteles y galletas, masas de pan, untables y salsas, crema batida casera, claras de huevo batidas para un sabroso merengue y muchas más recetas deliciosas. Todos los accesorios se almacenan convenientemente en el estuche de almacenamiento de diseño inteligente, que usa el mezclador en sí como la tapa a presión. La limpieza es muy sencilla con el botón de expulsión automática que desconecta rápidamente las herramientas de mezcla aptas para lavavajillas. Además, puede evitar aún más problemas con el talón y el tazón de descanso, lo que permite que la batidora se coloque verticalmente en el borde del tazón.', 0, 38, 'MX600G-1', '2021-02-26', 1, 4, 12),
