(338, 'a', 'MX600TR', 'BATIDORA B+D', 'Novedad de BLACK + DECKER! El diseño avanzado de hélice mejora el rendimiento de mezcla al maximizar la superposición del batidor y mezclar ingredientes en múltiples direcciones. El mezclador de mano BLACK + DECKER Helix Performance Premium presenta batidores de nylon reforzado con 2 veces el área de superficie y 2 veces el rendimiento de mezcla. El motor de 250 vatios funciona a cinco velocidades, incluida una velocidad de arranque más controlada para ayudar a evitar salpicaduras. Además, un turbo boost especial agrega un aumento de potencia en cada velocidad de mezcla para combinar ingredientes espesos en poco tiempo. Este conjunto incluye dos batidores helicoidales, dos ganchos para masa y un batidor de alambre, lo que le permite crear rápidamente masas para pasteles y galletas, masas de pan, untables y salsas, crema batida casera, claras de huevo batidas para un sabroso merengue y muchas más recetas deliciosas. Todos los accesorios se almacenan convenientemente en el estuche de almacenamiento de diseño inteligente, que usa el mezclador en sí como la tapa a presión. La limpieza es muy sencilla con el botón de expulsión automática que desconecta rápidamente las herramientas de mezcla aptas para lavavajillas. Además, puede evitar aún más problemas con el talón y el tazón de descanso, lo que permite que la batidora se coloque verticalmente en el borde del tazón.', 0, 38, 'MX600TR-1', '2021-02-26', 1, 4, 12),
(339, 'a', 'NE3200', 'CORTADOR DE NARIZ', 'La recortadora de vello de nariz y oídos de Remington es uno de los juegos de peluquería con los que lograrás el aseo que quieres en menos tiempo. Es resistente al agua y cuenta con batería, por lo que puedes usarla dentro y fuera de la ducha.\r\n\r\nOpera con tecnología ComfortTrim que utiliza navajas bidireccionales que remueven el vello indeseable sin tirones, y además cuenta con cubierta hipoalergénica antibacterial que se puede lavar fácilmente bajo la ducha.\r\n\r\nDispone de un cortador vertical con el que podrás acceder más fácilmente a los pelos de la nariz y las orejas y recortar con precisión la barba, barba corta o las cejas para darles forma.\r\n\r\nEl cortador de precisión es un accesorio que te permite retocar las patillas y la barba para perfilarlas mejor. Se puede usar dentro y fuera de la ducha. Su cortador vertical y de precisión ayuda a acceder fácilmente a los vellos, permitiendo retocar las patillas y perfilar la barba como tú quieras.', 0, 10, 'NE3200-1', '2021-04-07', 65, 66, 67),
(340, 'a', 'NE3550', 'KIT DE CORTE FACIAL', 'Recortador REMINGTON para nariz y orejas, ideal para viajes, con sistema avanzado de corte para mayor comodidad. Uso en seco/mojado y cuchillas de auto de afilar.\r\n\r\nAvanzado sistema de corte para mayor comodidad.\r\nUso en seco/mojado.\r\nCuchillas autoafilables.\r\nIdeal para viajes.\r\nRequiere 1 pila AAA.', 0, 10, 'NE3550-1', '2021-04-07', 65, 66, 67),
(341, 'a', 'PB1010B', 'LICUADORA PERSONAL B+D', 'Crea tu bebida favorita de manera más rápida y práctica con la licuadora personal portátil de BLACK+DECKER. Cuenta con un vaso de 415 ML. con tapa para beber, tamaño ideal para porciones individuales. Puedes preparar desde licuados, malteadas, batidos de proteína, hasta smoothies gracias a las potentes cuchillas de acero inoxidable diseñadas para triturar hielo, licuar alimentos y mezclar líquidos de manera uniforme.\r\n\r\n350 watts.\r\nCuchilla de acero inoxidable de 4 puntas.\r\nApto para lavaplatos.\r\nVaso de 415ml con tapa para beber.', 0, 28, 'PB1010B-1', '2021-02-26', 1, 4, 16),
