(344, 'a', 'RC514', 'OLLA ARROCERA B+D', 'Preparar cenas grande acaba de hacerse más facil con la Arrocera de 14 Tazas de BLACK+DECKER. La cocción solo toma 20 a 30 minutos y la unidad mantiene el arroz delicioso y esponjoso, listo para servir mucho después de terminar el proceso de cocción con una función automática para mantener caliente los alimentos. La cesta para cocinar al vapor incluida le permite cocinar comidas saludables con vegetales, pescado y más. La limpieza es muy fácil con la olla de cocción antiadherente, apta para lavavajillas y la tapa de vidrio templado. Además, también puede usar la arrocera para preparar sopas, guisos ¡y hasta avena!\n\nCapacidad 14 tazas cocidas\nCapacidad 7 tazas crudas\nRecipiente antiadherente\nLuces indicadoras\nFunción de mantener caliente los alimentos\nCesta para cocción al vapor\nTapa de vidrio templado\nTaza medidora\nCuchara para servir', 8, 33, 'RC514-1', '2021-02-26', 1, 4, 17),
(345, 'a', 'RC514WG', 'OLLA ARROCERA B+D', 'Preparar cenas grande acaba de hacerse más facil con la Arrocera de 14 Tazas de BLACK+DECKER. La cocción solo toma 20 a 30 minutos y la unidad mantiene el arroz delicioso y esponjoso, listo para servir mucho después de terminar el proceso de cocción con una función automática para mantener caliente los alimentos. La limpieza es muy fácil con la olla de cocción antiadherente, apta para lavavajillas y la tapa de vidrio templado. Además, también puede usar la arrocera para preparar sopas, guisos ¡y hasta avena!\r\n\r\nCapacidad 14 tazas cocidas.\r\nCapacidad 7 tazas crudas.\r\nRecipiente antiadherente.\r\nLuces indicadoras.\r\nFunción de mantener caliente los alimentos.\r\nTapa de vidrio templado.\r\nTaza medidora.\r\nCuchara para servir.', 0, 36, 'RC514WG-1', '2021-02-26', 1, 4, 17),
(346, 'a', 'RC620W', 'OLLA ARROCERA B+D', 'Cocina todas tus recetas favoritas sin que la comida se pegue y sea fácil de limpiar, nuestra arrocera multiusos BLACK+DECKER de 20 tazas cuenta con tecnología DURAGLIDE con recubrimiento antiadherente 3 veces más duradero*, tiene un tamaño ideal para cocinar desde arroz, sopas, guisados, avena, pastas hasta postres y muchas más recetas. Además, nuestra arrocera multiusos incluye una cesta para cocinar al vapor, cucharon para servir y taza de medir.\r\n\r\nRecubrimiento antiadherente con tecnología DURAGLIDE.\r\nCapacidad de 20 tazas/1.8L.\r\nCiclo para mantener los alimentos calientes.\r\nEscape de vapor.\r\nAsas frías al tacto.\r\nTapa de vidrio resistente.\r\nSoporte para la tapa.\r\nLuces indicadoras del ciclo de cocción y calentamiento.\r\nAccesorios incluidos: cesta para cocinar, cucharón para servir y taza de medir.', 0, 38, 'RC620W-1', '2021-02-26', 1, 4, 17),
(347, 'a', 'RC628W', 'OLLA ARROCERA B+D', 'Cocina todas tus recetas favoritas sin que la comida se pegue y sea fácil de limpiar, nuestra arrocera multiusos BLACK+DECKER de 28 tazas cuenta con tecnología DURAGLIDE con recubrimiento antiadherente 3 veces más duradero*, tiene un tamaño ideal para cocinar desde arroz, sopas, guisados, avena, pastas hasta postres y muchas más recetas. Además, nuestra arrocera multiusos incluye una cesta para cocinar al vapor, cucharon para servir y taza de medir.\r\n\r\nRecubrimiento antiadherente con tecnología DURAGLIDE.\r\nCapacidad de 28 tazas/2.8L.\r\nCiclo para mantener los alimentos calientes.\r\nEscape de vapor.\r\nAsas frías al tacto.\r\nTapa de vidrio resistente.\r\nSoporte para la tapa.\r\nLuces indicadoras del ciclo de cocción y calentamiento.\r\nAccesorios incluidos: cesta para cocinar, cucharón para servir y taza de medir.', 8, 53, 'RC628W-1', '2021-02-26', 1, 4, 17),
(348, 'a', 'S1001', 'PLANCHA DE CABELLO', 'La plancha de cabello Remington con placas recubiertas de cerámica. Lista para usar en tan solo 60 segundos y alcanza una temperatura máxima de 210°C.\r\n\r\nMedida de las placas: 2,54cm / 1\".\r\nTemperatura máxima: 210°C (410°F).\r\nBotón de Encendido y Apagado.\r\nCalentamiento en 30 segundos.\r\nSmooth Techology.\r\nPlacas Recubiertas de Cerámica.\r\nIndicador LED de encendido (Rojo).\r\nCable Giratorio de 2 metros.', 10, 19, 'S1001-1', '2021-04-07', 65, 66, 68),
(349, 'a', 'S4A500-F', 'PLANCHA DE CABELLO', 'La plancha para cabello de Remington Shine Therapy con placas recubiertas de cerámica con coco puede lograr un cabello protegido y con aspecto brillante. Sus 8 diferentes ajustes detemperatura permiten seleccionar la temperatura que más se adecúa a tu tipo de cabello evitando causar daños en él.\n\nMedida de las placas: 2,54cm / 1\"\n8 Ajustes de Temperatura: 150°C - 230°C\nCalentamiento en 15 segundos\nBotón de Encendido y Apagado\nPlacas Flotantes Recubiertas de cerámica y coco\nLuz indicadora LED\nBloqueo de placas\nApagado Automático\nCable Giratorio de 1,8 m\nCierre de seguridad.', 0, 30, 'S4A500-F-1', '2021-02-26', 1, NULL, NULL),
(350, 'a', 'S7710', 'PLANCHA DE CABELLO', 'La plancha de cabello Pro-Ion de Remington te ayudará a crear peinados absolutamente lisos y brillantes, libres de frizz y estática gracias a la tecnología iónica triple que genera iones negativos que envuelven el cabello de la raíz a la punta.\n\nEl revestimiento de turmalina avanzada ultra es ahora un 75% más suave* y mejora los resultados del alisado y el peinado. La turmalina es fuente natural de iones, que son liberados al cabello a través de las placas calientes mientras te peinas. Con esta excepcional plancha de cabello, conseguirás esos peinados lisos y sofisticados sin esfuerzo y en muy poco tiempo.\n\nMedida de las placas: 2,54cm / 1\"\nAjustes de Temperatura (+/-)\nTemperatura máxima: 210°C (410°F)\nCalentamiento en 30 segundos\nBotón de Encendido y Apagado\nPantalla Digital\nTecnología Iones triple con generado de iones\nPlacas Recubiertas de Cerámica Avanzada y Turmalina\nBloqueo de placas', 0, 54, 'S7710-1', '2021-05-14', 65, 66, 68),
(351, 'a', 'S8001P', 'PLANCHA DE CABELLO', 'Alisa tu cabello con la plancha de cabello Wet2Straight de Remington fabricada con placas recubiertas de cerámica y turmalina que alisan el cabello mojado, ahorrando tiempo y protegiendo tu cabello del frizz.\r\n\r\nMedida de las placas: 5,08cm / 2\".\r\nAjustes de Temperatura (+/-) con Temperatura. máxima: 230°C (450°F).\r\nCalentamiento en 30 segundos.\r\nBotón de Encendido y Apagado.\r\nPantalla Digital.\r\nPlacas Flotantes Recubiertas de Turmalina y Cerámica.\r\nBloqueo de placas.\r\nApagado Automático.\r\nCable Giratorio de 1,8 metros.', 0, 33, 'S8001P-1', '2021-04-07', 65, 66, 68),
(352, 'a', 'S8510', 'PLANCHA DE CABELLO', 'Elimina el frizz con la plancha para cabello de Remington Frizz Control, protección contra el frizz todo el día.\n\nLas placas rebubiertas con cerámica avanzada protegen tu cabello durante el uso gracias a sus microacondicionadores eliminando el frizz incluso en ambientes húmedos.\n\nMedida de las placas: 2,54cm / 1\"\nAjustes de Temperatura (+/-)\nBotón de Temperatura Rápida\nTemperatura máxima: 230°C (450°F)\nCalentamiento en 30 segundos\nBotón de Encendido y Apagado\nPantalla Digital\nPlacas Recubiertas de Cerámica infundida con microacondicionadores resistentes al frizz\nBloqueo de placas.', 0, 25, 'S8510-1', '2021-04-07', 65, 66, 68),
(353, 'a', 'S8598P', 'PLANCHA DE CABELLO', 'El cabello brillante y sano está de moda y llegó para quedarse, pero a veces, una combinación de cabello seco y calor alto, que normalmente ocurre cuando alisas el cabello directamente después del secado, puede causar daños. Por suerte, Remington tiene una solución para ponerle fin al alisado con calor excesivo y la falta de protección.\n\nMedida de las placas: 2,54cm / 1\"\nAjustes de Temperatura (+/-) (Temperatura máxima: 230°C)\nCalentamiento en 15 segundos\nBotón de Encendido y Apagado\nPantalla Digital\nTecnología Smart Pro Sensor regula la temperatura seleccionando por ti la más óptima\nPlacas Recubiertas de Cerámica con Aceite de Almendras', 10, 46, 'S8598P-1', '2021-04-07', 65, 66, 68),
(354, 'a', 'S9610', 'PLANCHA DE CABELLO  TITANIUM', 'La más avanzada tecnología con revestimiento de cerámica con proteínas de seda real contiene hasta 10 veces más cerámica que la plancha para cabello tradicional, ayudando a conseguir un deslizamiento sin esfuerzo, un cabello suave y saludable con menos frizz.\r\nLa cerámica con seda combinada con 220°C con desempeño profesional ayuda a crear un acabado de salón.\r\n\r\nMedida de las placas: 2,54cm / 1\".\r\n30 Ajustes de Temperatura.\r\nTemperatura máxima: 220°C (455°F).\r\nCalentamiento en 15 segundos.\r\nBotón de Encendido y Apagado.\r\nPlacas Recubiertas de Cerámica infundida con seda.\r\nBloqueo de placas.\r\nApagado Automático.\r\nPlacas flotantes.\r\nCable Giratorio de 1,8 metros.', 10, 34, 'S9610-1', '2021-04-07', 65, 66, 68),
(355, 'a', 'SC2007S', 'OLLA DE COCCION LENTA B+D', 'Compruebe lo fácil que puede ser preparar comidas deliciosas con la Olla de Cocción Lenta de 7 Cuartos de BLACK+DECKER. Para asados, sopas, chili y mucho más, solo coloque los ingredientes en la olla de gres y deje que el calor constante haga su trabajo. Tres ajustes de temperatura le brindan opciones para encontrar la mejor temperatura para su receta y su horario—baja por 8-9 horas de cocción, alta para 3-4 horas y tibia para mantener los alimentos a la temperatura ideal para servir. Además, la limpieza se facilita con la olla de gres y la tapa de vidrio templado aptas para lavavajillas.\n\n320 watts\nCapacidad 7 lt.\n3 Ajustes de temperatura\nSoporte integrado para la tapa\nTapa de vidrio resistente\nPerilla y asas frías al tacto\nOlla de gres fácil de limpiar', 0, 42, 'SC2007S-1', '2021-04-13', 1, 4, 17),
(356, 'a', 'SKG605', 'SARTEN ELECTRICO B+D', 'Black & Decker skg605 multi-cuisine grande Extra-deep Electric Skillet Extra-deep 3\" área de cocción para grandes piezas de pollo, grande de guisos, estofados y mucho más. Antiadherente superficie de cocción para una rápida y fácil limpieza. Liberación rápida con control variable Temperaturas para cocinar todo tipo de alimentos. Le ayuda a salir de la grasa de la pierna pan-tilt detrás de como usted cocinar y servir.\r\n\r\n1500 watts.\r\nSuperficie honda antiadherente.\r\nTapa transparente de vidrio templado.\r\nAsa de la tapa fría al tacto.\r\nControl removable de temperatura variable.\r\nAsas frias al tacto para servir.\r\nSoporte de inclinación ajustable.\r\nLuz indicadora de funcionamiento.', 0, 60, 'SKG605-1', '2021-02-25', 1, 4, 11),
(357, 'a', 'SM1000W', 'SANDWICHERA B+D', 'Con la Black+Decker sandwichera puede tuesta, sella y corta dos sándwiches a la vez con placas antiadherentes y de fácil limpieza.\r\n\r\n700 Watts.\r\nCapacidad 2 piezas.\r\nSuperficie de cocción antiadherente.\r\nCorta y sella los sandwiches.\r\nAsas frías al tacto.\r\nCierre de seguridad.\r\nLuz de encendido.\r\nLuz de calentamiento.\r\nGuardacable.', 0, 20, 'SM1000W-1', '2021-02-26', 1, 4, 21),
(358, 'a', 'SM1050WM', 'SANDWICHERA WINDMERE', '', 0, 16, NULL, '2020-09-29', 1, NULL, NULL),
(359, 'a', 'TO1342W', 'HORNO B+D', 'El Horno Tostador de 4 Rebanadas de BLACK+DECKER es ideal para tareas de horneo más pequeñas. Su interior expandido acomoda una pizza de hasta 23 cm (9”) o cuatro rebanadas de pan, y los controles simplificados le permiten elegir la función de hornear, asar, tostar o mantener caliente. Además, nuestra tecnología exclusiva EvenToast™ tuesta pan hasta un 30% más uniformemente que los competidores principales.\r\n\r\n1150 watts.\r\nCapacidad de 4 rebanadas.\r\nTecnología EvenToast™.\r\nReloj automático de 30 minutos con opción de funcionamiento continuo.\r\nInterior curvo, acomoda una pizza de 9\" o 4 rebanadas de pan.\r\nFUNCIONES: Hornear, Asar, Tostar y Mantener Caliente.\r\nBandeja de residuos para una limpieza fácil.\r\nIncluye bandeja para hornear y parrilla de asar.', 0, 36, 'TO1342W-1', '2021-02-26', 1, 4, 15),
(360, 'a', 'TO3265XSSD-HD', 'TOSTA HORNO FREIDOR B', 'Presentamos la tecnología Air Fry, nueva en el horno tostador extra ancho Crisp N Bake Air Fry de BLACK + DECKER. La tecnología Air Fry utiliza aire caliente de alta intensidad para hornear, dorar y freir sus alimentos fritos favoritos con poco o nada de aceite. Pruebe papas fritas, chips de vegetales, filetes de pescado empanizados, bocadillos congelados y mucho más. La capacidad extra grande se adapta a alimentos para toda la familia. Hay espacio para hasta ocho rebanadas de pan o una pizza de 30 cm (30 cm), ¡y puedes usar los moldes que ya tienes! Con espacio para un recipiente de 23 x 33 cm con asas, puedes pasar directamente del horno a la mesa. 3 perillas de control facilite la configuración del temporizador de tostadas y el temporizador de 60 minutos, y elija entre cinco funciones de cocción: hornear, asar, tostar, mantener caliente y freír al aire. La tecnología de convección hace circular el aire dentro del horno para obtener resultados rápidos y uniformes al freír al aire. ', 0, 120, 'TO3265XSSD-HD-1', '2021-04-13', 1, 4, 15),
(361, 'a', 'TOD1775G', 'HORNO B+D', '¡Sabor frito sin grasa! Este horno cuenta con la tecnología Air Fry, que utiliza aire caliente de alta intensidad para hornear, dorar y hacer crujientes sus comidas fritas favoritas con poco o ningún aceite. Los controles digitales facilitan configurar el temporizador hasta 60 minutos (o usar la función de permanencia para tiempos de cocción más largos) y elegir entre siete selecciones de tonos de tostado. La pantalla digital ayuda a lograr resultados precisos con las cinco funciones: Air Fry, Bake, Broil, Toast y Keep Warm. La tecnología de calentamiento por convección asegura una cocción rápida y uniforme, y el interior es lo suficientemente grande como para acomodar hasta cuatro rebanadas de pan o una pizza de 9 ”. Además, la bandeja de migas deslizable facilita mantener limpio el horno tostador y la encimera.\r\n\r\nTecnología Air Fry.\r\nTecnología de convección: cocción rápida y uniforme.\r\nPantalla digital: selección precisa de la hora y el tono de tostado.\r\n5 funciones: freír al aire, hornear, asar, tostar, mantener caliente.\r\nSe adapta a pizza de 9 \"o 4 rebanadas de pan.', 0, 110, 'TOD1775G-1', '2021-02-26', 1, 4, 15),
