(364, 'a', 'WPG4060', 'RECORTADORA REMINTONG', '¡Kit de cuerpo y bikini para una piel suave y sedosa!\n Recortadora de cuerpo para retoques rápidos\n Afeitadora de láminas para un corte cómodo y al ras\n Accesorio exfoliante para fregar fácilmente\n Mojado / seco: libertad para afeitarse en seco o en la ducha.', 0, 22, 'WPG4060-1', '2021-04-07', 65, 66, 67),
(367, 'nv', 'FP-546W', 'Mini procesador de alimentos 3 tazas', 'El potente mini procesador de alimentos Brentwood FP-546 de 3 tazas de 200 vatios le ahorra tiempo y energía en la cocina. Es perfecto para crear dips, salsas, picar verduras, especias y más. Operación de 2 velocidades alta / baja fácil de usar. Las cuchillas de acero inoxidable afiladas y duraderas pican los alimentos en segundos. La tapa con cierre de seguridad evita accidentes. El diseño compacto ocupa poco espacio en el mostrador y es fácil de almacenar. Piezas extraíbles sin BPA y fáciles de limpiar.\r\n\r\nAhorre tiempo cortando y mezclando.\r\nCree salsas, verduras picadas y más.\r\n2 velocidades alta / baja.\r\nCapacidad para 3 tazas.\r\nCuchillas de acero inoxidable afiladas y duraderas.\r\nDiseño compacto.\r\nSin BPA.\r\nTapa con cierre de seguridad.\r\nPiezas extraíbles aptas para lavavajillas.\r\nPies de succión anti-deslizantes.\r\nPotente 200 vatios.\r\nAlmacenamiento de cable.\r\nColor: blanco.', 0, 0, 'FP-546W-1', '2020-11-27', 1, NULL, NULL),
(368, 'a', 'PC-486W', 'COTUFERA BLANCA BRENTWOOD', 'La máquina para hacer palomitas de maíz de aire caliente Brentwood PC-486R de 8 tazas prepara hasta 8 tazas de palomitas de maíz saludables y sin aceite en solo 2-3 minutos. Disfrute de un ahorro 4 veces mayor si utiliza granos sueltos en lugar de bolsas para microondas. Las palomitas de maíz aparecen directamente en su tazón. Siga las recetas incluidas para crear sus propias palomitas de maíz gourmet. Las piezas extraíbles facilitan la limpieza.\r\n\r\n8 tazas de palomitas de maíz en solo 2-3 minutos.\r\nNo se usa aceite para un refrigerio saludable.\r\nAhorre dinero usando granos sueltos.\r\nCuchara con tapa de doble propósito / bandeja para derretir mantequilla.\r\nPalomitas de maíz directamente en su tazón.\r\nIncluye recetas de palomitas de maíz gourmet.\r\nFácil de limpiar.\r\nPiezas removibles.\r\nColor: Rojo.\r\nPotencia: 1200w.', 8, 19, 'PC-486W-1', '2021-06-03', 1, 7, 45),
(369, 'a', 'BLSTMG-A15', 'LICUADORA NARANJA', 'Esta licuadora con vaso de vidrio de 8 velocidades te da mucha más versatilidad a la hora de preparar licuados, frescas bebidas y comidas con la consistencia ideal.', 0, 35, 'BLSTMG-A15-1', '2021-03-01', 1, 5, 35),
(370, 'a', 'BLSTMG-K15', 'Licuadora Oster® 8 velocidades BLSTMG-K15', 'Esta licuadora con vaso de vidrio de 8 velocidades te da mucha más versatilidad a la hora de preparar licuados, frescas bebidas y comidas con la consistencia ideal.', 0, 34, 'BLSTMG-K15-1', '2021-03-01', 1, 5, 35),
(371, 'a', 'BLSTMG-M15', 'LICUADORA FUCSIA', 'Esta licuadora con vaso de vidrio de 8 velocidades te da mucha más versatilidad a la hora de preparar licuados, frescas bebidas y comidas con la consistencia ideal.', 0, 35, 'BLSTMG-M15-1', '2021-03-01', 1, 5, 35),
(372, 'a', '4126-R3S', 'LICUADORA ROJA METALIZADA', 'Esta práctica licuadora en metal que te permitirá hacer las bebidas más heladas con su revolucionaria cuchilla que tritura hielo. Como en muchos de nuestros modelos, el exclusivo sistema All-Metal Drive® garantiza una mayor duración del electrodoméstico.\r\n\r\n\r\nPotente motor de 600 watts.\r\nPulveriza hielo con la cuchilla trituradora de hielo.\r\nJarra de vidrio refractario Boroclass® con capacidad para 5 tazas (1,25 litros).\r\nControl giratorio de 3 velocidades.\r\nSistema de impulsión totalmente metálico All-Metal Drive®.\r\nTapa hermética con copa medidora.', 3, 64, '4126-R3S-1', '2021-03-01', 1, 5, 35),
(373, 'a', '4655', 'LICUADORA PLATEADA', 'Esta práctica licuadora en metal que te permitirá hacer las bebidas más heladas con su revolucionaria cuchilla que tritura hielo. Como en muchos de nuestros modelos, el exclusivo sistema All-Metal Drive® garantiza una mayor duración del electrodoméstico.\r\n\r\n\r\nPotente motor de 600 watts.\r\nPulveriza hielo con la cuchilla trituradora de hielo.\r\nJarra de vidrio refractario Boroclass® con capacidad para 5 tazas (1,25 litros).\r\nControl giratorio de 3 velocidades.\r\nSistema de impulsión totalmente metálico All-Metal Drive®.\r\nTapa hermética con copa medidora.', 8, 77, '4655-1', '2021-03-01', 1, 5, 35),
(374, 'a', '4128', 'Licuadora Clásica 3 velocidades', 'Esta práctica licuadora en metal que te permitirá hacer las bebidas más heladas con su revolucionaria cuchilla que tritura hielo. Como en muchos de nuestros modelos, el exclusivo sistema All-Metal Drive® garantiza una mayor duración del electrodoméstico.\r\n\r\n\r\nPotente motor de 600 watts.\r\nPulveriza hielo con la cuchilla trituradora de hielo.\r\nJarra de vidrio refractario Boroclass® con capacidad para 5 tazas (1,25 litros).\r\nControl giratorio de 3 velocidades.\r\nSistema de impulsión totalmente metálico All-Metal Drive®.\r\nTapa hermética con copa medidora.', 0, 62, '4128-1', '2021-03-01', 1, 5, 35),
(375, 'i', 'TSSTV10LTB', 'Horno Tostador 10 litros', 'El horno tostador que te permite preparar una amplia variedad de deliciosas comidas y bocadillos.\r\n\r\nCapacidad para 4 rebanadas/10 litros.\r\nControl de temperatura completamente ajustable de 90°C a 230°C (194°F a 450°F) para una amplia variedad de usos.\r\nRejilla ajustable a dos posiciones y capacidad de 10 litros con una bandeja para hornear y una parrilla para asar.\r\nFunciones para hornear, asar, tostar y recalentar que te permite crear comidas y refrigerios con facilidad.\r\nÚtil cronómetro de 30 minutos que apaga el horno automáticamente para mayor seguridad.', 0, 31.99, 'TSSTV10LTB-1', '2020-10-09', 1, NULL, NULL),
(427, 'a', 'GCSTBS4801R', 'PLANCHA ROJA', 'Con el sistema anti calcáreo este modelo permite un mejor desempeño de la plancha. Su suela antiadherente en color que facilita su deslizamiento, y temperatura y vapor variables que hacen que planchar sea una tarea más fácil.\n\nTemperatura y vapor variables para distintos tipos de tejidos.\nBotón de rociado fino que facilita la tarea del planchado. \nSistema anti-Calc que protege y prolonga la vida de la plancha, y mejora el desempeño de la plancha.\nPotente vapor permite eliminar arrugas mucho más rápido.\nSuela antiadherente en color que facilita el deslizamiento de la plancha.\nCable giratorio de 180º permite una mayor comodidad al momento de utilizar la plancha.\nTanque de agua con 180 ml de capacidad.\nPotencia de la plancha de 1200 W.', 10, 19, 'GCSTBS4801R-1', '2021-02-22', 1, 5, 37),
(425, 'a', 'GCSTBS4801L', 'PLANCHA OSTER', '\nCon el sistema anti calcáreo este modelo permite un mejor desempeño de la plancha. Su suela antiadherente en color azul que facilita su delizamiento, y temperatura y vapor variables que hacen que planchar sea una tarea más fácil.\n\n\n Temperatura y vapor variables para distintos tipos de tejidos\nBotón de rociado fino que facilita la tarea del planchado\nSistema anti-Calc que protege y prolonga la vida de la plancha, y mejora el desempeño de la plancha\nPotente vapor permite eliminar arrugas mucho más rápido\nSuela antiadherente en color que facilita el deslizamiento de la plancha\nCable giratorio de 180º permite una mayor comodida al momento de utilizar la plancha\nTanque de agua con 180 ml de capacidad\nPotencia de la plancha de 1200 W', 10, 19, 'GCSTBS4801L-1', '2021-06-29', 1, 5, 37),
(438, 'a', 'HM-48B', 'BATIDORA NEGRA 5 VELOC BRENTWOOD', 'Utilice la ergonómica y potente batidora manual eléctrica de 5 velocidades Brentwood HM-45 de 150 vatios para batir fácilmente huevos, batir crema, mezclar masa ligera y más durante períodos prolongados. Controle la velocidad y expulse los batidores con una mano. Los batidores aptos para lavavajillas están hechos de metal cromado duradero. La batidora de mano descansa cómodamente sobre su talón.\n\nBatir huevos, batir crema y más.\n5 velocidades.\nDurables batidores cromados.\nPequeños y livianos.\nMango ergonómico.\nBatidores aptos para lavavajillas.\nRespaldo del talón.\nPotencia: 150w.', 4, 17, 'HM-48B-1', '2021-02-25', 1, 7, 43),
