(426, 'nv', 'GCSTBS4801P', 'PLANCHA MORADA OSTER', 'Con el sistema anti calcáreo este modelo permite un mejor desempeño de la plancha. Su suela antiadherente en color que facilita su deslizamiento, y temperatura y vapor variables que hacen que planchar sea una tarea más fácil.\n\nTemperatura y vapor variables para distintos tipos de tejidos.\nBotón de rociado fino que facilita la tarea del planchado. \nSistema anti-Calc que protege y prolonga la vida de la plancha, y mejora el desempeño de la plancha.\nPotente vapor permite eliminar arrugas mucho más rápido.\nSuela antiadherente en color que facilita el deslizamiento de la plancha.\nCable giratorio de 180º permite una mayor comodidad al momento de utilizar la plancha.\nTanque de agua con 180 ml de capacidad.\nPotencia de la plancha de 1200 W.', 10, 19, '', '2020-12-10', 1, NULL, NULL),
(457, 'a', 'TS-1045W', 'HERVIDORA DE HUEVO BLANCA BRENTWOOD', 'Cocine huevos perfectos en todo momento con la hervidora eléctrica para huevos Brentwood modelo TS-1045BL. Simplemente agregue agua, coloque los huevos y presione el botón de encendido. Hervir suave, medio o duro hasta 7 huevos, 2 huevos y cocinar una tortilla de 3 huevos. Hervir la protección en seco con apagado automático. Las bandejas se apilan dentro de la olla para huevos para un fácil almacenamiento.\n\n• 7 huevos duros, medios o blandos.\n• 2 huevos perfectamente hervidos.\n• Tortillas de 3 huevos rápidas y fáciles.\n• Vegetales al vapor saludable.\n• Operación de un toque.\n• Apagado automático con zumbador.\n• Bandejas apilables para un fácil almacenamiento.\n• Sin BPA.\n• Color blanco.\n• Potencia: 360w.', 0, 14, 'TS-1045W-1', '2021-02-25', 1, 7, 42),
