(452, 'a', 'SK-65', 'SARTEN ELECTRICO BRENTWOOD', 'El potente sartén eléctrico antiadherente Brentwood modelo SK-65 de 12 pulgadas con tapa de vidrio de 1400w es la solución perfecta para freír, asar, guisar y hornear para toda la familia. Cuenta con un termostato ajustable, dos asas de fácil transporte, tapa de vidrio templado con ventilación de vapor y una superficie antiadherente fácil de limpiar. Prepare cómodamente el desayuno, el almuerzo y la cena mientras ahorra tiempo y electricidad.\n\n• Superficie de cocción familiar de 12 pulgadas.\n• Temperatura ajustable.\n• Calentamiento rápido y uniforme.\n• Superficie antiadherente fácil de limpiar.\n• Incluye tapa de vidrio templado con ventilación de vapor.\n• De color negro.\n• Potencia: 1400w.', 10, 36, 'SK-65-1', '2021-02-25', 1, 7, 52),
(460, 'a', 'TS-213BL', 'CAFETERA 4 TAZAS AZUL BRENTWOOD', 'Utilice la cafetera de 4 tazas Brentwood TS-213BL para preparar la taza de café perfecta. Simplemente coloque sus suelos, agregue agua y presione el botón de encendido. La placa calentadora mantiene el café caliente. Ahorre dinero con la canasta de filtro reutilizable. La unidad no contiene BPA y es fácil de limpiar.\n\nPrepara 4 tazas de café.\nIncluye jarra de vidrio para café.\nFiltro removible y reutilizable.\nPlaca calentadora.\nVentana de nivel de agua.\nRecogedor de café molido reutilizable.\nFácil de limpiar.\nCarcasa de tacto frío y mango de jarra.\nLuz indicadora de encendido.\nColor: azul.\nPotencia: 650w.', 10, 16, 'TS-213BL-1', '2021-02-25', 1, 7, 44),
(421, 'a', 'FP-546', 'PROCESADOR DE ALIMENTOS BRENTWOOD', 'El potente mini procesador de alimentos Brentwood FP-546 de 3 tazas de 200 vatios le ahorra tiempo y energía en la cocina. Es perfecto para crear dips, salsas, picar verduras, especias y más. Operación de 2 velocidades alta / baja fácil de usar. Las cuchillas de acero inoxidable afiladas y duraderas pican los alimentos en segundos. La tapa con cierre de seguridad evita accidentes. El diseño compacto ocupa poco espacio en el mostrador y es fácil de almacenar. Piezas extraíbles sin BPA y fáciles de limpiar.\n\nAhorre tiempo cortando y mezclando.\nCree salsas, verduras picadas y más.\n2 velocidades alta / baja.\nCapacidad para 3 tazas.\nCuchillas de acero inoxidable afiladas y duraderas.\nDiseño compacto.\nSin BPA.\nTapa con cierre de seguridad.\nPiezas extraíbles aptas para lavavajillas.\nPies de succión anti-deslizantes.\nPotente 200 vatios.\nAlmacenamiento de cable.\nColor: blanco.', 10, 29, 'FP-546-1', '2021-02-25', 1, 7, 51),
(443, 'a', 'JB-220R', 'LICUADORA DE 12 VELOCIDADES ROJA BRENTWO', 'La potente licuadora Brentwood modelo JB-220B de 12 velocidades y pulsos de 350 vatios, utiliza cuchillas de acero inoxidable para triturar y pulverizar hielo fácilmente. Elija entre 12 velocidades para mezclar deliciosos batidos, merengadas, proteínas abundantes y más. Incluye frasco y tapa aptos para lavavajillas de 50 oz sin BPA. Práctico almacenamiento de cables.\n\n• Mezcle deliciosos batidos, merengadas, proteínas y más.\n• 12 velocidades + pulso.\n• Cuchillas de acero inoxidable.\n• Incluye frasco de plástico de 50 oz con tapa / tapón de llenado.\n• Piezas extraíbles aptas para lavavajillas.\n• Conveniente almacenamiento de cables.\n• Base antideslizante.\n• De color rojo.\n• Potencia: 350w.', 0, 25, 'JB-220R-1', '2021-02-25', 1, 7, 49),
(445, 'a', 'KT-1900BK', 'TETERA NEGRA BRENTWOOD', 'Hierva agua en minutos con la hervidora eléctrica inalámbrica de vidrio Brentwood modelo KT-1900BK de 1.7L. El hervidor inalámbrico se levanta de la base para facilitar el llenado y vertido. Hervidor de vidrio lleno, elemento calefactor oculto y libre de BPA. Apagado automático, hervir en seco y protección contra sobrecalentamiento para mayor seguridad.\n\n• Capacidad: 1,7 Litros\n• Iluminación LED azul\n• Hervidor de agua lleno de vidrio\n• Elemento calefactor oculto\n• Totalmente libre de BPA\n• Inalámbrico\n• Base giratoria 360 con almacenamiento de cable\n• Protección para hervir en seco y sobrecalentamiento\n• Luz indicadora de poder\n• Color: negro, plateado\n• Potencia: 1100w', 10, 27, 'KT-1900BK-1', '2021-02-25', 1, 7, 44),
(436, 'a', 'HM-44', 'BATIDORA DE MANO NEGRA BRENTWOOD', 'Utilice la ergonómica y potente batidora manual eléctrica ligera de 5 velocidades Brentwood modelo HM-44 de 150 Watts para batir huevos, batir crema, mezclar masa ligera y más durante períodos prolongados. Controle la velocidad y expulse los batidores con una mano. Los batidores aptos para lavavajillas están hechos de metal cromado duradero. La batidora de mano descansa cómodamente sobre su talón.\n\n• Batir fácilmente los huevos, la crema batida y más\n• 5 velocidades\n• Operación con una mano\n• Batidores duraderos cromados\n• Pequeño y ligero\n• Mango ergonómico\n• Batidores aptos para lavavajillas\n• Talón de descanso\n• Potencia: 150w\n• De color negro', 10, 16, 'HM-44-1', '2021-03-29', 1, 7, 43),
(423, 'a', 'FPSTJE316W', 'EXTRACTOR DE JUGOS OSTER', 'Jugos llenos de vitaminas y nutrientes para ti y tu familia. Una manera fácil para llenar tu vida de energía y estar más saludable.\n\n\nEnvase para la pulpa con capacidad de 1,5 litros para mayor productividad.\nJarra con capacidad para extraer hasta 600 ml de jugo. \nLas superficies en contacto directo con los alimentos son libres de BPA (bisfenol-A).\nPalancas de cierre que aseguran el funcionamiento.\nFiltro completamente de acero.\nComponentes fáciles de desarmar.\nPotencia de 400 Watts.', 0, 53, 'FPSTJE316W-1', '2020-11-02', 1, NULL, NULL),
(422, 'a', 'FP547', 'PROCESADOR DE ALIMENTOS BRENTWOOD', 'El potente mini procesador de alimentos Brentwood FP-546 de 3 tazas de 200 vatios le ahorra tiempo y energía en la cocina. Es perfecto para crear dips, salsas, picar verduras, especias y más. Operación de 2 velocidades alta / baja fácil de usar. Las cuchillas de acero inoxidable afiladas y duraderas pican los alimentos en segundos. La tapa con cierre de seguridad evita accidentes. El diseño compacto ocupa poco espacio en el mostrador y es fácil de almacenar. Piezas extraíbles sin BPA y fáciles de limpiar.\n\nAhorre tiempo cortando y mezclando.\nCree salsas, verduras picadas y más.\n2 velocidades alta / baja.\nCapacidad para 3 tazas.\nCuchillas de acero inoxidable afiladas y duraderas.\nDiseño compacto.\nSin BPA.\nTapa con cierre de seguridad.\nPiezas extraíbles aptas para lavavajillas.\nPies de succión anti-deslizantes.\nPotente 200 vatios.\nAlmacenamiento de cable.\nColor: negro.', 0, 23, 'FP547-1', '2021-03-10', 1, 7, 51),
(446, 'a', 'KT-1900PR', 'TETERA MORADA BRENTWOOD', 'Hierva agua en minutos con la hervidora eléctrica inalámbrica de vidrio Brentwood modelo KT-1900BK de 1.7L. El hervidor inalámbrico se levanta de la base para facilitar el llenado y vertido. Hervidor de vidrio lleno, elemento calefactor oculto y libre de BPA. Apagado automático, hervir en seco y protección contra sobrecalentamiento para mayor seguridad.\n\n• Capacidad: 1,7 Litros\n• Iluminación LED azul\n• Hervidor de agua lleno de vidrio\n• Elemento calefactor oculto\n• Totalmente libre de BPA\n• Inalámbrico\n• Base giratoria 360 con almacenamiento de cable\n• Protección para hervir en seco y sobrecalentamiento\n• Luz indicadora de poder\n• Color: purpura, plateado\n• Potencia: 1100w', 5, 27, 'KT-1900PR-1', '2021-02-25', 1, 7, 44),
(456, 'a', 'TS-1045BL', 'HERVIDORA DE HUEVOS AZUL BRENTWOOD', 'Cocine huevos perfectos en todo momento con la hervidora eléctrica para huevos Brentwood modelo TS-1045BL. Simplemente agregue agua, coloque los huevos y presione el botón de encendido. Hervir suave, medio o duro hasta 7 huevos, 2 huevos y cocinar una tortilla de 3 huevos. Hervir la protección en seco con apagado automático. Las bandejas se apilan dentro de la olla para huevos para un fácil almacenamiento.\n\n• 7 huevos duros, medios o blandos.\n• 2 huevos perfectamente hervidos.\n• Tortillas de 3 huevos rápidas y fáciles.\n• Vegetales al vapor saludable.\n• Operación de un toque.\n• Apagado automático con zumbador.\n• Bandejas apilables para un fácil almacenamiento.\n• Sin BPA.\n• Color azul.\n• Potencia: 360w.', 0, 14, 'TS-1045BL-1', '2021-02-25', 1, 7, 42),
(459, 'a', 'TS-112R', 'CAFETERA ROJA  BRENTWOOD', 'Utilice la cafetera individual con taza Brentwood modelo TS-112B para preparar la taza de café perfecta con hasta 4 cucharadas de su café molido favorito. Simplemente coloque la cnatidad de cafe, agregue agua y presione el botón de encendido. La canasta de filtro reutilizable tiene capacidad para 4 cucharadas, el doble de la fuerza de una taza de café normal. La unidad no contiene BPA y es fácil de limpiar.\n\n• Fácil de usar y limpiar.\n• Filtro y soporte de filtro extraíbles.\n• Capacidad del filtro reutilizable: 4 cucharadas.\n• Incluye bandeja de goteo.\n• Sin BPA.\n• Taza de porcelana incluida.\n• Tamaño de taza compatible 3,5 (H) x 3 (L / W) pulgadas.\n• De color rojo.\n• Potencia: 450w.', 5, 24, 'TS-112R-1', '2021-02-25', 1, 7, 44),
(411, 'a', 'CKSTAF7601', 'FREIDORA DE AIRE OSTER', 'La freidora de aire Oster® utiliza hasta un 99.5% menos aceite en comparación con las freidoras tradicionales. El aire caliente circula alrededor de la comida, lo que permite cocinar dejando una capa crujiente por fuera, y suave y jugosa por dentro. Nuestras freidoras de aire cuentan con una superficie natural Bioceramic™ que ayuda a cocinar hasta 30% más rápido, es fácil de limpiar y dura hasta 8x más que otras superficies.\n\n\nRecubrimiento de cerámica Bioceramic®; 4 veces más resistente a rayaduras (comparado con recubrimiento tradicional).\nCapacidad extra grande de 3.2L (comparado con freidoras de 4L).\nTemporizador de 30 minutos con alerta sonora, control de temperatura variable de hasta 200 °C o 400 °F y una alerta sonora que indica cuando está lista la comida.\nCesta interior extraíble con recubrimiento de cerámica Bioceramic™ fácil de limpiar.\nMango seguro al tacto.\nUtiliza hasta 99.5% menos aceite.\nCanasta extra grande con 3.2 litros de capacidad para preparar múltiples porciones de comidas favoritas y poder cocinar para toda la familia.\nRecomendación: Antes de usar la cesta por primera vez, cubre la superficie con aceite vegetal. Calienta descubierta a una temperatura de 150ºC, por 10 a 15 minutos. Apaga y deja enfriar por completo. Limpia el aceite en exceso en agua caliente, sin frotar.', 0, 94, 'CKSTAF7601-1', '2020-11-02', 1, NULL, NULL);
INSERT INTO `producto` (`id_producto`, `estatus`, `codigo`, `nombre`, `descripcion`, `cantidad`, `precio`, `foto_prin`, `fecha_registro`, `id_departamento1`, `id_departamento2`, `id_departamento3`) VALUES
(450, 'a', 'PC-486R', 'COTUFERA ROJA BRENTWOOD', 'La máquina para hacer palomitas de maíz de aire caliente Brentwood PC-486R de 8 tazas prepara hasta 8 tazas de palomitas de maíz saludables y sin aceite en solo 2-3 minutos. Disfrute de un ahorro 4 veces mayor si utiliza granos sueltos en lugar de bolsas para microondas. Las palomitas de maíz aparecen directamente en su tazón. Siga las recetas incluidas para crear sus propias palomitas de maíz gourmet. Las piezas extraíbles facilitan la limpieza.\n\n8 tazas de palomitas de maíz en solo 2-3 minutos.\nNo se usa aceite para un refrigerio saludable.\nAhorre dinero usando granos sueltos.\nCuchara con tapa de doble propósito / bandeja para derretir mantequilla.\nPalomitas de maíz directamente en su tazón.\nIncluye recetas de palomitas de maíz gourmet.\nFácil de limpiar.\nPiezas removibles.\nColor: Rojo.\nPotencia: 1200w.', 10, 19, 'PC-486R-1', '2021-05-05', 1, 7, 45),
(451, 'a', 'SK-46', 'SARTEN ELECTRICO BRENTWOOD', 'El potente sartén eléctrico antiadherente Brentwood SK-46, de 8 pulgadas, con tapa de vidrio y de 600 vatios, es la solución perfecta para freír, asar a la parrilla, asar, guisar y hornear. Cuenta con un termostato ajustable, dos asas de fácil transporte, tapa de vidrio templado con ventilación de vapor y una superficie antiadherente fácil de limpiar. Prepare cómodamente el desayuno, el almuerzo y la cena mientras ahorra tiempo y electricidad.\n\nCapacidad: 40 onzas.\nCalentamiento uniforme rápido.\nSuperficie antiadherente.\nTemperatura ajustable.\nTapa de vidrio templado con ventilación de vapor.\nColor: Negro.\nPotencia: 600w.', 0, 22, 'SK-46-1', '2021-02-25', 1, 7, 52),
(458, 'a', 'TS-112B', 'CAFETERA NEGRA BRENTWOOD', 'Utilice la cafetera individual con taza Brentwood modelo TS-112B para preparar la taza de café perfecta con hasta 4 cucharadas de su café molido favorito. Simplemente coloque la cnatidad de cafe, agregue agua y presione el botón de encendido. La canasta de filtro reutilizable tiene capacidad para 4 cucharadas, el doble de la fuerza de una taza de café normal. La unidad no contiene BPA y es fácil de limpiar.\n\n• Fácil de usar y limpiar.\n• Filtro y soporte de filtro extraíbles.\n• Capacidad del filtro reutilizable: 4 cucharadas.\n• Incluye bandeja de goteo.\n• Sin BPA.\n• Taza de porcelana incluida.\n• Tamaño de taza compatible 3,5 (H) x 3 (L / W) pulgadas.\n• De color negro.\n• Potencia: 450w.', 5, 24, 'TS-112B-1', '2020-11-02', 1, NULL, NULL),
(437, 'a', 'HM-46', 'BATIDORA DE MANO ROJA BRENTWOOD', 'Utilice la ergonómica y potente batidora manual eléctrica de 5 velocidades Brentwood HM-45 de 150 vatios para batir fácilmente huevos, batir crema, mezclar masa ligera y más durante períodos prolongados. Controle la velocidad y expulse los batidores con una mano. Los batidores aptos para lavavajillas están hechos de metal cromado duradero. La batidora de mano descansa cómodamente sobre su talón.\n\nBatir huevos, batir crema y más.\n5 velocidades.\nDurables batidores cromados.\nPequeños y livianos.\nMango ergonómico.\nBatidores aptos para lavavajillas.\nRespaldo del talón.\nPotencia: 150w.', 0, 13, 'HM-46-1', '2021-02-25', 1, 7, 43),
(454, 'a', 'SM-1162BK', 'BATIDORA PEDESTAL BRENTWOOD', 'Use la batidora de pedestal Brentwood modelo SM-1162BK de 5 velocidades con un tazón de acero inoxidable de 3.5 litros para batir fácilmente huevos, batir crema, mezclar masa y más. Controle la velocidad y expulse los batidores con una mano. Incluye batidores cromados y ganchos para masa aptos para lavavajillas.\n\n• 5 velocidades diferentes.\n• 3.5 litros.\n• Batidores y ganchos para masa incluidos.\n• Piezas extraíbles para lavavajillas.\n• Pies antideslizantes.\n• Potencia: 250w.\n• De color negro.', 0, 41, 'SM-1162BK-1', '2021-02-25', 1, 7, 43),
(461, 'a', 'TS-239BK', 'WAFLERA NEGRA BRENTWOOD', 'La potente máquina de waffles doble antiadherente Brentwood TS-239BL Couture Purse de 1080w cocina dos waffles perfectos en 10 minutos. Cuenta con placas antiadherentes fáciles de limpiar, luces indicadoras de encendido/precalentamiento convenientes, cierre de seguridad contra sobrecalentamiento y almacenamiento vertical compacto. Nuestra máquina para hacer waffles de alta costura agrega un adorable sentido de la moda a su cocina.\n\nMonedero Diseño.\n2 galletas en 10 minutos.\nFácil de Limpiar las placas antiadherente.\nLos mangos frío al tacto.\nPotencia y precalentamiento Luces indicadoras.\nVertical de almacenamiento compacto.\nCable conveniente Wrap.\nCierre de Seguridad de la tapa.\nSeguridad sobrecalentamiento Apagado.\nPotencia: 1080W.\nColor: Negro\n\n', 14, 17, 'TS-239BK-1', '2021-03-15', 1, 7, 42),
(380, 'a', 'AF-15MBK', 'FREIDORA DE AIRE 1.5 NEGRA  BRENTWOOD', 'La potente freidora de aire eléctrica pequeña Brentwood AF-15MBK de 900 vatios y 1,5 litros, fríe rápida y uniformemente con poco o ningún aceite. Haga crujientes papas fritas, aros de cebolla, alitas de pollo, verduras asadas y más. Utilice la guía rápida de temperatura y el temporizador de 30 minutos con apagado automático para obtener resultados rápidos y crujientes. El toque frío, la cesta para freír extraíble y la bandeja de goteo facilitan el servicio. Superficie antiadherente fácil de limpiar.\n\nCapacidad de 1.6 cuartos de galón.\nSaludable, usa poco o nada de aceite.\nCirculación rápida de aire caliente.\nTemporizador de 30 minutos con apagado automático.\nTemperatura ajustable 175-400 ° F.\nSuperficie antiadherente fácil de limpiar.\nCanasta de freír y bandeja de goteo extraíbles.\nRápida Guía de temperatura.\nCómodo almacenamiento del cable.\nColor: Negro.\nPotencia: 900w.', 0, 46, 'AF-15MBK-1', '2021-02-25', 1, 7, 46),
(391, 'a', 'BLSTKAG-BRD', 'LICUADORA OSTER', 'El poderoso motor con alta fuerza de torsión y vaso de vidrio refractario Boroclass® de la licuadora Oster® con control de velocidad tipo perilla son ideales para preparar una amplia variedad de recetas frías y calientes, jugos, batidos y mucho más.\n\n\nMotor cuatro veces más duradero.\nAcople metálico 10 más fuerte.\nJarra de vidrio resistente a un choque térmico de 90°C, que te permite procesar ingredientes hirviendo sin necesidad de esperar a que estos se enfríen.\nPerilla con dos velocidades y pulso.\nCapacidad de 1.5 litros para preparar desde sopas hasta jugos, salsas y bebidas gratinadas con hielo.\nRevolucionaria cuchilla trituradora de hielo.', 9, 36, 'BLSTKAG-BRD-1', '2021-03-01', 1, 5, 35),
(390, 'a', 'BLSTAC-KIT', 'REPUESTO OSTER', 'Conjunto de acople compatible con cualquier licuadora Oster®\nIncluye pin, acople y collarín niquelado\nExclusivo sistema de acomple metálico', 9, 5, 'BLSTAC-KIT-1', '2021-04-09', 1, 5, 31),
(432, 'a', 'GCSTBS4951P', 'PLANCHA FUCSIA', 'Una plancha que cuenta con una base con recubrimiento de cerámica en color, lo que permite un mejor deslizamiento de la plancha sobre cualquier tejido.\n\nBase con recubrimiento de cerámica en color, que permite un deslizamiento superior.\nAjuste variables de vapor para distintos tipos de tejidos.\nEl botón de rociado fino ayuda a alisar arrugas difíciles.\nTanque de agua con 180 ml de capacidad.\nSistema anti-calc que mejora el desempeño de la plancha.\nTemperatura variable para distintos tipos de tejidos.\nCable giratorio de 180º permite una mayor comodidad al momento de utilizar la plancha.', 0, 18, 'GCSTBS4951P-1', '2021-02-22', 1, 5, 37),
(431, 'nv', 'GCSTBS4951L', 'PLANCHA AZUL', '', 0, 0, '', '2020-10-28', 1, NULL, NULL),
(428, 'a', 'GCSTBS4801S', 'PLANCHA  OSTER', 'Con el sistema anti calcáreo este modelo permite un mejor desempeño de la plancha. Su suela antiadherente en color que facilita su deslizamiento, y temperatura y vapor variables que hacen que planchar sea una tarea más fácil.\n\nTemperatura y vapor variables para distintos tipos de tejidos.\nBotón de rociado fino que facilita la tarea del planchado. \nSistema anti-Calc que protege y prolonga la vida de la plancha, y mejora el desempeño de la plancha.\nPotente vapor permite eliminar arrugas mucho más rápido.\nSuela antiadherente en color que facilita el deslizamiento de la plancha.\nCable giratorio de 180º permite una mayor comodidad al momento de utilizar la plancha.\nTanque de agua con 180 ml de capacidad.\nPotencia de la plancha de 1200 W.', 9, 19, 'GCSTBS4801S-1', '2021-03-29', 1, 5, 37),
(442, 'a', 'JB-220B', 'LICUADORA DE 12 VELOCIDADES NEGRA BRENTW', 'La potente licuadora Brentwood modelo JB-220B de 12 velocidades y pulsos de 350 vatios, utiliza cuchillas de acero inoxidable para triturar y pulverizar hielo fácilmente. Elija entre 12 velocidades para mezclar deliciosos batidos, merengadas, proteínas abundantes y más. Incluye frasco y tapa aptos para lavavajillas de 50 oz sin BPA. Práctico almacenamiento de cables.\n\n• Mezcle deliciosos batidos, merengadas, proteínas y más.\n• 12 velocidades + pulso.\n• Cuchillas de acero inoxidable.\n• Incluye frasco de plástico de 50 oz con tapa / tapón de llenado.\n• Piezas extraíbles aptas para lavavajillas.\n• Conveniente almacenamiento de cables.\n• Base antideslizante.\n• De color negro.\n• Potencia: 350w.', 0, 25, 'JB-220B-1', '2021-02-25', 1, 7, 49),
(444, 'a', 'KT-1710BL', 'TETERA AZUL 1.0', 'Hierva agua en minutos con la hervidora eléctrica inalámbrica Brentwood modelo KT-1710BL de acero inoxidable de 1 litro. El hervidor inalámbrico se levanta de la base para facilitar el llenado y vertido. Interior completo de acero inoxidable, elemento calefactor oculto y libre de BPA. Apagado automático, hervir en seco y protección contra sobrecalentamiento para mayor seguridad.\n\n• Capacidad: 1 litro.\n• Interior de acero inoxidable.\n• Elemento calefactor oculto.\n• Inalámbrico para servir fácilmente.\n• Indicador de nivel de agua.\n• Base giratoria 360.\n• Conveniente almacenamiento de cables.\n• Protección para hervir en seco y sobrecalentamiento.\n• Luz indicadora de poder.\n• Color azul.\n• Potencia: 1500w.', 10, 24, 'KT-1710BL-1', '2021-02-25', 1, 7, 44),
(462, 'a', 'TS-239BL', 'WAFLERA AZUL  BRENTWOOD', 'La potente máquina de waffles doble antiadherente Brentwood TS-239BL Couture Purse de 1080w cocina dos waffles perfectos en 10 minutos. Cuenta con placas antiadherentes fáciles de limpiar, luces indicadoras de encendido/precalentamiento convenientes, cierre de seguridad contra sobrecalentamiento y almacenamiento vertical compacto. Nuestra máquina para hacer waffles de alta costura agrega un adorable sentido de la moda a su cocina.\n\nMonedero Diseño.\n2 galletas en 10 minutos.\nFácil de Limpiar las placas antiadherente.\nLos mangos frío al tacto.\nPotencia y precalentamiento Luces indicadoras.\nVertical de almacenamiento compacto.\nCable conveniente Wrap.\nCierre de Seguridad de la tapa.\nSeguridad sobrecalentamiento Apagado.\nPotencia: 1080W.\nColor: Azul.', 8, 17, 'TS-239BL-1', '2021-02-25', 1, 7, 42),
(453, 'a', 'SM-1153', 'BATIDORA DE MANO NEGRA BRENTWOOD', 'Utilice la ergonómica y potente batidora de pedestal Brentwood modelo SM-1153 de 5 velocidades + turbo de 200 W para batir huevos, batir crema, mezclar masa y más fácilmente. Controle la velocidad y expulse los batidores con una mano. Se convierte en batidora de mano. Incluye batidor de masa y batidor cromado apto para lavavajillas, además de un tazón grande de acero inoxidable de 3 litros.\n\n• Bate fácilmente los huevos, la crema, mezclar la masa y más\n• 5 velocidades + Turbo\n• Se convierte en batidora de mano\n• Mango conveniente\n• Incluye batidores, ganchos para masa y tazón de acero inoxidable de 3 litros\n• Bol y batidores aptos para lavavajillas\n• Pies antideslizantes\n• Potencia 200w\n• De color negro', 6, 36, 'SM-1153-1', '2021-02-25', 1, 7, 43),
(455, 'nv', 'SM1200B', 'BATIDORA AJUSTABLE NEGRA BRENTWOOD', 'La potente batidora clásica Brentwood SM-1200B 15oz de 100w te lleva al pasado con su aspecto retro y su color turquesa claro. Mezcle batidos deliciosamente espesos en menos de 2 minutos. Cuenta con velocidades bajas y altas, eje de acero inoxidable duradero y sistema de bloqueo de seguridad que evita derrames. Incluye un vaso de acero inoxidable de 15 oz como en los viejos tiempos.\n\nDiseño clásico de fuente de soda.\nMezcle batidos, licuados, bebidas proteicas y más.\nListo en menos de 2 minutos.\nVelocidades: baja y alta.\nEje de mezcla de acero inoxidable duradero.\nAltura ajustable para una fácil operación.\nEl vaso se bloquea en su lugar para mayor seguridad.\nIncluye 15 onzas Vaso de acero inoxidable.\nPies de goma antideslizantes.\nPotencia: 100w.', 0, 0, 'SM1200B-1', '2020-12-14', 1, NULL, NULL),
(424, 'a', 'GA-125', 'CAFETERA ESPRESSO BRENTWOOD', 'La cafetera para espresso y capuchino Brentwood GA-125 de 800w prepara 4 porciones de espresso rico y cremoso. Potente varilla de vapor incorporada para capuchinos y lattes. Jarra de vidrio templado de tacto frío con pico vertedor fácil. Incluye herramienta de pala / apisonadora 2 en 1. Ahorre dinero con el portafiltro reutilizable de acero inoxidable. Piezas extraíbles fáciles de limpiar.\n\nPrepara 4 porciones.\nJarra de vidrio Cool Touch de 20 oz con pico vertedor.\nPortafiltro reutilizable de acero inoxidable.\nCabezal de grupo táctil frío duradero.\nVaporizador incorporado para Cappuccinos y Lattes\nCuchara y apisonadora 2 en 1.\nLuz indicadora de encendido.\nColor: negro, plateado.\nPotencia: 800w.', 0, 40, 'GA-125-1', '2021-02-25', 1, 7, 44),
(463, 'a', 'TS-250', 'MAQUINA MINI DONAS BRENTWOOD', 'La potente máquina para hacer mini donas antiadherente Brentwood TS-250 de 750 vatios hornea 7 mini donas perfectas en solo unos minutos. Las mini donas se deslizan directamente de las placas antiadherentes fáciles de limpiar. Prácticas luces indicadoras de energía / calor. Se almacena en posición vertical para un almacenamiento compacto. Cuenta con cierre de seguridad por sobrecalentamiento.\n\n7 mini donas listas en minutos.\nTambién hace mini brownies, pasteles, muffins y más.\nPlatos antiadherentes fáciles de limpiar.\nAsas táctiles frías.\nLuces indicadoras de encendido / calor.\nAlmacenamiento vertical.\nCómoda envoltura del cable.\nTapa con cierre de seguridad.\nSeguridad contra sobrecalentamiento Apagado.\nColor: Rosa.\nPotencia: 750w.', 8, 20, 'TS-250-1', '2021-02-25', 1, 7, 50),
(378, 'nv', '2499', 'BATIDORA DE MANO 5 VELOCIDADES', '', 0, 0, '', '2020-10-28', 1, NULL, NULL),
(379, 'a', '6640', 'LICUADORA 10 VELOCIDADES', 'Nuestras resistentes licuadoras cuentan con un exclusivo sistema de acople metálico All-Metal Drive®que prolongan su vida para que puedas licuar, picar y pulverizar los ingredientes más difíciles por mucho más tiempo.\n\nPotente motor de 450 vatios con opción de pulso para un licuado más preciso.\nExclusivo sistema de acople totalmente metálico All-Metal Drive® para mayor durabilidad.\njarra de plástico resistente con capacidad para 6 tazas (1.5 L) que puede lavarse en lava platos.\nRevolucionaria cuchilla de acero inoxidable con exclusivo diseño para licuar hasta los más duros ingredientes.', 0, 34, '6640-1', '2021-03-01', 1, 5, 35),
(381, 'a', 'AF-200BL', 'FREIDORA DE AIRE 1.5 AZUL BRENTWOOD', 'La potente freidora de aire eléctrica pequeña Brentwood AF-200BL de 1.89 litros con temporizador y temperatura. Controle las frituras rápida y uniformemente usando poco o nada de aceite. Haga crujientes papas fritas, alitas de pollo, verduras y más. Cuenta con guía rápida de temperatura y temporizador de 30 minutos con apagado automático. Cesta de freír y bandeja de goteo extraíble y fácil de limpiar. La adorable freidora de aire azul empolvado agrega un toque retro a su cocina.\n\nCapacidad de 1.89 litros.\nSaludable, usa poco o nada de aceite.\nCocción rápida y uniforme con circulación de aire caliente.\nTemporizador de 30 minutos con apagado automático.\nTemperatura ajustable de 175 a 400 grados.\nSuperficie antiadherente fácil de limpiar.\nToque frío, freír extraíble Cesta y bandeja de goteo.\nGuía rápida de temperatura.\nAlmacenamiento del cable.\nColor: Azul pastel.\nPotencia: 800w', 0, 46, 'AF-200BL-1', '2021-02-25', 1, 7, 46),
