(385, 'a', 'AF-350BK', 'FREIDORA DE AIRE NEGRA 3.5 L BRENTWOOD', 'La freidora de aire eléctrica Brentwood AF-350BK 3.5 litros fríe rápida y uniformemente con poco o ningún aceite. Haga crujientes papas fritas, aros de cebolla, alitas de pollo, verduras asadas y más. Utilice la guía rápida de temperatura y el temporizador de 30 minutos para obtener resultados rápidos y crujientes. El toque frío, la sartén y la cesta extraíbles facilitan el servicio. Superficie antiadherente fácil de limpiar.\n\nSaludable, usa poco o nada de aceite.\nCapacidad de 3.5 litros.\nCocción rápida y uniforme.\nTemporizador de 30 minutos.\nTemperatura ajustable 175-400 ° F.\nSuperficie antiadherente fácil de limpiar.\nSartén y canasta removibles.\nCordón retráctil conveniente.\nTemperatura rápida Guía.\nColor: Negro.\nPotencia: 1400w', 10, 75, 'AF-350BK-1', '2021-06-07', 1, 7, 46),
