(387, 'a', 'AR-136', 'TOSTI AREPAS BRENTWOOD', 'La máquina para hacer arepas antiadherente de 6 piezas Brentwood modelo AR-136 produce arepas redondas y tostadas. Incluye prácticos indicadores luminosos de encendido y precalentamiento. Las arepas se deslizan directamente de las placas antiadherentes y la limpieza es muy fácil. Ajuste el fuego de bajo a alto para que esté suave a crujiente. Se coloca en posición vertical para un almacenamiento compacto. También cocina mini panquecas, pan de maíz, huevos y más.\n\n• 6 arepas redondas y tostadas.\n• Cocine mini panqueques, pan de maíz, galletas, huevos y más.\n• Calor ajustable para arepas suaves o crujientes.\n• Recubrimiento antiadherente.\n• Carcasa exterior de plástico Cool Touch.\n• Luz indicadora de encendido y precalentamiento.\n• Almacenamiento vertical compacto.\n• Potencia: 1200w.\n', 10, 36, 'AR-136-1', '2021-02-25', 1, 7, 42),
(392, 'a', 'BLSTKAG-RRD', 'LICUADORA OSTER', 'El poderoso motor con alta fuerza de torsión y vaso de vidrio refractario Boroclass® de la licuadora Oster® con control de velocidad tipo perilla son ideales para preparar una amplia variedad de recetas frías y calientes, jugos, batidos y mucho más.\n\n\nMotor cuatro veces más duradero.\nAcople metálico 10 más fuerte.\nJarra de vidrio resistente a un choque térmico de 90°C, que te permite procesar ingredientes hirviendo sin necesidad de esperar a que estos se enfríen.\nPerilla con dos velocidades y pulso.\nCapacidad de 1.5 litros para preparar desde sopas hasta jugos, salsas y bebidas gratinadas con hielo.\nRevolucionaria cuchilla trituradora de hielo.', 0, 33, 'BLSTKAG-RRD-1', '2021-03-01', 1, 5, 35),
