(395, 'a', 'BLSTKAP-WRD', 'LICUADORA OSTER', 'El poderoso motor con alta fuerza de torsión y vaso de plástico de la licuadora Oster® con control de velocidad tipo perilla son ideales para preparar una amplia variedad de recetas frías y calientes, jugos, batidos y mucho más.\n\nMotor cuatro veces más duradero*\nAcople metálico 10 más fuerte**\nJarra de plástico, que te permite procesar ingredientes hirviendo sin necesidad de esperar a que estos se enfríen\nDos velocidades con pulso \nCapacidad de 1.5 litros para preparar desde sopas hasta jugos, salsas y bebidas gratinadas con hielo\nRevolucionaria cuchilla trituradora de hielo\nColor: Blanco', 10, 33, 'BLSTKAP-WRD-1', '2021-04-07', 1, 5, 35),
(396, 'a', 'BLSTMG-B00', 'LICUADORA NEGRA', 'Esta licuadora con jarra de vidrio de 8 velocidades te da mucha más versatilidad a la hora de preparar licuados, frescas bebidas y comidas con la consistencia ideal. Como cuenta con la confianza que el exclusivo sistema All-Metal Drive®, puedes quedarte tranquila que tendrás un electrodoméstico resistente y fácil de usar por mucho más tiempo.\n\n \nPotente motor de 450 vatios.\nJarra de vidrio refractario Boroclass® con capacidad para 6 tazas (1,5 litros), resiste cambios bruscos de temperatura.\n2 pulsos para los que prefieren tener el control de la licuadora a la hora de mezclar.\nExclusivo sistema de acople totalmente metálico All-Metal Drive®, para máxima durabilidad. \nCuchilla picahielo de acero inoxidable.', 0, 34, 'BLSTMG-B00-1', '2021-03-01', 1, 5, 35),
