(401, 'a', 'BVSTDC3390', 'PERCOLADORA 35 TAZAS OSTER', 'Ahora es posible disfrutar todo el sabor, aroma y textura de un buen café sirviendo hasta 35 tazas y respetando su esencia hasta la última gota. Además, gracias a la función automática, mantendrás el café caliente el tiempo que desees. Fabricado de acero inoxidable\n\nFabricado de acero inoxidable.\nLuz indicadora que señala cuando el café está listo para servir.\nFunción de protección que apaga automáticamente la unidad si no tiene agua adentro.\nMarcas interiores que indican el nivel de agua para un llenado fácil y exacto.\nFunción automática para mantener el café caliente.\nCable removible para facilitar el llenado y la limpieza.\nAsas laterales resistentes al calor que permiten cómodamente mover la percoladora.', 0, 42, 'BVSTDC3390-1', '2021-02-22', 1, 5, 33),
