(407, 'a', 'BVSTEK18B', 'TETERA 1.7 LTS OSTER', 'Capacidad 1.7 litros\nApagado automático con protección de ebullición en seco. \n1500 vatios de potencia.\nVentanas de agua duales.\nBase extraíble.\nTapa de cierre con bisagras.\nLuz indicadora de encendido.\nFiltro de agua de malla extraíble y lavable\n\nLargo: 8.2 Pulgadas\nAncho: 6.5 Pulgadas\nAlto: 11 Pulgadas\nColor: Black\nPeso del Producto: 2.05 Libras', 0, 20, 'BVSTEK18B-1', '2021-03-01', 1, 5, 33),
(408, 'a', 'CG-158B', 'MOLINILLO DE CAFE NEGRO BRENTWOOD', 'El molinillo de café y especias Brentwood CG-158B de 150 vatios utiliza una operación de un toque para moler de manera rápida y uniforme con cuchillas de acero inoxidable duraderas. Vea la aspereza del contenido con la vista superior clara. El sistema de bloqueo de seguridad evita accidentes. Piezas sencillas fáciles de limpiar.\n\nMoler uniformemente granos de café, especias, hierbas y nueces.\nGran capacidad de 4 oz.\nOperación con un solo toque.\nCómoda vista superior clara.\nCuchillas de acero inoxidable duraderas.\nSistema de bloqueo de seguridad.\nFácil de limpiar.\nPies de goma antideslizantes.\nColor: Negro, Plata.\nEnergía: 150w.', 10, 16, 'CG-158B-1', '2021-02-25', 1, 7, 44),
(409, 'a', 'CG-158BL', 'MOLINILLO DE CAFE AZUL BRENTWOOD', 'El molinillo de café y especias Brentwood CG-158B de 150 vatios utiliza una operación de un toque para moler de manera rápida y uniforme con cuchillas de acero inoxidable duraderas. Vea la aspereza del contenido con la vista superior clara. El sistema de bloqueo de seguridad evita accidentes. Piezas sencillas fáciles de limpiar.\n\nMoler uniformemente granos de café, especias, hierbas y nueces.\nGran capacidad de 4 oz.\nOperación con un solo toque.\nCómoda vista superior clara.\nCuchillas de acero inoxidable duraderas.\nSistema de bloqueo de seguridad.\nFácil de limpiar.\nPies de goma antideslizantes.\nColor: Negro, Plata.\nEnergía: 150w.', 10, 16, 'CG-158BL-1', '2021-02-25', 1, 7, 44),
(410, 'a', 'CG120W012000', 'WAFLERA 3 EN 1 OSTER', 'Una sandwichera más que completa con la que podrás preparar no sólo sándwiches sino también waffles, o cocinar alimentos como carnes y vegetales, pudiendo abrirse completamente para usar como parrilla. La altura es regulable, de acuerdo al grosor de lo que quieras elaborar. Además, las superficies de cocción son removibles para que la limpieza sea más fácil,\n\n\nTres-en-uno: placas reversibles para preparar waffles, dorar sándwiches o cocinar alimentos.\nControl variable que te permite seleccionar la temperatura adecuada para cocinar.\nSuperficies de cocción con recubrimiento antiadherente Altura regulable para preparar comidas de cualquier grosor.\nSe abre completamente para cocinar a la parrilla.\nSuperficies de cocción removibles.\nAsas y base frías al tacto.', 0, 45, 'CG120W012000-1', '2021-02-22', 1, 5, 38),
(412, 'a', 'CKSTAM0513', 'TOSTI AREPAS', 'Prepara deliciosas arepas para el desayuno, el almuerzo, la merienda, y hasta la cena. Reina pepiada, de jamón y queso, de carne mechada... las opciones son infinitas. Y lo mejor es que las arepitas se pueden hacer en solo 7 minutos, con la Tosty Arepa Oster®, la original.\n\nSi prefiere arepas más doradas y oscuras, puedes prolongar el tiempo de cocción durante unos minutos más. El Tosty Arepa Oster® cocina hasta un 30% más rápido que los tiempos de cocción tradicionales. Perfecto para cuando estás de prisa, especialmente en la mañana, cuando el tiempo es contado. \n\n\nCapacidad para cocinar 6 arepas al mismo tiempo en aproximadamente 7 minutos.\nCocina un 30% más rápido que los métodos de cocción tradicionales.\nCierre de seguridad que mantiene la unidad cerrada mientras se cocinan las arepas.\nRecubrimiento antiadherente para cocinar y limpiar fácilmente.\nDiseño compacto, que te permite guardarla verticalmente y ahorrar espacio.', 5, 36, 'CKSTAM0513-1', '2021-06-08', 1, 5, 34),
(413, 'a', 'CKSTGR3006', 'PARRILERA ELECTRICA', 'Hacer un asado ahora es más fácil y saludable que nunca. En invierno y verano, en departamento, en tu terraza o cuando vayas de vacaciones. La linea de parrillas Bioceramic® de Oster® es la mejor solución. Bioceramic® es cerámica natural libre de PTFE & PFOA y permite cocinar 20% más rápido, es cuatro veces más duradero y resistente a raspaduras, y es antiadherente.\n\n\nRecubrimiento de cerámica natural Bioceramic® para cocinar más saludablemente. Bioceramic® es libre de PTFE & PFOA, permite cocinar 20% más rápido, es cuatro veces más duradero y resistente a raspaduras, y es antiadherente.\nSuperficie lisa y acanalada.\nTapa de vidrio refractario resistente al calor.\nSuperficie de cocción de 25x35 cm.\nBandeja de goteo extraíble para recoger la grasa y el aceite y cocinar más saludable.\nControl de temperatura extraíble y base, placa de cocción, tapa y bandeja de goteo sumergibles en agua y lavables en lavavajillas para una fácil limpieza.\nDiseño vertical para ahorrar espacio y facilitar el almacenamiento.\nAplicaciones cromado cepillado.\nPotencia de 1500 Watts.\nRecomendación: Antes de usar la parrilla por primera vez, cubra la superficie con aceite vegetal. Caliente descubierto a una temperatura de 150ºC, por 10 a 15 minutos. Apague y deje enfriar por completo. Limpie el aceite en exceso en agua caliente, sin frotar.', 0, 87, 'CKSTGR3006-1', '2021-02-22', 1, 5, 38),
(414, 'a', 'CKSTPC4690', 'OLLA DE PRESION 4LTS', 'Olla de presión de 4 litros Oster 4690\n\nCuatro litros de capacidad y cuatro válvulas de seguridad: siseo, de presión, de resorte y fundible; te brindan toda la confiabilidad que necesitas a la hora de cocinar. Disfruta con tranquilidad gracias a su tapa con cierre de seguridad.\n\nFabricación de aluminio durable y ligero\n4 válvulas de seguridad para mayor confiabilidad\nTapa con cierre de seguridad\nFiltro integrado para retener partículas de alimentos y evitar la obstrucción de la válvula de presión\nDoble asa para un manejo más cómodo', 10, 44, 'CKSTPC4690-1', '2021-06-25', 1, 5, 36),
(415, 'a', 'CKSTPC4692', 'OLLA DE PRESION 7 LTS', 'OLLA DE PRESIÓN CAPACIDAD 7 LTRS TAPA CON CIERRE DE SEGURIDAD VÁLVULA DE PRESIÓN', 0, 49, 'CKSTPC4692-1', '2021-02-22', 1, 5, 36),
(416, 'a', 'CKSTPC4693', 'OLLA DE PRESION 9 LTS', 'OLLA DE PRESIÓN CAPACIDAD 7 LTRS TAPA CON CIERRE DE SEGURIDAD VÁLVULA DE PRESIÓN', 10, 63, 'CKSTPC4693-1', '2021-06-26', 1, 5, 36),
(417, 'a', 'CKSTSK1712', 'SARTEN ELECTRICO OSTER', 'El sartén eléctrico Oster® permite preparar una amplia variedad de alimentos saludables y recetas variadas.\n\n\nCocción más rápida y uniforme.\nInterior antiadherente que no necesita aceite para la preparación de los alimentos, y facilita la limpieza del producto.\nTapa de cristal templado y transparente con borde de acero inoxidable, tiene una mayor durabilidad y permite visualizar la preparación de los alimentos.\nTermostato desmontable con selector de temperatura con diferentes posiciones.\nTapa con orificio para la salida de vapor.', 0, 32, 'CKSTSK1712-1', '2020-11-02', 1, NULL, NULL),
(418, 'a', 'CKSTSKSH12', 'SARTEN ELECTRICO', 'Cocina más rápido, asa y vuélvete creativa, mientras aprovechas la libertad de movimientos y manos libres que te brinda la tapa removible con bisagra de este sartén eléctrico. Una vez servida la comida, aprovecharás su superficie de cocción antiadherente para limpiarla fácilmente.\n\n\nSu práctica tapa removible con bisagra permite que tengas las manos libres para revolver y servir.\nGran capacidad de cocción de 30 x 30 cm.\nLas asas frías al tacto permiten que sea fácil y seguro trasladarlo a la mesa.\nSensor de temperatura ajustable con función para mantener caliente que brinda mayor versatilidad.\nSuperficie de cocción antiadherente con tapa y base aptas para uso en lavaplatos que facilitan su limpieza.\nRecomendación: Antes de usar el sartén por primera vez, cubre la superficie con aceite vegetal. Calienta descubierto a una temperatura de 150ºC, por 10 a 15 minutos. Apaga y deja enfriar por completo. Limpia el aceite en exceso en agua caliente, sin frotar.', 0, 56, 'CKSTSKSH12-1', '2020-11-02', 1, NULL, NULL),
(419, 'a', 'CKSTSM2885', 'SANDWICHERA', 'Tu preparación de la manera más rápida y deliciosa: 2 sándwiches o 4 bocaditos sellados en aproximadamente 4 minutos y con un tostado perfecto y consistente gracias a su termostato automático.\n\n \nTermostato automático para un tostado perfecto y consistente.\nCierre de seguridad para un almacenamiento vertical y compacto.\nPrepara 2 sándwiches o 4 bocaditos sellados en aproximadamente 4 minutos.\nLuces indicadoras de encendido y listo.\nPráctico compartimiento para enroller el cable y almacenamiento vertical para ahorrar espacio.\nSistema de altura ajustable que se adapta a diversos tipos de panes.', 10, 23, 'CKSTSM2885-1', '2021-03-13', 1, 5, 38),
(420, 'a', 'CKSTSM3891', 'SANDWICHERA', 'Tu preparación de la manera más rápida y deliciosa: 2 sándwiches o 4 bocaditos sellados en aproximadamente 4 minutos y con un tostado perfecto y consistente gracias a su termostato automático. Las placas de cocción removibles antiadherentes colaboran con la fácil limpieza de tu electrodoméstico.\n\nPlacas de sándwich removibles con recubrimiento antiadherente.\nTermostato automático para un tostado perfecto y consistente.\nCierre de seguridad para un almacenamiento vertical y compacto.\nLuces indicadoras de encendido y listo.', 1, 34, 'CKSTSM3891-1', '2021-02-22', 1, 5, 38),
(433, 'a', 'GCSTBS4951R', 'PLANCHA ROJA', 'Una plancha que cuenta con una base con recubrimiento de cerámica en color, lo que permite un mejor deslizamiento de la plancha sobre cualquier tejido.\n\nBase con recubrimiento de cerámica en color, que permite un deslizamiento superior.\nAjuste variables de vapor para distintos tipos de tejidos.\nEl botón de rociado fino ayuda a alisar arrugas difíciles.\nTanque de agua con 180 ml de capacidad.\nSistema anti-calc que mejora el desempeño de la plancha.\nTemperatura variable para distintos tipos de tejidos.\nCable giratorio de 180º permite una mayor comodidad al momento de utilizar la plancha.', 0, 18, 'GCSTBS4951R-1', '2021-02-22', 1, 5, 37),
(434, 'a', 'GCSTBV4112', 'PLANCHA ANALOGICA', 'Simple, práctica y fácil de usar, este modelo cuenta con una base de aluminio pulido liviano que te otorga mayor docilidad en el planchado. Además podrás adaptar el calor a cada tejido con el control de temperatura para cuidar más tus prendas y prolongar su vida.\n\nBase de aluminio pulido.\nControl de temperatura variable para diferentes tejidos.\nLuz indicadora de listo para usar.\nAsa ergonómica para lograr un agarre cómodo.', 0, 14, 'GCSTBV4112-1', '2021-02-22', 1, 5, 37),
(435, 'a', 'GCSTBV4119', 'PLANCHA OSTER', '\nPlancha pesada para aplicar menos presión\nBase de aluminio pulido\nBase amplia para un planchado más eficiente\nControl de temperatura variable para diferentes tejidos\nLuz indicadora de listo para usar', 8, 15, 'GCSTBV4119-1', '2021-02-22', 1, 5, 37),
(439, 'a', 'HM-48BL', 'BATIDORA 5 VELOCIDADES BRENTWOOD', 'Utilice la ergonómica y potente batidora manual eléctrica de 5 velocidades Brentwood HM-45 de 150 vatios para batir fácilmente huevos, batir crema, mezclar masa ligera y más durante períodos prolongados. Controle la velocidad y expulse los batidores con una mano. Los batidores aptos para lavavajillas están hechos de metal cromado duradero. La batidora de mano descansa cómodamente sobre su talón.\n\nBatir huevos, batir crema y más.\n5 velocidades.\nDurables batidores cromados.\nPequeños y livianos.\nMango ergonómico.\nBatidores aptos para lavavajillas.\nRespaldo del talón.\nPotencia: 150w.', 7, 17, 'HM-48BL-1', '2021-05-05', 1, 7, 43),
(440, 'a', 'HM-48R', 'BATIDORA DE MANO ROJA BRENTWOOD', 'Utilice la ergonómica y potente batidora manual eléctrica de 5 velocidades Brentwood HM-45 de 150 vatios para batir fácilmente huevos, batir crema, mezclar masa ligera y más durante períodos prolongados. Controle la velocidad y expulse los batidores con una mano. Los batidores aptos para lavavajillas están hechos de metal cromado duradero. La batidora de mano descansa cómodamente sobre su talón.\n\nBatir huevos, batir crema y más.\n5 velocidades.\nDurables batidores cromados.\nPequeños y livianos.\nMango ergonómico.\nBatidores aptos para lavavajillas.\nRespaldo del talón.\nPotencia: 150w.', 10, 18, 'HM-48R-1', '2021-02-25', 1, 7, 43),
(441, 'a', 'HM-48W', 'BATIDORA BLANCA 5 VELOC BRENTWOOD', 'Utilice la ergonómica y potente batidora manual eléctrica de 5 velocidades Brentwood HM-45 de 150 vatios para batir fácilmente huevos, batir crema, mezclar masa ligera y más durante períodos prolongados. Controle la velocidad y expulse los batidores con una mano. Los batidores aptos para lavavajillas están hechos de metal cromado duradero. La batidora de mano descansa cómodamente sobre su talón.\n\nBatir huevos, batir crema y más.\n5 velocidades.\nDurables batidores cromados.\nPequeños y livianos.\nMango ergonómico.\nBatidores aptos para lavavajillas.\nRespaldo del talón.\nPotencia: 150w.', 9, 17, 'HM-48W-1', '2021-02-25', 1, 7, 43),
(447, 'a', 'KT-1900R', 'TETERA DE VIDRIO GLASS BRENTWOOD', 'Hierva agua en minutos con la hervidora eléctrica inalámbrica de vidrio Brentwood modelo KT-1900BK de 1.7L. El hervidor inalámbrico se levanta de la base para facilitar el llenado y vertido. Hervidor de vidrio lleno, elemento calefactor oculto y libre de BPA. Apagado automático, hervir en seco y protección contra sobrecalentamiento para mayor seguridad.\n\n• Capacidad: 1,7 Litros\n• Iluminación LED azul\n• Hervidor de agua lleno de vidrio\n• Elemento calefactor oculto\n• Totalmente libre de BPA\n• Inalámbrico\n• Base giratoria 360 con almacenamiento de cable\n• Protección para hervir en seco y sobrecalentamiento\n• Luz indicadora de poder\n• Color: Rojo\n• Potencia: 1100w', 5, 27, 'KT-1900R-1', '2021-03-29', 1, 7, 44),
(448, 'a', 'KT-1900W', 'TETERA BLANCA BRENTWOOD', 'Hierva agua en minutos con la hervidora eléctrica inalámbrica de vidrio Brentwood modelo KT-1900BK de 1.7L. El hervidor inalámbrico se levanta de la base para facilitar el llenado y vertido. Hervidor de vidrio lleno, elemento calefactor oculto y libre de BPA. Apagado automático, hervir en seco y protección contra sobrecalentamiento para mayor seguridad.\n\n• Capacidad: 1,7 Litros\n• Iluminación LED azul\n• Hervidor de agua lleno de vidrio\n• Elemento calefactor oculto\n• Totalmente libre de BPA\n• Inalámbrico\n• Base giratoria 360 con almacenamiento de cable\n• Protección para hervir en seco y sobrecalentamiento\n• Luz indicadora de poder\n• Color: blanco, plateado\n• Potencia: 1100w', 5, 27, 'KT-1900W-1', '2021-02-25', 1, 7, 44),
(449, 'a', 'MG-400W', 'MOLINO DE CARNE BRENTWOOD', 'El potente molino de carne y embutidora de salchichas eléctrica Brentwood modelo MG-400W de 1200 vatios pica y procesa todo tipo de carnes. Las placas de corte finas y gruesas producen diferentes texturas. Haz salchichas y Kubbe tradicional con los accesorios incluidos. La operación inversa elimina atascos. Piezas extraíbles aptas para lavavajillas.\n\n• Procesa carne de res, pollo y más.\n• Potente picadora de carne de 1200 vatios.\n• 2 velocidades más función de marcha atrás.\n• 2 cuchillas y discos de corte de acero inoxidable\n• Piezas extraíbles fáciles de limpiar\n• Incluye accesorios para salchicha y kubbe\n• Pies de goma antideslizantes\n• Color: blanco, plateado\n• Potencia: 400w', 0, 78, 'MG-400W-1', '2021-02-25', 1, 7, 51),
(464, 'a', 'TS-251', 'MAQUINA MINI PRETZELS BRENTWOOD', 'La potente máquina para hacer mini pretzels antiadherentes Brentwood TS-251 de 750 vatios hornea 7 mini pretzels perfectos en solo 5 minutos. Los mini pretzels se deslizan directamente de las placas antiadherentes fáciles de limpiar. Prácticas luces indicadoras de energía / calor. Se almacena en posición vertical para un almacenamiento compacto. Cuenta con cierre de seguridad por sobrecalentamiento.\n\n7 mini pretzels listos en 5 minutos.\nIncluye recetas de inmersión.\nPlatos antiadherentes fáciles de limpiar.\nAsas táctiles frías.\nLuces indicadoras de encendido/calor.\nAlmacenamiento vertical.\nCómoda envoltura del cable.\nTapa con cierre de seguridad.\nCierre de seguridad por sobrecalentamiento.\nColor: Verde.\nEnergía: 750w.', 10, 23, 'TS-251-1', '2021-04-09', 1, 7, 50),
(465, 'a', 'TS-252', 'MAQUINA MINI CUP CAKE BRENTWOOD', 'La potente máquina para hacer mini cupcakes antiadherente Brentwood TS-252 de 750 vatios hornea 7 mini cupcakes perfectos en solo unos minutos. Incluye varias recetas deliciosas. Los mini cupcakes se deslizan directamente de los platos antiadherentes fáciles de limpiar. Prácticas luces indicadoras de energía/calor. Se almacena en posición vertical para un almacenamiento compacto. Cuenta con cierre de seguridad por sobrecalentamiento.\n\n7 mini cupcakes listos en minutos.\nIncluye múltiples recetas deliciosas.\nPlatos antiadherentes fáciles de limpiar.\nAsas táctiles frías.\nLuces indicadoras de encendido/calor.\nAlmacenamiento vertical.\nCómoda envoltura del cable.\nTapa con cierre de seguridad.\nCierre de seguridad contra sobrecalentamiento.\nColor: Rosa.\nPotencia: 750w.', 4, 20, 'TS-252-1', '2021-04-07', 1, 7, 50),
(466, 'a', 'TS-253', 'ANIMAL WAFFLES BRENTWOOD', 'La potente máquina antiadherente para hacer waffles con forma de animal Brentwood TS-253 de 750 vatios hornea 3 mini waffles de animales perfectos en solo minutos. Los waffles se deslizan directamente de las placas antiadherentes fáciles de limpiar. Prácticas luces indicadoras de energía/calor. Se almacena en posición vertical para un almacenamiento compacto. Cuenta con cierre de seguridad por sobrecalentamiento.\n\n3 mini waffles con forma de animal listos en minutos.\nIncluye múltiples recetas deliciosas.\nPlatos antiadherentes fáciles de limpiar.\nAsas táctiles frías.\nIndicadores luminosos de encendido/calor.\nAlmacenamiento vertical.\nCómoda envoltura del cable.\nTapa con cierre de seguridad.\nCierre de seguridad contra sobrecalentamiento.\nColor : Azul.\nPotencia: 750w.', 8, 23, 'TS-253-1', '2021-04-10', 1, 7, 50),
(467, 'a', 'TS-306', 'ESTUFA ELECTRICA 1 HORNILLA BRENTWOOD', 'Utilice la potente hornilla eléctrica individual Brentwood TS-306 de 1200 vatios para todas sus necesidades de cocina. Ajuste el calor de bajo a alto. La bobina eléctrica proporciona un calentamiento uniforme. La práctica luz indicadora se ilumina cuando se enciende. El diseño portátil y liviano ocupa poco espacio en el mostrador y se almacena fácilmente. Los pies antideslizantes mantienen la unidad segura en su lugar.\n\nDistribución uniforme del calor.\nCalor ajustable hasta 600 grados.\nDiseño pequeño y liviano.\nFácil de limpiar.\nLuz indicadora de energía.\nPies antideslizantes.\nColor: Negro.\nPotencia: 1200w.', 0, 11, 'TS-306-1', '2021-02-26', 1, 7, 47),
(468, 'a', 'TS-321BK', 'ESTUFA ELECTRICA 1 HORNILLA BRENTWOOD', 'Utilice la potente hornilla eléctrica individual Brentwood TS-321BK de 1000 vatios para todas sus necesidades de cocina. Ajuste el calor de bajo a alto. La bobina eléctrica proporciona un calentamiento uniforme. La práctica luz indicadora se ilumina cuando se enciende. El diseño portátil y liviano ocupa poco espacio en el mostrador y se almacena fácilmente. Superficie y bandeja de goteo fáciles de limpiar. Los pies antideslizantes mantienen la unidad segura en su lugar.\n\nDistribución uniforme del calor.\nCalor ajustable.\nDiseño pequeño y liviano.\nFácil de limpiar.\nLuz indicadora de energía.\nPies antideslizantes extra anchos.\nColor: Negro.\nPotencia: 1000w.', 10, 14, 'TS-321BK-1', '2021-02-26', 1, 7, 47),
(469, 'nv', 'TS-322W', 'ESTUFA ELECTRICA 1 HORNILLA BRENTWOOD', '', 0, 0, '', '2020-10-28', 1, NULL, NULL),
(470, 'a', 'TS-345B', 'HORNO TOSTADOR NEGRO BRENTWOOD', 'El potente horno tostador de 4 rebanadas de acero inoxidable Brentwood TS-345B de 800w puede tostar, asar y hornear una variedad de alimentos. Rangos de temperatura ajustables de 50 a 450 grados. Elija entre las funciones de temporizador de 15 minutos con apagado automático y permanencia activa. Dos posiciones de parrilla y dos elementos calefactores aseguran un tostado uniforme. Práctica bandeja para migas. Incluye bandeja de comida y rejilla.\n\nTostar, hornear y asar a la parrilla.\nTemperatura ajustable 50-450F.\nTemporizador de 15 minutos con apagado automático.\nFunción Stay On.\n2 posiciones de parrilla.\nElemento calefactor de cuarzo de 2 piezas • Cámara recubierta de zinc.\nBandeja para migas.\nLuz indicadora de encendido.\nIncluye bandeja de comida y Parrilla.\nColor: plateado, negro.\nPotencia: 800w.', 0, 29, 'TS-345B-1', '2021-02-25', 1, 7, 42),
(471, 'nv', 'TS-345W', 'HORNO TOSTADOR BLANCO BRENTWOOD', '', 0, 0, '', '2020-10-28', 1, NULL, NULL);
INSERT INTO `producto` (`id_producto`, `estatus`, `codigo`, `nombre`, `descripcion`, `cantidad`, `precio`, `foto_prin`, `fecha_registro`, `id_departamento1`, `id_departamento2`, `id_departamento3`) VALUES
(472, 'a', 'TS-361BK', 'ESTUFA ELECTRICA DE 2 HORNILLA BRENTWOOD', 'La potente hornilla eléctrica doble Brentwood TS-361BK de 1500 w produce un calor uniforme y ajustable. Cuenta con una luz indicadora de energía. El diseño pequeño y liviano ocupa poco espacio en el mostrador. Fácil de limpiar.\n\nQuemadores de 1000w y 500w.\nDistribución uniforme del calor.\nCalor ajustable.\nDiseño pequeño y liviano.\nFácil de limpiar.\nLuz indicadora de energía.\nPies antideslizantes extra anchos.\nColor: Negro.\nPotencia total: 1500w.', 10, 25, 'TS-361BK-1', '2021-02-25', 1, 7, 47),
(473, 'a', 'TS-361W', 'ESTUFA ELECTRICA BLANCA', 'La potente hornilla eléctrica doble Brentwood TS-361BK de 1500 w produce un calor uniforme y ajustable. Cuenta con una luz indicadora de energía. El diseño pequeño y liviano ocupa poco espacio en el mostrador. Fácil de limpiar.\n\nQuemadores de 1000w y 500w.\nDistribución uniforme del calor.\nCalor ajustable.\nDiseño pequeño y liviano.\nFácil de limpiar.\nLuz indicadora de energía.\nPies antideslizantes extra anchos.\nColor: Negro.\nPotencia total: 1500w.', 10, 27, 'TS-361W-1', '2021-02-25', 1, 7, 47),
(474, 'a', 'TS-368', 'ESTUFA ELECTRICA 2 HORNILLAS', 'La potente hornilla eléctrica doble Brentwood TS-368 de 1500 watts produce un calor uniforme y ajustable. Cuenta con quemadores de 1000w y 500w con luz indicadora de potencia. El diseño pequeño y liviano ocupa poco espacio en el mostrador. Fácil de limpiar.\n\n• Quemadores de 1000w y 500w\n• Distribución uniforme del calor\n• Calor ajustable\n• Diseño pequeño y liviano\n• Fácil de limpiar\n• Luz indicadora de poder\n• Pies antideslizantes\n• Color blanco', 10, 37, 'TS-368-1', '2021-04-07', 1, 7, 47),
(475, 'a', 'TS-819', 'PLANCHA ELECTRICA/1500W BRENTWOOD', 'La poderosa plancha eléctrica antiadherente modelo TS-819 de Brentwood con bandeja de goteo mide 9 por 18 pulgadas, suficiente parrilla para cocinar alimentos para toda la familia. Disfrute de panquecas, huevos, tocino y más. Incluye bandejas de goteo y calentamiento extraíbles aptas para lavavajillas. Tiene asas de tacto frío y temperatura ajustable.\n\n• Haga panquecas, huevos, tocino y más.\n• Plancha de tamaño familiar de 9 x 18 pulgadas.\n• Plancha de aluminio fundido a presión.\n• Bandeja de goteo apta para lavavajillas.\n• Temperatura ajustable.\n• Superficie antiadherente.\n• Asas Cool Touch.\n• Luz indicadora de poder.\n• De color negro.\n• Potencia: 1500w.', 10, 32, 'TS-819-1', '2021-02-25', 1, 7, 42),
(476, 'a', 'TS-820', 'PARRILLERA BRENTWOOD', 'La poderosa plancha eléctrica antiadherente Brentwood TS-820 con bandeja de goteo mide 10 por 20 pulgadas, suficiente parrilla para cocinar alimentos para toda la familia. Disfrute de panqueques, huevos, tocino perfectos. Incluye bandejas de goteo y calentamiento extraíbles aptas para lavavajillas. Tiene asas de tacto frío y temperatura ajustable.\n\nPlancha de tamaño familiar de 10 x 20 pulgadas.\nPrepara panqueques, huevos, tocino y más.\nPlancha de aluminio fundido a presión que se calienta rápida y uniformemente.\nIncluye bandeja para goteo y calentamiento apta para lavavajillas.\nTemperatura ajustable.\nSuperficie antiadherente fácil de limpiar.\nAsas de tacto frío.\nLuz indicadora de energía.\nColor: Negro.', 10, 34, 'TS-820-1', '2021-02-25', 1, 7, 42),
(477, 'a', 'TSSTTV10LTB', 'HORNO TOSTADOR', 'El horno tostador que te permite preparar una amplia variedad de deliciosas comidas y bocadillos.\n\nCapacidad para 4 rebanadas/10 litros.\nControl de temperatura completamente ajustable de 90°C a 230°C (194°F a 450°F) para una amplia variedad de usos.\nRejilla ajustable a dos posiciones y capacidad de 10 litros con una bandeja para hornear y una parrilla para asar.\nFunciones para hornear, asar, tostar y recalentar que te permite crear comidas y refrigerios con facilidad.\nÚtil cronómetro de 30 minutos que apaga el horno automáticamente para mayor seguridad.', 0, 40, 'TSSTTV10LTB-1', '2021-02-22', 1, 5, 34),
(478, 'nv', 'TSSTTVSK01', 'HORNO DE CONVECCION OSTER', '', 0, 0, '', '2020-10-28', 1, NULL, NULL),
(479, 'a', 'TSSTTVVG01', 'HORNO OSTER', 'Este horno compacto te permite elegir entre las funciones de hornear, asar y tostar para que logres un resultado mucho más preciso de acuerdo a tus necesidades.\n\n\nTamaño compacto ideal para espacios pequeños.\nCapacidad para 4 rebanadas.\nCon funciones para tostar, hornear y dorar.\nCronómetro de 30 Minutos con opción de encendido permanente.\nPerilla de control de temperatura.\nControl de intensidad del tostado.\nIncluye bandeja para hornear duradera para facilitar la cocción.\nIndicador de encendido se ilumina cuando el horno esta prendido.', 0, 36, 'TSSTTVVG01-1', '2021-02-22', 1, 5, 34),
(480, 'a', 'D3015-S1520F', 'Combo Plancha Alisadora + Secador Rosegold', 'Consigue un cabello increíblemente suave y sin frizz con este combo de Plancha Alisadora más Secador Rose Gold Remington. La plancha tiene placas de cerámica 25mm y temperatura máxima de 205°C, y el secador tiene rejillas recubierta de cerámica + iones. Gracias a esta exclusiva tecnología podrás lucir un pelo bonito cada día, sea cual sea el peinado que desees crear.\nGarantía de 2 años.\"\n\n\n\nPlacas de ceramica de 25mm recubiertas de ceramica\n\nPlancha con 2 niveles de temperatura\n\nPotente secador de 1875W de potencia\n\nSecador con 3 ajustes de temperatura\n\nPlancha con placas flotantes y cable giratorio', 0, 35, 'D3015-S1520F-1', '2021-04-07', 65, 66, 69),
(481, 'nv', 'PR1335-MB06A', 'Kit Afeitadora + Cortador de detalles', 'Afeitadora rotativa con cortador de Barba y Bigote, ideal para afeitar y detallar.\n\nCuchillas TwinTrack™ para máximo contacto el piel.\nCuchillas de PrecisionPlus™ tienen ranuras y agujeros.\nPowerFlex 360º permite que el cabezal se ajuste.\nCabezal antimicrobiano ayuda inhibir las bacterias\nRecargable para 40 minutos de uso', 0, 0, 'PR1335-MB06A-1', '2021-04-07', 65, 66, 67),
(482, 'a', '50129', 'LICUADORA 10 VEL. ROJO H-B', 'Ideal para batidos, malteadas y bebidas heladas.\nJarra de 48 oz apta para lavavajillas: jarra de una pieza se coloca en el lavavajillas para facilitar la limpieza\n10 funciones de mezcla que hacen batidos perfectos y mucho más\nMotor de potencia máxima de 500 vatios\nCuchillas de acero inoxidable\nLa base del tarro estable en el mostrador se asienta para evitar que se vuelque\nFácil de usar: las funciones de mezcla claramente etiquetadas facilitan la selección de la velocidad adecuada para cada trabajo\nLibre de BPA en zonas de comida\n \n\nDimensiones (pulgadas): 14,68 H x 7,87 W x 6,29 D', 8, 32, '50129-1', '2021-02-23', 1, 8, 56),
(484, 'a', '38513P', 'PLANCHA ELÉCTRICA ANTIADHERENTE', 'Superficie de cocción antiadherente\nBandeja de grasa apta para lavavajillas\nAsas frias al tacto\nControl de temperatura ajustable\nTotalmente sumergible sin cable\nTamaño familiar', 0, 31, '38513P-1', '2021-02-23', 1, 8, 53),
(483, 'a', '38526', 'Sartén Eléctrico', 'Superficie de cocción antiadherente\nCalor ajustable\nAsas de tacto frío\nTapa de vidrio apta para lavavajillas\nAptas para el lavavajillas\n16,3 pulgadas de ancho (incluyendo mangos y sonda), 14,2 pulgadas (sin sonda) o 11,2 pulgadas (sin mangos ni sonda)', 0, 32, '38526-1', '2021-02-23', 1, 8, 53),
(485, 'a', '37538N', 'ARROCERA 20 TAZAS ANTIADHERENTE H-B', 'Versátil: cocina arroz de todo el mundo\nArroz perfecto cada vez\nLa capacidad de arroz es de 20 tazas cocidas (10 tazas sin cocer)\nCocina el arroz automáticamente y luego cambia a calentar\nAccesorios incluidos: cesta para cocinar al vapor, paleta de arroz y recipiente medidor\nRecipiente antiadherente y tapa de vidrio aptos para lavavajillas\n \nDimensiones (pulgadas): 10,83 H x 12,72 W x 10,71 D', 10, 33, '37538N-1', '2021-02-24', 1, 8, 57),
(486, 'a', 'KT-2150BL', 'MAQUINA DE HACER CAFE Y TE FRIO AZUL', 'Utilice la cafetera y tetera helada KT-2150BK de Brentwood con jarra de 64 onzas para preparar grandes cantidades de sus cervezas favoritas. Cuenta con un selector de fuerza, canasta de filtro reutilizable, apagado automático y jarra con tapa de 3 posiciones. Un día caluroso puede ser un gran día con su elección de té helado o café helado.\n\n• Prepara té helado y café\n• Rinde 8 porciones\n• Incluye jarra de 64 oz\n• Botón de encendido / apagado simple\n• Cesta de filtro reutilizable\n• Dial selector de fuerza\n• Diseño de cabezal de ducha\n• Tapa de 3 posiciones\n• Apagado automático\n• Almacenamiento de cables\n• De color negro\n• Potencia: 700w', 10, 29, 'KT-2150BL-1', '2021-02-25', 1, 7, 44),
