(541, 'a', '10713', 'LEGO CLASICO CREATIVE SUITCASE 210 PZ', 'Organiza tus ladrillos de construcción LEGO y llévalos donde quiera que vayas en esta maleta creativa LEGO Classic de color amarillo.\nEsta funda portátil LEGO Classic alberga un mundo de creatividad para niños e incluye una selección de coloridas piezas LEGO Classic, incluyendo ladrillos, formas, ruedas y ojos.\nLa maleta mide más de 10 pulgadas de altura, 11 pulgadas de ancho y 2 pulgadas de profundidad.\n213 piezas - para niños y niñas de más de 4 años.\nLos conjuntos de construcción LEGO Minecraft son compatibles con todos los conjuntos de construcción LEGO para construcción creativa.', 0, 35, '10713-1', '2021-03-04', 2, 27, NULL),
