(546, 'a', '23241', 'PLAY-DOH 4 TARROS MINI 20Z', 'Convierte un día gris en una colorida y creativa maratón de formas! Abre estas cuatro minilatas de compuesto PLAY-DOH y da rienda suelta a tu imaginación. ¡Mezcla y combina colores y luego moldea, da formas, presiona y da vida a tus creaciones!\nIncluye 4 latas de compuesto para moldear Play-Doh (rojo, amarillo, azul y verde) de 2 onzas.\nIncluye 4 latas de compuesto para moldear Play-Doh.\nPara niños de 2 años en adelante.', 0, 10, '23241-1', '2021-03-04', 2, NULL, NULL),
(547, 'a', '31108', 'HORNO DE CONVECCION/ ROSTIZADOR/ TOSTADOR', 'Rostizador giratorio\nLa carne se coce a sí misma al girar\nSirve para un pollo de 5 lb o un asado de 5 lb\nCapacidad extra grande para dos pizzas de 30cm (12\") o dos guisos 23x23cm (9\"x13\")\nConfiguraciones de ajuste: convección, horneado y asado\nLa configuración de convección cocina más rápido que el horno convencional\n3 perillas con diseño de giro fácil\nTemporizador de 2 horas con apagado automático y opción para permaneces encendido\nDetalles de acero inoxidable\nIncluye bandeja para hornear / bandeja de goteo revestida de esmalte, brocheta para rostizar y elevador para asar\n \n\n  Dimensiones (pulgadas): 13.11 H x 20.62 W x 16.54 D', 0, 86, '31108-1', '2021-02-23', 1, 8, 55),
(548, 'a', '31225', 'HORNO AIR FRY 6 FUNCIONES 1800W H-B', 'Función air fry\n1800 vatios de potencia\n6 configuraciones de funciones brindan muchas opciones de cocción\nHorno de encimera versátil y freidora en uno\nHorno espacioso para preparar comidas familiares de cualquier tamaño\nIncluye canasta de malla metálica para freír al aire y 2 posiciones de rejilla para horno\nBandeja para migas deslizable para una fácil limpieza\nDimensiones (pulgadas): 12,7 H x 17,6 W x 15,7 D', 0, 126, '31225-1', '2021-02-23', 1, 8, 55),
(549, 'a', '31334D', 'HORNO TOSTADOR H-B', 'Fácil acceso a la encimera\nFácil acceso a la comida\nFácil acceso a la comida y la encimera.\nFácil de mantener limpio: la comida no se puede derramar en la puerta\nPuerta extraíble para una fácil limpieza.\nFunciones de hornear, asar y tostar\nPara 4 rebanadas de pan tostado o pizza de 9 ”\nIncluye bandeja para hornear\n2 posiciones de rejilla\nBandeja para migas de acceso frontal\nTemporizador de 30 minutos con apagado automático\nPerillas contorneadas de fácil giro', 0, 52, '31334D-1', '2021-02-23', 1, 8, 55),
