(713, 'a', '37530Z', 'VAPORERA DIGITAL PARA ALIMENTOS H-B', 'Use un tazón humeante o apile dos tazones para cocinar al vapor cantidades más grandes\nRetire el divisor entre los tazones para cocinar al vapor alimentos grandes, como mazorcas de maíz o una cabeza de brócoli.\nCocina al vapor pescado delicado, langosta, camarones, almejas, mejillones y ostras\nIncluye un tazón de arroz que es perfecto para arroz blanco o integral y alimentos pequeños.\nCocina los huevos en posición vertical, de blandos a duros.\nEl panel táctil digital facilita la configuración del temporizador de cuenta regresiva y otras funciones\nCambia a WARM automáticamente y le avisa con un pitido cuando se acaba el tiempo de cocción\nEl ajuste CALIENTE funciona durante una hora y luego se apaga el vaporizador\nEl temporizador DELAY START le permite llenar la vaporera con productos agrícolas por adelantado y comenzar a cocinar al vapor más tarde (no lo use para pescados, mariscos, carnes o aves crudas)\nEl cuenco de arroz y la bandeja de goteo son aptos para lavavajillas\nTabla de cocción al vapor incluida en la guía de uso y cuidado\nEl diseño de almacenamiento anidado se adapta perfectamente a su gabinete de cocina\nCocina al vapor pechugas de pollo y salchichas\nDimensiones (pulgadas): 12.6 H x 13.7 W x 7.28 D', 1, 39, '37530Z-1', '2021-02-24', 1, 8, 57),
(714, 'a', '37532N', 'OLLA ARROCERA 20 TZ ANTIADHERENTE', 'Versátil: cocina arroz de todo el mundo\nArroz perfecto cada vez\nLa capacidad de arroz es de 20 tazas cocidas (10 tazas sin cocer)\nCocina el arroz automáticamente y luego cambia a calentar\nAccesorios incluidos: cesta para cocinar al vapor, paleta de arroz y recipiente medidor\nRecipiente antiadherente y tapa de vidrio aptos para lavavajillas', 8, 34, '37532N-1', '2021-02-24', 1, 8, 57),
(715, 'a', '37542', 'OLLA ARROCERA 20 TZ. ANTIADHERENTE', 'Versátil: cocina arroz y cereales de todo el mundo.\nCocine hasta 20 tazas de todo tipo de arroz (10 tazas sin cocer)\nArroz perfecto cada vez\nCocina el arroz automáticamente y luego cambia a calentar\nAccesorios incluidos: cesta para cocinar al vapor, paleta de arroz y recipiente medidor\nRecipiente antiadherente y tapa de vidrio aptos para lavavajillas\nDimensiones (pulgadas): 10,83 H x 12,72 W x 10,71 D', 7, 34, '37542-1', '2021-02-24', 1, 8, 57),
