(728, 'a', '38518R', 'ASADOR ELECTRICO CERAMICA H-B', 'Plancha Antiadherente Durathon\n\nRevestimiento antiadherente cerámico Durathon®, 4 veces más duradero que el antiadherente tradicional, no se agrieta ni se despega\n200 pies cuadrados de superficie de cocción\nSuperficie de cocción de cerámica antiadherente:\n4 veces más duradero\nSin PTFE y PFOA\nTotalmente sumergible sin cable\nCalor ajustable\nAsas de tacto frío\nBandeja de grasa extraíble apta para lavavajillas', 0, 37, '38518R-1', '2021-02-23', 1, 8, 53);
