(729, 'a', '42088', 'LEGO TECHNIC CHERRY PICKER', 'Construye un recolector de cerezas LEGO Technic con mecanismo de elevación detallado, brazo de trabajo y cesta, 4 luces de advertencia de peligro, 2 balizas de advertencia y ruedas de trabajo con neumáticos gruesos.\nJuego 2 en 1 de LEGO Technic- se reconstruye en un camión de remolque, descubre los bloques de construcción de máquinas mecánicas de la vida real con mecanismos de engranaje realistas de LEGO Technic\nEl recogedor de cerezas (con pluma bajada) mide más de 2.8 in de altura, 5.5 in de largo y 2.0 in de ancho, y más de 4.7 in de alto con el remolque extendido de la pluma mide más de 2.8 in de altura, 4.7 in de largo y 2.0 in de ancho.\n155 piezas – para niños y niñas a partir de 7 años y para fans y niños de todas las edades.\nEste juego LEGO Technic Cherry Picker 42088 se puede construir junto con todos los otros juegos de LEGO originales y ladrillos LEGO para un edificio creativo.', 0, 20, '42088-1', '2021-03-04', 2, NULL, NULL),
(730, 'a', '42091', 'LEGO TECHNIC POLICE PURSUIT', 'Construye un impresionante vehículo de policía con un potente motor de retroceso, luces de advertencia rojas y azules, parachoques delantero aerodinámico, alerón trasero grande y llantas negras anchas con neumáticos de perfil bajo.\nCombina este modelo con el 42090 Getaway Truck Pull Back para acción repleta de persecuciones de alta velocidad o para crear el último modelo 4x4 Combi\nMide más de 2 pulgadas (2.4 in) de alto, 7 pulgadas (7.9 in) de largo y 3 pulgadas (3.9 in) de ancho, el modelo Combi mide más de 3 pulgadas (3.9 in) de alto, 9 pulgadas (9.1 in) de largo y 3 pulgadas (3.9 in) de ancho.\n120 piezas: para niños y niñas de 7 años y para fans y niños de todas las edades.\nEste juego LEGO Technic Police Pursuit 42091 se puede construir junto con todos los otros juegos originales de LEGO y ladrillos LEGO para la construcción creativa.', 1, 36, '42091-1', '2021-03-01', 2, 27, NULL),
(731, 'a', '465-15', 'LICUADORA C/VASO DE VIDRIO 2 VEL. OSTER', 'Utiliza su cuchilla trituradora para pulverizar el hielo y utilizarlo en increíbles bebidas. Su funcionalidad te acompañará por mucho más tiempo ya que su sistema de acople metálico All-Metal Drive® la vuelve más resistente y duradera.\n\n\n \n\nPotente motor de 500 vatios\nJarra de vidrio refractario con capacidad para 5 tazas (1,25 litros)\nControl giratorio de 2 velocidades\nClásico diseño cromado\nExclusivo sistema de acople totalmente metálico All-Metal Drive® para máxima durabilidad\nPulveriza hielo con la cuchilla trituradora de hielo', 0, 55, '465-15-1', '2021-03-01', 1, 5, 35),
(732, 'a', '4732', 'OLLA ARROCERA 1.8 LITROS  10 TAZAS OSTER', 'Con nuestra arrocera multiusos, cocina arroz y todo lo que puedas imaginar de la manera más fácil, rápida y rendidora, ya que tiene una capacidad de 1,8 litros. ¿No quieres comer arroz hoy? Puedes volverte creativa a la hora de crear preparaciones saludables gracias a su bandeja para cocer al vapor. Usa la función automática para mantener tus comidas perfectas hasta la hora de servirlas. Además podrás limpiarla fácilmente gracias a su tazón interno removible de aluminio con recubrimiento antiadherente.\n\n \n\nElegante diseño de acero inoxidable\nCapacidad para 1.8 lts (10 tazas) de arroz cocido\nExclusiva fuente de calor esférica que asegura una cocción uniforme\nOlla con recubrimiento antiadherente removible para una fácil limpieza\nBotón de un solo toque para fácil manejo\nCable de alimentación desmontable\nTapa de vidro refractario con ventilación para evitar la cocción excesiva de los alimentos\nFunción automática para matner el arroz caliente una vez cocido\nIncluye taza medidora y cucharón ', 0, 35, '4732-1', '2021-02-22', 1, 5, 36),
(733, 'a', '4900-011', 'ANILLO DE GOMA P/ LICUADORA SET 2', 'Set De 2 Anillos De Goma\nCompatible con cualquier jarra de licuadora Oster\nMaterial Neopreno\nResistentes\nRepuesto Original', 10, 6, '4900-011-1', '2021-04-09', 1, 5, 31),
