(751, 'a', '52400', 'LICUADORA DE 8 PIEZA H-B', 'Un tamaño para cada trabajo\nMezcla alimentos y bebidas con facilidad\nMotor de potencia máxima de 650 vatios\nAcción de pulso para control de picado\nFrascos Tritan ™ que no se rompen y aptos para lavavajillas\nIncluye:\nUno de 32 oz. tarro con tapa\nUno de 8 oz. taza de molienda con tapa mezcladora\nDos de 16 oz. vasos de viaje con tapa para beber\n\nCombinando la practicidad de una licuadora grande con la conveniencia de una sola porción, la licuadora Hamilton Beach® Stay or Go® se adapta a su ajetreado estilo de vida. Puede hacer batidos, licuados o malteadas fácilmente y también puede hacer puré de salsas o moler quesos duros. Con cuatro contenedores incluidos, esta licuadora tiene el tamaño perfecto para cada trabajo. ', 19, 43, '52400-1', '2021-05-14', 1, 8, 56),
(752, 'a', '54210', 'LICUADORA NEGRA DE 800W / JARRA DE VIDRIO H-B', '40 oz. capacidad\nPotente mezcla para batidos, bebidas heladas y salsas perfectas\nCuchillas trituradoras de hielo de acero inoxidable\nMezcla versátil para batidos, salsas, hummus, bebidas heladas y más\nMotor de 800 vatios de potencia máxima\n14 velocidades con pulso alto / bajo\n2 onzas. tapa de llenado para agregar ingredientes mientras se licua\nTarro y cuchillas extraíbles aptos para lavavajillas\n \n\nDimensiones (pulgadas): 14,69 H x 6,5 W x 8,66 D\n\nPotente mezcla para batidos, salsas, hummus y más\n\nAumente su poder y capacidades de mezcla sin romper el banco con la licuadora multifunción Hamilton Beach®. El resistente a roturas, 40 oz. frasco de vidrio, cuchillas de acero inoxidable y 800 vatios de potencia máxima trabajan juntos para mezclar sin esfuerzo bebidas heladas, puré de hummus, picar salsas y mucho más. Cada una de las 14 velocidades de licuado está etiquetada por función para eliminar las conjeturas, y una de 2 oz. El tapón de llenado le permite agregar ingredientes mientras mezcla. Disfrute de la tranquilidad con una garantía limitada de 3 años y el acceso a nuestro equipo de atención al cliente con sede en EE. UU.\n\nMezcle una variedad de bebidas y alimentos\nEl motor de potencia máxima de 800 vatios proporciona la máxima cantidad de energía en el momento adecuado para permitirle mezclar, mezclar y hacer puré de bebidas, salsas, salsas y más.\n\nResistente a roturas, 40 oz. Jarra de vidrio\nEl frasco de vidrio apto para lavavajillas está diseñado para empujar los alimentos hacia las cuchillas para crear resultados uniformes y uniformes.\n\nCuchillas para triturar hielo de acero inoxidable\nEstas cuchillas pueden manejar todo, desde frutas congeladas hasta sopas calientes.\n\n2 onzas. Tapa\nAgregue aceite de oliva para pestos y aderezos, agregue más vino a su frosé o algunas cucharaditas de proteína en polvo a su batido.\n\nGarantía limitada de 3 años\n¿Qué es mejor que comprar una licuadora de una de las marcas más vendidas? Cuando viene protegido con una garantía de 3 años y acceso a un equipo dedicado a brindar soporte a clientes como usted.', 9, 41, '54210-1', '2021-02-23', 1, 8, 56),
(753, 'a', '54886', 'HW CARRITO METAL BASICO PAQx10', 'HW CARRITO METAL BASICO PAQx10', 8, 25, '54886-1', '2021-03-04', 2, 27, NULL),
(754, 'a', '58140', 'LICUADORA ROJA H-B', 'Hamilton Beach® Power Elite®\nTapa con boquilla facilita el vertido\nToda la potencia que necesita para: mezclar, hacer puré, cortar en pedacitos, triturar hielo, y mucho más con sólo cuatro botones sencillos\nMotor con potencia máxima de 700 watt\n Jarra de vidrio de 48 onzas resistente al lavavajillas\n Exclusivo pico vertedor que evita salpicaduras\nCompartimiento para el cable\nSistema Wave~Action® promueve continuamente la mezcla hacia las cuchillas para resultados suaves y sin trozos de hielo - elimina la necesidad de revolver', 5, 39, '58140-1', '2021-02-23', 1, 8, 56),
(755, 'a', '58144', 'LICUADORA Y PICATODO ROJO H-B', 'Dos electrodomésticos en uno: licuadora y picador\nLa licuadora cuenta con un frasco de vidrio para 5 tazas y el revolucionario sistema Wave-Action® para obtener resultados suaves en todo momento\nEl picador cuenta con un tazón para picar de 3 tazas, ideal para verduras, nueces, salsa, aderezos y salsas\n\nLicuadora\n\nFrasco de vidrio de 5 tazas\nEl revolucionario sistema Wave-Action® empuja continuamente la mezcla hacia las cuchillas para obtener resultados suaves en todo momento\nNo más trozos de hielo\n700 vatios de potencia máxima\nCaño sin ensuciar\nCuchillas de acero inoxidable\n\nPicador\n\nTazón para picar 3 tazas\nIdeal para verduras, nueces, salsa, aderezos y salsas.\nRecipiente aptos para lavavajillas\n2 velocidades más pulso\nAlmacenamiento de cable\nCuchillas de acero inoxidable\n\n\nDimensiones (pulgadas): 14.69 H x 8.5 W x 8.66 D', 5, 50, '58144-1', '2021-02-23', 1, 8, 56),
(756, 'a', '58147', 'LICUADORA 12 FUNC ROJA H-B', 'Potente triturador de hielo con cuchillas patentadas Ice Sabre®\nMotor duradero de potencia máxima de 700 vatios: probado para mezclar 8.000 bebidas heladas\nTodo el poder que necesita para mezclar, hacer puré, cortar en dados, triturar hielo y más, con solo 4 botones simples\n12 funciones de mezcla\nPico vertedor único y patentado que no ensucia\nEl sistema Wave ~ Action® tira continuamente la mezcla hacia las cuchillas para obtener resultados suaves en todo momento, no más trozos de hielo\nApto para lavavajillas 40 oz. El frasco de vidrio está probado contra choque térmico para soportar cambios extremos de temperatura.\nAlmacenamiento de cable\n\n \nDimensiones (pulgadas): 14,69 H x 6,5 W x 8,66 D', 8, 39, '58147-1', '2021-02-23', 1, 8, 56),
(757, 'a', '58148', 'LICUADORA DE 12 V. 700W H-B', 'Licuadora multifunción Power Elite® con frasco de vidrio de 40 oz que no ensucia, 700W negro e inoxidable\n\nPotente triturador de hielo con cuchillas patentadas Ice Sabre®\nMotor duradero de potencia máxima de 700 vatios: probado para mezclar 8.000 bebidas heladas\nTodo el poder que necesita para mezclar, hacer puré, cortar en dados, triturar hielo y más, con solo 4 botones simples\n12 funciones de mezcla\nPico vertedor único y patentado que no ensucia\nEl sistema Wave ~ Action® tira continuamente la mezcla hacia las cuchillas para obtener resultados suaves en todo momento, no más trozos de hielo\nApto para lavavajillas 40 oz. El tarro de vidrio está probado contra choque térmico para soportar cambios extremos de temperatura.\nAlmacenamiento de cable\nRespaldado por 3 años de garantía\nDimensiones (pulgadas): 14,69 H x 6,5 W x 8,66 D\n\nLa licuadora multifunción Power Elite es ideal para mezclar bebidas clásicas como batidos y bebidas heladas, pero tiene el mismo talento para preparar alimentos como salsas y purés. Una vez que esta licuadora multitarea esté en su cocina, se convertirá rápidamente en su electrodoméstico para preparar muchas cosas diferentes. Para simplificar la combinación, sus 4 botones de combinación indican claramente para qué función está diseñado cada botón. Podrá seleccionar rápidamente qué botón presionar para cada tarea de licuado, desde hacer batidos y triturar hielo hasta la preparación de alimentos como puré, dados, picar y rallar.\n\nConsejos y cuidados para el mejor rendimiento\nLa cantidad mínima de líquido necesaria por receta es una taza (8 oz / 250 ml). Agregue más líquido si su mezcla no se mezcla correctamente. Para agregar alimentos o líquidos cuando la licuadora está en funcionamiento, abra la tapa de vertido con bisagras y agregue los ingredientes a través de la abertura. Si la acción de licuado se detiene durante el licuado o los ingredientes se pegan a los lados del frasco, es posible que no haya suficiente líquido en el frasco para licuar de manera eficiente.', 19, 43, '58148-1', '2021-02-23', 1, 8, 56),
(758, 'a', '58149', 'LICUADORA COMADA C/ PROCESADOR H-B', 'Dos electrodomésticos en uno: licuadora y picador\nLa licuadora cuenta con un frasco de vidrio para 5 tazas y el revolucionario sistema Wave-Action® para obtener resultados suaves en todo momento\nEl picador cuenta con un tazón para picar de 3 tazas, ideal para verduras, nueces, salsa, aderezos y salsas\n\nLicuadora\n\nFrasco de vidrio de 5 tazas\nEl revolucionario sistema Wave-Action® empuja continuamente la mezcla hacia las cuchillas para obtener resultados suaves en todo momento\nNo más trozos de hielo\n700 vatios de potencia máxima\nCaño sin ensuciar\nCuchillas de acero inoxidable\n\nPicador\n\nTazón para picar 3 tazas\nIdeal para verduras, nueces, salsa, aderezos y salsas.\nRecipiente aptos para lavavajillas\n2 velocidades más pulso\nAlmacenamiento de cable\nCuchillas de acero inoxidable\n\n\nDimensiones (pulgadas): 14.69 H x 8.5 W x 8.66 D', 8, 50, '58149-1', '2021-02-23', 1, 8, 56),
(759, 'a', '58161', 'LICUADORA MULTIFUNCIONAL H-B', 'Dos frascos para mezclar:\nLicue y vaya con los vaso de 20 oz. y tapa de viaje\nMezcle un lote más grande con la jarra de 40 oz\nMotor de potencia máxima de 700 vatios\nSistema Wave ~ Action® para obtener resultados suaves sin remover\n12 funciones de mezcla, incluidas Pulse y Easy Clean\nPico de tapa sin ensuciar para verter fácilmente desde la jarra de 40 oz.\n\nDimensiones (pulgadas): 15.2 H x 7.8 W x 6.8 D', 4, 47, '58161-1', '2021-02-23', 1, 8, 56),
(760, 'a', '59765', 'BATIDORA DE INMERSION H-B', 'Pica directamente en el tazón\n2 velocidades y múltiples usos\nUn producto para múltiples tareas: Licuar, mezclar, batir, hacer puré y picar\nIncluye varilla para mezclar, batidor y tazón para picar\nAccesorios seguros para el lavavajillas\nMotor de 225 watts\nDimensioness (pulgadas): 14.75 H x 3 W x 2.75 D', 7, 31, '59765-1', '2021-06-03', 1, 8, 54),
(761, 'a', '60138', 'LEGO CITY POLICE HIGH-SPEED CHASE 294', 'Cuenta con un helicóptero de policía con rotores giratorios, persecución policial coche dispone de un spoiler trasero y un coche deportivo con espacio en la parte posterior para billetes y lingotes de oro\nAccesorios incluidos: una radio, unas esposas, 2 barras de oro, 2 billetes, además de una barrera para construir\nIncluye 4 mini cifras: un piloto, un agente de policía, ladrón y un exclusivo para la primavera 2017 Chase McCain\nHelicóptero con rotor blades mide más de 4\" (11 cm) de alto, 12\" (33 cm) de largo y 10\" (26 cm) de ancho\nAlice búsqueda coche mide más de 1\" (4 cm) de alto, 4\" (11 cm) de largo y 1\" (5 cm) de ancho, las medidas de coche deportivo más 1\" (4 cm) de alto, 4\" (12 cm) de largo y 1\" (5 cm) de ancho\nEste fantástico juguete para niños ofrece una experiencia de construir y jugar apropiada para niños de 5 – 12', 1, 68, '60138-1', '2021-03-01', 2, 27, NULL),
(762, 'a', '60180', 'LEGO CITY MONSTER TRUCK 192 PC', 'Incluye una minifigura del piloto de la camioneta monstruo.\nContiene una colorida camioneta monstruo con ruedas enormes, toma de aire en el capó y suspensión real, además de una rampa para construir.\nEste juguete está recomendado para niños de 6 a 12 años.\nLa camioneta monstruo mide más de 4 pulgadas de alto, 5 pulgadas de largo y 3 pulgadas de ancho.\nLa rampa mide más de 3 pulgadas de ancho, 2 pulgadas de profundidad y menos de 1 pulgada de alto.', 0, 33, '60180-1', '2021-03-04', 2, 27, NULL),
