(960, 'a', '98831', 'TWISTER ESPA?OL HASBRO', 'Pon a prueba tu equilibrio con el original Twister. Mano derecha azul, pie izquierdo rojo… Sé el último jugador en quedar en pie y serás el ganador.', 0, 23, '98831-1', '2021-03-04', 2, NULL, NULL),
(961, 'a', 'A2120', 'JENGA CLASICO HASBRO', 'Es el juego de equilibrio y destreza que complementa todas las reuniones. El objetivo es evitar los nervios y tener buen pulso para poder retirar uno a uno los bloques de madera sin derribar la torre.\n\nBloques Jenga de madera\nInstructivo\n6 AÑOS EN ADELANTE', 0, 20, 'A2120-1', '2021-03-04', 2, NULL, NULL),
