(963, 'a', 'AF-32MBK', 'FREIDORA DE AIRE NEGRA 3.2 L', 'Utilice la potente freidora de aire eléctrica Brentwood Select AF-32MBK 3.4 litros de 1500 vatios para freír alimentos a la perfección de manera rápida y uniforme sin la culpa de la grasa y las calorías adicionales. Nuestra freidora requiere poco o nada de aceite para cocinar maravillosamente papas fritas, aros de cebolla, alitas de pollo, bistec, verduras asadas y más. Utilice la guía de temperatura de referencia rápida y el temporizador de 30 minutos para obtener resultados rápidos y crujientes. El toque frío, la sartén y la cesta extraíbles facilitan el servicio. La sartén y la canasta están hechas con una superficie antiadherente para una limpieza sin esfuerzo.\n\n• Saludable, utiliza poco o ningún aceite\n• Cocción rápida y uniforme con circulación de aire caliente rápida\n• Temporizador de 30 minutos\n• Temperatura ajustable de 175 a 400 grados\n• Superficie antiadherente fácil de limpiar\n• Canasta y sartén extraíble Cool Touch\n• Práctico cable retráctil\n• Guía rápida de temperatura\n• Potencia: 1500w', 9, 90, 'AF-32MBK-1', '2021-02-25', 1, 7, 46),
(964, 'a', 'B0011', 'PLAYDOH LIC MY LITTLE PONY SALON', '¿Qué es más divertido que un pony mágico y moderno? ¡Un pony al que le puedes dejar crecer el pelo! Este set de juego Rainbow Dash Style Salon incluye una extrusora de pony que se parece a Rainbow Dash y 6 colores de compuesto de modelado Play-Doh. ¡Puedes hacerle una trenza de arcoíris y cortarla con las tijeras, y hacer todo tipo de adornos divertidos para ella! Cuando tienes el set de juego Rainbow Dash Style Salon, ¡el único límite a la creatividad es tu imaginación! Play-Doh, My Little Pony y todos los personajes relacionados son marcas comerciales de Hasbro.', 0, 20, 'B0011-1', '2021-03-04', 2, 28, NULL),
(965, 'nv', 'B0440', 'AVENGERS MASCARA SURTIDAS', '', 10, 10, NULL, '2021-02-10', 2, NULL, NULL),
(966, 'nv', 'B1169', 'PLAY-DOH DIDACTICO BOLSA BASICA', 'PLAY-DOH DIDACTICO BOLSA BASICA\n', 0, 0, 'B1169-1', '2021-03-04', 2, NULL, NULL),
(967, 'a', 'B3398', 'PLAY- DOH KITCHEN PASTELES', 'Play-Doh Kitchen Creations Pasteles Divertidos ¡Crea agradables pasteles Play-Doh con este set Pasteles divertidos! Con un plato de pastel, canasta de frutas y 5 accesorios, este set permite que los pequeños \"pasteleros\" preparen divertidos dulces dignos de una dulcería Play-Doh. Prepara la masa Play-Doh del pastel, usa los moldes en la base de la canasta de frutas para crear maravillosos rellenos de fruta, ¡y luego decora tus coloridas creaciones con crema! Este set Pasteles divertidos es irresistiblemente imaginativo.\n\nIncluye\n1 Plato de pastel, 1 Canasta de frutas, 5 Accesorios, 4 Latas de masa modeladora Play-Doh\n\nEdad Recomendada 3+', 0, 20, 'B3398-1', '2021-03-04', 2, NULL, NULL),
(968, 'a', 'B3401', 'PLAY-DOH FROZEN OLAF', 'PLAY-DOH FROZEN OLAF', 0, 15, 'B3401-1', '2021-03-04', 2, NULL, NULL),
(969, 'a', 'B4438', 'NERF SOAKER BREACH LANZA AGUA', 'Nerf Super Soaker Breach Blast Pistola De Agua B4438 Hasbro\n\nIncluye 1 lanzador de agua.\nLanzador de agua de gran capacidad.\nCon capacidad para 1,4 litros de agua.\nLanza agua hasta 11,5 metros.\nBombea para lanzar.\n\nEdad: 6 años en adelante', 0, 30, 'B4438-1', '2021-03-04', 2, 27, NULL),
(970, 'a', 'B4440', 'NERF SOAKER ARCO TID LANZA AGUA', '¡Lanza misiles o agua con el Tidal Torpedo Bow! Sorprende a tus oponentes con un poderoso chorro de agua o un enorme misil de espuma. Sumerge la punta del misil en agua para empapar al impactar el misil. El Tidal Torpedo Bow lanza agua hasta 9 metros y tiene capacidad para 650 mL de agua. Viene con 2 misiles de espuma. Para diversión innovadora.\n\n¡nada empapa como un lanzador de agua Super Soaker!\n\n•Incluye 1 lanzador de agua y 2 misiles de espuma\n•Lanza misiles o agua\n•Con capacidad para 650 mL de agua\n•Lanza agua hasta 9 metros\n•Viene con 2 misiles\n•Edad recomendada: 6 años en adelante\n•PRECAUCIÓN No apuntes a los ojos ni a la cara. PARA EVITAR LESIONES: Utiliza sólo agua limpia del grifo y los proyectiles diseñados para este producto. No modifiques los proyectiles ni el lanzaproyectiles.\n•Se producirán piezas pequeñas. No es para niños menores de 3 años.', 0, 40, 'B4440-1', '2021-03-04', 2, 27, NULL),
(971, 'a', 'B4443', 'NERF SOAKER SQUALL LANZA AGUA', 'Sumérjase en un remojo sin parar con el chorro de agua Squall Surge! El Squall Surge presenta un disparo de gatillo presurizado para entregar una corriente de agua creciente. Envíe el chorro de agua hasta 35 pies (10,6 m). Con un diseño táctico, este lanzador de agua tiene capacidad para 16 fl. onz. (473 ml). Para una diversión innovadora de chorro de agua, ¡nada se empapa como un chorro de agua Super Soaker!', 0, 30, 'B4443-1', '2021-03-04', 2, 27, NULL),
(972, 'a', 'B4444', 'NERF SOAKER TORNADO LANZA AGUA', 'Deja a tus contrincantes empapados con el chorro de agua Nerf Tornado Scream Super Soaker. Con una boquilla giratoria, desata un ciclón de agua sobre todos los oponentes. Lanza una amplia corriente de agua para empapar más objetivos. El chorro de agua Nerf Tornado Scream Super Soaker puede contener hasta 35 onzas (1 litro) de agua. Libera una marea masiva de remojo con esta pistola de agua y obtén la ventaja competitiva para una dominación total de la inmersión. Deja a todos los oponentes súper empapados!\n\nDimensiones del producto 42,5 cm x 27,9 cm x 0,64 cm\nPeso del producto 0,805 kg\n\nEdad mínima recomendada 8 años', 0, 35, 'B4444-1', '2021-03-04', 2, 27, NULL),
(973, 'a', 'B5517', 'PLAY-DOH 4 TARROS CLASICO 4 OZ', 'Edad recomendada 2+\nPlay-Doh - Set de 4 colores llamativos, no tóxicos - Latas de 113 gramos\n¡Aprieta, moldea y crear todo lo que imagines!\nImágenes referenciales.', 0, 10, 'B5517-1', '2021-03-04', 2, NULL, NULL),
(974, 'a', 'B5520', 'PLAY-DOH JUEGO DR DENTISTA', 'El dentista bromista! ¡Creatividad, muchos colores y diversión!\n\nIncluye \n*Cabeza. \n*Taladro. \n*Pinzas. \n*Ruedita moldeadora. \n*Cepillo de dientes.\n*Molde en forma de diente.\n*Accesorio. \n*Instructivo.\n*5 Potes de masa. \n\nRequiere 2 pilas AA (No incluidas). \nEdad 3+ ', 0, 22, 'B5520-1', '2021-03-04', 2, NULL, NULL),
(975, 'a', 'B8248', 'NERF SOAKER FLOODIN LANZA AGUA', 'Tu pequeño podrá desatar una guerra con lo nuevo de Nerf, Empapada Masiva, un lanzador que se puede llenar con agua para Lanzar chorros de diversión y disfrutarlo por un largo tiempo.\nRecomendado para niños mayores de 5 años.\n\nIncluye: 1 Lanzador de Agua.\n- Tiene Capacidad de 2 Litros.\n- Lanza hasta 11,5 metros de agua.\n- Recomendado para niños mayores de 5 años.\n- Medidas Aproximadas del producto Alto 17 cm, Ancho 46 cm, Profundo 6 cm.\n- Medidas aproximadas del empaque 30x50x8 cm', 0, 30, 'B8248-1', '2021-03-04', 2, 27, NULL),
(976, 'a', 'B9014', 'PLAY-DOH KITCHEN ESTUFA SONIDO', 'Ahora los chicos pueden cocinar con sus set de sartenes de Play-Doh, las cuales hacen sonidos reales\n\n\"Prende\" una de las sartenes y pon tu comida Play-Doh para que se escuche como si estuviera en una sartén de verdad.\n\nIncluye estufa, 12 accesorios y 5 latas de Play-Doh\n\nEdad +3', 0, 32, 'B9014-1', '2021-03-04', 2, NULL, NULL),
(977, 'a', 'BEST02-E01', 'LICUADORA MOTOR REVERSIBLE 2 VEL. 5 TZ', 'Esta tecnología consta de un motor que hace girar la cuchilla hacia adelante y hacia atrás logrando, gracias a su potencia y especialmente a sus aspas, que los ingredientes se mantengan en el centro durante la rotación a una velocidad continua. De esta manera, garantiza la homogeneidad y consistencia perfecta desde las preparaciones más suaves a las más espesas\n\n \n\nPotente motor de 600 vatios\nTecnología de motor reversible para lograr un licuado uniforme y homogéneo con un control manual que permite girar la cuchilla en forma bidireccional\nJarra de vidrio refractario con capacidad para 6 tazas (1,5 litros)\nExclusivo sistema de acople totalmente metálicoAll-Metal Drive® para máxima durabilidad\nBase de acero inoxidable cepillado', 10, 74, 'BEST02-E01-1', '2021-03-01', 1, 5, 35),
(978, 'a', 'BFSR16B', 'VENTILADOR DE PEDESTAL B+D', 'Perfecto para cualquier lugar del hogar, garaje u oficina.\n3 configuraciones de velocidad para obtener la cantidad correcta de circulación de aire\nMando a distancia fácil de usar con almacenamiento a bordo (pilas no incluidas)\nHoja duradera de 16 pulgadas\nÁngulo de inclinación y altura ajustable\nFunción de oscilación para cubrir un área más grande\nConveniente temporizador de apagado', 10, 37, 'BFSR16B-1', '2021-04-14', 1, 4, 24),
(979, 'a', 'BLBD210GR', 'LICUADORA ROJA B+D', 'La Licuadora de DURAPRO de 10 Velocidades de BLACK+DECKER es un clásico en la cocina. Con mayor función de pulso y 4 cuchillas de acero inoxidable, 2 veces más duraderas ** para eficiencia y funcionamiento. La jarra de 1.25 Lt de vidrio y tapa de doble abertura está diseñada para verter fácilmente y tiene capacidad suficiente para acomodar varias porciones de sus batidos favoritos y ¡más! Además, la limpieza es muy fácil gracias a las piezas removibles aptas para lavavajillas.\n\n550 Watts\n10 velocidades + función de pulso\nJarra de vidrio de 1.25 Lt con tapa de doble abertura\n4 Cuchillas de acero inoxidable son 2 veces más duraderas**\nDispositivo de bisagra para añadir ingredientes\nBoquilla vertedora integrada\nPies antideslizantes\nApto para lavaplatos\nGuardacable', 5, 38, 'BLBD210GR-1', '2021-04-13', 1, 4, 16),
(980, 'nv', 'BLSTMP-W00', 'LICUADORA 8 VEL. C/ VASO DE PLASTICO', '', 8, 34, NULL, '2021-02-10', 1, NULL, NULL),
(981, 'a', 'BLW15', 'LM TIERNA DISFRAZ', '¡Es una fiesta de jardín con adorables bebés! Las niñas pueden elegir entre un encantador borreguito, un cariñoso oso bebé, o un lindo conejito rosa. ¡Mitad peluche y mitad muñecas bebé, son perfectas para acurrucarse y para jugar! Cada una es muy suave y tienen una capucha que combina. Se venden por separado.', 0, 25, 'BLW15-1', '2021-03-02', 2, 28, NULL),
(982, 'nv', 'BVSTDC3392', 'PERCOLADORA 45 TZS OSTER', '', 0, 0, NULL, '2021-02-10', 1, NULL, NULL),
(983, 'a', 'C0162', 'NERF DARDOS ACCUSTRIKE 12', 'Forma parte de la serie AccuStrike\nLos dardos han sido diseñados para mayor precisión\nIncluye 12 dardos\nCompatibles con los lanzadores Nerf Elite', 7, 8, 'C0162-1', '2021-03-02', 2, 27, NULL),
(984, 'a', 'CKSTRC1700W', 'OLLA ARROCERA MULTI-USO 10 TZ OSTER', 'Con nuestra arrocera multiusos, cocina arroz y todo lo que puedas imaginar de la manera más fácil, rápida y rendidora, ya que tiene una capacidad de 1,8 litros. ¿No quieres comer arroz hoy? Puedes volverte creativa a la hora de crear preparaciones saludables gracias a su bandeja para cocer al vapor. Usa la función automática para mantener tus comidas perfectas hasta la hora de servirlas. Además podrás limpiarla fácilmente gracias a su tazón interno removible de aluminio con recubrimiento antiadherente.\n\n \nCapacidad para 1.8 lts (10 tazas) de arroz cocido.\nExclusiva fuente de calor esférica que asegura una cocción uniforme.\nOlla con recubrimiento antiadherente removible para una fácil limpieza.\nBotón de un solo toque para fácil manejo.\nTapa de vidro refractario con ventilación para evitar la cocción excesiva de los alimentos.\nFunción automática para matener el arroz caliente una vez cocido.\nIncluye taza medidora de 180 ml (6.1 oz) y cucharón.', 0, 28, 'CKSTRC1700W-1', '2021-02-22', 1, 5, 36),
(985, 'a', 'CKSTRC2911', 'BANDEJA DE VAPOR P/ARROCERA OSTER', 'Esta vez traemos hasta ti la Bandeja de Vapor CKSTRC2911 de Oster para que prepares los vegetales al vapor mas deliciosos y sueltos que hayas podido probar. Con asas de agarre cómodo para garantizar tu comodidad y seguridad, esta bandeja de vapor te brindará la oportunidad de cocinar distintos platillos, para que sorprendas y compartas con todos.\n\nOster, empresa estadounidense iniciada en 1924 de la mano de John Oster, decidido a facilitar las tareas diarias de sus personas más cercanas desarrolló distintos electrodomésticos para todo el hogar, brindando calidad y máximo rendimiento en cada una de sus piezas.\n\n2.5 litros de capacidad para preparar una amplia variedad de alimentos al vapor.\n\nSe puede usar en la olla arrocera multiusos Oster® Modelo 6029 con capacidad para 10 tazas para una mayor versatilidad.\n\nBandeja de vapor fácil de lavar, incluso en lavavajillas • Cómodo y fácil de usar mientras prepara el arroz, lo que le permite preparar una comida completa de una sola vez.', 10, 5, 'CKSTRC2911-1', '2021-03-30', 1, 5, 36),
(986, 'a', 'CKSTSM3884', 'SANDWICHERA GRILL OSTER', 'Esta sandwichera te permitirá preparar tus sándwiches favoritos con el tipo de pan que prefieras. Su sistema de altura ajustable se adapta a cualquier exigencia.\n\nUna sandwichera en la que podrás preparar no sólo sándwiches sino también cocinar alimentos como carnes, hamburguesas, vegetales y hasta panqueques\n\nEl cierre de seguridad permite un almacenamiento vertical y compacto, mientras que los platos o placas removibles de material antiadherente permitirán una limpieza más fácil.\n\nPrepara tu mejor desayuno, almuerzo o cena con la Plancha Sandwichera de Oster. Su altura regulable te permitirá elaborar comidas de cualquier grosor de manera rápida y su alta potencia, para un calentamiento rápido, agilizará la espera.\n\nLa Plancha Sandwichera de Oster tiene capacidad hasta para 4 rebanadas y además, podrás tener tus alimentos como siempre quisiste y realizarlos de forma saludable.\n\nPotencia de 1650 Watts\nSistema de altura ajustable que se adapta a diversos tipos de panes\nAlmacenamiento vertical con cierre de seguridad para ahorrar espacio\nPráctica área para enrollar el cable y mantener organizada la cocina\nPlanchas antiadherentes que facilitan la limpieza\nEstilo exterior contemporáneo resistente con luces indicadoras que facilitan su supervisión', 0, 65, 'CKSTSM3884-1', '2021-02-22', 1, 5, 38),
