(1012, 'a', 'DJW57', 'BARBIE MIX MATCH DOLL', 'Barbie incluye 10 piezas de moda para que las niñas jueguen y puedan crear ¡más de 20 looks diferentes! Barbie viene con una increíble blusa y una hermosa falda, accesorios como zapatos, brazalete y un par de aretes. Incluye opciones adicionales de atuendos-un par de pantalones y un vestido, un lazo, una bolsa', 0, 35, 'DJW57-1', '2021-03-05', 2, 28, NULL),
(1013, 'a', 'DVM95', 'BARBIE DREAMTOPIA HADA BRUBUJAS', '¡Esta hada del reino de las chuches de Barbie Dreamtopia está más encantadora que nunca con sus alas que hacen burbujas!\n\nSolo hay que verter solución jabonosa (incluye recipiente) en la bandeja en forma de mariposa y sumergir las alas de Barbie en la solución\n\nEl Hada burbujas mágicas parece cobrar vida luciendo un vestido radiante con caramelos de colores en el corpiño y una falda rosa a juego con su increíble pelo\n\n¡A las pequeñas soñadoras les encantará llenar sus historias y sus juegos de burbujas!', 0, 32, 'DVM95-1', '2021-03-05', 2, 28, NULL),
(1014, 'nv', 'DVX51', 'BARBIE DOLL PLAYSET FURNITURE', '', 0, 0, NULL, '2021-02-10', 2, NULL, NULL),
(1015, 'a', 'DVX59', 'BARBIE CARRO CONVERTIBLE GLAM', 'Diseñado en brillante color rosa, este vehículo de dos asientos tiene el estilo exclusivo de Barbie®. Tiene volante plateado que gira de verdad, vestiduras realistas y cinturones de seguridad para las muñecas. Las muñecas se venden por separado.', 0, 30, 'DVX59-1', '2021-03-05', 2, 28, NULL),
(1016, 'a', 'DWJ50', 'BARBIE CHELSEA CLUB HOUSE', 'Únete al club con la casa de juegos de muñecas chelsea.\n\nDos plantas con cocina y mucho espacio de juego hacen de la casa una escapada ideal para la imaginación de los jóvenes.\n\nColoque la muñeca chelsea en la plataforma, su oso en la canasta y mueva la plataforma.\n\nOtras características de trabajo incluyen la puerta de entrada y las puertas de los electrodomésticos de cocina.\n\nLos muebles divertidos amplían la narración: hay una mesa de comedor, dos sillas y una cama para organizar y reorganizar.', 0, 30, 'DWJ50-1', '2021-03-02', 2, 28, NULL),
(1017, 'a', 'DWJ68', 'BARBIE PASEA PERRITO', '¡La diversión llega con Barbie!\n\nTus pequeñas se divertirán ayudando a Barbie a pasear a su perro y enseñándole a ir al baño: simplemente hay que girar la perilla a un costado del perrito y jalar la correa, ¡El cachorro empieza a caminar solo! Cuando es momento de ir al baño, Barbie puede limpiar usando la escoba y recogedor. Un plato y hueso que cabe en la boca del cachorro son la mejor recompensa.\n\nEncuentra en Ripley.com lo más variado en juguetería y a los mejores precios. ¡Con la Barbie Paseo de Perrito la diversión está asegurada!', 0, 30, 'DWJ68-1', '2021-03-05', 2, 28, NULL),
(1018, 'nv', 'DWSF1813', 'VENTILADOR PLASTICO DE 18\" DAEWOO', '', 1, 37, NULL, '2021-02-10', 1, NULL, NULL),
(1019, 'a', 'DYN93', 'BARBIE DIY EMOJI STYLE DOLL', 'Con este diseño de Emoji, tus modas para Barbie aparecerán en poco tiempo.\n\nSeleccione un modo y fácil de poner en tirar Tailors Dummy con uno, dos o más de más de 40 Emoji / pegatinas con un diseño de Emoji para diseñar.\n\nPara que puedas empezar los juegos al mismo tiempo, un vestido, un top y una falda (Modas reversibles) y se incluye una muñeca Barbie con camiseta, mono, botas a juego y una cadena.\n\nPara niñas de 5 años en adelante.', 8, 31, 'DYN93-1', '2021-03-02', 2, 28, NULL),
(1020, 'a', 'E0392', 'NERF ELITE LANZA DARDOS DISRUPTOR', '¡Lanza el doble de dardos con este lanzador Disruptor! Además de los 6 dardos Elite, este lanzador incluye 6 dardos de la serie AccuStrike para que los jugadores personalicen su plan de ataque y decidan entre dardos diseñados para el alcance o para mayor precisión. Desenfunda y lanza rápido con este lanzador Disruptor que cuenta con un cilindro giratorio de 6 dardos. Elige tu objetivo y lanza 1 dardo a la vez, o utiliza el deslizador ráfaga para lanzar los 6 dardos con rapidez. Para preparar el lanzador, jala y suelta el deslizador. Mira el indicador si es de color naranja, el lanzador está listo para lanzar. El lanzador Nerf N-Strike Elite Disruptor lanza dardos hasta 27 metros. \nIncluye\nLanzador\n6 dardos Elite\n6 dardos de la serie AccuStrike e instructivo \nCilindro giratorio de 6 dardos\nDesenfunda y lanza rápido\nDeslizador ráfaga\n\nEdad recomendada 8 años en adelante', 0, 22, 'E0392-1', '2021-03-04', 2, 27, NULL),
(1021, 'a', 'E0559', 'AVENGERS FIG. SET IRON MAN VS THANOS', 'Muñeco Avengers Ironman tecnomision 35cm E0560 Hasbro Cuando la misión requiere un refuerzo tecnológico, Tony Stark se enfunda en un avanzado traje que le permite estar bien preparado para el combate y acabar con los malhechores. Imagina al héroe tecnológico volando al combate con esta figura de 35 cm', 0, 45, 'E0559-1', '2021-03-04', 2, 27, NULL),
(1022, 'a', 'E0560', 'AVENGERS FIG. 13,5 IRON MAN MISION TEC', 'Muñeco Avengers Ironman tecnomision 35cm E0560 Hasbro Cuando la misión requiere un refuerzo tecnológico, Tony Stark se enfunda en un avanzado traje que le permite estar bien preparado para el combate y acabar con los malhechores. Imagina al héroe tecnológico volando al combate con esta figura de 35 cm', 0, 50, 'E0560-1', '2021-03-04', 2, 27, NULL),
(1023, 'a', 'E0585', 'JENGA RETRO PASS CHALLENG', 'Saca el juego clásico de Jenga \"de la mesa\".\nRetira un bloque a la vez que sostienes el mango de la plataforma.\nMantén la torre firme y con la mano apartada después de cada turno.\nEste juego cuenta con 10 retos divertidos.\nIncluye 27 bloques Jenga de madera dura con bolsa de almacenamiento de plástico resellable, plataforma de paso, soporte de apilamiento e instrucciones (idioma español no garantizado).', 7, 31, 'E0585-1', '2021-03-01', 2, NULL, NULL),
(1024, 'a', 'E0606', 'AVENGERS FI 13 IRON MAN', 'Figura de acción Avenger Titan Heroes series modelo Iron Man', 5, 36, 'E0606-1', '2021-03-01', 2, 27, NULL),
(1025, 'a', 'E0824', 'NERF ELITE LANZA DARDOS SCOUT MIKII', '¡Espía de cerca a tus oponentes y ataca rápidamente con el lanzador Strike Elite Scout MKII de Nerf! El cilindro giratorio tiene capacidad para guardar 4 dardo Elite y lanzarlos una a la vez. Introduce 4 dardos por la parte frontal del cañón, jala la manija para preparar el lanzador y luego jala el gatillo para lanzar un dardo. Cuando la batalla requiere movilidad, toma el lanzador Scout MKII para estar listo y actuar con rapidez en un momento. El lanzador N-Strike Elite Scout MKII de Nerf viene con 4 dardos Elite diseñados para el alcance.\n\nIncluye: Lanzador y 4 dardos.\n\nDetalles:\n\nEdad recomendada: 8 años en adelante. \nPRECAUCIÓN: No apuntes a los ojos ni a la cara.\nPARA EVITAR LESIONES: Utiliza sólo los dardos NERF oficiales. Otros dardos pueden no cumplir las normas de seguridad. No modifiques los dardos ni el lanzadardos.', 0, 15, 'E0824-1', '2021-03-04', 2, 27, NULL),
(1026, 'nv', 'E1509', 'STAR WARS MASCARA', '', 0, 0, NULL, '2021-02-10', 2, NULL, NULL),
(1027, 'a', 'E1952', 'PLAY-DOH JUEGO DINO REX', '¡Haz rugir tu imaginación con este gracioso dinosaurio! Rex está listo para pisar fuerte a la hora de jugar con las características y los accesorios Play-Doh y 4 latas de masa Play-Doh. Crea una disparatada lengua y escamas cargando un poco de masa Play-Doh y presionando en la cola: ¡Esto, además, activa la mandíbula! El dinosaurio se sale de la base para que juegues con la figura. ¡Para más diversión dinoestupenda, crea huellas con el cortador y haz que el volcán lance lava Play-Doh!\n\n• Incluye Juego de Rex el dinosaurio con base, volcán, cortador de huella, cuchillo y 4 latas de masa modeladora Play-Doh (peso neto 224 gramos).\n• Haz que a Rex el dinosaurio le salgan una lengua y escamas muy graciosas\n• La cola activa la mandíbula del dinosaurio\n• Haz salir hilos de lava del volcán\n', 0, 25, 'E1952-1', '2021-03-04', 2, 27, NULL),
(1028, 'a', 'E1953', 'PLAY-DOH JUEGO DINOSAURIOS', '5 divertidas herramientas Play-Doh con forma de dinosaurios\nCultiva pinchos tontos para los triceratops\nCorta y corta con el pterodáctilo y el estegosaurio\nSella y enrolla huellas de dinosaurio con el velociraptor\nIncluye cortador de estegosaurio, herramienta triceratops, sello velociraptor, cortador de pterodáctilo, rodillo de huevo texturizado y 3 latas de compuesto de modelado de la marca Play-Doh (peso neto 6 onzas). A partir de 3 años', 8, 20, 'E1953-1', '2021-03-01', 2, NULL, NULL),
(1029, 'nv', 'E2912', 'DISNEY PRINCESS MU?ECA ACCESORIOS', '', 0, 0, NULL, '2021-02-10', 2, NULL, NULL),
(1030, 'a', 'E3048', 'DISNEY PRINCESA RAPUNZEL', 'Estas muñecas de estilo audaz tienen un cabello ideal para peinar y faldas removibles\n\nCada muñeca incluye corpiño moldeado con detalles brillantes, falda removible, zapatos, cepillo para el cabello, espejo y accesorios\n\nLas muñecas de la colección Sé brillante, sé valiente se inspiran en la valentía y el espíritu vibrante de las princesas Disney.\nLas muñecas vienen vestidas con atuendos de brillantes colores y faldas con estampados impactantes, que reflejan la personalidad audaz de estos personajes.\nImagina emocionantes aventuras con estas muñecas Disney, que cuentan con un brillante corpiño moldeado y una falda removible con estampados audaces. Además, traen un cepillo para el cabello y un espejo, entre otros accesorios.\n\nEdad recomendada: 3 años en adelante.', 6, 31, 'E3048-1', '2021-03-01', 2, 28, NULL),
