(1035, 'a', 'E3304', 'AVENGERS FIG 12 HULK TITAN HERO', 'Figura de Hulk de 12 pulgadas con diseño inspirado en las películas.\nConecta el paquete de efectos de potencia del Titan Hero para activar sonidos y frases (no incluido se vende por separado con las figuras de efectos de potencia Titan hero).\nIncluye puerto de conexión Titan Hero Power FX.\nInspirado por la película Los Vengadores Endgame', 0, 20, 'E3304-1', '2021-03-04', 2, 27, NULL),
(1036, 'a', 'E3306', 'AVENGERS BLAKC PANTHER FX 2.0', 'Figura de Pantera Negra de 12 pulgadas con diseño inspirado en la película.\n\nConecta el lanzador Titan Hero Power FX para activar sonidos y frases y proyectiles.\n\nEl lanzador Titan Hero Power FX se conecta a las figuras compatibles de la serie Titan Hero (cada una se vende por separado).\n\nInspirado en la película de Los Vengadores Endgame.\n\nEdad: 4+', 0, 35, 'E3306-1', '2021-03-04', 2, 27, NULL),
