(1042, 'a', 'E4020', 'DISNEY PRINCESA SHIMMER A FASHION DOLL', '¡Los niñas pueden coleccionar sus personajes favoritos de Princesas de Disney con el surtido de Princesas Disney Royal Shimmer! Cada muñeca de moda se vende por separado Ariel, Cenicienta y Rapunzel. ¡Cada juguete de Princess brilla con un atuendo de color característico que brilla desde la parte superior de su corpiño hasta la parte inferior de su falda! A los pequeños soñadores les encantará representar momentos mágicos de las películas de las princesas de Disney e imaginar sus propios cuentos de hadas con estas hermosas muñecas. Cada uno se vende por separado.', 0, 30, 'E4020-1', '2021-03-04', 2, 28, NULL),
