(1046, 'a', 'E5044', 'PLAY-DOH 8TARROS NEON TTL 16OZ', '8 colores neón que salen de los ojos: haz que tu creatividad salga con latas de 2 onzas de compuesto Play-Doh no tóxico en 8 colores neón salvaje: azul, rosa, rosa fuerte, verde, azul claro, naranja, morado y verde.\nManténgalo fresco para reutilizar una y otra vez: hay pocas cosas más satisfactorias que abrir una lata fresca de compuesto Play-Doh. Los recipientes herméticos lo mantienen fresco para jugar una y otra vez.\nIncluye 8 latas de compuesto de modelado de marca Play-Doh (peso neto total 16 onzas).\nA partir de 2 años.\nNo tóxico. Conforme a: ASTM D-4236', 0, 12, 'E5044-1', '2021-03-01', 2, NULL, NULL),
(1047, 'a', 'E5247', 'BABY  ALIVE BEBE PASOS Y RISAS', '¡En sus marcas, listo, fuera! Bebé pasos y risas de Baby Alive tiene zapatos que se iluminan con cada paso. Imagina que caminas y saltas con la bebé para activar las luces en sus zapatos, así como adorables risas y divertidas frases como “¡Guau, mira mis zapatos!” y “Ahora tengo sed\". Dale de beber unos sorbos de agua de su tacita y mojará el pañal. Da saltitos junto a tu bebé, dale de beber de su tacita, luego cámbiale el pañal cuando lo moje. Además, la bebé te dirá cuando quiera hacer una siesta. Acuesta a la bebé y puede que bostece y te diga que está cansada. Te encantará esta muñeca, que cuenta con más de 25 sonidos y frases, y ¡zapatos que se iluminan!\nBaby Alive y todas las propiedades relacionadas son marcas de comercio de Hasbro.\n\nSUS ZAPATOS SE ILUMINAN La muñeca Bebé pasos y risas de Baby Alive tiene zapatos que realmente se iluminan con cada paso', 0, 45, 'E5247-1', '2021-03-04', 2, 28, NULL),
(1048, 'a', 'E5248', 'BABY ALIVE PASOS Y RISAS', '¡En sus marcas, listo, fuera! Bebé pasos y risas de Baby Alive tiene zapatos que se iluminan con cada paso. Imagina que caminas y saltas con la bebé para activar las luces en sus zapatos, así como adorables risas y divertidas frases como “¡Guau, mira mis zapatos!” y “ahora tengo sed\". Dale de beber unos sorbos de su tacita y mojará el pañal. Da saltitos junto a tu bebé, dale de beber de su tacita, luego cámbiale el pañal cuando lo moje. Además, la bebé te dirá cuando quiera hacer una siesta. Acuesta a la bebé y puede que bostece y te diga que está cansada. Te encantará esta muñeca, que cuenta con más de 25 sonidos y frases, y ¡zapatos que se iluminan!\n\nBaby Alive y todas las propiedades relacionadas son marcas de comercio de Hasbro.\n\n• Incluye muñeca, ropa removible, lentes, tacita, peine e instrucciones.', 0, 45, 'E5248-1', '2021-03-04', 2, 28, NULL),
