(1051, 'a', 'E5511', 'FROZEN 2 CASTILLO', '• JUGUETE DE CASTILLO DE ARENDELLE PORTÁTIL DE 2 PISOS Imagina que recreas historias inspiradas en escenas de Frozen 2 de Disney con este castillo de juguete de 2 pisos\n• AVENTURAS EN EL CAMINO El castillo puede guardar accesorios y plegarse en un tamaño portátil para que puedas llevar tus aventuras de Arendelle contigo\n• ACCESORIOS PARA LAS HABITACIONES DEL CASTILLO Este set viene con 6 accesorios, incluyendo 2 sillas, 2 copas, una panera y una jarra de agua\n• PARA NIÑOS Y NIÑAS DE 3 AÑOS EN ADELANTE Este divertido castillo es ideal para recrear o imaginar .', 0, 80, 'E5511-1', '2021-03-04', 2, 28, NULL),
(1052, 'a', 'E5516', 'FROZEN 2 ELSA Y NOKK', 'Elsa de las películas Disney Frozen: un personaje popular de las películas Disney Frozen, esta muñeca clásica de Elsa lleva un traje inspirado en el que se ve en la película Disney Frozen 2.\nPresentamos a Nokk: Presentado en la película de Disney Frozen 2, la figura de Nokk representa el mítico personaje del espíritu del agua.\nTraje azul claro inspirado en la película: El hermoso traje azul claro de la muñeca Elsa es una versión hasta la rodilla de su vestido de la película Disney Frozen 2.\nLargo pelo rubio: A tu hijo le encantará jugar con el pelo largo rubio de la muñeca Elsa, modelado en una trenza.\nPara niños de 3 años y más: A los fanáticos de las películas de Disney Frozen les encantará este juguete de Elsa y Nokk como regalo de cumpleaños o regalo navideño para representar escenas o crear las suyas.', 7, 57, 'E5516-1', '2021-03-01', 2, 28, NULL),
