(1058, 'a', 'E6171', 'NERF ELITE LANZA DARDOS SHELLSTRIKE', 'Pistola lanza dardos Nerf N-strike Elite Shellstrike DS-6 Hasbro original.\nLanza 3 dardos a la vez desde este blaster de carga de proyectiles.\nEl blaster Nerf Elite Shellstrike presenta un mecanismo de apertura para insertar un cargador en el interior, mueva el pestillo y el blaster se abrirá.\nViene con 6 dardos oficiales Nerf Elite y 2 cargadores que pueden contener hasta 3 dardos.\nPuede almacenar 2 cargadores en el blaster, manteniéndolos cerca para recargar rápidamente.\n\nEdad sugerida: 8+', 0, 22, 'E6171-1', '2021-03-04', 2, 27, NULL),
(1059, 'a', 'E6709', 'FROZEN 2 MU?ECA ELSA', 'Elsa, es uno de los personajes principales de Frozen de Disney. La muñeca clásica de Elsa tiene un tamaño aprox. de 28 cm, y lleva un precioso conjunto degradado en color azul, inspirado en la película Frozen 2. Muñequita de largo cabello rubio recogido en una impresionante trenza y gran realismo con la que, gracias a sus 5 puntos de articulación, tu pequeñ@ podrá recrear las posturas e interpretaciones más divertidas de las escenas de las películas Frozen.\nEdad mínima recomendada (por el fabricante) +3 años', 0, 25, 'E6709-1', '2021-03-04', 2, 28, NULL),
(1060, 'a', 'E6710', 'FROZEN 2 MU?ECA ANNA', 'Anna de las películas de frozen de Disney uno de los personajes favoritos de los fans de las películas de frozen de Disney, esta muñeca clásica de anna lleva un conjunto inspirado en el que lleva en la película frozen 2 de Disney\nConjunto inspirado en la película su precioso conjunto está inspirado en el traje y la capa de la película frozen 2 de Disney\nCabello rojo y largo a los niños les encantará jugar con el cabello largo y rojo de la muñeca anna, que lo lleva suelto como en la película\nPosturas divertidas representa diferentes posturas y juega a que está interpretando las diferentes escenas divertidas de las películas de frozen de Disney con los 5 puntos de articulación\nPara niños a partir de 3 años los fans de las películas de frozen de Disney se deleitarán con esta muñeca de anna, adecuado como regalo de cumpleaños o navidad, para recrear escenas o inventar las suyas propias', 0, 25, 'E6710-1', '2021-03-04', 2, 28, NULL),
(1061, 'a', 'E6711', 'FROZEN 2 MU?ECA KRISTOFF', 'Imagina ser Kristoff con el nuevo muñeco de la película de Disney Frozen 2! Cuenta con su característicos trajes y botas moldeadas.', 0, 25, 'E6711-1', '2021-03-04', 2, NULL, NULL),
(1062, 'a', 'E6852', 'FROZEN 2 ELSA CANTANTE', '• HERMOSA MUÑECA DE ELSA, QUE CANTA La muñeca de Elsa, la amada heroína de las películas de Disney Frozen, tiene el cabello rubio y largo, recogido con una trenza\n• CANTA UNA CANCIÓN DE FROZEN 2 Presiona el botón en el pecho de la muñeca de Elsa para que cante Lo que se ocultó, tema musical de la película Frozen 2 de Disney\n• SU ATUENDO SE ILUMINA La muñeca de Elsa cantante lleva puesto un vestido azul claro inspirado en la película Frozen 2 de Disney. El vestido se ilumina cuando presionas el botón situado en su pecho\n• PARA NIÑOS Y NIÑAS DE 3 AÑOS EN ADELANTe Esta muñeca de Elsa cantante es ideal para recrear o imaginar escenas de las películas Frozen de Disney y como regalo en cumpleaños o celebraciones para quienes adoran estas películas\n• HERMANAS CANTANTES También busca la muñeca Anna cantante para coleccionar las 2 hermanas cantantes inspiradas en Frozen 2 de Disney. (Se vende por separado. Sujeto a disponibilidad)\n\n• Edad recomendada 3 años en adelante.\n', 0, 35, 'E6852-1', '2021-03-04', 2, 28, NULL),
(1063, 'a', 'E6853', 'FROZEN 2 ANNA CANTANTE', 'Figura Anna Cantante de Frozen 2 marca Hasbro', 4, 36, 'E6853-1', '2021-03-01', 2, 28, NULL),
(1064, 'nv', 'E6952', 'FROZEN 2 MU', '', 8, 36, NULL, '2021-02-10', 2, NULL, NULL),
(1065, 'a', 'E6966', 'PLAY- DOH 4 TARROS CONFETTI 2 OZ X4,8 OZ', 'Incluye 6 colores con confeti únicos\nSe ha añadido confeti colorido a cada color\nGenial para dar rienda suelta a tu creatividad\nIncluye 2 cortadores', 0, 13, 'E6966-1', '2021-03-04', 2, NULL, NULL),
(1066, 'nv', 'E7333', 'SPIDERMAN FIG 12 TITAN', '¡Disfruta con los poderes de la nueva Figura Spiderman Titan Hero de Hasbro!\n\nHazte con esta genial figura de gran tamaño, inspirada en el popular superhéroe, ahora uno de los Vengadores más populares y estrella del cine, series y cómics. Haz frente a los villanos con sus telarañas, defiéndete del resto con el sentido arácnido y disfruta recreando todas sus aventuras en un tamaño muy especial. ¡Recrea tus momentos preferidos con las geniales figuras Titan Hero de Hasbro!\n\nPara aumentar la diversión, puedes hacerte con el Blast Gear (se vende por separado) compatible con esta figura. Un complemento con el que multiplicar las habilidades y poderes del bueno de Spiderman.\n\nEdad recomendada + 4 años.\n\nIncluye 1 figura Spiderman Titan Hero con traje original y cinco puntos de articulación.\n\nMedidas aproximadas de la figura 29 cm de alto, 9 cm de ancho y 4 cm de fondo.', 0, 0, 'E7333-1', '2021-03-04', 2, 27, NULL),
(1067, 'a', 'E7344', 'SPIDERMAN TITAN HERO', 'Imagina que te lanzas a una nueva aventura con las figuras, vehículos y artículos para juego de rol del Hombre Araña inspirados en el Universo Marvel. Con esta línea de juguetes inspirada en las historietas, los niños pueden imaginar toda la acción del universo del Hombre Araña con sus héroes favoritos.\n\nEl lanzador Blast Gear se vende con las figuras Titan Hero Blast Gear.\n\nEdad recomendada 4 años', 0, 30, 'E7344-1', '2021-03-04', 2, 27, NULL),
(1068, 'a', 'E7360', 'AVENGER FIG. 9.5 OLYMPUS', 'Figura de acción Avenger Olympus modelo Iron Man', 0, 16, 'E7360-1', '2021-03-01', 2, 27, NULL),
(1069, 'a', 'E7374', 'AVENGERS FIG 12 CAPITAN AMERICA TH', 'Figura de acción Titan Heroes Series modelo Capitán America The Innovation', 0, 32, 'E7374-1', '2021-03-01', 2, 27, NULL),
(1070, 'a', 'E7375', 'AVENGERS ESCUDO CAPITAN AMERICA', '¡Hora de pasar a la acción como el Primer Vengador! ¡Gracias al nuevo Avengers Nerf Power Moves Lanza Escudo Capitán América de Hasbro!\n\nArma tu brazo y siente la fuerza y precisión del mismísmo escudo del Capitán América, un nuevo arma que podrás acoplar en tu brazo y golpear a tus objetivos desde la distancia. Es muy fácil de colocar y utilizar, solo has de cargar el lanzador y pulsar el botón para que el icónico escudo salga por los aires dirigido a tu objetivo. ¡Descubre la fuerza y precisión de los Vengadores y los lanzadores Nerf!\n\nMedidas empaque 35x23x8cm', 0, 35, 'E7375-1', '2021-03-04', 2, 27, NULL),
(1071, 'a', 'E7380', 'AVENGERS FIG 12 IRON MAN INNOVATION', 'Figura de Iron Man de 12 pulgadas imagina a Tony Stark como Iron Man con esta figura de Iron Man de 12 pulgadas, inspirada en el clásico diseño de personajes del universo de Marvel.\n\nSistema de engranaje de explosión de la serie Titan Hero personajes geniales y accesorios de lanzador impresionantes, ¡es lo que el sistema de engranajes de explosión es todo! Cada figura de Blast Gear incluye un lanzador y proyectiles compatibles. Colecciónalos todos para completar el arsenal de Blast Gear.\n\nCarga y relájate con los accesorios de engranaje de explosión carga y carga el proyectil en el lanzador de engranajes de explosión (incluido), conecta el lanzador a la figura de Iron Man de los Vengadores y enciende con solo pulsar un botón. La figura incluye lanzador.\n\nEdad 4+ años', 0, 30, 'E7380-1', '2021-03-04', 2, 27, NULL),
(1072, 'a', 'E7388', 'AVENGERS FIG BLACK PANTHER TH INNC', 'El rey T’Challa protege a la nación de Wakanda y al mundo como Black Panther. Imagínese lanzarse a la aventura con las figuras, vehículos y elementos de juego de rol de los Vengadores inspirados en los cómics de Marvel.\n\nIncluye: figura, 3 accesorios y 2 proyectiles.\n\n• FIGURA DE LA PANTERA NEGRA DELUXE A ESCALA DE 12 PULGADAS Imagina al heroico rey de Wakanda con esta figura de la Pantera Negra a escala de 12 pulgadas, inspirada en el diseño clásico de personajes de los cómics de Marvel.\n• ACCESORIOS INSPIRADOS EN LOS CÓMICOS DE MARVEL Los fanáticos pueden imaginar al heroico Avenger luchando contra el mal en una lucha por el destino del mundo con esta figura de Pantera Negra que incluye escudo, garra retráctil y accesorios de lanza, inspirados en el personaje de los cómics de Marvel.\n• INCLUYE EL LANZADOR DE ENGRANAJES TITAN HERO BLAST El accesorio Shield es un lanzador de proyectiles de engranajes explosivos. ', 0, 30, 'E7388-1', '2021-03-04', 2, 27, NULL),
(1073, 'a', 'E7410', 'BABY ALIVE MU?ECA TRICICLO', 'Muñeca con Triciclo Baby Alive marca Hasbro', 0, 30, 'E7410-1', '2021-03-01', 2, 28, NULL),
