(1077, 'a', 'E8587', 'DISNEY PRINCESA MULAN REFLEJOS', 'Disney Princess Mulán Doble Reflejo. Mulán de Disney es la historia épica de una joven valiente que arriesga todo por amor a su familia y su país para convertirse en uno de los mejores guerreros que China haya conocido. Esta muñeca de moda de lujo tiene cabello largo y negro, 2 atuendos y accesorios divertidos, como complemento de su personalidad valiente y enérgica en la nueva película de Disney.', 6, 52, 'E8587-1', '2021-03-04', 2, 28, NULL),
(1078, 'nv', 'E8677', 'AVENGERS 06 FIGURAS', '', 8, 16, NULL, '2021-02-10', 2, NULL, NULL),
(1079, 'a', 'E8683', 'SPIDERMAN MAXIMUN VENOM CAP AMERICA VENO', 'El Capitán América obtiene nuevos y extremos poderes cuando el simbionte Venom se adhiere a él.\n\nFigura Capitán América.\nSpiderman Maximun Venom\nIncluye accesorios\nEdad recomendada 4 años  ', 0, 40, 'E8683-1', '2021-03-04', 2, 27, NULL),
(1080, 'a', 'E8685', 'SPIDERMAN FIG 12 EXCLUSIVE MULTI', 'SPIDERMAN FIG 12 EXCLUSIVE MULTI', 0, 40, 'E8685-1', '2021-03-04', 2, 27, NULL),
(1081, 'a', 'E8716', 'BABY ALICE SPLASH SNUGGLE', '• Incluye muñeca, toalla y chupón.\n\n• JUEGA DENTRO Y FUERA DEL AGUA Los niños y niñas pueden jugar con la muñeca en el agua e imaginar que está en una bañera o en una piscina. ¡También pueden abrazarla y mimarla fuera del agua!\n• ACCESORIOS DE MUÑECA BEBÉ Cuando la diversión en el agua ha terminado, los niños y niñas pueden secar a su muñeca bebé con la toalla incluida\n• ADORABLE TRAJE DE BAÑO DE BEBÉ ¡Este juguete para juego acuático Baby Alive tiene cabello rubio y viene con un adorable traje de baño para jugar en el agua con estilo!\n• CÁLMALA Y MÍMALA Los niños pueden darle el chupón e imaginar que calman y miman a la pequeña muñeca bebé tras jugar con ella en el agua\n• PARA NIÑOS Y NIÑAS DE 3 AÑOS EN ADELANTE ¡Diviértete a montones con una muñeca que puedes imaginar que calmas y mimas como a una bebé de verdad! Es un juguete o regalo fabuloso para niños de 3 años en adelante\n\n', 0, 30, 'E8716-1', '2021-03-04', 2, 28, NULL),
(1082, 'a', 'E8936', 'DISNEY PRINCESA BELLES ROYAL KITCHEN', 'Cocina real de Bella: Imagina a Bella cocinando deliciosos dulces para todos sus amigos en este juego de cocina, que incluye a la muñeca Bella, 13 accesorios, y las figuras de juguete de la Sra. Potts y Chip\nMuñeca elegante con traje removible: El juego incluye una muñeca de princesa Disney, Bella, con una falda removible que tiene un estampado de temática de horneado, unos zapatos y una tiara para que te diviertas vistiendo a tu muñeca\n13 accesorios: La cocina real de Bella viene con un montón de accesorios, incluyendo un pastel y su soporte, pay, molde para panqués, candelabro, taza, manzanas, olla, taza, dispensador de jabón y 2 utensilios\nFiguras de la Sra. Potts y Chip: El juego también incluye figuras de 2 de los amigos encantados de Bella, la Sra. Potts y su hijo Chip, de la película Disney La Bella y la Bestia\nMuñecas de princesas Disney: Este juego es un excelente regalo para niñas de 3 años y más y es un excelente complemento a una colección de muñecas de princesas Disney. ', 3, 57, 'E8936-1', '2021-03-01', 2, 28, NULL),
(1083, 'a', 'E9043', 'DISNEY PRINCESA CENICIENTA HOLIDAY', 'Muñeca de Cenicienta de estilo de princesas Disney: a los fans y coleccionistas les encantará este giro especial en una de sus héroes favoritos de Disney, vestida con un estilo contemporáneo.\nPrecioso vestido en colores de invierno: Cenicienta brilla como la nieve recién caída en este hermoso vestido en tonos de azul y plata, con detalles de purpurina, guantes de ópera, zapatos, diadema, pendientes y gargantilla.\nMuñeca de moda para coleccionistas de vacaciones 2020: en su impresionante ropa de muñeca de moda, este coleccionable de Disney fue especialmente creado para celebrar la temporada de vacaciones.\nCelebra los 70 años de Cenicienta: en 2020 la princesa Disney Cenicienta celebra el 70 aniversario de la liberación de su clásica película animada.\nMuestra en el paquete: el paquete de esta muñeca de coleccionista ha sido diseñado para mostrar su vestido y accesorios, lo que la convierte en una gran parte de cualquier colección de muñecas de princesas de Disney.', 1, 67, 'E9043-1', '2021-03-01', 2, 28, NULL),
(1084, 'nv', 'E9097', 'PAW PATROL PLAYSET 2', '', 0, 0, NULL, '2021-02-10', 2, NULL, NULL),
(1085, 'a', 'E9382', 'BABY ALIVE LITTLES LIL PONY RIDE', 'Emocionante movimiento de conducción: los niños disfrutarán empujando y tirando de esta muñeca interactiva de Lil\' Pony Ride Little Mandy y su compañero de pony, Pet Brandy, utilizando el accesorio de empuje.\n\nPequeño montón de bolos realmente: cuando los niños toman sus Littles por Baby Alive Lil\' Pony Ride muñeca y pony juguete para un paseo, Little Mandy se mueve a lo largo como Pet Brandy se guía hacia adelante y hacia atrás.\n\nBonito atuendo de vaquera: Little Mandy está listo para montar con estilo con su adorable atuendo de vaquera, completo con sombrero extraíble y botas de equitación, y es un gran regalo para niños de 3 años o más.\n\nAccesorios divertidos: lo que Little Mandy necesita para la diversión de montar a caballo. Incluye Little by Baby Alive Lil\' Pony Ride muñeca, pony juguete, peine, sombrero de vaquera, botas de equitación y empujador sin montar para pony.\n\nConstruye tu cuadrado: para divertidas aventuras con todo el equipo, busca todas las muñecas Littles by Baby Alive, accesorios y moda. (cada uno se vende por separado, sujeto a disponibilidad).', 6, 41, 'E9382-1', '2021-06-25', 2, 28, NULL),
(1086, 'a', 'E9508', 'AVENGERS THANOS GUANTE ROJO', 'Avengers Guante Rojo de Thanos marca Hasbro', 8, 35, 'E9508-1', '2021-03-01', 2, 27, NULL),
(1087, 'a', 'E9658', 'MVL STAN LEE', 'Figura coleccionable de Stan Lee de 6 pulgadas: los fanáticos, coleccionistas y niños por igual pueden disfrutar de esta figura de Stan Lee de 6 pulgadas, inspirada en el creador de los Vengadores, Stan \"el hombre\" Lee.\n\nDiseño inspirado en la película Marvel: figura de Stan Lee con diseño premium, detalles y articulación para una alta capacidad de pose y visualización en una colección de Marvel.\n\nArticulación y detalles de alta calidad: la figura de Stan Lee de alta calidad, realista, de 6 pulgadas cuenta con múltiples puntos de articulación y es una gran adición a cualquier colección de figuras de acción.\n\nIncluye escudo del Capitán América con su firma y un tablero de ajedrez basado en su icónico cameo en la película Marvel los Vengadores.', 0, 40, 'E9658-1', '2021-03-04', 2, 27, NULL);
INSERT INTO `producto` (`id_producto`, `estatus`, `codigo`, `nombre`, `descripcion`, `cantidad`, `precio`, `foto_prin`, `fecha_registro`, `id_departamento1`, `id_departamento2`, `id_departamento3`) VALUES
(1088, 'nv', 'F0120', 'AVENGERS HULK ABOMINATION', 'DISEÑO INSPIRADO EN VIDEOJUEGOS DE MARVEL: La figura de Hulk presenta una piel invicta con diseño, detalle y articulación de primera calidad para posar y exhibir en una colección Marvel.\nARTICULACIÓN Y DETALLES PREMIUM: Estas figuras de calidad de Hulk vs.Abomination de la serie de 6 pulgadas cuentan cada una con nueve puntos de articulación (¡incluida la articulación de la rodilla!) Y son una gran adición a cualquier colección de figuras de acción.\nUNIVERSO MARVEL EN ESCALA DE 6 PULGADAS: busque otras figuras de la serie Hasbro Marvel Gamerverse (cada una se vende por separado) con personajes inspirados en videojuegos, incluidos Ms. Marvel, Capitán América y Iron Man. (Las cifras adicionales se venden por separado. Sujeto a disponibilidad).\nHULK COLECCIONABLE A ESCALA DE 6 PULGADAS VS. FIGURAS DE ABOMINACIÓN: los niños pueden disfrutar de estas figuras de Hulk contra Abominación de 6 pulgadas, inspiradas en los personajes del videojuego Marvels Avengers.', 0, 0, 'F0120-1', '2021-03-04', 2, 27, NULL),
(1089, 'a', 'FBG44', 'CARS 8.5\" SURTIDOS', 'Con este vehículo de Mate de 21 cm los fans podrán disfrutar de toda la acción de Cars de Disney Pixar. El camión de remolque favorito incluye colores y estilos icónicos, además de detalles del personaje inspirados en la película y está listo para jugar empujándolo. También puedes llevarte a su mejor amigo, El Rayo McQueen, para extender la diversión de la nueva película. Se venden por separado y están sujetas a disponibilidad.', 4, 36, 'FBG44-1', '2021-03-29', 2, 27, NULL),
(1090, 'a', 'FBN52', 'CARS 20 VEHICULOS MC QUEEN', 'CARS 20 VEHICULOS MC QUEEN', 1, 35, 'FBN52-1', '2021-03-04', 2, 27, NULL),
(1091, 'a', 'FBR37', 'BARBIE MUNECA FASHIONISTA', 'Cada muñeca Barbie® Fashionistas™ tiene su propia imagen y estilo, ¡todas las modas están inspiradas en las últimas tendencias! La nueva línea de Barbie® Fashionistas™ tiene un mayor rango de tipos de cuerpo, tonos de piel, color de ojos, color de cabello y peinados. Con más diversidad y mayor variedad de estilos, moda, zapatos y accesorios, los niños tendrán muchas más formas de usar su imaginación y crear historias.\"', 0, 15, 'FBR37-1', '2021-03-05', 2, 28, NULL),
(1092, 'a', 'FCF18', 'HW POWER SHIFT PISTA', 'Esta Pista es lo más en acción extrema en una pendiente difícil de superar, Saldrás despedido! Aceptas el reto? Los niños podrán lanzar a toda pastilla, arriba, abajo y alrededor del circuito con el lanzador motorizado a través de un desafiante looping y experimentar toda la diversión y emoción de las espectaculares acrobacias que sólo Hot Wheels te puede ofrecer. También pueden jugar con varios vehículos a la vez sobre la pista y disfrutar de las épicas carreras Hot Wheels. Se incluye impulsor motorizado para activar las acrobacias y las escenas de choque y un vehículo Hot Wheels', 0, 50, 'FCF18-1', '2021-03-05', 2, 27, NULL),
(1093, 'a', 'FFK05', 'BARBIE DOLL MULTICOLOR HAIRSTYLE', 'Muñeca Barbie y muñeca Ken están listos para servir de diversión en este paquete de dos\nLas dos muñecas de 12.0 in llevan trajes profesionales.\nViene con una máquina de panini, sándwich en un plato y una taza de café.\nIncluye un abrigo de chef para muñeca Ken y un delantal para muñeca Barbie.\nEs el regalo perfecto para los fans de Barbie.', 0, 26, 'FFK05-1', '2021-03-05', 2, 28, NULL),
(1094, 'a', 'FFN47', 'CARS 3 CARRO 5 PERSONAJES', 'Busca tus personajes favoritos de la película Cars de Disney Pixar de 12 cm de largo, incluyen detalles icónicos de la película de Cars de Disney Pixar. Elige entre El Rayo McQueen, Mate, Cruz Ramirez, el Sheriff, entre otros, y recrea tus escenas favoritas de las películas. Se venden por separado y están sujetas a disponibilidad. Los colores y las decoraciones podrían variar. ', 0, 25, 'FFN47-1', '2021-03-05', 2, 27, NULL),
(1095, 'a', 'FHP57', 'BARBIE CHEF PASTELITOS', 'Cocina la diversión con un juego de hornear con una muñeca Barbie® y un horno con diversión mágica: el temporizador suena, la puerta funciona, el bizcocho y los cupcakes \"suben\" y la parte superior de los cupcakes tiene un glaseado que cambia de color.\nLos accesorios adicionales proporcionan los ingredientes para inspirar la imaginación de los jóvenes amantes de la comida: ¡un tazón y una cuchara para mezclar, una caja de mezcla para pasteles, una espátula y un guante de cocina que se adapta a la mano de la muñeca Barbie®!\nLa acción de horneado es fácil de activar. Coloque el molde con el bizcocho o el molde con los cupcakes en el horno y gire el temporizador hacia la derecha: ¡el temporizador suena y aparece el bocadillo horneado dentro!\nEl horno rosa y blanco presenta un diseño plug-and-play y un estilo característico: los accesorios más pequeños caben en los bolsillos para jugar en el lugar y facilitar la limpieza.\n', 0, 30, 'FHP57-1', '2021-03-05', 2, 28, NULL),
(1096, 'nv', 'FHP64', 'BARBIE CHEF DUO PLAYSET', 'Muñeca Barbie y muñeca Ken están listos para servir de diversión en este paquete de dos\nLas dos muñecas de 12.0 in llevan trajes profesionales.\nViene con una máquina de panini, sándwich en un plato y una taza de café.\nIncluye un abrigo de chef para muñeca Ken y un delantal para muñeca Barbie.\nEs el regalo perfecto para los fans de Barbie.', 0, 0, 'FHP64-1', '2021-03-05', 2, NULL, NULL),
(1097, 'a', 'FHY97', 'BARBIE SKIPPER MU', 'A los niños les encantará experimentar momentos de cuidado de niños con las muñecas Barbie BabySitter de Mattel. Estas hermosas Barbies proporcionarán maravillosos momentos de juego y diversión. Elija entre muñecos con diferentes estilos y temas. Cada uno se vende por separado.', 4, 31, 'FHY97-1', '2021-03-05', 2, 28, NULL),
(1098, 'a', 'FJL45', 'LITTLE MOMMY BEBITA', 'Todo lo que ella necesita es una pequeña mamá que la cuide y le enseñe el mundo. Estas pequeñas bebés están listas para encantar a todos con sus adorables atuendos que hacen juego con su biberón, que se adapta a la forma de sus bocas para crear divertidos roleplay de crianza. La mantita las mantiene tibias. Las pequeñas pueden representar momentos cotidianos, como alimentar y reconfortar: además, llegarán a ser como sus mamás. A las pequeñas mamás les encantará criar a estas pequeñas. Los colores y las decoraciones podrían variar. Para edades de 18 meses en adelante.\n\nPeso del paquete- 0.544218kg\nMedidas del paquete- 33.02×16.51×12.7\nModelo- FJL45\nEdad Mínima Sugerida- 18 meses', 0, 15, 'FJL45-1', '2021-03-05', 2, 28, NULL),
(1099, 'a', 'FKD02', 'LITTLE MOMMY MU', 'Esta adorable muñeca permite a las pequeñas mamás alimentar a su bebé con el tetero y cuidar de ella cuando se moja el pañal reutilizable.\n\nPara iniciar el proceso, hay que poner agua en el biberón, alimentar al bebé y el agua pasa a través de la muñeca.\n\nLas pequeñas mamás también pueden \"alimentar\" al bebé con deliciosas comidas y golosinas, incluyendo un tazón, una cuchara, dos \"tarros de comida\", \"galleta\" y \"rebanada de manzana\n\nIncluye 9 accesorios\n\nMedidas de la muñeca\n28 x 14 cm\nMedidas del empaque\n36,5 x26,5 x 12,5 cm', 2, 29, 'FKD02-1', '2021-03-02', 2, 28, NULL),
(1100, 'a', 'FLB44', 'LM BABY WITH PET', 'La Bebita necesita cariño cuando está inquieta y tu pequeña es la amiguita ideal para jugar y cuidar a esta tierna muñeca y su linda mascota de peluche. Diseñada con un tierno atuendo que la hace más hermosa y especial para tu hija. Ahora las tardes de juego serán más entretenidas y divertidas.', 0, 25, 'FLB44-1', '2021-03-05', 2, 28, NULL),
(1101, 'nv', 'FNB15', 'HW CITY SUPER SET', '', 3, 52, NULL, '2021-02-10', 2, NULL, NULL),
(1102, 'a', 'FNH22', 'ENCHANTIMALS DOLL', 'Déjate encantar por estos preciosos muñecos y sus mascotas. Los Enchantimals son unos muñecos encantadores que comparten una relación muy especial con sus mascotas, ¡son inseparables y se parecen mucho a ellas! Elige entre el muñeco con mascota Enchantimals de un guepardo, un loro, una ardilla, un erizo, un cordero y un koala. Todos los muñecos miden 15 cm y lucen un conjunto y unos zapatos de colores vivos, estampados divertidos y texturas de piel. Para completar su look, todos los muñecos tienen orejas de animales o tocados en el pelo. Además, las muñecas tienen una suave melena larga, mientras que el muñeco Hixby Hedgehog luce un peinado de punta a la última moda. Los extravagantes toques le dan más diversión a cada personaje, como sus mechones, rasgos de animales y acabados únicos.', 0, 20, 'FNH22-1', '2021-03-05', 2, 28, NULL),
(1103, 'a', 'FP-547', 'PROCESADOR DE ALIMENTOS BRENTWOOD', 'El potente mini procesador de alimentos Brentwood FP-546 de 3 tazas de 200 vatios le ahorra tiempo y energía en la cocina. Es perfecto para crear dips, salsas, picar verduras, especias y más. Operación de 2 velocidades alta / baja fácil de usar. Las cuchillas de acero inoxidable afiladas y duraderas pican los alimentos en segundos. La tapa con cierre de seguridad evita accidentes. El diseño compacto ocupa poco espacio en el mostrador y es fácil de almacenar. Piezas extraíbles sin BPA y fáciles de limpiar.\n\nAhorre tiempo cortando y mezclando.\nCree salsas, verduras picadas y más.\n2 velocidades alta / baja.\nCapacidad para 3 tazas.\nCuchillas de acero inoxidable afiladas y duraderas.\nDiseño compacto.\nSin BPA.\nTapa con cierre de seguridad.\nPiezas extraíbles aptas para lavavajillas.\nPies de succión anti-deslizantes.\nPotente 200 vatios.\nAlmacenamiento de cable.\nColor: negro.', 0, 23, 'FP-547-1', '2021-02-25', 1, 7, 51),
(1104, 'a', 'FP-549BK', 'PROCESADOR DE 3 TZAS NEGRO', 'Nuestro procesador de alimentos de 200watts Brentwood FP-549BK de 3 tazas le ahorra tiempo y energía en la cocina. Es perfecto para crear dips, salsas, picar verduras, especias y más. Operación de 2 velocidades alta / baja fácil de usar. Las cuchillas afiladas y duraderas de acero inoxidable pican los alimentos en segundos. La tapa con cierre de seguridad evita accidentes. El diseño compacto ocupa poco espacio en el mostrador y es fácil de almacenar. Piezas extraíbles sin BPA y aptas para lavavajillas.\n\n• 2 velocidades + pulso\n• Capacidad para 3 tazas\n• Cuchillas de acero inoxidable\n• Diseño compacto\n• Sin BPA\n• Tapa de bloqueo de seguridad\n• Piezas extraíbles aptas para lavavajillas\n• Pies de succión antideslizantes\n• Almacenamiento de cables\n• De color negro', 10, 29, 'FP-549BK-1', '2021-02-25', 1, 7, 51),
(1105, 'a', 'FPL88', 'BARBIE DOLL PLAYSET CHELSEA', 'Muñeca Barbie y muñeca Ken están listos para servir de diversión en este paquete de dos\nLas dos muñecas de 12.0 in llevan trajes profesionales.\nViene con una máquina de panini, sándwich en un plato y una taza de café.\nIncluye un abrigo de chef para muñeca Ken y un delantal para muñeca Barbie.\nEs el regalo perfecto para los fans de Barbie.', 0, 30, 'FPL88-1', '2021-03-05', 2, 28, NULL),
(1106, 'nv', 'FPSTHB2615W', 'BATIDORA DE INMERSION OSTER', '', 0, 0, NULL, '2021-02-10', 1, NULL, NULL),
(1107, 'nv', 'FPSTJU4175', 'EXPRIMIDOR DE JUGO BLANCO OSTER', '', 0, 0, NULL, '2021-02-10', 1, NULL, NULL),
(1108, 'a', 'FRB08', 'BARBIE DREAMTOPIA HADA ALAS MAGICAS', 'Un mundo de posibilidades- combina este juguete con muñecas y accesorios de Barbie y vive mil aventuras divertidas (las muñecas y accesorios se venden por separado).\n\nLa muñeca Hada alas mágicas de Barbie Dreamtopia es ideal para dejar volar la imaginación con sus alas que vuelan de verdad.\n\nEl hada Barbie viene con dos pares de alas voladoras que se pueden sujetar a las alas de mariposa de su espalda.\n\nLos dos pares de alas voladoras tienen adornos del arcoíris, un cuerpo y movimientos de mariposa.\n\nEste hada Barbie inspira historias llenas de colores con un look del Reino del Arcoíris Mágico formado por un corpiño rosa de un solo hombro decorado con franjas de colores y estrellas, una brillante falda de hada con un estampado de arcos iris y nubes, y una corona rosa para darle el toque final.\n\nEdaD- 3+', 0, 45, 'FRB08-1', '2021-03-05', 2, 28, NULL),
(1109, 'a', 'FRP01', 'BARBIE SET COMPLETO SUPERMARKET', '¡Comienza una nueva semana y toca hacer la compra! ¡Disfruta con la nueva Barbie Vamos al supermercado! ¡Prepara la lista de la compra y acompaña a tu muñeca preferida !\n\nAhora puedes disfrutar de tareas cotidianas junto a Barbie, como ir al Supermercado, pasa un rato genial y escoge los mejores artículos para tener energía durante toda la semana. Barbie cuida mucho su alimentación, por lo que tendrás que tenerlo en cuenta a la hora de escoger unos productos u otros en el supermercado. ¡Coje el carro y que comience la diversión!\n\nDisfruta con este y otros playsets para tu muñeca preferida, Barbie, completa tus aventuras con packs como este y encuentra todos los accesorios, vestidos y mucho más en nuestro amplio stock de artículos Barbie.', 0, 42, 'FRP01-1', '2021-03-05', 2, 28, NULL),
(1110, 'a', 'FRP05', 'BARBIE CRAYOLA STAMPS DOLL', '- Colorea con diversión y dibuja la creatividad con la muñeca Barbie CRAYOLA +15 piezas\n\n- Las piezas incluyen 4 artículos de ropa lavables, diseños gráficos, Soporte para colocar los vestidos y colorearlos, y con las herramientas de colorear.\n\n- Elija una moda, colóquelo en la forma del vestido y coloréelo. Reproduce una historia o captura una mirada. A continuación, lava la moda y el color en un nuevo diseño, es una diversión creativa infinita.', 0, 30, 'FRP05-1', '2021-03-05', 2, 28, NULL),
(1111, 'a', 'FTC23', 'FP SES MU?ECOS ACTI', 'Cookie Monster acaba de poner un nuevo lote de galletas en el horno, ¡y no puede esperar hasta que estén listas para poder comerlas! ¿Qué podemos hacer para ayudar a Cookie Monster a esperar sus cookies? Ahora su hijo puede jugar junto con Cookie Monster con esta divertida y educada muñeca peluche de Fisher-Price. Haga que su hijo apriete la barriga de Cookie y que juegue un conteo y un juego de color. Hay más de 40 sonidos y frases divertidas. Contar con Cookie enseña y promueve hábitos saludables, identificación del color, números y conteo. Este surtido de muñecas de peluche parlante incluye Guess with Elmo y Counting with Cookie. Cada uno se vende por separado y sujeto a disponibilidad. Plaza Sésamo: Más inteligente, más fuerte, Kinder.', 0, 35, 'FTC23-1', '2021-03-05', 2, NULL, NULL),
(1112, 'a', 'FTC26', 'ELMO DANCE BAILA CON ELMO', '¡Elmo tendrá una fiesta y quiere que bailes y cantes con él sus canciones favoritas! Este peluche mecánico mueve sus brazos y salta arriba y abajo, creando divertidos pasos de baile para tres diferentes canciones originales. Presiona el pie de Elmo para comenzar con la diversión. Además, Elmo puedo bailar el “Baile de los Encantados”. Este juguete enseña y promueve habilidades motrices, desarrollo del lenguaje y expresión creativa. Incluye más de 30 frases, junto con toda la música para bailar y cantar. ¡Que comience la fiesta! Sésamo: ayudando a los niños a crecer inteligentes, fuertes y amables.', 0, 76, 'FTC26-1', '2021-03-05', 2, NULL, NULL),
(1113, 'a', 'FTG80', 'BARBIE MU?ECA MADE TO MOVE', 'Barbie® está lista para ejercitarse por completo, ¡ya sea que ponga a prueba su balance en la postura del árbol o que haga una sesión de estiramiento antes de su ejercicio aeróbico! Y luce fabulosa para el ejercicio con un tierno top de gimnasio y elegantes mallas deportivas con patrones florales. Con sus 22 “articulaciones” Barbie® puede doblarse ¡y posar de muchas maneras!', 0, 30, 'FTG80-1', '2021-03-05', 2, 28, NULL),
(1114, 'a', 'FTV96', 'BARBIE BICICLETA', 'Barbie® pone a volar la imaginación con una Hermosa bicicleta ¡qué puede montar de verdad! Diseñada en rosa con acentos plateados, canastilla y asiento morado, ayuda a crear todo tipo de historias. \n\nBarbie® cabe en el asiento para dar vida al juego – un clip en él sirve para sostener su dorso, sus manos se ajustan al manubrio y sus pies a los pedales. \n\nSolo empuja para que empiece la acción- las piernas de Barbie® se doblan en la cintura y rodillas para que sus pies se muevan con los pedales mientras las llantas ruedan. ¡Hay tantos lugares por recorrer!', 0, 30, 'FTV96-1', '2021-03-05', 2, 28, NULL),
(1115, 'a', 'FVM67', 'BATMAN DELUXE', '¡Los  superhéroes  y  supervillanos  de  DC  Comics  cobran  vida  con  estas  figuras  de  acción  de  30  cm!  ¡Cada  figura  de  acción  Movimientos  auténticos  incluye  nuevas  armas  de  batalla,  permite  adoptar  posturas  realistas  y  lleva  a  cabo  movimientos  característicos  de  su  personaje  al  apretarle  las  piernas!  Mira  cómo  Batman  hace  una  llave  de  karate  contra  el  enemigo  o  cómo  lanza  un  disco  para  derribarlo.  Con  sus  once  puntos  de  articulación,  los  fans  podrán  recrear  las  posturas  más  famosas  del  personaje.  ¡Enfrenta  al  Caballero  Oscuro  con  los  supervillanos  de  DC  Comics  para  recrear  un  clásico  combate  del  bien  contra  el  mal!  Las  figuras  se  venden  por  separado  y  están  sujetas  a  disponibilidad.', 0, 30, 'FVM67-1', '2021-03-05', 2, 27, NULL),
(1116, 'a', 'FWK85', 'BARBIE FRY AST', 'Deja volar tu imaginación con las hadas aladas Barbie. Cada muñeca tiene un par de alas a rayas con los colores del arcoiris y estrellitas. La muñeca está vestida con un hermoso vestido rosa, que consiste en una falda extraíble y un corsé decorado. La estilización se completa con una hermosa tiara. Dreamtopia es una tierra inusual, fabulosamente colorida, llena de hadas arcoiris, flotando en nubes de algodón de azúcar, sirenas, chapoteando en coloridas cascadas y princesas. 2 modelos surtidos. Se venden por separado. Envío sujeto a disponibilidad.', 0, 20, 'FWK85-1', '2021-03-05', 2, 28, NULL),
(1117, 'a', 'FWV25', 'BARBIE TRVL LEAS DL', 'Barbie Vamos de viaje, muñeca con accesorios, edad recomendada: 3 años y mas', 1, 31, 'FWV25-1', '2021-03-04', 2, 28, NULL),
(1118, 'a', 'FWY29', 'BARBIE HELICOTERO', '¡Sé lo quieras ser con Barbie!\nÚnete a la diversión con el Helicóptero de Barbie y ¡viaja con tu imaginación a cualquier parte del mundo! Diseñado en color rosa y azul, “vuela” con este helicóptero y admira la vista desde arriba.\n\nHay espacio para dos muñecas (se venden por separado) e incluyen cinturones de seguridad para hacer la hora de juego más realista y “controles” color plata ¡para que puedas llevar el helicóptero a donde quieras! ¿Dónde será tu próxima aventura\n\n¡Dibuja en su rostro la sonrisa que iluminará tu día! Engríe a las princesas de casa con un increíble juego capaz de despertar su lado creativo y hacer volar su imaginación con fantásticas historias.\n\n¿Aun no decides que regalo llevar Adquiere de inmediato este entretenido juego y sorprende con el obsequio soñado.', 0, 30, 'FWY29-1', '2021-03-05', 2, 28, NULL),
(1119, 'nv', 'FXG41', 'BARBIE INDOUTDR AST', '', 0, 0, NULL, '2021-02-10', 2, NULL, NULL),
(1120, 'a', 'FXN96', 'BARBIE MU?ECA PEINADOS ARCOIRIS', '¡La muñeca Barbie® Rainbow Sparkle Hair despierta la imaginación de los jóvenes para diseñar peinados únicos con gel brillante, accesorios para el cabello y características increíbles!\n\nTiene un arcoíris oculto con cinco colores brillantes en su cabello rubio extra largo que mide 7.5 pulgadas de largo\n\nUse el peine y el gel brillante para agregar brillo al cabello de la muñeca Barbie® simplemente conecte el tubo de gel al peine y apriételo mientras lo peina para aplicarlo con facilidad\n\nLas jóvenes estilistas pueden crear divertidos peinados: trenzas, coletas, coletas, bollos, peinados parciales y más, ¡usando las tres pinzas para el cabello, dos cintas para el cabello y el cepillo!\n\nCuando llegue el momento de una nueva apariencia, lave el brillo con agua y comience de nuevo: ¡repita una y otra vez para explorar diferentes miradas e historias diferentes!\n', 0, 26, 'FXN96-1', '2021-03-05', 2, 28, NULL),
(1121, 'a', 'FXR94', 'BARBIE MU?ECA DREAMTOPIA', 'La muñeca Barbie ™ Dreamtopia ayuda a la imaginación a soñar nuevas tierras y nuevos peinados.\nTiene el cabello de color rosa brillante de fantasía que es extralargo, por lo que es muy divertido de cepillar: ¡se incluye un cepillo para el cabello que es fácil de agarrar para manos pequeñas! \nLa muñeca princesa Barbie® viste un atuendo fantástico: el corpiño azul está decorado con estrellas, la falda rosa tiene un estampado de arcoíris, los zapatos azules combinan y una tiara azul completa el look con un toque de fantasía.\nLas modas extraíbles fomentan el estilo y la diversión de la fantasía, lo que hace que esta muñeca Barbie ™ de pelo largo sea un gran regalo para los niños más pequeños.\nColecciona todas las muñecas y juguetes Barbie ™ Dreamtopia para recrear escenas favoritas o contar tus propios cuentos de hadas y navegar con Chelsea ™ y su hermana mayor Barbie® (cada una se vende por separado, sujeto a disponibilidad).', 0, 20, 'FXR94-1', '2021-03-05', 2, 28, NULL),
(1122, 'nv', 'FXT00', 'BARBIE FAIRY DOLL', '', 2, 26, NULL, '2021-02-10', 2, NULL, NULL),
(1123, 'a', 'FXT13', 'BARBIE PRINCESS DOLL', '¡Ha llegado el gran día! ¡Consigue las nuevas Princesas de Dreamtopia y disfruta de nuevas aventuras a todo color!\n\nVive nuevas aventuras con Barbie y las nuevas muñecas de la exitosa película Dreamtopia, una nueva película de tu muñeca favorita y todas sus amigas. ¡Magia, amistad y diversión!\n\nCada muñeca tiene 5 puntos de articulación.\n\nNota: La falda se puede cambiar, pero el corpiño de la muñeca va unido a la misma.', 0, 20, 'FXT13-1', '2021-03-05', 2, 28, NULL),
(1124, 'a', 'FXT20', 'BARBIE CHELSEA CASTILLO SIRENA', 'La muñeca sirena Chelsea ™ y la figura de su amiga Merbear están listas para sumergirse en el tiempo de juego con un parque infantil que ofrece sorpresas de fantasía para todos los estados de ánimo. Con forma de castillo de arena en rosa pastel, azul y amarillo, el juego tiene un columpio, un tobogán, una piscina y una fiesta de té para dos. Coloca a la muñeca Chelsea ™ en el columpio rosa con forma de concha y empuja para balancearla hacia adelante y hacia atrás.', 0, 30, 'FXT20-1', '2021-03-05', 2, 28, NULL),
(1125, 'a', 'FXT25', 'BARBIE MU?ECA SIRENA PLAYST', 'Si te gusta nadar y cuidar a los bebés, ahora con esta Barbie Sirena y su guardería de sirenas completarás la diversión.\n\nUnas muñecas elaboradas con materiales de alta calidad, con los que sin duda podrás jugar de manera divertida .', 0, 45, 'FXT25-1', '2021-03-05', 2, 28, NULL),
(1126, 'a', 'FYJ44', 'HW MONSTER TRUCK CARROS 1:64', 'ompleta tu colección de coches, con estos Hot Wheels Vehículo Monster Truck 1:64.\n\nUnos fabulosos y resistentes vehículos realizados en material de alta calidad, en diferentes modelos y a escala de los impresionantes Monster truck 1:64, para que puedas arrasar con todo.\nEstos vehículos tienen ruedas de goma, estructura resistente y cada uno de ellos está caracterizado de manera diferente. Todos tienen un mini coche de plástico en un color para que puedas pasar por encima y \"Aplastarlo\", además de poder unirlos y encajar las piezas con otros mini vehículos.\n\nCoches con calidad, con diseño atrevido y perfectos para que disfrutes junto a tus amigos y amigas realizando diferentes aventuras. Pintado como un camión de bomberos, de cebra, tigre o tiburón, estos son algunos de los diseños que puedes encontrar y que tienes que coleccion', 0, 20, 'FYJ44-1', '2021-03-05', 2, 27, NULL),
(1127, 'a', 'FYN86', 'CARS PISTA MICRO RACERS', 'Disney Pixars Cars Spinning y Crashing Mini Racers Speed Race\nEl botón lanzador funciona con niños dispara vehículos en acción.\nLos desafíos divertidos incluyen desvíos irregulares y una pared de choque.', 0, 40, 'FYN86-1', '2021-03-05', 2, 27, NULL),
(1128, 'a', 'GBD87', 'BATMAN 12 TLK SET 2', 'Batman Armadura Poder\nREF GBD87\nMarca mattel\nmas de 30 sonidos y fraces\nPrepárate para una misión épica con Batman Mission Total Armor Batman Action Figure! Esta figura de acción de Batman con escala de 12 pulgadas presenta una armadura extraíble de \"titanio\", luces, sonidos y 11 puntos de articulación para crear poses realistas. Dispara la placa del cofre y Batman gritará frases secretas mientras entra en acción. ¡Cambie su Batsuit para pasar del modo base al modo armadura y desbloqueará frases adicionales! Los efectos de sonido incluyen una explosión de granadas, chasquido de capa y doble golpe. Las frases icónicas incluyen \"Esta ciudad está bajo mi protección\"', 0, 35, 'GBD87-1', '2021-03-05', 2, 27, NULL),
(1129, 'a', 'GBF81', 'HW PISTA CHAMPION', 'Realiza competiciones entre tus amigos y amigas con estas Championship Trackset de Hot Wheels.\n\nEstas pistas de Hot Wheels están fabricadas en material resistente de alta calidad en color, naranja, azul y gris. Cada una de ellas dispone de una función diferente con la que te lo pasarás en grande, e incluye un coche para tu colección.\nPor un lado tenemos la pista de subida a pique, con lanzador para impulsar los coches y que estos suban la increíble rampa para llegar a la parte superior con tan solo un empujón. La rampa está situada sobre una base con espacio para guardar hasta 6 vehículos. Una subida increíble en la que los coches subirán a toda velocidad.\n\n¿Te gusta derrapar?\nOtra de las opciones que nos presentan desde Hot Wheels es esta increible pista de derrape, donde tus coches podrán derrapar a toda velocidad. Impulsa tu vehículo desde el lanzador con un golpe que hará que salga a toda velocidad impulsándose y derrapando por la pista.\n', 0, 20, 'GBF81-1', '2021-03-05', 2, 27, NULL),
(1130, 'a', 'GBK24', 'BARBIE MU', 'Crea impresionantes peinados rizados con la muñeca Barbie Ultimate Curls y sus conjuntos. ¡Es muy fácil y no tienes que aplicar calor! Hay dos maneras de rizar el largo pelo rubio de Barbie: con el rizador y con el ondulador, ¡y ambos funcionan sin calor! Solo tienes que colocar el pelo de la muñeca alrededor de la herramienta, mantenerlo unos instantes y soltarlo. Crea rizos definidos, ondas suaves o déjale el pelo liso. Entre los accesorios adicionales encontrarás pasadores, pinzas y diademas, para que puedas crear todavía más peinados originales y creativos. Para crear otro peinado, cepilla el pelo de Barbie y empieza de nuevo. Haz un sinfín de peinados para descubrir looks nuevos y expresa tu estilo. Barbie está vestida para adaptarse a todo tipo de historias gracias a un colorido vestido con la parte de los hombros transparente, una falda a capas y unos divertidos zapatos. Incluye un brazalete dorado que le da el toque final.', 1, 31, 'GBK24-1', '2021-03-02', 2, 28, NULL),
(1131, 'a', 'GBK59', 'STICE', '\nBarbie Team Stacie Muñeca gimnasta con accesorios, juguetes +3 años', 2, 31, 'GBK59-1', '2021-03-04', 2, 28, NULL),
(1132, 'a', 'GBK92', 'BARBIE MU?ECA BASICA', 'Estas Muñecas Barbie® está listas para una tarde de diversión y grandes emociones con sus llamativos vestidos florales! Cada Muñeca lleva un vestido con un estampado de flores grandes y costuras en contraste en los dobladillos. Los colores vivos y las flores grandes son divertidos y están a la moda. Y los zapatos a juego completan su look y le dan otro toque elegante. Las niñas podrán explorar el mundo con Barbie® en este conjunto tan versí¡til, ¡porque cuando una niña juega con Barbie®, imagina todo lo que puede llegar a ser! Incluye una Muñeca Barbie® con un conjunto y accesorios. Se venden por separado y están sujetos a disponibilidad. Las Muñecas no pueden tenerse en pie por sí­ solas. Los colores y la decoración pueden ser distintos de los mostrados.', 0, 15, 'GBK92-1', '2021-03-05', 2, 28, NULL),
(1133, 'nv', 'GBY54', 'DC SUPER HERO GIRLS SURTIDAS', '', 0, 0, NULL, '2021-02-10', 2, NULL, NULL),
(1134, 'a', 'GCF94', 'HW MONSTER TRUCK CARROS 1:43', 'HW MONSTER TRUCK CARROS 1:43', 0, 12, 'GCF94-1', '2021-03-01', 2, 27, NULL),
(1135, 'a', 'GCW29', 'SHAZAM 12 FIGURE AST', 'Auténticas figuras de acción de Shazam a escala de hasta 12 pulgadas fieles a los disfraces de películas con una capa de tela o una chaqueta, diseños faciales de última generación y semejanzas de actores.\n\n11 puntos de articulación para un juego de batalla realista.', 8, 21, 'GCW29-1', '2021-03-02', 2, 27, NULL),
(1136, 'a', 'GDJ37', 'BARBIE DLPETS', '\nMattel Barbie-Muñeca Rubia y Conjunto de 3 cachorritos, bañera y Accesorios, Juguetes 3 años, Multicolor ', 8, 31, 'GDJ37-1', '2021-03-04', 2, 28, NULL),
(1137, 'a', 'GDP79', 'TOY STORY 4 BUZZ LIGHYEAR WRIST', 'El comunicador de muñeca Buzz Lightyear permite que los niños se pongan como el Space Ranger.\nEl juguete de rol incluye una pistola y 3 proyectiles.\nEl panel interior tiene un medidor de adhesivos y un almacenamiento de proyectiles Gamma Sector 4.\nPara más diversión en disfraces, elige el Rapid Disc Blaster y Space Ranger Armor con JetPack (cada uno se vende por separado, sujeto a disponibilidad).\nA partir de 3 años.', 0, 26, 'GDP79-1', '2021-03-05', 2, 27, NULL),
(1138, 'a', 'GFH60', 'BARBIE UNICORNIO LUCES BRILLANTE', 'Ilumina la diversión con el mágico unicornio brillos de arcoíris de barbie dreamtopia. Su cuerpo se ilumina y emite sonidos al activarlo de una de las dos formas. Las luces y sonidos crearán un increíble momento cada vez que aparezcan y es muy divertido repetirlo una y otra vez. Para activar la diversión, solo tienes que cepillar las crines del unicornio, largas y en rosa brillante para darle un toque de fantasía, con el cepillo \"mágico\" incluido o pulsar el botón en el cuerpo del unicornio. Los niños se inspirarán e imaginarán grandes aventuras con este unicornio de barbie dreamtopia. Los amantes de la magia podrán imaginar toda clase de historias de fantasía', 1, 54, 'GFH60-1', '2021-03-05', 2, 28, NULL),
(1139, 'a', 'GFL82', 'BARBIE MU?ECA SIRENA LUNES DREAMTOPIA', 'Sumérgete con la muñeca Sirena Nada y Brilla de Barbie Dreamtopia; ¡su cola móvil con luces la convierten en un regalo perfecto para niñas y niños imaginativas!\n\nCon sus movimientos y luces fáciles de activar, esta muñeca para niñas y niños les permite jugar sin parar imaginando historias llenas de sorpresas y efectos mágicos\n\nSolo hay que sumergir a Barbie sirena en el agua para activar un espectáculo de luces arcoíris en la cola translúcida morada\n\nTambién se pueden apretar los lados de su volante para activar sus luces cuando no está en el agua- ¡la variedad de sorprendentes combinaciones le da más diversión!\n\nCon la muñeca sirena Barbie en el agua (o fuera), presiona los lados de su volante para que mueva su cola- ¡es tan realista que las posibilidades de juego son infinitas!\n\nEl conjunto de Barbie le da todavía más magia gracias a un corpiño rosa brillante que atrapa la luz y una cola translúcida y reluciente.', 0, 32, 'GFL82-1', '2021-03-05', 2, 28, NULL),
(1140, 'a', 'GFP59', 'BARBIE SWEETS BAKING PLAYSET', '¡La muñeca Barbie® Baker viene con un dulce juego que les permite a los niños \"hornear\", decorar y exhibir pasteles con masa Barbie® y divertidas funciones de trabajo!\nLa isla de la panadería tiene un horno con un molde extraíble para 2 pasteles, uno grande y otro pequeño, ¡para crear pasteles con 1 o 2 capas! \nRellena el molde con la masa incluida (se incluyen 3 colores), dale forma con la pieza para aplanar la masa, coloca en el horno y tira de la palanca para ver \"subir\" los pasteles - mmmm!\nDecora los lados de una capa colocándola en el soporte para pasteles y seleccionando 1 de 3 diseños; luego deslice la palanca para acercar el soporte a la plantilla y gire a mano para imprimir la masa. \n¡Apila capas para la combinación perfecta y luego cubre con 1 de 3 adornos para pasteles dulces!', 0, 42, 'GFP59-1', '2021-03-05', 2, 28, NULL),
(1141, 'a', 'GFR45', 'BARBIE DREAMTOPIA ROYAL BALL PRINCES', 'Disfruta junto a una Princesa especial, valiente y mágica! ¡Sorprende a todos con la nueva Muñeca Barbie Súper Princesa Dreamtopia con Accesorios!\n\nJuega y aprende junto a esta adorable Princesa de uno de los bosques más coloridos y divertidos de Dreamtopia, comienza una nueva aventura junto a tu muñeca preferida y el resto de sus inseparables amigas. La muñeca incluye un precioso vestido con purpurina, una práctico cepillo para peinar la larga melena de la muñeca y diferentes complementos para añadirlos al look de la muñeca. ¡Incluye un cetro mágico para salvar a todas las criaturas del bosque en apuros!', 0, 35, 'GFR45-1', '2021-03-05', 2, 28, NULL),
(1142, 'a', 'GGB26', 'TOY STORY 4 FIG BASICA 2 PACK', 'Prepárese para una gran diversión con este pack de figuras del nuevo Toy Story 4 The Disney Pixar Toy Story.\nPersonajes Woody y Perdigón con cuerpo flexible.\nModelos variados, surtidos de forma aleatoria', 0, 32, 'GGB26-1', '2021-03-05', 2, 27, NULL),
(1143, 'a', 'GGC09', 'BARBIE MRMD', 'La sirena de barbie dreamtopia estimula la imaginación y la sumerge en los cuentos de hadas, su cola y corpiño coloridos están decorados con detalles de fantasía, y su aleta aporta otro chapuzón de colores, dóblala por la cintura para contar un montón de aventuras: «nada» en el mar o siéntate para tomar el sol, después, recrea tus sueños e imagina muchos más, porque cuando una niña juega con barbie, imagina todo lo que puede llegar a ser. Incluye una sirena de barbie dreamtopia, la muñeca no puede tenerse en pie ni nadar por sí sola, los colores y la decoración del juguete pueden ser distintos de los mostrados.', 8, 21, 'GGC09-1', '2021-03-05', 2, 28, NULL),
(1144, 'a', 'GGH38', 'TOY STORY 4 BLAST OFF BUZZ LY', '¡Vuela al infinito y más allá con esta divertida figura de Buzz Lightyear!\nSus alas son desplegables. Presiona para escuchar frases y sonidos de vuelo. Mira como se ilumina su traje.', 0, 38, 'GGH38-1', '2021-03-05', 2, 27, NULL),
(1145, 'a', 'GGY38', '12 L SHAZAM SOUNDS', 'Figura icónica de Shazam™ de 3 cm con luces y sonidos para recrear una auténtica batalla.', 6, 31, 'GGY38-1', '2021-03-02', 2, 27, NULL),
(1146, 'nv', 'GHH38', 'BARBIE MU?ECA BASICA PLAYERA SURTIDAS', '', 0, 0, NULL, '2021-02-10', 2, NULL, NULL),
(1147, 'a', 'GHK23', 'BARBIE SPRTS DL', 'Regalo óptimo para niñas y niños de más de 3 años.\n\nMuñeca nada y bucea de barbie dreamhouse adventures, 29 cm, con bañador, y accesorio para nadar, trampolín y cachorrito.\n\nLa muñeca nada y bucea de barbie está inspirada en barbie dreamhouse adventures, vestida con un bañador a rayas deportivas y detalles óptimas\nAl apretar la palanca de su cintura barbie mueve las piernas como si estuviese nadando.\n\nEl cachorrito de barbie también puede usarse como juguete lanza chorritos.', 5, 31, 'GHK23-1', '2021-03-02', 2, 28, NULL),
(1148, 'a', 'GHK24', 'BARBIE SPRTS CO LTD DL', '¡Cuente historias y juegue deportes con las muñecas Barbie inspiradas en Barbie ?Dreamhouse Adventures! Las jóvenes imaginaciones pueden jugar a la acción de girar y girar con la muñeca Teresa y su set Barbie con temas de gimnasia. Sujete el anillo azul a su cintura y gírelo para ayudarla a girar o girar. ¡Luego sujeta el aro a su muñeca y mira cómo lo gira!', 2, 31, 'GHK24-1', '2021-03-02', 2, 28, NULL),
(1149, 'a', 'GHL91', 'BARBIE MU?ECA PISCINA', 'La imaginación joven puede hacer un chapoteo con la muñeca Barbie y su divertida piscina.\nAyuda a la muñeca Barbie a subir la escalera y deslizarse directamente en o descansar en la zona de asiento integrada.\nUn accesorio de toalla colorido, dos bebidas frías y posavasos integrados ayudan a establecer la escena para la fiesta de piscina perfecta.\nEn traje de baño brillante con un gráfico de flores, la muñeca Barbie está lista para la diversión en el sol.\nLas imaginaciones de 3 a 7 años de edad pueden jugar tantas historias de verano con la muñeca Barbie y su piscina.', 0, 35, 'GHL91-1', '2021-03-05', 2, 28, NULL),
(1150, 'a', 'GHV81', 'BARBIE CHLSA BLT PLYST', '\nBarbie Club Chelsea Doll and Ballet Playset, 6 pulgadas Morena, con escenario transformador, accesorios incluyendo barra de ballet, moda y accesorios.', 2, 31, 'GHV81-1', '2021-03-04', 2, 28, NULL),
(1151, 'a', 'GHV92', 'BARBIE FEAT PET BLINDE', '¡Disfruta de un paseo en familia junto a tu muñeca favorita y sus mascotas! ¡Gracias al set Barbie y Sus Mascotas de Mattel!\n\nDescubre una nueva aventura de la mano de Barbie y sus dos perritos, disfruta de divertidos paseos por el parque de una forma muy cómoda y segura, gracias al carrito para mascotas incluido. El set incluye accesorios que podrás llevar en el bolsito y sacar en cualquier momento del paseo.\n\n\n\nIncluye- 1 muñeca Barbie con vestido blanco con rayas de colores y un par de zapatillas rosas, 2 perritos, 1 carrito para los perritos, 1 bolso rosa para accesorios, 2 comederos, 1 botella de agua, 2 huesos y 1 frisbee..', 0, 30, 'GHV92-1', '2021-03-05', 2, 28, NULL),
(1152, 'nv', 'GJK49', 'BARBIE DREAMTOPIA TEA PARTY', '', 0, 0, NULL, '2021-02-10', 2, NULL, NULL),
(1153, 'a', 'GJL16', 'HW TIENDA DE NEUMATICOS', 'La pista Hyper-Boost Tire Shop de Hot Wheels City les ofrece a los niños un cambio de neumáticos superrápido. Este set motorizado interactivo es perfecto para jugar con varios vehículos, estimular la imaginación e inspirar un sinfín de historias mientras se desarrollan las habilidades motoras de los niños de 5 a 8 años. Los niños podrán pasar sus vehículos Hot Wheels a escala 1:64 por el medidor de presión de neumáticos y seguir por la pista hasta el propulsor. Deberán intentar evitar el neumático que gira, subir y seguir subiendo para llegar hasta la parte superior del taller. Cuando logren cumplir el desafío, el vehículo descenderá y en el primer piso los pequeños podrán ver los controles del garaje, cargar combustible y cambiar el aceite para estar listos para la siguiente carrera. Se conecta con otros sets de Hot Wheels', 0, 50, 'GJL16-1', '2021-03-05', 2, 27, NULL),
(1154, 'nv', 'GJL58', 'BARBIE BASICA BAILARINA', '', 8, 21, NULL, '2021-02-10', 2, NULL, NULL),
(1155, 'a', 'GJM77', 'HW ACTION ECL SET', 'Este emocionante juego de Hot Wheels incluye todo lo que los niños necesitan para poner a prueba sus habilidades de conducción de alto rendimiento. Con la rueda, dos lanzadores y dos autos incluidos, los niños pueden desafiarse a sí mismos y entre ellos para lanzar sus autos por la pista, a través de la rueca y golpear las aletas de puntuación en el volante para ganar puntos. \n\nEl puntaje total más alto gana el día, pero el desafío en sí es donde está la diversión. Ayuda a desarrollar las habilidades motoras, la sincronización y el impulso competitivo de los niños.\n\nJugar solo en el set de juego puede fomentar la paciencia y la atención al tiempo, mientras que jugar cara a cara desarrolla el espíritu competitivo.\nLanzar a través de la rueda giratoria y sumar puntos proporciona una actividad y un objetivo enfocados que lleva el juego del automóvil a un nivel más alto de diversión y descubrimiento.\n\nUn gran regalo para niños de 5 años en adelante con acción y puntuación de alto vuelo.', 4, 52, 'GJM77-1', '2021-03-02', 2, 27, NULL),
(1156, 'a', 'GJN32', 'BARBIE SET BA?ERA BURBUJAS', '¡La muñeca Barbie® sabe que la mejor forma de ser es brindarte la mejor atención! Este juego temático de spa celebra una de sus formas favoritas de recargar energías: un baño con gas. Viene con una muñeca Barbie®, un cachorro, una bañera de hidromasaje y accesorios para jugar un verdadero baño con gas. Simplemente llene la bañera con agua, coloque la muñeca Barbie® dentro y agregue uno de los cinco paquetes de burbujas brillantes para ver la burbuja de agua, ¡como en un verdadero spa!\n\nLa muñeca Barbie® puede relajarse con accesorios que incluyen una bandeja de bañera, productos de baño, esponja vegetal, un cepillo para la espalda y una toalla. El spa también es relajante, con un marco inspirado en madera con una maceta para pandas. Hay mucho espacio para que el cachorro se siente, además de lugares para almacenar los accesorios. Algunas piezas tienen un asa que la muñeca puede sostener para alentar la diversión de los juegos .', 0, 30, 'GJN32-1', '2021-03-05', 2, 28, NULL),
(1157, 'a', 'GKH26', 'BARBIE MU?ECA DREAMTOPIA PRINC FALDA 2 E', 'Barbie Muñeca Princesa de la nieve, falda azul transformación mágica (GKH26) ¡Vive auténticos cuentos de hadas con la muñeca Barbie® princesa de Barbie™ Dreamtopia! \n\nEsta muñeca princesa está preparada para la ocasión con un vestido de varias capas con estampado de copos de nieve, colores invernales y mucho brillo. \n\nEl corpiño brillante con degradado de blanco a morado y un lazo combina a la perfección con la suave chaquetilla de piel de imitación. \n\nAprieta el botón del corpiño de la muñeca Barbie® para ver cómo se abre el vestido y aparecen copos de nieve plateados y tonos lavanda, azules y rosas. \n\nLa larga mecha de color rosa en el largo cabello rubio de Barbie® le añade un toque de fantasía, e incluye además un peine para que las niñas puedan prepararla para su aventura real. \n\nEDAD RECOMENDADA- +3 AÑOS \n', 0, 32, 'GKH26-1', '2021-03-05', 2, 28, NULL),
(1158, 'a', 'GKH73', 'BARBIE MU?ECA SPA', 'Barbie sabe que la mejor forma de sentirte bien, es brindándote el mejor cuidado a ti misma! Estos sets de muñecas y accesorios celebran sus formas favoritas de renovarse con una muñeca, un cachorro y juguetes temáticos que permiten a los niños jugar un momento de bienestar. Elige entre los temas de spa, entrenamiento y relajación. Cada muñeca Barbie usa un atuendo cómodo y elegante que se adapta a su actividad. Sumérgete en un día relajante con piezas como una almohada para el cuello y un cepillo de baño en el set de spa, mantente en forma con un tapete de yoga, una botella de agua y una bolsa de gimnasia del conjunto de ejercicios o encuentre un momento de tranquilidad con el diario y la máscara para los ojos en la relajación conjunto. A las niñas les encantará expandir sus mundos con las muñecas de bienestar Barbie. Los niños pueden recolectarlos todos para ampliar aún más las posibilidades porque cuando una niña juega con Barbie, ¡puede ser lo que quiera ser!', 0, 25, 'GKH73-1', '2021-03-05', 2, 28, NULL),
(1159, 'a', 'GKT75', 'BARBIE SIRENA', '¡La Sirena Slime de Barbie Dreamtopia se puede estrujar para que las niñas se diviertan contando cuentos de hadas táctiles! Cuenta un montón de historias imaginativas con dos paquetes de slime de colores y brillante, y una sirena Barbie con un look inspirado en el mar. \n\nAprieta, estira y dobla el slime para divertirte con las manos. Luego, pulsa el botón de la espalda de Barbie para retirar su cola y guarda el slime dentro ¡su cola es suave, estrujable y muy divertida!', 0, 40, 'GKT75-1', '2021-03-05', 2, 28, NULL),
(1160, 'a', 'GMW03', 'BARBIE COFEE SHP', 'Barbie y su Cafetería, Muñeca con accesorios para café , smoothies, cupcakes y ensaladas de juguete (Mattel GMW03): ¡Puedes tener una cafetería con el conjunto de Barbie Cafetería! Incluye la cafetería, una muñeca Barbie y más de 20 accesorios para jugar de manera creativa. Con una adorable camiseta a rayas, un delantal rosa y el pelo recogido en un moño, Barbie prepara cafés, batidos y tés para sus clientes (gira la rueda en la cafetera para elegir la bebida que quieras). Además, Barbie sirve comida, agua embotellada y mucho más. Cuando el cliente haya decidido su pedido, Barbie puede apuntarlo en la caja registradora. Algunos artículos tienen una anilla con clip para que Barbie pueda agarrarlos y darle más realismo al juego. ¡Explora todo un mundo de creatividad y divertidas historias con el conjunto de juego de Barbie Cafetería!', 0, 42, 'GMW03-1', '2021-03-05', 2, 28, NULL),
(1161, 'a', 'GNK01', 'BARBIE MU?ECA YOGA', 'Las niñas pueden practicar el cuidado personal a la vez que ayudan a la muñeca Barbie Respira conmigo a practicar la meditación.\nLa muñeca Barbie tiene luces y sonidos diseñados para inspirar la consciencia plena: pulsa el botón de su collar para iniciar uno de los cinco ejercicios de meditación guiados.\nEl perrito ayuda a la muñeca Barbie a centrarse con la visualización: coloca uno de los cuatro emojis de nube en su cabeza para expresar una emoción; cámbialos para expresar una nueva sensación.\nLa muñeca Barbie lleva inspiradora ropa de descanso con un estampado de nubes y arco iris en la camiseta y un estampado de nubes en los pantalones.\nTambién cuenta con 15 puntos de articulación para ofrecer movimientos y posturas más realistas: en el cuello, los hombros, los codos, las muñecas, los muslos, las caderas, las rodillas .', 0, 35, 'GNK01-1', '2021-03-05', 2, 28, NULL),
(1162, 'nv', 'GNL70', 'HW PISTA GARAJE', 'HW PISTA GARAJE', 1, 36, 'GNL70-1', '2021-03-01', 2, 27, NULL),
(1163, 'a', 'HC1095', 'CORTADORA DE CABELLO ROJA DE 14 PIEZAS R', 'La máquina de cortar cabello HC1095 de Remington tiene un corte 100% lineal que ayuda a que sus cuchillas tengan un movimiento uniforme y perfecto para lograr cortes precisos. Su mango antideslizante hará del corte del cabello una tarea más sencilla y cómoda, que junto a su potente motor hará que cortar el cabello más grueso y difícil sea un juego de niños. Esta máquina de cortar pelo tiene todo para crear tu estilo y es ideal para todo tipo de cabello ya que cuenta además con 6 peines de diferentes tamaños para que logres el largo del cabello que desees, con una longitud de desde los 3mm hasta los 12mm.\nY lo mejor para el final: la HC1095 tiene una gran durabilidad gracias a sus fuertes cuchillas de acero inóxidable.\nUso con cable\nCuchillas de Acero inoxidable\nIncluye 13 piezas\n6 Peines de guía\nAceite lubricante\nCepillo de limpieza\n2 clips\nPalanca de ajuste\nProtector de Hojilla\nPotente motor para todo tipo de cabello', 10, 16, 'HC1095-1', '2021-06-07', 65, 66, 67),
(1164, 'nv', 'HM-45', 'BATIDORA DE MANO DE 5V BLANCO', '', 0, 0, NULL, '2021-02-10', 1, NULL, NULL),
(1165, 'a', 'JB-330BL', 'LICUADORA RETRO AZUL', 'La potente Licuadora 2 velocidades + pulso modelo JB-330BL de Brentwood utiliza cuchillas de acero inoxidable para triturar y pulverizar hielo fácilmente. Elija entre 2 velocidades para mezclar deliciosos batidos, batidos espesos, proteínas abundantes y más. Incluye un frasco y una tapa aptos para lavavajillas de 50 oz sin BPA. Práctico almacenamiento de cables. .\n\n• Tarro de plástico de 50 oz\n• 2 velocidades + pulso\n• Totalmente libre de BPA\n• Cuchillas de acero inoxidable\n• Piezas aptas para lavavajillas\n• Almacenamiento de cables\n• Base antideslizante\n• Color azul\n• Potencia: 350w', 8, 36, 'JB-330BL-1', '2021-02-25', 1, 7, 49),
(1166, 'a', 'K2784', 'UNO SPIN', '¡El juego clásico de cartas UNO® se revoluciona! Cuando sale una carta de spin, uno de los jugadores deberá girar la rueda, en tan solo un turno, todo puede cambiar, los jugadores pueden llegar desde atrás y tomar la delantera. ¡Diversión a un ritmo acelerado, que te hará dar vueltas la cabeza! Incluye una rueda UNO Spin™ y baraja de cartas UNO.', 0, 28, 'K2784-1', '2021-03-05', 2, NULL, NULL),
(1167, 'a', 'K5904', 'HW CARRITO METAL BASICO PAQx3', 'HW CARRITO METAL BASICO PAQx3', 8, 13, 'K5904-1', '2021-03-01', 2, 27, NULL),
(1168, 'a', 'KT-2150BK', 'MAQUINA DE HACER CAFE Y TE FRIO NEGRA', 'Utilice la cafetera y tetera helada KT-2150BK de Brentwood con jarra de 64 onzas para preparar grandes cantidades de sus cervezas favoritas. Cuenta con un selector de fuerza, canasta de filtro reutilizable, apagado automático y jarra con tapa de 3 posiciones. Un día caluroso puede ser un gran día con su elección de té helado o café helado.\n\n• Prepara té helado y café\n• Rinde 8 porciones\n• Incluye jarra de 64 oz\n• Botón de encendido / apagado simple\n• Cesta de filtro reutilizable\n• Dial selector de fuerza\n• Diseño de cabezal de ducha\n• Tapa de 3 posiciones\n• Apagado automático\n• Almacenamiento de cables\n• De color negro\n• Potencia: 700w', 10, 29, 'KT-2150BK-1', '2021-02-25', 1, 7, 44),
(1169, 'nv', 'MOD810', 'TRICICLO SENCILLO COLORES MIXTOS (AZUL, NARANJA Y ', '', 0, 0, NULL, '2021-02-10', 2, NULL, NULL),
(1170, 'nv', 'MOD833', 'TRICICLO COLORES MIXTOS BOCINA(VERDE, AZUL Y NARAN', '', 0, 0, NULL, '2021-02-10', 2, NULL, NULL),
(1171, 'nv', 'MOD910', 'TRICICLO COLORES MIXTOS LUZ REDONDA (VERDE, ROJO Y', '', 0, 0, NULL, '2021-02-10', 2, NULL, NULL),
(1172, 'nv', 'MOD916', 'TRICICLO COLORES MIXTOS LUZ CUADRADA (AZUL, ROJO Y', '', 0, 0, NULL, '2021-02-10', 2, NULL, NULL),
(1173, 'a', 'PC-488BL', 'COTUFERA AZUL BRENTWOOD', 'La cotufera de aire con rayas clásicas PC-488R de Brentwood hace estallar hasta 8 tazas de palomitas de maíz saludables y sin aceite en solo 2-3 minutos. Disfrute de 4 veces los ahorros utilizando granos sueltos en lugar de bolsas para microondas. Las palomitas de maíz aparecen directamente en su tazón. Siga las recetas incluidas para crear sus propias palomitas de maíz gourmet. Las piezas extraíbles facilitan la limpieza.\n\n• 8 tazas de palomitas de maíz en solo 2-3 minutos\n• No se usa aceite para un refrigerio saludable\n• Ahorre dinero usando granos sueltos\n• Bandeja para derretir mantequilla / cuchara con tapa de doble propósito\n• Las palomitas de maíz aparecen directamente en su tazón\n• Conveniente almacenamiento de cables\n• Incluye recetas gourmet de palomitas de maíz\n• Piezas extraíbles fáciles de limpiar\n• Color: azul, blanco\n• Potencia: 1200w', 10, 31, 'PC-488BL-1', '2021-04-09', 1, 7, 45),
(1174, 'a', 'PC-488R', 'COTUFERA ROJA CLASICA', 'La cotufera de aire con rayas clásicas PC-488R de Brentwood hace estallar hasta 8 tazas de palomitas de maíz saludables y sin aceite en solo 2-3 minutos. Disfrute de 4 veces los ahorros utilizando granos sueltos en lugar de bolsas para microondas. Las palomitas de maíz aparecen directamente en su tazón. Siga las recetas incluidas para crear sus propias palomitas de maíz gourmet. Las piezas extraíbles facilitan la limpieza.\n\n• 8 tazas de palomitas de maíz en solo 2-3 minutos\n• No se usa aceite para un refrigerio saludable\n• Ahorre dinero usando granos sueltos\n• Bandeja para derretir mantequilla / cuchara con tapa de doble propósito\n• Las palomitas de maíz aparecen directamente en su tazón\n• Conveniente almacenamiento de cables\n• Incluye recetas gourmet de palomitas de maíz\n• Piezas extraíbles fáciles de limpiar\n• Color: rojo, blanco\n• Potencia: 1200w', 9, 31, 'PC-488R-1', '2021-04-09', 1, 7, 45);
