(1175, 'a', 'PC-490R', 'COTUFERA CON BOWL ROJO', 'La máquina para hacer palomitas de maíz de aire caliente Brentwood PC-490R Jumbo 24 tazas prepara suficientes palomitas de maíz para toda la familia. Pop 8 tazas en 3 minutos. Cuenta con palomitas de maíz saludables sin aceite, un tazón para servir extraíble incorporado y piezas desmontables para una fácil limpieza. Incluye varias recetas. Agregue una estética clásica a su cocina con nuestra máquina de palomitas de maíz roja.\n\n• Tazón para servir 24 tazas\n• 8 tazas de palomitas de maíz en 3 minutos\n• No se usa aceite para un refrigerio saludable\n• Ahorre dinero usando granos sueltos\n• Las palomitas de maíz se colocan directamente en el recipiente extraíble\n• Piezas extraíbles fáciles de limpiar\n• Incluye cuchara medidora\n• Recetas de palomitas de maíz gourmet gratuitas\n• Color rojo\n• Potencia: 1200w', 10, 36, 'PC-490R-1', '2021-04-09', 1, 7, 45),
(1176, 'a', 'PG6155', 'KIT DE CORTE VIAJERO REMINTONG', 'Recargable (Batería Litio)\nHasta 70 minutos de uso sin cable\nTiempo de carga completa: 4 hr\nCuchillas de Acero Quirúrgico\nIndicador de carga\nIncluye 3 Peines de guía intercambiables y lavables\nEstuche de almacenamiento\nCarga rápida de 5 min\nCortador ancho de 30 mm\nCortador de detalles y cortador de rotativo de nariz.', 0, 23, 'PG6155-1', '2021-04-07', 65, 66, 67),
(1177, 'a', 'PR1335-MB06F', 'COMBO MAQUINA RASURADORA REMINGTON', 'Combo de Afeitadora rotativa modelo PR1335 con Cortador de Detalles para Barba y Bigote modelo MB06.\n\nCuchillas TwinTrack™ para máximo contacto con la piel.\nActiveContour cabezal flexible con más seguimiento de contorno para una afeitada cómoda.\nPowerFlex 360º permite que el cabezal se ajuste a cualquier ángulo de la cara para ayudar a reducir la irritación.\nCuchillas de PrecisionPlus™ tienen ranuras y agujeros que cómodamente afeitan el vello facial más largo y más corto.\nCabezal antimicrobiano ayuda a inhibir las bacterias, e hipoalergénico.\nBatería recargable interna para 40 minutos de uso\nUso en seco o mojado.\nIndicasor led.\nVoltaje universal\n', 0, 43, 'PR1335-MB06F-1', '2021-04-07', 65, 66, 67),
(1178, 'a', 'RZE-BT160HK', 'AURICULARES BLUETOOTH INALAMBRICOS NEGRO', 'Una cómoda almohadilla para los oídos y hasta 10 horas de reproducción de música es lo que elige con los auriculares estéreo inalámbricos Slick Series Toshiba para colocar sobre las orejas. Su diseño liviano y pulido lo convierte en un dispositivo fácilmente portátil y un ajuste cómodo cuando se usa durante horas prolongadas. Olvídate del torpe cableado que alguna vez fue vital para disfrutar de la buena música: deja que estos auriculares lleven su experiencia musical al próximo siglo.\n\nYa sea que esté haciendo ejercicio, caminando o estudiando, estos son perfectos para una variedad de actividades.\nConéctate con dispositivos compatibles con Bluetooth para transmitir música.\nEscucha música o habla con la familia hasta 10 horas con una sola carga.\nPausa la música, omite pistas y ajusta el volumen con los botones integrados.\nRecibe y contesta llamadas telefónicas.\nConéctate con hasta 2 dispositivos Bluetooth diferentes simultáneamente.\nAlmohadillas acolchadas para la comodidad durante todo el día.\nAlcance operativo de hasta 30 pies.\n\nIncluye:\nCable de carga USB\nCable de audio\nManual de usuario\n\nEstos auriculares permiten una gran calidad de sonido, así como comodidad y estabilidad.\n\nCon la capacidad Bluetooth, podrás hablar y escuchar música con una duración de carga de 10 horas, son el regalo perfecto para niños y adultos.\n \nCon un rango de funcionamiento de 30 pies, podrás colgar alrededor de la piscina sin preocuparte por llevar tu dispositivo contigo.\n\nComodidad y calidad envueltos en uno', 0, 18, 'RZE-BT160HK-1', '2021-06-02', 74, 75, NULL),
