(1180, 'a', 'RZE-BT160HP', 'AURICULARES BLUETOOTH INALAMBRICOS FUCSIA', 'Una cómoda almohadilla para los oídos y hasta 10 horas de reproducción de música es lo que elige con los auriculares estéreo inalámbricos para colocar sobre las orejas de Toshiba. Su diseño liviano y pulido lo convierte en un dispositivo fácilmente portátil y un ajuste cómodo cuando se usa durante horas prolongadas. Olvídese del torpe cableado que alguna vez fue vital para disfrutar de la buena música: deje que estos auriculares lleven su experiencia musical al próximo siglo.\n\nYa sea que esté haciendo ejercicio caminando o estudiando, estos son perfectos para una variedad de actividades.\nConéctese con dispositivos compatibles con Bluetooth para transmitir música\nEscuche música o hable con la familia durante hasta 10 horas con una sola carga\nPausa la música, omite pistas y ajusta el volumen con los botones integrados en los oídos\nRecibir y contestar llamadas telefónicas\nConéctese con hasta 2 dispositivos Bluetooth diferentes simultáneamente\nAlmohadillas acolchadas cómodas para la comodidad durante todo el día\nAlcance operativo de hasta 30 pies\nIncluye:\nCable de carga USB\nCable de audio\nManual de usuario\n\nEstos auriculares negros van sobre la cabeza, lo que permite una gran calidad de sonido, así como comodidad y estabilidad.\nCon la capacidad Bluetooth, podrás hablar y escuchar música con una duración de carga de 10 horas.\nCon varios colores a elegir, estos auriculares son el regalo perfecto para niños y adultos. \nCon un rango de funcionamiento de 30 pies, podrás colgar alrededor de la piscina sin preocuparte por llevar tu dispositivo contigo.\n\nComodidad y calidad envueltos en uno\n\nEstilo versátil, rendimiento versátil: estos auriculares estéreo inalámbricos son un viaje de primera clase que espera suceder. Disfrute de la impecable experiencia que se merece.', 20, 25, 'RZE-BT160HP-1', '2021-06-30', 74, 75, NULL),
(1181, 'a', 'RZE-BT160HR', 'AURICULARES BLUETOOTH INALAMBRICOS ROJO', 'Una cómoda almohadilla para los oídos y hasta 10 horas de reproducción de música es lo que elige con los auriculares estéreo inalámbricos Slick Series Toshiba para colocar sobre las orejas. Su diseño liviano y pulido lo convierte en un dispositivo fácilmente portátil y un ajuste cómodo cuando se usa durante horas prolongadas. Olvídate del torpe cableado que alguna vez fue vital para disfrutar de la buena música: deja que estos auriculares lleven su experiencia musical al próximo siglo.\n\nYa sea que esté haciendo ejercicio, caminando o estudiando, estos son perfectos para una variedad de actividades.\nConéctate con dispositivos compatibles con Bluetooth para transmitir música.\nEscucha música o habla con la familia hasta 10 horas con una sola carga.\nPausa la música, omite pistas y ajusta el volumen con los botones integrados.\nRecibe y contesta llamadas telefónicas.\nConéctate con hasta 2 dispositivos Bluetooth diferentes simultáneamente.\nAlmohadillas acolchadas para la comodidad durante todo el día.\nAlcance operativo de hasta 30 pies.\n\nIncluye:\nCable de carga USB\nCable de audio\nManual de usuario\n\nEstos auriculares permiten una gran calidad de sonido, así como comodidad y estabilidad.\n\nCon la capacidad Bluetooth, podrás hablar y escuchar música con una duración de carga de 10 horas, son el regalo perfecto para niños y adultos.\n \nCon un rango de funcionamiento de 30 pies, podrás colgar alrededor de la piscina sin preocuparte por llevar tu dispositivo contigo.\n\nComodidad y calidad envueltos en uno', 0, 25, 'RZE-BT160HR-1', '2021-06-02', 74, 75, NULL),
(1182, 'a', 'RZE-D160HK', 'AURICULARES NEGRO', 'Estos auriculares Slick Series vienen con un agarre deportivo de goma, que se envuelve alrededor de la oreja, lo que le permite trotar esa mañana sin que se caigan.\n\nCon almohadillas acolchadas para los oídos, se le brinda un mejor agarre, aportándole mayor comodidad y estabilidad. Con varios colores disponibles no tendrá problemas para encontrar el elegante par que ha estado buscando.\n\nControladores dinámicos de gran formato de 1,5 pulgadas. Almohadilla de oreja de felpa\nRespuesta de frecuencia: 20Hz a 20 kHz\n\nEl Auricular Toshiba RZE-D160 tiene un diseño de lazo ajustable para adaptarlo a diferentes medidas, y suaves cojines que brindan comodidad, incluso durante largas horas de uso, para la práctica de actividades de la rutina diaria o cuando se viaja.\n\nEl micrófono integrado ofrece una gran calidad de sonido para realizar y recibir llamadas en modo manos libres. Los altavoces dinámicos proporcionan audios con notas potentes y equilibradas para escuchar música con buena calidad independientemente del estilo musical.', 20, 16, 'RZE-D160HK-1', '2021-06-02', 74, 75, NULL),
(1183, 'a', 'RZE-D160HL', 'AURICULARES AZUL', 'Estos auriculares Slick Series vienen con un agarre deportivo de goma, que se envuelve alrededor de la oreja, lo que le permite trotar esa mañana sin que se caigan.\n\nCon almohadillas acolchadas para los oídos, se le brinda un mejor agarre, aportándole mayor comodidad y estabilidad. Con varios colores disponibles no tendrá problemas para encontrar el elegante par que ha estado buscando.\n\nControladores dinámicos de gran formato de 1,5 pulgadas. Almohadilla de oreja de felpa\nRespuesta de frecuencia: 20Hz a 20 kHz\n\nEl Auricular Toshiba RZE-D160 tiene un diseño de lazo ajustable para adaptarlo a diferentes medidas, y suaves cojines que brindan comodidad, incluso durante largas horas de uso, para la práctica de actividades de la rutina diaria o cuando se viaja.\n\nEl micrófono integrado ofrece una gran calidad de sonido para realizar y recibir llamadas en modo manos libres. Los altavoces dinámicos proporcionan audios con notas potentes y equilibradas para escuchar música con buena calidad independientemente del estilo musical.', 20, 16, 'RZE-D160HL-1', '2021-06-02', 74, 75, NULL),
(1184, 'a', 'RZE-D160HR', 'AURICULARES ROJO', 'Estos auriculares Slick Series vienen con un agarre deportivo de goma, que se envuelve alrededor de la oreja, lo que le permite trotar esa mañana sin que se caigan.\n\nCon almohadillas acolchadas para los oídos, se le brinda un mejor agarre, aportándole mayor comodidad y estabilidad. Con varios colores disponibles no tendrá problemas para encontrar el elegante par que ha estado buscando.\n\nControladores dinámicos de gran formato de 1,5 pulgadas. Almohadilla de oreja de felpa\nRespuesta de frecuencia: 20Hz a 20 kHz\n\nEl Auricular Toshiba RZE-D160 tiene un diseño de lazo ajustable para adaptarlo a diferentes medidas, y suaves cojines que brindan comodidad, incluso durante largas horas de uso, para la práctica de actividades de la rutina diaria o cuando se viaja.\n\nEl micrófono integrado ofrece una gran calidad de sonido para realizar y recibir llamadas en modo manos libres. Los altavoces dinámicos proporcionan audios con notas potentes y equilibradas para escuchar música con buena calidad independientemente del estilo musical.', 20, 16, 'RZE-D160HR-1', '2021-06-02', 74, 75, NULL),
(1185, 'a', 'S11A', 'PLANCHA DE CABELLO', 'La plancha para cabello de Remington Shine Therapy con placas recubiertas de cerámica con coco puede lograr un cabello protegido y con aspecto brillante\n\nMedida de las placas: 2,54cm / 1\"\n8 Ajustes de Temperatura: 150°C - 230°C\nCalentamiento en 15 segundos\nBotón de Encendido y Apagado\nPlacas Flotantes Recubiertas de cerámica y coco\nLuz indicadora LED\nBloqueo de placas\nApagado Automático\nCable Giratorio de 1,8 m\nCierre de seguridad.', 10, 49, 'S11A-1', '2021-05-05', 65, 66, 68),
