(1188, 'a', 'SK-66', 'SARTEN ELECTRICO 12 PULGADAS COPPER', 'Sartén eléctrico de cobre antiadherente de 12 pulgadas con tapa de vidrio\n\nLa poderosa sartén eléctrica de cobre antiadherente de 1300w Brentwood SK-66 de 12 pulgadas con tapa de vidrio es la solución perfecta para freír, asar, guisar y hornear para la familia. Cuenta con un revestimiento cerámico de cobre antiadherente fácil de limpiar, termostato ajustable, dos asas de fácil transporte y tapa de vidrio templado con ventilación de vapor. Cocina cómodamente el desayuno, el almuerzo y la cena mientras ahorras tiempo y electricidad.\n\n• Sartén eléctrica familiar de 12 pulgadas\n• Revestimiento infundido de cerámica de cobre\n• Temperatura ajustable\n• Calentamiento rápido y uniforme\n• Superficie antiadherente fácil de limpiar\n• Incluye tapa de vidrio templado con ventilación de vapor\n• Potencia: 1300w', 10, 43, 'SK-66-1', '2021-02-25', 1, 7, 52),
(1189, 'a', 'SK-67BK', 'SARTEN ELECTRICO 12 PULGADAS NEGRO 1400W', 'Sartén eléctrica antiadherente redonda de 12 pulgadas con tapa de vidrio ventilada, color negro\n\nUse la sartén eléctrica antiadherente redonda Brentwood SK-67BK de 12 pulgadas con tapa de vidrio ventilada para cocinar todas sus comidas favoritas. Cocine para 2-3 personas gracias a la gran capacidad de 7 tazas. Disfrute haciendo salteados, hamburguesas, tortillas, pasteles e incluso pizza. Cuenta con superficie antiadherente, temperatura ajustable, termostato extraíble, tapa de vidrio templado ventilado y pies de goma antideslizantes.\n\n• Temperatura ajustable\n• Termostato extraíble\n• Tapa de vidrio templado ventilada\n• Pies de goma antideslizantes\n• Superficie antiadherente fácil de limpiar\n• Capacidad de líquido: 7 tazas\n• Área de cocina: 38 pies cuadrados. En.\n• Profundidad: 1,5 pulg.\n• Potencia: 1400w', 0, 28, 'SK-67BK-1', '2021-02-25', 1, 7, 52),
(1190, 'a', 'SK-69BK', 'WOK ELECTRICO', 'La potente sartén eléctrico Wok de fondo plano antiadherente Brentwood SK-69BK de 1400w y 13 pulgadas con tapa de vidrio ventilada es perfecta para saltear y más. Cuenta con un termostato ajustable y extraíble, asas de tacto frío y una superficie antiadherente fácil de limpiar.\n\n• Sartén wok eléctrica de 13 pulgadas\n• Fondo plano de 9 pulgadas para un calor uniforme y rápido\n• Capacidad de líquido: 24 tazas\n• Temperatura ajustable 195-450 ° F\n• Termostato extraíble\n• Asas Cool Touch\n• Superficie antiadherente fácil de limpiar\n• Tapa de vidrio templado ventilada\n• Pies de goma antideslizantes\n• Potencia: 1400w\n• De color negro', 1, 35, 'SK-69BK-1', '2021-02-25', 1, 7, 52),
(1191, 'a', 'SM-1162W', 'BATIDORA DE PEDESTAL/ BOWL DE ACERO BLANCA', 'Use la batidora de pedestal Brentwood modelo SM-1162BK de 5 velocidades con un tazón de acero inoxidable de 3.5 litros para batir fácilmente huevos, batir crema, mezclar masa y más. Controle la velocidad y expulse los batidores con una mano. Incluye batidores cromados y ganchos para masa aptos para lavavajillas.\n\n• 5 velocidades diferentes.\n• 3.5 litros.\n• Batidores y ganchos para masa incluidos.\n• Piezas extraíbles para lavavajillas.\n• Pies antideslizantes.\n• Potencia: 250w.\n• De color negro.', 0, 40, 'SM-1162W-1', '2021-02-25', 1, 7, 43),
(1192, 'a', 'SM-1200B', 'BATIDORA AJUSTABLE AZUL BRENTWOOD', 'La potente batidora clásica Brentwood SM-1200B 15oz de 100w te lleva al pasado con su aspecto retro y su color turquesa claro. Mezcle batidos deliciosamente espesos en menos de 2 minutos. Cuenta con velocidades bajas y altas, eje de acero inoxidable duradero y sistema de bloqueo de seguridad que evita derrames. Incluye un vaso de acero inoxidable de 15 oz como en los viejos tiempos.\n\nDiseño clásico de fuente de soda.\nMezcle batidos, licuados, bebidas proteicas y más.\nListo en menos de 2 minutos.\nVelocidades: baja y alta.\nEje de mezcla de acero inoxidable duradero.\nAltura ajustable para una fácil operación.\nEl vaso se bloquea en su lugar para mayor seguridad.\nIncluye 15 onzas Vaso de acero inoxidable.\nPies de goma antideslizantes.\nPotencia: 100w.', 10, 28, 'SM-1200B-1', '2021-04-09', 1, 7, 43),
