(1196, 'a', 'TS-1405BL', 'WAFLERA EN FORMA DE CONO', 'Utilice la wafflera Brentwood TS-1405BL 750w para hacer conos de azúcar, obleas y waffles. Cuenta con indicadores luminosos de temperatura, potencia y precalentamiento ajustables, tapa con cierre y almacenamiento compacto vertical. Incluye rodillo de cono para conos perfectos.\n\n• Haga conos de azúcar, obleas y waffles\n• Platos para gofres de 7 \"de diámetro\n• Luces indicadoras de encendido y precalentamiento\n• Rango de temperatura ajustable\n• Almacenamiento vertical compacto\n• Tapa con cierre\n• Pies antideslizantes\n• Incluye rodillo cónico\n• Color azul\n• Potencia: 750w', 0, 25, 'TS-1405BL-1', '2021-05-21', 1, 7, 42),
(1197, 'a', 'TS-1420BL', 'MAQUINA DE HACER CONO DE NIEVES/ GRANIZADOS', 'Utilice la Máquina para hacer cono de nieve y máquina de hielo raspado TS-1420BL de Brentwood para satisfacer a sus amigos y familiares con un sabroso manjar. Las duraderas cuchillas de acero inoxidable convierten los cubitos de hielo de tamaño estándar en nieve en polvo. Incluye 4 conos reutilizables y piezas extraíbles fáciles de limpiar.\n\n• Haga conos de nieve, hielo raspado y más\n• Utiliza cubitos de hielo de tamaño estándar\n• Cuchillas de acero inoxidable duraderas\n• Incluye 4 conos reutilizables\n• Piezas extraíbles fáciles de limpiar\n• Color azul', 0, 28, 'TS-1420BL-1', '2021-02-25', 1, 7, 42),
(1198, 'a', 'TS-180S', 'OLLA ARROCERA 1.5 LITROS BRENTWOOD', 'La potente olla arrocera y vaporera de alimentos Brentwood TS-180S de 500 vatios sin cocer / 16 tazas cocida cocina al vapor carnes y verduras mientras se cocina el arroz. Caliente chili, sopas y más. Cuenta con operación de un toque con calentamiento automático. Presenta una olla antiadherente extraíble y asas de tacto frío. Incluye taza medidora y paleta para servir, solo agrega tus ingredientes.\n\n• 16 tazas de arroz cocido\n• Cocina al vapor carnes y verduras\n• Además, caliente y disfrute el chile, las sopas y más\n• Operación de un toque\n• Calienta automáticamente\n• Tapa de vidrio templado de vista superior\n• Olla de cocción extraíble\n• Superficie antiadherente fácil de limpiar\n• Asas Cool Touch\n• Incluye bandeja de vapor, paleta y taza medidora\n• Luz indicadora de encendido / calentamiento\n• Potencia: 500w', 10, 23, 'TS-180S-1', '2021-02-25', 1, 7, 42),
(1199, 'a', 'TS-254', 'CAKE POP', 'La potente máquina para hacer cake pops antiadherente Brentwood TS-254 de 750 vatios hornea 12 cake pops perfectos en solo 4 minutos. Las paletas de pastel se deslizan directamente de las placas antiadherentes fáciles de limpiar. Prácticas luces indicadoras de energía / calor. Se almacena en posición vertical para un almacenamiento compacto. Cuenta con cierre de seguridad por sobrecalentamiento.\n\n• 12 cake pops listos en 4 minutos\n• Incluye múltiples recetas deliciosas\n• Placas antiadherentes fáciles de limpiar\n• Asas Cool Touch\n• Luces indicadoras de energía / calor\n• Almacenamiento vertical\n• Conveniente envoltura de cable\n• Tapa de bloqueo de seguridad\n• Apagado de seguridad por sobrecalentamiento\n• Color morado\n• Potentes 750 vatios', 6, 23, 'TS-254-1', '2021-04-07', 1, 7, 50),
(1200, 'a', 'TSSTTVSM9L', 'HORNO TOSTADOR OSTER', 'Horno de mesa de 13\", acero inoxidable.\n\n4-slice tostador horno es perfecto para cocinas y encimeras donde el espacio es un 150 Premium a 272 Rango de temperatura.\nControles dispone de un temporizador de 60 minutos con apagado automático diseño compacto es perfecto para cocinas y encimeras de 1000 W.\nCapacidad de 4-slice temporizador de 30 minutos con opción de saco nórdico.', 0, 38, 'TSSTTVSM9L-1', '2021-02-22', 1, 5, 34),
(1201, 'a', 'W2085', 'JUEGO UNO CLASICO', '¡El juego de cartas familiar #1 en el mundo! Tendrás que deshacerte de todas tus cartas lo más rápido posible utilizando tus habilidades de estrategia y colocando \"trampas\" a tus oponentes con las cartas de comando. No te olvides de gritar UNO cuando sólo te quede una carta. Incluye baraja de cartas UNO.\n\nEdad-7+ años', 0, 15, 'W2085-1', '2021-03-05', 2, NULL, NULL),
(1202, 'a', 'AF-300BK', 'FREIDORA DE AIRE DE 3 L NEGRA', 'La potente freidora de aire eléctrica Brentwood AF-300BK de 3 litros y 1200 watts fríe rápida y uniformemente usando poco o ningún aceite. Haga crujientes papas fritas, aros de cebolla, alitas de pollo, verduras asadas y más. Utilice la guía rápida de temperatura y el temporizador de 30 minutos con apagado automático para obtener resultados rápidos y crujientes. La cesta para freír extraíble de tacto frío hace que servir sea muy fácil. Superficie antiadherente fácil de limpiar.\n\n• 3,2 cuartos / 3 litros\n• Use poco o nada de aceite\n• Calor rápido y uniforme\n• Temporizador de 30 minutos\n• Apagado automático\n• Temperatura 190-410°F\n• Superficie antiadherente fácil de limpiar\n• Canasta de freír extraíble Cool Touch\n• Guía rápida de temperatura\n• Potencia: 1200watts\n\nDimensiones del artículo (LxWxH): 10 x 11 x 10,5 pulgadas', 8, 66, 'AF-300BK-1', '2021-05-05', 1, 7, 46),
