(1205, 'a', 'FP-549W', 'PROCESADOR DE ALIMENTOS 2V/BLANCO', 'Nuestro procesador de alimentos de 200w Brentwood FP-549W de 3 tazas le ahorra tiempo y energía en la cocina. Es perfecto para crear dips, salsas, picar verduras, especias y más. Operación de 2 velocidades alta / baja fácil de usar. Las cuchillas afiladas y duraderas de acero inoxidable pican los alimentos en segundos. La tapa con cierre de seguridad evita accidentes. El diseño compacto ocupa poco espacio en el mostrador y es fácil de almacenar. Piezas extraíbles sin BPA y aptas para lavavajillas.\n\n• 2 velocidades + pulso\n• Capacidad para 3 tazas\n• Cuchillas de acero inoxidable\n• Diseño compacto\n• Sin BPA\n• Tapa de bloqueo de seguridad\n• Piezas extraíbles aptas para lavavajillas\n• Pies de succión antideslizantes\n• Almacenamiento de cables\n• Color blanco\n• Potentes 200 vatios', 9, 29, 'FP-549W-1', '2021-03-01', 1, NULL, NULL),
