(1209, 'a', '1999543', 'VASO CONTIGO KENTON COLOR VERY BERRY 20 OZ/591 ML', 'El vaso térmico Contigo modelo Kenton está construido en acero inoxidable y con doble pared aislada al vacío para mantener la temperatura de tus bebidas; calientes hasta 7 horas o frías hasta 18 horas. Gracias al mecanismo patentado Snapseal® puedes manejarlo y desbloquearlo para beber con una sola mano.\n\nAdemás, cuenta con depósito especial diseñado para recoger esa gota de exceso al separar los labios de su bebida.', 5, 21, '1999543-1', '2021-06-30', 70, 71, NULL),
