(1213, 'a', '2094850', 'VASO CONTIGO  BYRON COLOR SAKE 20 OZ/591 ML', 'Con el vaso térmico de viaje Contigo modelo Byron, construido con doble pared y en acero inoxidable por dentro y por fuera, podrás disfrutar de beber en una sola mano con una tapa que se cierra a presión para una comodidad a prueba de derrames gracias a su tecnología SnapSeal. Además, las bebidas se mantienen calientes hasta 6 horas o frías hasta 12, y un agarre de textura sutil permite una sujeción segura.\n\nCon la tecnología de aislamiento SnapSeal beber es más fácil. Empuje hacia arriba la palanca para beber, empuje hacia abajo para cerrar.', 8, 18, '2094850-1', '2021-04-07', 70, 71, NULL),
