(1225, 'a', '4728', 'OLLA ARROCERA MULTI-USOS DE 7 TAZAS BLANCA', 'Ahora podrás volverte creativa en las recetas que incluyan arroz y sorprender gratamente a tus invitados, familia y amigos. Además, no tendrás que perder tiempo limpiando una vez terminada la reunión, ya que el tazón interior removible de aluminio con recubrimiento antiadherente facilita su limpieza.\n\n\nTapa de vidrio refractario con borde de acero inoxidable que potencializa su resistencia, y con orificio de salida de exceso de vapor y asa fría al tacto.\nTazón interior removible de aluminio con recubrimiento antiadherente y capacidad de 1,2 litros (7 tazas de arroz cocido).\nBase calefactora cóncava para una mejor distribución del calor.\nTermostato y base calefactora dotada para funcionar como multiusos Luces indicadoras que identifican el ciclo del proceso.', 9, 39, '4728-1', '2021-04-07', 1, 5, 36),
(1226, 'a', '4729', 'OLLA ARROCERA MULTI-USOS DE 10 TAZAS BLANCA', 'Ahora encontrarás que cocinar arroz es más simple y rápido con nuestra arrocera multiusos. Además, su función automática mantiene el arroz caliente hasta el momento de servirlo. Una vez servido, podrás limpiarla fácilmente gracias a su tazón interno removible de aluminio con recubrimiento antiadherente.\n\n\nTapa de vidrio refractario, con orificio de salida de exceso de vapor.\nAsa fría al tacto.\nTapa con anillo de acero inoxidable.\nOlla interior removible de aluminio con recubrimiento antiadherente capacidad de 1,2 litros (7 tazas de arroz cocido).\nCuerpo calefactor (olla exterior) recubierta con pintura porcelanizada, asas de material plástico frío al tacto, base con patas de hule (goma, caucho).\nControl térmico automático.', 10, 38, '4729-1', '2021-04-11', 1, 5, 36),
(1242, 'a', '085715320919', 'GUESS DARE WOMEN/FEMME 3.4 OZ 100 ML', 'Perfume Guess Dare EDT 3.4oz para dama', 2, 36, '085715320919-1', '2021-04-16', 3, 29, NULL),
(1227, 'a', '6029', 'OLLA ARROCERA MULTI-USOS 10 TZ/SOFRITO', '¿Te gustaría darle un toque original a tus preparaciones con arroz? Este modelo te permite dorar previamente el arroz para que la receta quede a la perfección. Además contarás con una capacidad de hasta 10 tazas gracias a su olla interior removible de aluminio con recubrimiento antiadherente, para que puedas cocinar para todos y luego limpiar con facilidad.\n\n\nTapa de vidrio refractario, con orificio de salida de exceso de vapor. \nAsa fría al tacto.\nTapa con anillo de acero inoxidable. \nOlla interior removible de aluminio con recubrimiento antiadherente capacidad de 7 tazas (1.2 litros).\nCuerpo calefactor (olla exterior) recubierta con pintura porcelanizada, asas de material plástico frío al tacto, base con patas de hule (goma, caucho).\nControl térmico automático.\nIncluye bandeja vaporera. ', 8, 42, '6029-1', '2021-04-07', 1, 5, 36),
(1228, 'a', '62674E', 'BATIDORA DE MANO ERGONOMICA DE 6 VELOCIDADES', 'Diseño ergonomico\nEl inteligente rediseño de esta liviana batidora de mano elimina el dolor del proceso de mezcla. Mientras se mezcla, el codo y la muñeca se colocan estratégicamente, lo que minimiza la tensión de la muñeca y el brazo y maximiza el control y la comodidad.\n\nSeis velocidades con Quickburst\nEl dial giratorio de 6 velocidades es de fácil acceso para un control de velocidad óptimo y cuenta con Quickburst para un impulso de potencia adicional en cualquier configuración. Una guía de mezcla está impresa en la parte posterior para una referencia rápida, lo que le permite saber la velocidad perfecta para lograr la función que requiere su receta.\n\nCrea menos desorden\nEl potente motor está diseñado para proporcionar un verdadero arranque lento y un primer ajuste más lento para reducir las salpicaduras y el desorden que a menudo dejan otros mezcladores.', 10, 32, '62674E-1', '2021-04-07', 1, 8, 54),
(1229, 'a', '71157', 'VASO CONTIGO BYRON COLOR MONACO BLUE 20 OZ/591 ML', 'Con el vaso térmico de viaje Contigo modelo Byron, construido con doble pared y en acero inoxidable por dentro y por fuera, podrás disfrutar de beber en una sola mano con una tapa que se cierra a presión para una comodidad a prueba de derrames gracias a su tecnología SnapSeal. Además, las bebidas se mantienen calientes hasta 6 horas o frías hasta 12, y un agarre de textura sutil permite una sujeción segura.\n\nCon la tecnología de aislamiento SnapSeal beber es más fácil. Empuje hacia arriba la palanca para beber, empuje hacia abajo para cerrar.', 5, 18, '71157-1', '2021-04-07', 70, 71, NULL),
(1230, 'a', '72953', 'VASO CONTIGO BYRON COLOR STORMY WEATHER 24 OZ/709 ', 'Con el vaso térmico de viaje Contigo modelo Byron, construido con doble pared y en acero inoxidable por dentro y por fuera, podrás disfrutar de beber en una sola mano con una tapa que se cierra a presión para una comodidad a prueba de derrames gracias a su tecnología SnapSeal. Además, las bebidas se mantienen calientes hasta 6 horas o frías hasta 12, y un agarre de textura sutil permite una sujeción segura.\n\nCon la tecnología de aislamiento SnapSeal beber es más fácil. Empuje hacia arriba la palanca para beber, empuje hacia abajo para cerrar.', 9, 18, '72953-1', '2021-04-07', 70, 71, NULL),
(1231, 'a', 'BLSTAL-B00', 'TAPA NEGRA REDONDA/LICUADORA', 'Accesorio original Oster® para usar con nuestras licuadoras. Contiene tapón de llenado de 60 ml (2 onzas)\n\nTapa de vaso negra con dosificador integrado\n\nPara uso con vaso tipo contemporáneo \n', 0, 5, 'BLSTAL-B00-1', '2021-04-07', 1, 5, 31),
(1232, 'a', 'BLSTKAP-WPB', 'LICUADORA DE 2V/VASO DE PLASTICO/1,25L/BLANCA DE P', 'El poderoso motor con alta fuerza de torsión y jarra de plástico resistente a las roturas de la licuadora Oster® son ideales para preparar una amplia variedad de recetas frías y calientes, jugos, batidos y mucho más.\n\n\nMotor cuatro veces más duradero.\nAcople metálico 10 más fuerte.\nJarra de plástico, que te permite procesar ingredientes hirviendo sin necesidad de esperar a que estos se enfríen.\nDos velocidades con pulso alto y bajo.\nCapacidad de 1.25 litros (5 tazas) para preparar desde sopas hasta jugos, salsas y bebidas gratinadas con hielo.\nRevolucionaria cuchilla trituradora de hielo.', 9, 34, 'BLSTKAP-WPB-1', '2021-04-07', 1, 5, 35),
(1233, 'a', 'BVSTDC05', 'CAFETERA DE 5 TAZAS/TERMORESISTENTE/FILTRO PERMANE', 'La cafetera Oster® de 5 tazas permite disfrutar de una taza de café recién hecha al momento que desees. Con su función de Pausa y Servir, puedes servir una taza de café durante el proceso de colado para disfrutar de su rico sabor. ¡Contiene el tamaño adecuado para ahorrar espacio en tu cocina!\n\n\nCapacidad para 5 tazas de café colado.\nLa canasta removible facilita su llenado y limpieza.\nLa función de pausa y servir permite servir el café durante el proceso de colado.\nLa luz indicadora permite saber si la cafetera está encendida o apagada.\nLa ventanilla de un lado muestra la cantidad de agua que se encuentra en el tanque para llenarlo con precisión.\nIncluye filtro permanente para mayor comodidad.\nPotencia: 672 watts en modelos de 120V y 600 watts en modelos de 220V.', 5, 22, 'BVSTDC05-1', '2021-04-07', 1, 5, 33),
(1234, 'a', 'CKSTRC3011', 'VAPORERA PARA ARROCERA DE 2,6 LITROS OSTER', 'Esta bandeja es excelente para preparar alimentos al vapor para mayor versatilidad de cocción.\n\nCompatible con los modelos de arroceras de 12 tazas CKSTRC6130-052 y 006030-052-000\nEste producto no necesita el sello SEC', 10, 5, 'CKSTRC3011-1', '2021-04-07', 1, 5, 36),
(1235, 'a', 'GCSTBS4951S', 'PLANCHA A VAPOR DE CERAMICA/PLATEADA', 'Una plancha que cuenta con una base con recubrimiento de cerámica en color, lo que permite un mejor deslizamiento de la plancha sobre cualquier tejido.\n\nBase con recubrimiento de cerámica en color, que permite un deslizamiento superior.\nAjuste variables de vapor para distintos tipos de tejidos.\nEl botón de rociado fino ayuda a alisar arrugas difíciles.\nTanque de agua con 180 ml de capacidad.\nSistema anti-calc que mejora el desempeño de la plancha.\nTemperatura variable para distintos tipos de tejidos.\nCable giratorio de 180º permite una mayor comodidad al momento de utilizar la plancha.', 6, 19, 'GCSTBS4951S-1', '2021-04-07', 1, 5, 37),
(1236, 'a', 'JB-220BL', 'LICUADORA DE 12 V /JARRA DE PLASTICO AZUL', 'La potente licuadora Brentwood modelo JB-220B de 12 velocidades y pulsos de 350 vatios, utiliza cuchillas de acero inoxidable para triturar y pulverizar hielo fácilmente. Elija entre 12 velocidades para mezclar deliciosos batidos, merengadas, proteínas abundantes y más. Incluye frasco y tapa aptos para lavavajillas de 50 oz sin BPA. Práctico almacenamiento de cables.\n\n• Mezcle deliciosos batidos, merengadas, proteínas y más.\n• 12 velocidades + pulso.\n• Cuchillas de acero inoxidable.\n• Incluye frasco de plástico de 50 oz con tapa / tapón de llenado.\n• Piezas extraíbles aptas para lavavajillas.\n• Conveniente almacenamiento de cables.\n• Base antideslizante.\n• Potencia: 350w.', 10, 33, 'JB-220BL-1', '2021-04-09', 1, 7, 49),
(1237, 'a', 'OGCMJ412S2BCSCAF-10', '3 EN 1 HORNO DE CONVECCION/FREIDORA/MICROONDAS', 'Cocción por convección para asar y hornear uniformemente y cocinar 100% uniformemente.\nRápido precalentamiento y versatilidad de cocción: roasts beef, aves y verduras; hornea guisos de pescado, cupcakes y pan.\nTecnología TotalFry 360 Enhanced Air Fry para un calor radiante intenso y aire caliente forzado rápido que crea alimentos súper crujientes.\nEspacio de cocción más utilizable en comparación con una freidora de aire tradicional.\nRecalentamiento de microondas cómodo y cocción con 1000 Watts de potencia.\nSeis selecciones de menú de cocción automática: papas, palomitas de maíz, bebidas, recalentamiento, alitas de pollo/nuggets y papas fritas.\nModos de microondas, convección, micro+convección y freír con aire, 10 niveles de potencia, reloj y temporizador, y descongelación por tiempo/peso.\nCerradura de seguridad en la puerta.\nIncluye horno de convección 3 en 1, kit TotalFry 360 Air Fry, bandeja para hornear y asar y plato giratorio de vidrio.', 9, 183, 'OGCMJ412S2BCSCAF-10-1', '2021-04-09', 1, 5, 34),
(1238, 'a', 'SSA100B01', 'VASO CONTIGO BYRON COLOR VIVACIOUS 20 OZ/591 ML', 'Con el vaso térmico de viaje Contigo modelo Byron, construido con doble pared y en acero inoxidable por dentro y por fuera, podrás disfrutar de beber en una sola mano con una tapa que se cierra a presión para una comodidad a prueba de derrames gracias a su tecnología SnapSeal. Además, las bebidas se mantienen calientes hasta 6 horas o frías hasta 12, y un agarre de textura sutil permite una sujeción segura.\n\nCon la tecnología de aislamiento SnapSeal beber es más fácil. Empuje hacia arriba la palanca para beber, empuje hacia abajo para cerrar.', 9, 20, 'SSA100B01-1', '2021-04-07', 70, 71, NULL),
(1239, 'a', 'SSG100B01', 'VASO CONTIGO BYRON COLOR GRAYED JADE 20 OZ/591 ML', 'Con el vaso térmico de viaje Contigo modelo Byron, construido con doble pared y en acero inoxidable por dentro y por fuera, podrás disfrutar de beber en una sola mano con una tapa que se cierra a presión para una comodidad a prueba de derrames gracias a su tecnología SnapSeal. Además, las bebidas se mantienen calientes hasta 6 horas o frías hasta 12, y un agarre de textura sutil permite una sujeción segura.\n\nCon la tecnología de aislamiento SnapSeal beber es más fácil. Empuje hacia arriba la palanca para beber, empuje hacia abajo para cerrar.', 9, 18, 'SSG100B01-1', '2021-04-07', 70, 71, NULL),
(1240, 'a', 'TS-112W', 'CAFETERA INDIVIDUAL BLANCA', 'Utilice la cafetera individual con taza Brentwood modelo TS-112B para preparar la taza de café perfecta con hasta 4 cucharadas de su café molido favorito. Simplemente coloque la cnatidad de cafe, agregue agua y presione el botón de encendido. La canasta de filtro reutilizable tiene capacidad para 4 cucharadas, el doble de la fuerza de una taza de café normal. La unidad no contiene BPA y es fácil de limpiar.\n\n• Fácil de usar y limpiar.\n• Filtro y soporte de filtro extraíbles.\n• Capacidad del filtro reutilizable: 4 cucharadas.\n• Incluye bandeja de goteo.\n• Sin BPA.\n• Taza de porcelana incluida.\n• Tamaño de taza compatible 3,5 (H) x 3 (L / W) pulgadas.\n• Potencia: 450w.', 9, 21, 'TS-112W-1', '2021-04-07', 1, 7, 44);
