(1277, 'a', 'CM0701W', 'CAFETERA DE 5 TAZAS BLANCA B+D', 'El mejor café, el de la mañanita o el de la tarde, para el desayuno o la merienda, para compartir con la familia o los amigos, lo puede hacer con la Cafetera de 5 tazas modelo CM0701W de Black+Decker. Con su tecnología sneak-a-cup puede servir una taza de café en pleno proceso de colar; dicho proceso se pausará y continuará una vez que vuelva a colocar la jarra en su lugar.\n\nMedidor de agua\nFiltro permanente\nJarra de vidrio\nCapacidad de 5 tazas\nTecnología sneak-a-cup', 9, 23, 'CM0701W-1', '2021-05-05', 1, 4, 13),
(1402, 'a', '3349668571819', 'SET INVICTUS (M) 2PC.100 ML+20 ML P.RABANNE', 'Set Paco Rabanne Invictus de 2 piezas para caballero. Incluye:\n\nPerfume de 100ml / 3.4oz\nPerfume Viajero de 20ml / 0.6oz', 5, 108, '3349668571819-1', '2021-05-05', 3, 30, NULL),
(1278, 'a', 'HC1095WM-F', 'CORTADOR DE CABELLO DE 20 PIEZAS', 'Sin importar el look que desees llevar, nuestra máquina de cortar pelo HC1095WM es un poderoso kit de corte con el que podrás lograr el estilo que tanto te gusta con calidad profesional. Cuento con cuchillas de corte de acero inoxidable y un diseño ergonómico que ayuda a un mejor control y comodidad. Es ideal para el corte de todo tipo de cabello.\n\nAcero Quirúrgico autoafilables\nPoderoso motor de corte lineal\nIncluye 20 piezas: 8 Peines de guía, Aceite lubricante, Peine, Tijeras, 1 clip, Capa y Caja de almacenamiento\nCuchillas Lavables\nPoderoso motor de corte lineal\n2 años de Garantía\nCromo', 5, 25, 'HC1095WM-F-1', '2021-06-07', 65, 66, 67),
(1279, 'a', 'HC1096', 'CORTADOR DE CABELLO DE 13 PIEZAS', 'Lucir siempre impecable y en perfecto estado es necesario para enfrentar la vida. Es por eso que te recomendamos la Máquina de cortar pelo HC1096 de Remington. Una cortadora de cabello con todo lo necesario para cada necesidad de corte, cuya versatilidad hace que cada detalle valga la pena. Llévalo contigo y sorprende con una nueva imagen.\n\nUso con cable\nCuchillas de Acero inoxidable\nIncluye 13 piezas\n6 Peines de guía\nAceite lubricante\nCepillo de limpieza\n2 clips\nPalanca de ajuste\nProtector de Hojilla\nPotente motor para todo tipo de cabello', 10, 16, 'HC1096-1', '2021-06-07', 65, 66, 67),
(1280, 'a', 'PG6025', 'KIT DE CORTE TODO EN 1 DE 11 PIEZAS', 'El kit todo en uno de Remington es uno de los mejores juegos de peluquería ya que te brinda el poder de la precisión con total versatilidad para todas tus necesidades de cuidado personal. Incluye una recortadora de tamaño completo; afeitadora de aluminio; recortador de nariz, orejas y detalles; peine para cortar el cabello con 8 ajustes de longitud; tres peines de barba; y una bolsa de almacenamiento o viaje. Cuenta con una batería de recargable con hasta 50 minutos de autonomía inalámbrica y cuchillas de acero quirúrgicas\n\nUso sin cable (Base de carga con Almacenamiento)\nHasta 50 minutos de uso sin cable\nTiempo de carga completa: 4 hr\nCuchillas de Acero Quirúrgico\nIndicador de carga\nIncluye 3 Peines de guía, Cortadora de barba, Recortadora de hoja, Detalladora para Nariz y oidos\nCaja de almacenamiento\nPeines intercambiables Lavables\n2 años de Garantía', 10, 26, 'PG6025-1', '2021-04-16', 65, 66, 67),
(1281, 'a', 'R27A', 'AFEITADORA ROTATIVA INDESTRUCTIBLE', 'Diseñado para durar toda la vida. La afeitadora rotativa Virtualmente Indestructible de Remington presenta una carcasa de policarbonato de alto impacto para proteger su poderoso interior. Cuenta con grandes tecnlogías que te ayudarán a lograr un afeitado suave al ras y libre de irritación. El diseño WETech™ le da la libertad de afeitarse en seco o con gel, y en la ducha, y el aditivo antimicrobiano especial ayuda a inhibir el crecimiento de bacterias para un afeitado limpio. La batería recargable ofrece hasta 60 minutos de autonomía inalámbrica.\n\nWetTEch™ Uso en húmedo o seco\nPowerFlex 360° giro del cuello\nSistema comfort ActiveContour\nCabezales PrecisionPlus\nTwinTrack™ cuchillas de dos rieles\nCobertura de alto impacto\nMango de goma antideslizante\nFlexibilidad de afeitado inalámbrico\nAditivo antimicrobiano', 11, 64, 'R27A-1', '2021-06-09', 65, 66, 67),
(1282, 'a', 'S6300', 'PLANCHA DE CABELLO  MACADAMIA', 'Gracias a las placas recubiertas de cerámica con macadamia, tu cabello lucirá hidratado y suave después de estilizar. Si tu cabello se ve dañado, sin fuerza y opaco, esta plancha alisadora será tu aliada al momento de peinar. Conseguirás un cabello más resistente, hidratado y en definitiva bonito gracias a este ingrediente natural.\n\nPlacas largas (110 mm) con revestimiento de cerámica con macadamia\nTemperatura máxima de 210 °C\nLista para usarse en 30 segundos\n30 ajustes de temperatura\nBotón On/off con indicador LED\nCierre de seguridad\nCable giratorio', 11, 29, 'S6300-1', '2021-04-17', 65, 66, 68),
(1283, 'a', 'S9600', 'PLANCHA PROFESIONAL DE CABELLO SILK', 'El más avanzado revestimiento de cerámica con proteínas de seda real contiene hasta 10 veces más cerámica que la plancha de cabello tradicional, ayudando a conseguir un deslizamiento sin esfuerzo, un cabello suave y saludable con menos frizz.\nLa cerámica con seda combinada con 235°C con desempeño profesional ayuda a crear un acabado de salón.\n\nMedida de las placas: 2,54cm / 1\"\nAjustes de Temperatura (+/-)\nTemperatura máxima: 235°C (450°F)\nCalentamiento en 10 segundos\nBotón de Encendido y Apagado\nPantalla Digital con temperatura actual y recomendada para el cabello\nFunción de memoria de temperatura\nPlacas Recubiertas de Cerámica infundida con Seda\nBloqueo de placas', 9, 48, 'S9600-1', '2021-04-19', 65, 66, 68),
(1284, 'a', 'TO3265XSS-LA', 'HORNO TOSTADOR FREIDOR B+D', '¡Disfrute del sabor de alimentos fritos en aceite abundante sin la grasa! La tecnología para freír con aire usa aire caliente de alta intensidad para hornear, dorar y crujir sus alimentos fritos favoritos con poco o ningún aceite. Pruebe las papas fritas, papitas fritas de vegetales, filetes de pescado empanizados, meriendas congeladas y ¡mucho más!\n\n1500 Watts\nTecnología de convención: Aumenta la velocidad y la uniformidad\nTecnología para freír saludable: Aire caliente de gran intensidad hornea, dora, y concina crujiente con poco o nada de aceite\nReloj automático de 60 minutos con opción de funcionamiento continúo\n5 Funciones: Freír con Aire, Hornea, Tuesta, Asa, Mantiene Caliente\nAcomoda una pizza de 12” o una bandeja con asas para hornear de 9\" x 13\"\nIncluye cesta de freír con aire, bandeja para hornera, y parrilla de asar\nBandeja de residuos removible', 11, 148, 'TO3265XSS-LA-1', '2021-04-16', 1, 4, 15),
(1285, 'a', 'TS-213BK', 'CAFETERA DE 4 TZ', 'Utilice la cafetera de 4 tazas Brentwood TS-213BK para preparar la taza de café perfecta. Simplemente coloque sus suelos, agregue agua y presione el botón de encendido. La placa calentadora mantiene el café caliente. Ahorre dinero con la canasta de filtro reutilizable. La unidad no contiene BPA y es fácil de limpiar.\n\n• Prepara 4 tazas de café\n• Incluye jarra de vidrio y filtro reutilizable\n• Placa calentadora\n• Ventana de nivel de agua\n• Recogedor de café molido reutilizable\n• Sin BPA\n• Fácil de limpiar\n• Carcasa de tacto frío y asa de la jarra\n• Luz indicadora de poder\n• De color negro\n• Potencia: 650w', 10, 20, 'TS-213BK-1', '2021-04-16', 1, 7, 44),
(1286, 'a', 'TS-240B', 'SANDIWCHERA', 'La máquina para hacer sándwiches doble compacta antiadherente TS-240B de Brentwood asa de 1 a 2 sándwiches a la vez. Cuenta con 750 vatios potentes, asas táctiles frías, placas antiadherentes fáciles de limpiar, luces indicadoras de encendido / precalentamiento, conveniente envoltura de cables y almacenamiento vertical.\n\n• Disfrute de 1 a 2 sándwiches a la parrilla\n• Asas de tacto frío\n• Placas antiadherentes fáciles de limpiar\n• Luces indicadoras de encendido / precalentamiento\n• Tapa de cierre de seguridad\n• Conveniente envoltura de cable\n• Almacenamiento vertical compacto\n• Color: negro, plateado\n• Potencia: 750w', 7, 20, 'TS-240B-1', '2021-04-16', 1, 7, 42),
(1400, 'a', '25430', 'SANDWICHERA NEGRA', 'Haz un sándwich caliente en pocos minutos: convierte un básico para el almuerzo en algo especial como sándwiches de queso a la parrilla o sándwiches con masa de pizza. O cocina rápidamente otras comidas como omelettes, tostadas francesas y postres.\n\nFácil de limpiar: las placas antiadherentes se limpian fácilmente.\n\nAhorro de espacio y diseño compacto: Bloquea el mango y almacena este electrodoméstico compacto en posición vertical en cualquier armario.\n\nEnciende y lista para cocinar: la luz de encendido te permite saber que la unidad está encendida y la luz de pre-calentamiento te permite saber cuándo está lista para cocinar.\n\nLuces de encendido y precalentamiento.\n\nDimensiones del artículo LxWxH:	10.75 x 11.25 x 4.1 pulgadas\n\nPeso del artículo: 1.56 Kilogramos', 10, 26, '25430-1', '2021-05-10', 1, 8, 53),
(1491, 'a', '4890', 'VASO PLASTICO 1.25 L', 'Vaso plástico cuadrado perfecto para casi todas las licuadoras Oster®.\n\nCapacidad de 1,25 litros\nIncluye tapa con dosificador integrado\nFabricado de plástico resistente a golpes\nIndicadores de medidas que permiten llenar con precisión\nCompatible con casi todas las licuadoras Oster®, excepto las líneas de licuadoras Oster® Xpert Series™, ActiveSense™ y modelos con código BLSTPYG', 20, 13, '4890-1', '2021-06-11', 1, 5, 31),
(1492, 'a', '4918', 'VASO DE VIDRIO 1.25 L', 'Vaso de vidrio con tapa resistente a cambios bruscos de temperatura\n\nBoca superior en forma trébol\nCapacidad de 1,25 litros\nIncluye tapa con dosificador integrado\nVaso de vidrio termorresistente que aguanta cambios bruscos de temperatura\nIndicadores de medidas que permiten llenar con precisión\nIncluye tapón dosificador removible\nCompatible con casi todas las licuadoras Oster®, excepto las líneas de licuadoras Oster® Xpert Series™, ActiveSense™ y modelos con código BLSTPYG', 20, 25, '4918-1', '2021-06-11', 1, 5, 31),
