(1401, 'a', '32229R', 'HORNO ROSTIZADOR', 'Asa, hornea, cocina y sirve con este horno asador de acero inoxidable. Capacidad de 21 litros y conveniencia de un horno convencional, es la respuesta perfecta para un espacio adicional al cocinar cenas navideñas y comidas abundantes. El control de temperatura ajustable de 150º a 450ºF le permite hacer de todo, desde mantener caliente una guarnición hasta asar un pollo grande. La rejilla extraíble tiene asas para levantar fácilmente artículos grandes después de cocinar. O lleve el horno directamente a la mesa para servir. De cualquier manera, la limpieza es fácil: la olla, la tapa y la rejilla extraíbles se pueden lavar con agua caliente y jabón.\n\nSe adapta a un pavo de hasta 28 lb, perfecto para las fiestas.\n\nFunción de Asar\nFunción de Hornear\nFunción de Cocinera\nServir: el diseño atractivo va desde la cocina hasta el buffet para servir fácilmente.\n\nDimensiones (pulgadas): 12,52 H x 23,39 W x 16,02 D', 10, 92, '32229R-1', '2021-05-10', 1, 8, 55),
(1403, 'a', '49316', 'CAFETERA DE 12 TZAS NEGRA', 'Conveniente primera taza - La función de pausa al servir le permite servir una taza mientras el café se prepara.\nCanastilla de filtro en forma de cono extrae el rico sabor del café.\nResistente al lavavajillas canastilla de filtro y garrafa.\nBotón de encendido. \nAlmacenamiento de cable esconde el cable que no se está usando.\nVentana de agua grande para un llenado rápido y fácil.\nPlaca anti-adherente para mantener caliente resiste las manchas y se limpia fácilmente.', 10, 25, '49316-1', '2021-05-06', 1, 8, 53),
(1404, 'a', '50123', 'LICUADORA NEGRA  10V JARRA DE PLASTICO', '10 velocidades para mezclar versatilidad.\nJarra de 48 oz (1.4 litros) de capacidad.\nIdeal para batidos y bebidas heladas.\nMotor de potencia máxima de 500 watts.\nCuchillas de acero inoxidable.\nLa base estable de la jarra se asienta sobre el mostrador para evitar que se vuelque.\nFácil de usar: las funciones de mezcla claramente etiquetadas facilitan la selección de la velocidad adecuada para cada trabajo.', 10, 37, '50123-1', '2021-05-06', 1, 8, 56),
(1405, 'a', '50128', 'LICUADORA NEGRA Y GRIS 10V JARRA DE PLASTICO', '10 velocidades para mezclar versatilidad.\nJarra de 48 oz (1.4 litros) de capacidad.\nIdeal para batidos y bebidas heladas.\nMotor de potencia máxima de 500 watts.\nCuchillas de acero inoxidable.\nLa base estable de la jarra se asienta sobre el mostrador para evitar que se vuelque.\nFácil de usar: las funciones de mezcla claramente etiquetadas facilitan la selección de la velocidad adecuada para cada trabajo.', 9, 37, '50128-1', '2021-05-06', 1, 8, 56),
