(1406, 'a', '63393', 'BATIDORA DE PEDESTAL 7V AZUL', 'Misma acción de mezcla que las batidoras de pie KitchenAid®\nLa acción de mezcla brinda una cobertura completa del tazón\nPotente motor de 300 watts\nOfrece una mejor mezcla que las batidoras de pie de 2 batidores\nIncluye batidor plano, batidor globo y gancho para masa.\nTazón de acero inoxidable de 4 cuartos (3.79 litros) con asas\nIncluye escudo contra salpicaduras\n7 velocidades\nEl mango facilita el movimiento y almacenamiento de la batidora\nGuía de mezcla\nCabeza inclinada\nPies antideslizantes', 4, 151, '63393-1', '2021-05-05', 1, 8, 54),
