(1500, 'a', 'DE-TB1487R', 'LICUADORA INTELIGENTE MULTIFUNCION  ROJA', 'Licuadora Inteligente Multifunción\n\nEsta muy versatil licuadora viene con 10 velocidades pre establecidas: hielo picado, comida caliente, pulso, licuar, mezclar, puree y 4 velocidades generales más.\n\nSu motor inteligente da velocidad óptima para todo tipo de alimentos.\n\nCuenta con jarra de vidrio de 2.3 litros con 6 cuchillas de acero inoxidable que hacen un fuerte vórtice para la realización de todos sus platillos.\n\nFunción para mezcla de bebidas calientes como sopas y salsas.\n\n10 programas inteligentes\n650 watts de potencia\n6 cuchillas de acero inoxidable desmontables para fácil limpieza\n2.3 litros\nAdaptable para hielo, alimentos fríos y calientes\nBase antiresbalante', 12, 80, 'DE-TB1487R-1', '2021-06-11', 1, 58, 61),
(1499, 'a', 'DE-TB1487B', 'LICUADORA INTELIGENTE MULTIFUNCION  NEGRA', 'Licuadora Inteligente Multifunción\n\nEsta muy versatil licuadora viene con 10 velocidades pre establecidas: hielo picado, comida caliente, pulso, licuar, mezclar, puree y 4 velocidades generales más.\n\nSu motor inteligente da velocidad óptima para todo tipo de alimentos.\n\nCuenta con jarra de vidrio de 2.3 litros con 6 cuchillas de acero inoxidable que hacen un fuerte vórtice para la realización de todos sus platillos.\n\nFunción para mezcla de bebidas calientes como sopas y salsas.\n\n10 programas inteligentes\n650 watts de potencia\n6 cuchillas de acero inoxidable desmontables para fácil limpieza\n2.3 litros\nAdaptable para hielo, alimentos fríos y calientes\nBase antiresbalante', 12, 80, 'DE-TB1487B-1', '2021-06-11', 1, 58, 61),
