(1497, 'a', 'DE-FOF1493', 'ABANICO RECARGABLE PORTATIL Y AJUSTABLE', 'Ventilador Recargable, Portátil y Ajustable\n\nControl de 3 velocidades.\nDiseño elegante con motor silencioso.\nTubo de soporte telescópico que alcanza hasta 40 pulgadas de alto para satisfacer todas sus necesidades.\nParrilla frontal desmontable para fácil limpieza.\nTiempo de uso: Bajo/Medio/Alto (10/4.5/2.2 horas aprox).\nBatería de litio recargable con carga USB.\nCapacidad de la batería: 3600mAH.\nCompacto para un fácil almacenamiento.', 18, 38, 'DE-FOF1493-1', '2021-06-11', 1, 58, 63),
(1473, 'a', 'S7740', 'ALISADORA TRIPLE INFUSION', 'Puedes lograr un estilo elegante, liso y duradero en casa con la plancha de cabello Triple Infusion de Remington. Cuenta con microacondicionadores de Keratina para un cabello saludable y fuerte, Aceite de Argán para reducir el frizz y aportar brillo, y Macadamia para un cabello más suave.\n\nAgrega esta plancha para cabello a tu rutina de cuidado del cabello con la Remington Triple Infusion. Las placas de cerámica de 1\" están infundidas con aceite de Keratina, Argán y Macadamia para lograr un cabello con 80%* menos frizz, 86%* más de brillo y 90%* de cabello más liso y elegante. Estos microacondicionadores nutren tu cabello durante el alisado de una sola pasada para obtener resultados hermosos y rápidos.\n\nMedida de las placas: 2,54cm / 1\"\nAjustes de Temperatura (+/-)\nTemperatura máxima: 230°C (450°F)\nCalentamiento en 15 segundos\nBotón de Encendido y Apagado\nPantalla Digital\nPlacas Recubiertas de Triple Infusion (Argán, Keratina, Macadamia)\nBloqueo de placas\nApagado Automático', 10, 44, 'S7740-1', '2021-05-24', 65, 66, 68),
(1475, 'nv', '049398940055', 'KIM KARDASHIAN GOLD W 100 ML', '', 5, 26, NULL, '2021-05-31', NULL, NULL, NULL),
(1495, 'a', 'BT1209-15', 'CORTABARBA', 'Beardtrimmer series 1000 | Cortabarba\n\nEste recortador se diseñó para cargarse con cualquier cable micro-USB. Se carga completamente en 8 horas y funciona por hasta 30 minutos. Las cuchillas autoafilables de acero inoxidable te permiten una afeitada sin problemas como en el primer uso.\n\nConsigue un corte perfecto y seguro, una y otra vez. Las cuchillas de acero del recortador se frotan suavemente entre sí, afilándose unas a otras a medida que cortan el vello, por lo que conservan un filo potente y ofrecen un alto rendimiento como en el primer día.\n\nEl cortabarba incluye un cable USB para obtener una carga más flexible mediante tu computadora o cualquier adaptador USB. El adaptador no se incluye (se recomienda el adaptador Philips HQ80).', 12, 27, 'BT1209-15-1', '2021-06-30', 65, 76, NULL),
(1489, 'nv', '7640131395380', 'SWISS ARMY VICTORIA W 100 ML', '', 5, 40, NULL, '2021-05-31', NULL, NULL, NULL),
(1498, 'a', 'DE-SM1013', 'SANDWICHERA NEGRA DAEWOO', 'Sandwichera 2 rebanadas\n\nPlaca de Cocción con Revestimiento Antiadherente\n750 watts de potencia\nHornea 2 sandwiches a la vez\nCuerpo de plástico con decoración\nControl de intensidad por termostato\nAsas frías al tacto con material aislante de calor\nIndicadores luminosos de encendido\nBases antiresbalantes\nTamaño de la placa: 21.5 x 12.5cm\nCable eléctrico de 75cm', 20, 29, 'DE-SM1013-1', '2021-06-23', 1, 58, 62),
(1493, 'a', 'BG3005-15', 'AFEITADORA CORPORAL P-DUCHA', 'Bodygroom series 3000 | Afeitadora corporal para la ducha\n\nLa serie 3000 se diseñó para recortar el vello, sin comprometer la protección de la piel. Puedes usar la afeitadora suave con la piel o recortar el vello con el peine recortador de 3 mm.\n\nEsta afeitadora, diseñada para ser segura y cómoda para las axilas, el pecho y el abdomen, los hombros, la ingle y las piernas, atrapa y corta el vello de distintas longitudes, sin necesidad de utilizar múltiples herramientas ni de poner la piel en contacto con bordes afilados.\n\nEl cabezal de afeitado cuenta con puntas redondeadas patentadas y una lámina hipoalergénica para proteger la piel durante el afeitado. Los recortadores bidireccionales cortan el vello más largo para luego poder afeitarlo y lograr un resultado más al ras.\n\nDiseñado para proteger incluso las zonas sensibles\n\nIncluye peine recortador extraíble de 3 mm\n40 min de uso sin cable / 8 horas de carga\nPuntas redondeadas y lámina hipoalergénica para brindar comodidad\nAncho de la cuchilla: 32 mm', 11, 50, 'BG3005-15-1', '2021-06-30', 65, 76, NULL),
(1490, 'nv', '3365440621053', 'YSL LA NUIT DE L\'HOMME LE PARFUM 100 ML', '', 5, 111, NULL, '2021-06-01', NULL, NULL, NULL),
(1494, 'nv', 'BLST4655', 'LICUADORA CROMADA 3V', '', 12, 84, NULL, '2021-06-08', NULL, NULL, NULL),
(1496, 'a', 'DE-35SC1525', 'OLLA DE COCCION LENTA 3.5 L DAEWOO', 'Olla de Cocción Lenta\n\nOlla interior de cerámica extraíble con capacidad de 3.5 litros.\n\nCuenta con 3 funciones: Bajo / Alto / Mantener Caliente.\n\nEstructura de acero inoxidable con tapa de vidrio templado.\n\n200 watts de potencia\nBajo consumo de energía\nCapacidad de 3.5 litros\nOlla interior de cerámica extraíble para fácil limpieza\nAsas y perillas aislantes de calor\nCerámica apta para lavavajillas', 12, 37, 'DE-35SC1525-1', '2021-06-15', 1, 58, 59),
(1501, 'a', 'HEAD-HA104', 'GLOVES FOR WOMEN TALLA M', 'TRAINING GLOVES | GUANTES DE ENTRENAMIENTO PARA DAMA\n\nUtilice los guantes de entrenamiento para entrenar con mancuernas, pesas o cualquier otro accesorio de entrenamiento. Son ajustables en la muñeca para adaptarse correctamente a su mano. Sus palmas acolchadas hacen que el agarre sea mucho más cómodo y te permiten tener más resistencia.\n\nTamaño: pequeño/mediano\nDiseño ergonómico\nSoporte de muñeca superior\nTranspirabilidad y confort\nAgarre antideslizante', 10, 17, 'HEAD-HA104-1', '2021-06-30', 78, 79, NULL),
(1502, 'a', 'HEAD-HA105-1', 'GLOVES FOR MAN TALLA L', 'TRAINING GLOVE | GUANTES DE ENTRENAMIENTO\n\nUtilice los guantes de entrenamiento para entrenar con mancuernas, pesas o cualquier otro accesorio de entrenamiento. Son ajustables en la muñeca para adaptarse correctamente a su mano. Sus palmas acolchadas hacen que el agarre sea mucho más cómodo y te permiten tener más resistencia.\n\nTamaño: Mediano/Grande\nDiseño ergonómico\nSoporte de muñeca superior\nTranspirabilidad y confort', 10, 17, 'HEAD-HA105-1-1', '2021-06-30', 78, 79, NULL),
(1503, 'a', 'HEAD-HA200A', 'RUEDA ABDOMINAL + MINI COLCHON', 'La rueda de abdominales Head es un equipo de entrenamiento simple pero efectivo que se enfoca en los músculos abdominales. Cuando se agrega a su entrenamiento, ayuda a tonificar y desarrollar los músculos, fortaleciendo la base y mejorando el estado físico. También involucra los músculos de los hombros y los brazos.\n\nLos agarres antideslizantes ayudan con el control de la estabilidad. Este es un gran accesorio para tu entrenamiento funcional.\n\nEste robusto rodillo es liviano y fácilmente transportable, lo que le permite hacer ejercicio tanto en casa como en el gimnasio. También cuenta con asas de espuma acolchadas que ofrecen un agarre adicional, ¡brindándote un entrenamiento estable y efectivo!\n\nRodillo ab robusto y portátil\nMango antideslizante\nAsas de agarre de espuma\nEspesor de la esfera: 1 cm\nExcelente para fortalecer el núcleo y apuntar a los abdominales\nIncluye Alfombra\nDiámetro: 14,5 cm\nDimensiones: 38cm x 20cm x 1cm', 11, 20, 'HEAD-HA200A-1', '2021-06-30', 78, 79, NULL),
(1504, 'a', 'HEAD-HA292F', 'BARRAS PARA FLEXIONES', 'PUSH UP BAR | MINI BARRAS PARA EMPUJE Y FLEXIONES\n\nTrabaja los grupos musculares de los pectorales, hombros y brazos con entrenamientos de empuje.\n\nLogra un desarrollo muscular mayor o una definición ideal, de acuerdo a tus necesidades y rutinas de ejercicios que emplees.\n\nESTRUCTURA METALICA\nBASE DE PVC DE ALTO IMPACTO\nMANGO ANTIDESLIZANTE\n2 PIEZAS', 12, 18, 'HEAD-HA292F-1', '2021-06-30', 78, 79, NULL),
(1505, 'a', 'HEAD-HA757', 'ANTI-BURTS GYM BALL WITH AIR', 'Pelota de gimnasio Head Fitness de superficie resistente y antideslizante para gimnasia o rehabilitación, que fortalece los músculos, la resistencia, mejora la flexibilidad y el equilibrio del cuerpo, y además relaja perfectamente los músculos cansados y rígidos.\n\nCon esta pelota podrás entrenar de forma cómoda y segura. Su material antideslizante te aporta estabilidad y te permite estirar y tonificar tus músculos.\n\nCuenta con sistema de protección contra explosiones, lo que quiere decir que el usuario no sufrirá ninguna lesión debido a que la pelota se desinflará muy lentamente.\n\nDiametro: 85 	cm\nPeso corporal máximo que aguanta la pelota: 155 kg\nIncluye bomba para inflar', 10, 28, 'HEAD-HA757-1', '2021-06-09', 78, 79, NULL),
(1506, 'a', 'HEAD-HA791', 'YOGA SET', '-PIECE YOGA SET | SET DE YOGA DE 4 PIEZAS\n\nALFOMBRA DE YOGA\nLa ALFOMBRA de yoga es antideslizante y muy cómoda. Su textura invita a usarlo. Tiene la densidad adecuada para practicar yoga.\n\nPELOTA DE YOGA\nCon esta pelota podrás entrenar de forma cómoda y segura. Su material antideslizante te aporta estabilidad y te permite estirar y tonificar tus músculos.\n\nCUBO DE YOGA\nUtiliza este cubo como complemento en tus rutinas de yoga, pilates y rehabilitación. Es ligero, suave y fácil de lavar.\n\nTOALLA DE YOGA\nLa toalla es muy absorbente y ultraligera. Es fácil de lavar y de secado rápido.\n\nESPESOR DE ALFOMBRA: 6 MM\nPELOTA DE 65 CM DE DIÁMETRO\nTOALLA ABSORBENTE\nTAMAÑO DE LA TOALLA: 183 x 63 cm\n', 10, 75, 'HEAD-HA791-1', '2021-06-30', 78, 79, NULL),
(1507, 'a', 'HEAD-HA794', 'SET DE ENTRENAMIENTO', 'TRAINING SET | SET DE ENTRENAMIENTO\n\nCon el set de entrenamiento podrás entrenar de forma sencilla y práctica. Su material antideslizante las hace súper cómodas. También puede ajustar los pesos de los tobillos y las muñecas. Úsalos tanto en el gimnasio como en casa.\n\nIncluye 6 piezas: cuerda de saltar, par de mancuernas, par de pesas para tobillos y banda elástica.\n\nLONGITUD DE LA CUERDA DE SALTO: 3 metros\nPESAS DE TOBILLOS: 0,5 kg cada una\nMANCUERNAS CON MANGOS ANTIDESLIZANTES\nGROSOR DE BANDA: 0,5 MM\nTAMAÑO DE LA BANDA: 120 x 15 cm', 12, 33, 'HEAD-HA794-1', '2021-06-30', 78, 79, NULL),
(1508, 'a', 'HEAD-HA937A', 'LIGA PARA SALTAR', 'Esta cuerda para saltar es liviana, ideal para calentar y como parte de un entrenamiento de acondicionamiento y resistencia. Tamaño 270 x 0,5 CM. También puede quemar calorías y perder peso. Es el complemento perfecto para tu rutina.\n\nLargo: 3 metros\nMangos ergonómicos antideslizantes\n\nMejora la resistencia aeróbica\nMovimiento rápido y suave', 12, 7, 'HEAD-HA937A-1', '2021-06-08', 78, 79, NULL),
(1509, 'a', 'HEAD-HA937D', 'SOGA PARA SALTAR', 'Cuerda para saltar Head Fitness\n\nEsta cuerda para saltar es liviana, ideal para calentar y como parte de un entrenamiento de acondicionamiento y resistencia. También puede quemar calorías y perder peso. Es el complemento perfecto para tu rutina.\n\nLargo de la cuerda: 3 metros\nMangos ergonómicos antideslizantes\n\nMejora la resistencia aeróbica\nMovimiento rápido y suave\n', 11, 8, 'HEAD-HA937D-1', '2021-06-30', 78, 79, NULL),
(1510, 'a', 'HEAD-HA965', 'LIGA ELASTICA DE RESISTENCIA', 'Banda Elastica Head Fitness recubierta con manijas reforzadas\n\nLargo: 1.20 metros\nMango de agarre suave\nEl material es de Caucho Termoplástico 100% natural e hipoalergénico de alta calidad y fácil de llevar.\nIdeal para ejercicios en piernas, brazos, tobillos, espalda y glúteos.\nPuedes hacer estiramientos, calentamientos, fisioterapia, yoga, pilates y crossfit.\nSon livianas, duraderas y compactas.', 12, 11, 'HEAD-HA965-1', '2021-06-11', 78, 79, NULL),
(1511, 'a', 'HEAD-HALS003-6', 'SOGA ELASTICA', 'ELASTIC ROPE FITNESS RESISTANCE TUBE | CUERDA ELÁSTICA DE RESISTENCIA CON ASAS\n\nEntrena casi todas las áreas del cuerpo, principalmente el tren superior, con esta cuerda elástica de resistencia.\n\nEs increíble la cantidad de ejercicios que puedes hacer con ella, y lo mejor de todo es que puedes llevarla a donde quieras.\n\nLargo: 1.20 metros\nAncho: 1 metro\nEspesor: 5 mm\nPeso: 0.2 kg\nMaterial: silicón', 12, 8, 'HEAD-HALS003-6-1', '2021-06-30', 78, 79, NULL),
(1512, 'a', 'HEAD-HALS003-7', 'SOGA ELASTICA', 'Extra Heavy Resistance Band with Grips | Banda de resistencia extra pesada con agarres\n\nLas bandas de resistencia hacen que los entrenamientos sean más dinámicos sin aumentar el impacto en las articulaciones y son una excelente herramienta en casa o en movimiento. La alta resistencia es ideal para usuarios avanzados que buscan entrenamiento de fuerza. Estas bandas también se pueden utilizar para ejercicios de la parte inferior del cuerpo, como sentadillas y estocadas. La resistencia aumenta gradualmente a lo largo de un ejercicio: al comienzo del movimiento, hay una tensión mínima, pero a medida que continúa la resistencia aumenta.\n\nLargo: 1.60 metros\nNivel de resistencia: estándar\nMaterial: silicón', 12, 9, 'HEAD-HALS003-7-1', '2021-06-08', 78, 79, NULL),
(1513, 'a', 'HEAD-HAPUB018', 'TABLERO PARA FLEXIONES', 'Ultimate muscle training pad | Tablero para Flexiones\n\nEste sistema de entrenamiento con tablero de flexiones fortalece y esculpe toda la parte superior del cuerpo. Puedes construir tu pecho, brazos, espalda y hombros. También puedes perder peso y quemar calorías.\n\nSu superficie antideslizante te permite entrenar de forma más segura. \n\nTiene diferentes objetivos de tablero codificados por colores de acuerdo al área o grupo muscular que desees trabajar.', 8, 72, 'HEAD-HAPUB018-1', '2021-07-01', 78, 79, NULL),
(1514, 'a', 'MG3710-15', 'MULTIGROOM SERIES 3000 6N1', 'Multigroom series 3000 | Recortador 6 en 1\n\nObtén siempre un recorte perfecto. Las cuchillas de acero se frotan suavemente entre sí, lo que permite que se afilen a medida que cortan. De esta manera, tendrás unas cuchillas que se mantendrán afiladas igual que el primer día tras tres años de uso.\n\nRecorta y perfila tu vello facial con 6 accesorios\nEste recortador todo en uno corta y perfila fácilmente tu vello facial.\n\nRecorta los bordes de tu barba y cuello para perfeccionar tu aspecto\nUtiliza el recortador sin peine para conseguir líneas limpias y definidas en los bordes de tu barba y cuello. Las cuchillas autoafilables del recortador se mantendrán afiladas igual que el primer día incluso después de tres años de uso.\n\n6 accesorios\nCuchillas autoafilables de acero\nHasta 60 minutos de autonomía\nAccesorios lavables', 20, 43, 'MG3710-15-1', '2021-06-30', 65, 76, NULL),
(1515, 'a', 'MG3730-15', 'MULTIGROOM SERIES 3000 8N2', 'Multigroom series 3000 | 8 en 1, rostro y cabello\n\nRecortador todo en uno.\n8 accesorios.\nCuchillas autoafilables de acero.\nHasta 60 minutos de autonomía.\nAccesorios lavables.\n\nCuchillas autoafilables que no irritan la piel para un recorte perfecto. Obtén siempre un recorte perfecto. Las cuchillas de acero se frotan suavemente entre sí, lo que permite que se afilen a medida que cortan. De esta manera, tendrás unas cuchillas que se mantendrán afiladas igual que el primer día tras tres años de uso.\n\nRecorta y perfila tu cabello y vello facial con 8 accesorios.\n\nRecorta los bordes de tu barba y cabello para perfeccionar tu aspecto. Utiliza el recortador sin peine para conseguir líneas limpias y definidas en los bordes de tu barba, cuello y nacimiento del cabello. Las cuchillas autoafilables del recortador se mantendrán afiladas igual que el primer día incluso después de tres años de uso.', 20, 53, 'MG3730-15-1', '2021-06-30', 65, 76, NULL),
(1516, 'a', 'NT3160-10', 'RECORTADOR PARA NARIZ ,OREJAS Y CEJAS', 'Nose trimmer series 3000 | Cómodo recortador para nariz y orejas\n\nSu sistema de protección avanzada evita tirones, cortes y rasguños. Gracias a la revolucionaria tecnología ProtecTube, una lámina ultra fina con puntas redondeadas protege la cuchilla para evitar la irritación de la piel. Además, se diseñó la cuchilla para evitar que el cabello quede atrapado entre los elementos de corte que se mueven por separado, lo que garantiza que no ocasione tirones.\n\nTanto la cuchilla y el protector tienen ranuras precisas y afiladas para asegurar que se corten todos los vellos de manera rápida y eficaz.\n\nSin tirones, garantizado.\nRecorte rápido y seguro para vello de nariz, orejas y cejas.\nSistema de protección, ángulo ideal.\nCompletamente lavable, batería AA\nIncluye 2 peines para cejas y funda.', 16, 26, 'NT3160-10-1', '2021-06-30', 65, 76, NULL),
(1517, 'a', 'QP210-50', 'CABEZAL DE REPUESTO ONEBLADE', 'OneBlade | Cuchilla reemplazable\n\nPhilips OneBlade es un nuevo modelador híbrido revolucionario que permite recortar y afeitar, además de crear líneas y bordes precisos, sin importar la longitud del vello. Olvídate de tener que usar múltiples herramientas y de seguir varios pasos. OneBlade lo hace todo.\n\nTiene una tecnología revolucionaria diseñada para modelar y perfilar el vello facial y corporal. Podrás recortar, perfilar y afeitar vello de cualquier longitud. Su sistema de protección doble, un revestimiento deslizante con puntas redondeadas, facilita el afeitado y hace que sea más cómodo. Su tecnología de afeitado tiene un cortador de movimiento rápido (200 veces por segundo), por lo que es eficiente incluso en vellos más largos.\n\nLas cuchillas están diseñadas para ofrecer un rendimiento duradero y obtener un rendimiento óptimo, solo debes reemplazar las cuchillas cada 4 meses. El proceso de reemplazo es rápido y sencillo.\n\nDiseñada para cortar el vello, no piel\nRecorta, modela y afeita\n1 cuchilla de repuesto\nSe ajusta a todos los mangos OneBlade', 12, 24, 'QP210-50-1', '2021-06-08', 65, 76, NULL),
(1518, 'a', 'QP2521-10', 'PHILIPS ONEBLADE', 'OneBlade\n\nRecorta, modela y afeita cualquier longitud del vello\n\nPhilips OneBlade es un nuevo modelador híbrido revolucionario que permite recortar y afeitar, además de crear líneas y bordes precisos, sin importar la longitud del vello. Olvídate de tener que usar múltiples herramientas y de seguir varios pasos. OneBlade lo hace todo.\n\nPhilips OneBlade tiene una tecnología revolucionaria diseñada para modelar y perfilar el vello facial y corporal. Podrás recortar, perfilar y afeitar vello de cualquier longitud. Su sistema de protección doble, un revestimiento deslizante con puntas redondeadas, facilita el afeitado y hace que sea más cómodo. Su tecnología de afeitado tiene un cortador de movimiento rápido (200 veces por segundo), por lo que es eficiente incluso en vellos más largos.\n\nRecorta tu barba con una alta precisión usando uno de los 2 peines recortadores para barba incluidos. 1 mm para una barba incipiente y 2 mm para una barba media.\n\nModela y crea líneas precisas con la cuchilla de doble filo. Puedes afeitar en cualquier dirección y así ver bien cada vello que cortes. Define tu estilo en segundos.\n\nDiseñada para cortar el vello, no piel.\nRecorta, modela y afeita.\nPara cualquier longitud de vello.\n2 peines recortadores extraíbles.\nRecargable, uso en seco y en húmedo.', 20, 44, 'QP2521-10-1', '2021-06-30', 65, 76, NULL),
(1519, 'a', 'HC5850', 'CORTADORA DE CABELLO 8 PEINES', 'La Máquina de cortar pelo Virtualmente Indestructible de Remington está diseñada para durar toda la vida. Incorpora materiales reforzados en el interior y el exterior para aumentar su durabilidad. Máxima resistencia.\n\nPresenta una carcasa de policarbonato de alto impacto para proteger su poderoso interior: un motor súper magnético que impulsa a máxima potencia las cuchillas de precisión para un rendimiento de corte 4 veces más rápido.\n\nEl exclusivo sistema de cuchillas POWERCUT™ las mantiene correctamente alineadas para un corte uniforme en todo momento. Además, con el kit de 15 piezas podrás darle los toques finales a tu corte de cabello con peines guía de longitud, aceite y protectores para cuchillas, y una bolsa de almacenamiento para mantener todo junto.\n\nUso con Cable\nIncluye 15 piezas: 8 Peines de guía, Cuchillas removibles Precision Ground, Cepillo para el cuello, Aceite lubricante, Tijeras y Capa\nEstuche duro de almacenamiento\nProtector de Hojilla\n2 veces más potente para cortes rápidos y limpios\n', 10, 44, 'HC5850-1', '2021-06-16', 65, 66, 67),
(1520, 'nv', 'RZE-BT160HK-II', 'AURICULARES BLUETOOTH INALAMBRICOS NEGRO II', '', 10, 28, NULL, '2021-06-16', NULL, NULL, NULL),
(1521, 'nv', 'RZE-D160HL-II', 'AURICULARES CON CABLE AZUL II', '', 10, 19, NULL, '2021-06-16', NULL, NULL, NULL),
(1522, 'a', 'S2412', 'ALISADOR COMPACTO', 'Una innovación a escala mundial que alisa el cabello a la perfección. La plancha para cabello Air Plates de Remington incorpora un exclusivo sistema de placas en suspensión que se ajusta automáticamente al cabello para propiciar el máximo contacto en cada pasada.\n\nEstiliza cada mechón de tu cabello con nuestra última innovación. La plancha para cabello Air Plates, es la primera alisadora con placas suspendidas a nivel mundial. Nuestra tecnología única de suspensión de placas permite que las placas se ajusten con cada estilizado, proporcionando máximo contacto en cada alisado dando así resultados más eficientes.\n\nLas lujosas placas infundidas en titanio negro tienen 10 veces más cerámica para darle un deslizamiento 2 veces más suave que las alisadoras estandars.\n\nMedida de las placas: 2,54cm / 1\"\nTemperatura máxima: 200°C (390°F)\nCalentamiento en 30 segundos\nBotón de Encendido y Apagado\nPlacas Recubiertas de Cerámica con Titanio\nLuz Indicadora de encendido\nBloqueo de placas\nApagado Automático\nTecnología única de suspensión de placas\nCable Giratorio', 10, 34, 'S2412-1', '2021-06-16', 65, 66, 68),
(1523, 'a', 'S7310', 'PLANCHA PARA CABELLO', 'Placas de cerámica - el diseño de remington permite que esta herramienta de rendimiento se caliente en sólo 30 segundos.\n\nRejillas de ventilación de vapor - las aberturas de vapor distintivo le permiten comenzar a diseñar directamente de la ducha sin secar su cabello primero.\n\nCalor de salón de calidad - La Remington Wet 2 Straight de 1 pulgada proporciona hasta 420 grados de calor de grado profesional.\n\nCon ella puede olvidarse del secador de pelo y ponerse en marcha en cualquier momento.\n\nLe permite enderezar si su cabello está húmedo o seco con calor de grado profesional de 420 grados a través de placas de cerámica, con 30 ajustes, así como aberturas de vapor distintivas que secan y peinan con menos daño.', 10, 29, 'S7310-1', '2021-06-16', 65, 66, 68),
(1524, 'a', 'S9960-CI5326', 'COMBO DE PLANCHA Y RIZADORA AGUACATE CON MACADAMIA', 'Consiente tu cabello con este increíble combo de Plancha Alisadora más Rizador Remington, la combinación perfecta para lucir un cabello suave y brillante gracias a su recubrimiento de cerámica avanzada y micro acondicionadores de aguacate y macadamia. \n\nLa plancha alisadora cuenta con placas flotantes de 110mm para un contacto permanente con el cabello, lista para usarse en 30 segundos, cable giratorio de 2 metros, temperatura máxima de 230°C (450 °F), control de temperatura digital, bloqueo de placas para mejor almacenamiento y apagado automático. \n\nMientras que el rizador tiene un barril de cerámica de 1 pulgada (25mm) de grosor y alcanza una temperatura de 210 °C (410 °F).\n\nPlancha con pantalla digital\nPlacas extralargas de 110mm\nPlancha con calor instantaneo en 30 segundos\nRizador con alta temperatura de 210°C\nRizador con 30 configuraciones de temperatura', 10, 80, 'S9960-CI5326-1', '2021-06-16', 65, 66, 68),
(1525, 'a', 'TO1950SBD', 'HORNO DE CONVECCION DE 9\"', 'El horno de seis rebanadas de pan BLACK+DECKER tiene tecnología de convección que circula aire caliente para cocinar pizzas y congelados favoritos  por mínimo tiempo. El interior está diseñado para el enfoque hacia la comida rápida e incluso cocinar. Las funciones de cocción son hornear, asar, tostar y mantener caliente. Tiene una capacidad para una pizza de 9 o seis rebanadas de pan.\n\nCapacidad de 14 litros\n1350 watts\nSelector de Temperatura\nSelector Multi-Función\nCronometro a 30 minutos\nPuerta de Vidrio con asa fría al tacto\nLuz Indicadora de funcionamiento\nIncluye: bandeja para hornear, bandeja para asar y bandeja para migas', 4, 67, 'TO1950SBD-1', '2021-06-30', 1, 4, 15),
(1526, 'a', 'WM120B', 'WAFLERA PLACAS ANTIADHERENTES', 'El desayuno es mejor con la wafflera de BLACK+DECKER WM120B. Las placas son antiadherentes, lo cual significa que están listas para liberar las secciones del waffle y luego poder limpiarse fácilmente. Una luz indicadora se ilumina cuando la waflera se ha calentado adecuadamente y está lista para recibir la mezcla, luego se vuelve a iluminar cuando el waffle se termina de cocinar.\n\n760 Watts\nPlacas antiadherentes\nLuz indicadora\nCierre de la asa\nAsa fria al tacto\nBase de almacenamiento vertical\nGuardacable', 6, 24, 'WM120B-1', '2021-06-30', 1, 4, 21),
(1527, 'nv', 'RZE-BT160HR-II', 'AURICULARES BLUETOOTH INALAMBRICOS ROJO II', '', 10, 28, NULL, '2021-06-28', NULL, NULL, NULL),
(1528, 'a', 'TS-321W', 'ESTUFA ELECTRICA 1000W BLANCA', 'Utilice la potente hornilla eléctrica individual Brentwood TS-321BK de 1000 vatios para todas sus necesidades de cocina. Ajuste el calor de bajo a alto. La bobina eléctrica proporciona un calentamiento uniforme. La práctica luz indicadora se ilumina cuando se enciende. El diseño portátil y liviano ocupa poco espacio en el mostrador y se almacena fácilmente. Superficie y bandeja de goteo fáciles de limpiar. Los pies antideslizantes mantienen la unidad segura en su lugar.\n\nDistribución uniforme del calor.\nCalor ajustable.\nDiseño pequeño y liviano.\nFácil de limpiar.\nLuz indicadora de energía.\nPies antideslizantes extra anchos.\nColor: Blanco.\nPotencia: 1000w.', 10, 14, 'TS-321W-1', '2021-06-30', 1, 7, 47),
(1529, 'a', 'TS-380S', 'OLLA ARROCERA 20 TZAS BLANCA', 'La potente olla arrocera y vaporizador de alimentos Brentwood TS-380S de 10 tazas cocina al vapor carnes y verduras mientras se cocina el arroz. Caliente chile, sopas y más. Cuenta con operación de un toque con calentamiento automático. Presenta una olla antiadherente extraíble y asas de tacto frío. Incluye taza medidora y paleta para servir, solo agrega tus ingredientes.\n\n• 20 tazas de arroz cocido\n• Cocina al vapor carnes y verduras\n• Además, calienta y disfruta el chile, las sopas y más\n• Operación de un toque\n• Calienta automáticamente\n• Tapa de vidrio templado de vista superior\n• Olla de cocción extraíble\n• Superficie antiadherente fácil de limpiar\n• Asas de tacto frío\n• Incluye bandeja de vapor, paleta y taza medidora\n• Luz indicadora de encendido / calentamiento\n• Potencia: 700 watts', 9, 36, 'TS-380S-1', '2021-06-29', 1, 7, 42),
(1530, 'a', 'TS-480S', 'OLLA ARROCERA 30 TZAS BLANCA', 'La potente olla arrocera y vaporera de alimentos Brentwood TS-480S de 15 tazas cocina al vapor carnes y verduras mientras se cocina el arroz. Caliente chile, sopas y más. Cuenta con operación de un toque con calentamiento automático. Presenta una olla antiadherente extraíble y asas de tacto frío. Incluye taza medidora y paleta para servir, solo agrega tus ingredientes.\n\n• 30 tazas cocidas\n• Cocina al vapor carnes y verduras\n• Además, caliente y disfrute el chile, las sopas y más\n• Operación de un toque\n• Calienta automáticamente\n• Tapa de vidrio templado de vista superior\n• Olla de cocción extraíble\n• Superficie antiadherente fácil de limpiar\n• Asas de tacto frío\n• Incluye bandeja de vapor, paleta y taza medidora\n• Luz indicadora de encendido / calentamiento\n• Potencia: 900 watts', 10, 43, 'TS-480S-1', '2021-06-29', 1, 7, 42),
(1531, 'a', 'TS-700S', 'OLLA ARROCERA 8 TAZAS  BLANCA', 'La potente olla arrocera y vaporizador de alimentos Brentwood TS-700S de 4 tazas cocina al vapor carnes y verduras mientras se cocina el arroz. Caliente chile, sopas y más. Cuenta con operación de un toque con calentamiento automático. Presenta una olla antiadherente extraíble y asas de tacto frío. Incluye taza medidora y paleta para servir, solo agrega tus ingredientes.\n\n• 8 tazas de arroz cocido\n• Cocina al vapor carnes y verduras\n• Además, calienta y disfruta el chile, las sopas y más\n• Operación de un toque\n• Calienta automáticamente\n• Tapa de vidrio templado de vista superior\n• Olla de cocción extraíble\n• Superficie antiadherente fácil de limpiar\n• Asas de tacto frío\n• Incluye bandeja de vapor, paleta y taza medidora\n• Luz indicadora de encendido / calentamiento\n• Potencia: 350 watts', 4, 28, 'TS-700S-1', '2021-06-29', 1, 7, 42);
